INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (1, '<P>[1]<BR><FONT STYLE=''color:006600''>Es waren freundlich Gesellen, die selten mehr als einmal, wenn ?berhaupt, die Stadt betraten. Sie, die Bauern der Umgebung von Suchdireinengutennamenf?rdiestadtaus, hatten ein Sprichwort: Landluft macht frei - Atmen.</FONT> </P>');
