INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (3, '<P>[3]<BR>der Platz der guten Laune</P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (4, '<P>[0]<BR>Suchdireinengutennamenf?rdiestadtaus wurde irgenwann einmal auf der ganzen Welt zum offiziellen Namen dieser Stadt erkl?rt. Trotzdem beharren die Einwohner darauf, da? der Name in Wirklichkeit eine Aufforderung sei, sich f?r die Stadt einen guten Namen auszudenken.</P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (5, '<P>[4]<BR>Man muss schon ein Schaf sein, um in einer pferdelosen Welt etwas anderes zu erwarten. Es war ein Sechssp?nner, gezogen von sechs schwarzen Schafen, so wie alle Postkutschen. </P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (6, '<P>[1]<BR> Wer sich immer noch ?ber diese Art der Geographie wundert, m?ge sich mal ?ber die Geographie des &#187;Zweiten Zeitalters&#171; informieren. Zu empfehlen hierf?r ist das Standartwerk &#187;<B>JETZT LESEN</B> sowie andere Rand- oder Zwischenbemerkungen, BAND 1-2769d<!--2073a-->&#171; von Magnus Alberts.</P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (7, '<P>[2]<BR> Der Begriff &#187;die Alten&#171; wurde meistens als Ehrbezeugung vor der Weisheit durch das Alter verwendet, egal wie alt die betreffende Person war oder wann sie diese Weisheit erlangte. Selten genug wurden damit die Eltern gemeint ... was ein g?nzlich anderes Thema war und ist.  </P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (8, '<P>[3]<BR> Drachen in der fr?hen Zeit, jene aus grauer Vorzeit, so um Hammeln herum und davor, waren h?flich. Sie sprachen ein oh, bevor sie redeten, damit sie nicht fauchten. Anderfalls h?tte man jenes laue L?ftchen nicht mehr versp?rt, welches einem das Fleisch vom Knochen sch?lte.</P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (9, '<P>[4]<BR> Nicht da? man zu dieser Zeit schon wusste, was Banditen waren. Es waren noch beschauliche Zeiten.  </P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (10, '<P>[5]<BR> L?nder, Inseln, die von Ratten schon lange bewohnt wurden, ?hneln am Rand einem Igel, oder einer Hafenmole f?r ?berdimensionierte Schiffe. Und das lange schon bevor die Schiffahrt ?berhaupt erfunden wurde. Einige Doedels behaupteten, es w?ren altert?mliche Abwehrma?nahmen gegen Drachenflieger, und das obwohl sie sp?ter selber Br?cken bauten. </P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (11, '<P>[6]<BR> Es war das Schweigen der L?mmer.  </P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (12, '<P>[1]<BR> Wie man sich irren kann.</P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (13, '<P>[2]<BR> In sp?teren Zeiten wurde die Insel tats?chlich als weltweit gr??tes Freilicht-Theater benutzt. Man nannte es &#187;The Black Arena&#171; und es war sehr ber?hmt, insbesondere f?r die Auftritte der <A NAME=''4''>Village Vanguard Boys</A><A HREF=''/index.php?str=1&show=5&fn=4''&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594 TARGET=''_parent'' onMouseOver="popup(''footnote.php?show=5&fn=4'',300,350)"><SPAN CLASS=af>[4]</SPAN></A>.</P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (18, '[1]<BR>\r\nAuf sie bezieht sich das Sprichwort:<BR>\r\nSie hat es gegeben? Sie hat es genommen!');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (14, '<P>[3]<BR> Wahre Helden sind jene tapferen und wackeren, gr?llenden Vollidioten, die mit explosiven Sachen so umgehen, als wenn es harmlosen Kinderspielzeug w?re; und dabei ihre n?here Umgebung in Angst und Schrecken vor der sich ausbreitenden Verw?stung versetzen.</P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (15, '<P>[4]<BR> Es handelt sich hierbei um die ber?hmteste Teeny-Pop-Gruppe des &#187;Zweiten Zeitalters&#171;. Ihre Konzerte in der &#187;Black Arena&#171; waren f?r ihre hoch explosive Stimmung legend?r. Stets wurden sie von ein, zwei oder mehr Haufen kreischender Teenager begleitet, was auch nicht weiter verwunderlich ist, wenn man verzweifelt nach dem n?chsten Notausgang sucht. Ihre Konzerte wurden mit den Worten &#187;&lt;DATUM&gt;...DANGER handle with care!&#171; angek?digt.</P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (16, '<P>[5]<BR> In sp?teren Zeiten berief sich eine erfolglose Revoluzergruppe, die Kapitalisten, auf dieses Buch.</P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (17, '<P>[6]<BR> Zum Beispiel autofocusierende Kerzenleuchter, Kerzenleuchter waren schon in Verwendung, einem Souffleurkasten, was erstaunlich ist, mit Souffleuse, was ungemein fortschrittlich ist, und einem B?hnenvorhang. Das Fortschrittlichste ?berhaupt. </P>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (19, '[1]<BR>\r\nUnd wahrlich konnte man sich als Sieger f?hlen, wenn man die Halle wieder lebendig verlies. ');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (20, 'Weder bei Doedeln noch bei Ratten kann man an ihrem blo?en ?u?eren erkennen, ob sie m?nnlich oder weiblich sind. Sie sind der Meinung, da? es sich um eine sehr private Angelegenheit handelt. So treten Kinder aus der Stille der H?user in das Licht der Welt.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (21, '[0] &#187;Ein Pferd zureiten&#171; enspricht in etwa dem Sprichwort &#187;Jemanden einen B?ren aufbinden&#171;, was trotz der aller Gr??e eines B?ren wahrscheinlicher ist. Immerhin gibt es B?ren.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (22, '[1] In sp?teren Zeiten wird man solche B?cher Zauberb?cher nennen, weil sie auf unerkl?rliche Fragen und unerkl?rliche Antworten enthalten. Sie haben die Eigenart manchmal auf unerkl?rliche Art und Weise zu erscheinen, gelesen zu werden und zu verschwinden. Die Ratschl?ge, die solche B?cher geben, stimmen immer. ');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (23, '[1] <BR>Es geh?rt zu den wenigen guten Eigenschaften reicher Eltern, da? sie gelegentlich ihren verw?hnten Z?glingen gegen?ber geizig sind -  nat?rlich nur im Rahmen ihrer sonst gar ?ppigen M?glichkeiten.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (24, '[2]<BR>\r\nSchon Damals waren Polizisten und andere Rechtschaffende unterbezahlt.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (25, '[3]<BR> Allm?hlich entwickelte sich Gunfried zu einem Sokritiker, einem ?beraus scharfsinnigen und umsichtigen Doedel.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (26, '[4]<BR> Das DailyLama sagt:<BR>Nicht alles ist, wie es scheint und nicht alles, was scheint, ist die Sonne.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (27, '[1]: <BR> So bescheiden k?nnen die W?nsche von Eltern sein ...');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (28, '[2]: <BR>Ger?che und Ger?chte haben einiges gemein. Zum Beispiel f?hren sie ein Eigenleben.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (29, '[3]: <BR> Es heist nicht umsonst, einem eile der Ruf voraus.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (30, '[1] : <br> <i>So ist es!</i>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (31, '[2] : <br> <i>So ist es immer noch!</i>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (32, '[3] : <br> <i>So ein bis zwei Tonnen voll sollten reichen.</i>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (33, '[4] : <br> <i>Soso, dann zeig mal her!</i>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (34, '[5] : <br> <i>Nachts ist es immer so dunkel.</i>');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (35, '[1] :\r\n Erster Boxer: <i>Man serviert ihm das Schwein auf dem Silbertablett.</i> <br />\r\n Zweiter Boxer: <i>Ja, und es hat einen Apfel im Maul.</i> <br /><br />\r\n          <A HREF="http://www.doedels.de/index.php?str=1&show=57&media=21" target="_blank"><SPAN CLASS="av">[media]</SPAN></A>\r\n          Zitat aus: <br />\r\n   King Rocky Teil 1 von Willicombaldus Schuettelbier<a href="http://www.dailylama.de/index.php?str=1&show=lexikon&key=Sch%FCttelbier" target="_blank"><span class="af">[mehr]</span></a><br />\r\n       Willicombaldus Schuettelbier hatte den Fu? der Welt besucht. An einem kleinem Ort in mitten der Insel und unz?hliger sehr alter Ruinen namens Plijskiepsailenz sammelte er unz?hlige Sprichw?rter ?ber Schweine. Das mag nicht weiter verwundern, denn hier residierte der ?rtliche Schweinez?chterverband.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (36, '[2] : Er schreit wie ein Schwein am Spie?e');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (37, '[3] : Gleichbedeutend mit dem Ausruf jede Gl?cksstr?hne muss mal ein Ende haben.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (38, '[4] : Dieser Wilder ist ein Keiler!');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (39, '[1] : <br /> Martinsh?rner, rot oder wei? je nach Olivensorte, aber mindestens zwei.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (40, '[2] : <br /> Wenn du etwas anderes behauptest, dann guten Flug und angenehme Nachtruhe. ');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (41, '[4] : <br />\r\nUrsache hief?r : <br />\r\nEin unangenehmer Flug und eine noch h?rtere Nachtruhe.\r\n');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (42, '[0] :<br /> Ungern erw?hne ich hier, was er unter einem Opferstock verstand. Wenn das Opfer erwachte, fehlten ihm ein Zehnt seines Geldes. Der zornige Nick war ein gelehrsames Kind seiner Kirche.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (43, '[1] :<br /> Kehrknecht Ruppert war ein lausiger Prediger und ein schlechter S?nger. Deswegen musste er vor jedem Gottesdienst die Kirche ausfegen und hernach sie auffeudeln.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (44, '[2] : <br />\r\nDas Viertel lag wirklich abseits. Es lag im Schatten der Burg, fern der Handelsstra?en, nahe der Abfallh?gel und der Ausfl?sse der Latrinen. Den Hafen und das anderseitige Zollhaus erreichte man auch nicht ohne weiteres. Es war durchzogen mit engen verwinkelten Gassen die nirgendwohin zu f?hren schienen. Heuer hie? es noch das alte Handelsviertel, sp?ter einmal w?rde dieses Viertel tats?chlich das Abseits hei?en.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (45, '[3] : <br />\r\nSeinen Namen, Kneehigh Jones, trug er zurecht. Man bedenke jedoch, da? die Sitten in jener Zeit rau waren. Giftmorde beging er nicht, noch hatte er je jemanden auf andere Art get?tet. Man konnte ihn also mit Fug und Recht einen Sanftm?tigen nennen.');
INSERT INTO `doc_footnote` (`id_footnote`, `footnote`) VALUES (46, '[4] : <br />\r\nVolltrunkenheit ist in der Kirche von Rum der Zustand der erleuchteten Heiligen und M?rtyrer.');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (1, ' Continued : - &#187;...to be continued&#171; - wird fortgesetzt. ', 'Continued');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (2, ' Hammelsprung : Keinswegs mit dem &#187;deHundschen Wahlverfahren&#171; <!--de Hondtsches ...-->zu verwechseln. Die Schafe glauben nicht an die Demokratie, sondern immer noch an das Führerprinzip. &#187;Null Bock&#171; ist bei ihnen ein wirklich trauriger Zustand, bedeutet es doch, dass die Herde ohne Hammel, geschweige denn Leithammel ist. ', 'Hammelsprung');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (3, 'Schüttelbier, Willicombaldus : Autor von zahlreichen, meist epischen Theaterwerken. Am bekanntesten ist &#187;Der Ring Der Weisen&#171;, einem Zyklus von 4 Theaterstücken:&#187;Langsam Dämmert Es Der Dämmerung&#171;, &#187;Ein Feld, Ein Herr, Ein Hügel&#171;, &#187;Führer Komm, Wir Verfolgen Dir&#171;, &#187;Einsicht, Gicht, Aussicht&#171;. Diese Epen beschreiben auf eindringliche Weise mit dichterischer Freiheit die Zeit kurz nach Himmelfahrt bis zur Schlacht um Hammeln. <BR><DIV ALIGN=right><A HREF=''index.php?str=1&show=5''&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594>mehr&#187;</A><BR><A HREF=''index.php?str=1&show=15''&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594>K?NIGSTUNIER&#187;</A><BR><A HREF=''index.php?str=1&show=13''&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594>HIMMELFAHRT&#187;</A><BR>\r\n<A HREF=''index.php?str=1&show=51''&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594>IN 80 TAGEN ...(Auszug)&#187;</A></DIV>', 'Schüttelbier');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (4, ' Drachen : auch Ohs, waren im &#187;Zeiten Zeitalter&#171; häufige Reisegefährten. Galten Sie zunächst als zuvorkommend und höfflich, hielt man sie später für gefährlich. Tatsächlich waren sie hochexplosiv. Es gab unterschiedliche Drachenarten, allerdings sollte man sie nicht mit Lindwürmern oder Schlangen verwechseln.\r\n<DIV ALIGN=right><A HREF=''index.php?str=1&show=32''&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594>mehr&#187;</A></DIV><BR>', 'Drachen');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (5, ' Lama, das : Das bekannteste Orakel des &#187;Zeiten Zeitalters&#171;. Befragte man es, so erhielt man einen weisen Spruch als Antwort. Diese Antwort wurde dringend benötigt. Man musste nur noch herausfinden von wem. ', 'Lama');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (6, 'DailyLama : Haus und Hofpostille des &#187;Dritten Zeitalters&#171;. Bennant nach einem legendären Orakel. ', 'DailyLama');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (7, 'Geographie, die : Vom &#187;Ersten Zeitalter&#171; sind keine Karten erhalten. Es soll 6 Kontinente gegeben haben. Diese Zahl ist aber nicht gesichert. Auch weis keiner, was Kontinente sind. Hier eine Karte des &#187;Zweiten Zeitalters&#171;<A HREF=''/index.php?str=1&media=2&show=lexikon''&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594 onMouseOver="popup(''/story/media.php?show=<?php echo $show; ?>&media=2'',600,450)"''><SPAN CLASS=av>[Karte]</SPAN></A>, vermutlich von W.Sch?ttelbier. Die Geographie des &#187;Dritten Zeitalters&#171; ist ebenso difus, wie dei Zeitrechnung konfus ist. Es gilt als gesichert, dass es eine Stadt mit dem Namen &#187;Suchdireinengutennamenf?rdiestadtaus&#171; gibt. Sie liegt in unmittelbaren Nähe des Redhill und des Fastberges. ', 'Geographie');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (8, 'Luftschiff : umgangssprachlich Schiff, auch als Gondeliere bekannt. Großes Transportfahrzeug am Ende des &#187;Zweiten Zeitalters&#171;. ', 'Luftschiff');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (9, 'Kerkerdimensionen: Nicht jedes Land oder jede Insel hatte eine Kerkerdimension. Sie befanden sich üblicher Weise immer unten und sind sehr alt und feucht. Ihren Namen hatten sie erhalten, weil sie gelegentlich als Kerker benutzt wurden und vielschichtig, gerade zu labyrinthisch multidimensional angelegt waren. Sie stammten nicht aus dem &#187;Zweiten Zeitalter&#171;. Manche Kerker wurden erst beim Bau von Kellern, Kanalisationen oder Katakomben entdeckt. In den Kerkerdimensionen wohnten Dämonen.', 'Kerkerdimensionen');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (10, 'Dämonen: Auch Bestien genannt. Das beste Buch über Dämonen ist die &#187;Daemonologiae Von Jacub & Sieglinde&#171;. Bekannte Dämonen sind Bären, Elfender, Einauge und Zwölfhänder, sowie Sieglinde.<BR>\r\n<DIV ALIGN=right><A HREF=''index.php?str=1&show=38''&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594>mehr &#187;</A></DIV>', 'Dämonen');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (11, 'Sieglinde: Sieglinde, einst einer der vielen namenlosen Dämonen, ernährte sich von Ratten und wurde zur Strafe gefanggesetzt. Erhielt ihren Namen durch ihren Sieg bei der Linde über Jakub.', 'Sieglinde');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (12, 'Mountainhigh, FastBerg : Der Fastberg ist das Ei eines Weltendrachens. Das Ei ist interdimensional. Deswegen ist es immer zugleich verfault, noch in Brut oder bereits der Drachen geschlüpft. Im Inneren der Schale ist der Sternenhimmel zu sehen, der Gleiche, den man auch bei Nacht sieht. Nur ist das Ei halt interdimensional, wodurch man einen guten Blick in Vergangenheit, Zukunft und Gegenwart und auf den eigenen Planeten hat. Die Forscher/Bibleothekare der Stadt haben im Inneren des Eis ein gigantisches Teleskop errichtet', 'Mountainhigh');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (13, 'Riverlow And Mountainhigh : Die Nationalhymne der Stadt , weil der Fastberg die einzige wiklich hohe Erhebung ist, so hoch, da? die Stadt im Hochsommer immer im leichten Bergschatten liegt. Angenehme Sommerk?hle bezeichnen die Einwohner deswegen als ''Es stinkt ertr?glich''. Der Fluss ist nur knietief.', 'Riverlow And Mountainhigh');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (14, 'das Jahr Nym : Nym, auch Nymus. Die Zeitrechnung des ganzen &#187;dritten Zeitalters&#171; bezieht sich auf dieses Jahr. Die meistens Dokumente in Suchdireinengutennamenfürdiestadtaus werden mit ihrem Entstehungsdatum unterschrieben. zB. 1522a.n.  Der Name des Autor taucht selten auf, fast nie. So lautet die Unterschrift unter einen Zettel mit der Zeile ''Ich liebe dich!'' nicht ''G.'' sondern ''im Jahre Nymus''. Das hat viele Vorteile ...<!--von anno(lat.)-> anonymus-->', 'Nymus');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (15, 'Jetzt Lesen : Bücher, Nachrichten, Vermerke die so unter/überschrieben sind sollten jetzt gelesen werden. SOFORT! häufig auch fett, in großen Lettern und mit roter Tinte geschrieben. siehe auch Hans Magnus Alberts', 'Jetzt Lesen');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (16, 'Hans Magnus Alberts : <!--Albert (Magnus)circa.1193-1280, M?nch und ?bersetzer Aristoteles, Begr?nder der modernen Wissenschaften, der Legende nach Zauberer,(Stephen William Hawking) -> William Hawk&Stephan King(Zwillinge),ROGER BACON,Thomas v.Aquin-->agekürzt HMA oder auch HA! Magnus der Bibleothekare von Suchdireinengutennamenfürdiestadtaus. Ehemaliger Magier, bevor es Bibleothekare gab. Zu seinem 100jährigen [Neu]Erscheinen wird in Suchdireinengutennamenfürdiestadtaus ein Fest gefeiert. Das Datum seiner Ersterscheinung ist nicht bekannt(siehe -> das Jahr Nym[us]). Es ist bekannt das er in drei Jahrhunderten nicht erschien. Er pflegt es, seine Nachrichten mit dem Vermerk ''<FONT STYLE=''font-weight:bold; color:CC0000''>JETZT LESEN</FONT>'' zu überschreiben. (siehe->jetzt lesen) Wichtigste Publikationen : <FONT STYLE=''font-weight:bold; color:CC0000''>JETZT LESEN</FONT> sowie andere Rand- und Zwischenbemerkungen BAND 1-2073a. Manchmal wird im Scherz vermutet es handele sich bei A. um Herrhiering, dem Wiedergeborenen(siehe->Herrhiering). Dies beruht auf der Tatsache das A. sein Ableben im Teleskop alle 100Jahre beobachtet und daraufhin ein so starkes Narkotikum einnimmt, dass er seinen eigenen Tod verschläft. Folgerichtig ist er bisher noch nie gestorben.', 'Hans Magnus Alberts');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (17, 'Herrhiering : <!--von Buddha, klinkt so ähnlich wie Butt da, Hering hier.--> Herrhiering ist der stets Wiedergeborene, und der Meister des Ringes der Weisen. ER fand IHN und verlegte ihn ebenso sorgfältig. Es ist allgemein nicht bekannt, wer Herrhiering ist.(siehe auch->ER, Hans Magnus Alberts', 'Herrhiering');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (18, 'Weltendrachen : das Universum', 'Weltendrachen');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (19, 'Magnus(,der) : Höchster der Bibleothekare', 'Magnus');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (20, 'Zauberer : Schriftkundige, neuzeitlich auch als Bibleothekare bekannt. Zur Heilkunst und anderen noch nicht bekannten Fortschritten fähige Zeitgenossen. Sind zu mehr oder weniger präzisen Zukunftsweisagungen befähigt, ins besondere was das Wetter angeht. Sind auch fähig, andere wahrheitsgemäß zu verleugnen.', 'Zauberer');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (21, 'Redhill : Der Hügel aus rotem Sand, bewachsen mit roten Ahornbäumen, auf dem eine Teleskopwerkstatt errichtet wurde. Redhill stellt heute noch Betriebsanleitungen für Nachrichtenteleskope her. Die jeweils neueste Version ist nicht nur stabiler (und schwerer) als die vorherige, sondern garantiert auch mit weniger schon bekannten Fehlern und Sicherheitslücken ausgestattet. Der Redhill liegt zwischen Suchdireinengutennamenfürdiestadtaus und dem Fastberg.', 'Redhill');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (22, 'Benmea Talp : <!--ben(schottisch:Berg; meat(eng.):Fleisch; alp(eng.): Berg)-->Wird auch als ''Fleischklöpschen'' bezeichnet oder auch von seinen Gegner als <STRIKE>''Schwuchtel''</STRIKE> beschimpft, weil er stets Röcke trug. Held am Anbeginn des Zweite Zeitalters. Wurde durch &#187;Die Schlacht Um Hammeln&#171; bekannt.', 'Benmea Talp');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (23, 'Hammeln : Hammeln ist ein Ort, wo man im Zweiten Zeitalter als erstes Schafe fand.', 'Hammeln');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (24, 'Schafe : Schafe sind sowohl von den Ratten als auch von den Doedels begehrte Tiere. Sie eignen sich f?r die K?seproduktion, zum Einbinden von B?chern, zur Herstellung von leichtem R?stzeug und Kleiderwaren, doch wirklich begehrt sind sie als Reittiere.', 'Schafe');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (25, 'Thema : Wenn ich Thema sage, meine ich Thema. Und wenn ich ein anderes Thema sage, meine ich ein anderes Thema, und zwar ein gänzlich anderes Thema. Ich meine, ich meine, was ich sage ... und zwar immer ... meistens ... gelegentlich ... ist das Thema jetzt erledigt?', 'Thema');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (26, 'Hafen : Hafen,der <A HREF=''/index.php?str=1&show=lexikon&media=11''&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594 TARGET=''_parent'' onMouseOver="popup(''/story/media.php?show=lexikon&media=11'',655,525)"><SPAN CLASS=av>[media]</SPAN></A>. Eine Anlage zum Be- und Entladen von Schiffen.', 'Hafen');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (27, 'Schiff : Wie gedenken Sie den in einer Welt ohne Ozeane zu reisen? Schwimmen? Fliegen? ... ja, genau sie habens erfasst.', 'Schiff');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (28, 'Die Rechtsform einer Gesellschaft oder Firma bestimmt auf welcher Weise man sein Geld zu verdienen gedenkt. Am Gel?ufigsten sind dabei die GDNA -> GEHT DICH NICHTS AN!, und die ngB -> nur gegen Barzahlung. Bekannt ist auch die Stobe, in ungesitterten Gegenden auch Stube, -> Stirb oder bezahle. Die aGuV ist hingegen seltener -> auf Gedeih und Verderb. ', 'Rechtsform');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (29, 'Warnung, oder auch Warnhinweise. Sie wurden häufig in einer altertümlichen Sprache verfasst, dem Angelsächsischen. Eine typische Warnung war &#187;&lt;DATUM&gt;...DANGER handle with care!&#171;, womit das erwartete Erscheinen von Drachen angekündigt wurde.', 'Warnung');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (30, '[Neu]Schöpfung : <!--Der genetische, atomare Holocaust. Vor diesem Ereigniss wurde der G.O.D gebaut. Im G.O.D wurde eine genetische Datenbank angelegt. In einer nicht näher bezeichneten Stadt mit vielen Wolkenkratzern(Hochhäusern) an einem großem Gewässer machte ein Forscher ein Genexperiment. Er wollte genormte Ratten erzeugen mit optimalen humanoiden Eigenschaften, damit zukünftige Artzneimitteltest schneller übertragbare Ergebnisse erzielen. Ihm fiel dabei ein Tasse Kaffee um, was zufolge hatte, das sie Ratten bei Genuss von Kaffee besser denken. Sie, die Ratten, sind Kaffee-süchtig. Aus diesem Grund brachen die Ratten aus dem Labor aus, brachen in die globalen Computernetze ein, spekulierten an der Börse und erfuhren von dem G.O.D. Sie veranlassten eine Sondermission. So gelangten sie auf den G.O.D. Nach der Schöpfung bevölkerten die Ratten zunächst alleine die zerstörte Welt. Dabei ist es nicht klar ob es sich um ihre auf der Erde überlebenden Nachfahren handelte, oder um solche, die vor den Doedels die Welten betraten.-->Doedels nennen die Schöpfung Himmelfahrt. Die Schöpfung tritt immer zum Anfang oder Ende eines jeden Zeitalters ein.', 'Schöpfung');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (31, '''Global Orbital Depot'' oder auch ''Grant Orbital Destroyer''. Der Name ist abhängig vo der jeweiligen Schöpfungsgeschichte. Der G.O.D ist im Zeitalter nach der Schöpfung von den Moiry bewohnt.', 'G.O.D');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (32, 'Moiry : <!--Die Moiren (auch Mören) sind griechische Schicksalsgöttinnen, die den Menschen den Anteil am Leben zuteilen.Die Moiren sind Töchter des Zeus und der Themis.Klotho spinnt Lebensfaden.Lachesis teilt Lebenslos zu.Atropos zertrennt Lebensfaden.-->Kakerlaken mit extrem hoher Intelligenz. Sie tragen immer Sonnenbrillen und warten den Computer des G.O.D (siehe auch-> Bugs). Im &#187;Dritten Zeitalter&#171; verdingten sich ihre Nachfahren als Spezialsten für Nachrichtenteleskope.', 'Moiry');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (33, 'Historie -> eine der drei Schwester. Ihren schlechten Ruf trägt sie wohl zu Unrecht, obwohl sie die nachgeborene Zwillingsschwester der Geographie ist. Diesen schlechten Ruf, blutrüünstig zu sein, trägt sie  wie ihre Stiefschwester, die schwarze Braut, zu unrecht. Wo immer die Geographie ihren Tribut einfordert, den Boden mit Blut zu düngen, folgen sie hernach, um ihren Job gründlich und gewissenhaft zu vollenden. Das einzige, was man der Historie nachsagen kann, ist, dass sie etwas vergesslich ist.  ', 'Historie');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (34, 'Village Vanguard Boys: Gegründet als &#187;Who Is Afraid Of Yellow, Red And Blue?&#171; mussten sie sich anfangs mit kleinen Auftritten bescheiden. Ihr Manager Bernadette Neumann holte noch Greenleaves und Zeitweiseorange in die Gesangestruppe, womit der Erfolg begann. Am Ende stieß noch Violentdreams hinzu. Damit endete auch ihre Karriere. ', 'Village Vanguard Boys');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (35, 'Sokratie, die : Herrschaftsform nach den Lehren des Weisen Soso (circa 600 v.H.).  Sokratie besagt, dass es so und nur so geht. Eine verschärfte Form lehrt, dass es so oder so besser geht. Auf jeden Fall erfordert diese Herrschaftsform sehr viel Bescheidenheit und Weisheit.', 'Sokratie');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (36, 'Jacub : Jacub <A HREF=''/index.php?str=1&show=lexikon&media=10''&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594 TARGET=''_parent'' onMouseOver="popup(''/story/media.php?show=lexikon&media=10'',370,280)"><SPAN CLASS=av>[media]</SPAN></A>, Herrscher ?ber das Reich, Verfasser des Standartwerkes ?ber D?monen.', 'Jacub');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (37, 'Rattenzahn : Erster Herrscher über das Reich. Berühmter und vielgeachteter Sokritiker, genannt der Hammer. ', 'Rattenzahn');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (38, 'Soso: Soso, circa 600 v.H. Weiser aus dem Morgenland. Der bekannteste Auspruch des Weisen war, nachdem ihn ein unbedeutender Zeitgenosse seine Meinung gesagt hatte, mit einem leichten Kopfschüttel :\r\n&#187;Soso ... ?!&#171;', 'Soso');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (39, 'Sokritiker : Sokritiker, der. Anhänger der Sokratie.', 'Sokritiker');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (41, 'Gunfried : Erster Held von Drecksloch, doch er selbst würde sich nie so sehen. über ihn werden viele Geschichten erzählt, ihm werden viele Heldentaten zugeschrieben. \r\n<BR><DIV ALIGN=right><A HREF=''index.php?str=1&show=41''&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594>mehr&#187;</A></DIV>', 'Gunfried');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (42, 'Krawall : Krawall, auch als &#187;silentium nullum charavallum&#171; bekannt. Stadt auf der gleichnamigen Insel. Einst größte Handelsmetropole im ZZ. Endete mit einem gro?en Krawall . Sie war für ihre Kneiptouren und ihre demokratische Tyrannei bekannt. <DIV ALIGN="right"><A HREF="index.php?str=1&show=44&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594">[mehr]</A></DIV>', 'Krawall');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (43, 'Archie und Noel : Gebrüder Archie und Noel, SNC, Handwerker. In späteren Zeiten wurden sie als die Gründungsmeistern der Zimmermänner, Tischler, Maurer, Klempner, eigentlich aller Handwerkersberufe betrachtet, wobei jeder Handwerker natürlich bestritt, dass Archie oder Noel, Gründungsmeister irgendeines anderen Berufes als seines eigenen sei.', 'Archie und Noel');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (44, 'Martinshorn : Martinshorn, das. Allseits bekanntes und beliebtes alkloholisches Getränk, welches gerührt oder geschüttelt getrunken wird. Auf jeden Fall gehört in das Getränk mindestens eine Olive. In guten Gaststätten und Restaurants erhalten sie zwei, in der Lounge des &#187;Merchators&#171; sogar drei. Der Streit, wie das Getränk zuzubereiten sei, führte bei einer plötzlich einsetzenden Olivenknappheit zu einem Krieg.', 'Martinshorn');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (45, 'Saft : S.A.F.T, Abkürzung für die Organisation <!--&#187;Simulation A Fight Task&#171;-->&#187;Security Agency For Trade&#171;.', 'Saft');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (46, 'Laden : Laden, der. Abkürzung für &#187;Liberation And Destruction Empire Network&#171;. das Hauptquartier von Saft.', 'Laden');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (47, 'GI Busch : Busch, George im. Nicht verwand mit Willhelm im Busch. Besitzer eines Saftladens in Dreckloch. Bankrotteur und niemals Bürgermeister von Drecksloch.\r\n', 'GI Busch');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (48, 'Willhelm im Busch : Busch, Willhelm im. Berufe: Kinderschreck, Hühnerdieb, versuchter Held, Einbein und Märchenonkel. Kam auf tragische Art und Weise ums Leben. \r\n<DIV ALIGN=right><A HREF=''index.php?str=1&show=45''&phpMyAdmin=11ff380ee5b25c684be5835c62783970&phpMyAdmin=e1f10e59901d165c9ca72edc9ef70594>mehr&#187;</A></DIV><BR>', 'Willhelm im Busch');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (49, 'ZZ : ZZ, das. Abk?rzung f?r das &#187;Zweite Zeitalter&#171;', 'ZZ');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (50, 'SNC : SNC, gebräuchliche Abkürzung für &#187;silentium nullum charavallum&#171;.', 'SNC');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (51, 'Ironische Insel : Ironische Insel, die. Bekannt sind die inneren und die äußeren ironische Insel. Etwas kleineres Archipel der nördliche Archipele, zwischen denen von Drecksloch und Latifundien gelegen. Allseits beliebt sind die Küche und die Getränke der ironischen Inseln.', 'Ironische Insel');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (52, 'Merchator : Merchator, das. Erste und edelste Adresse f?r Handlungsreisende und andere Helden in Krawall. Eine Suite hat eine magische T?rsicherung, ein Schlafzimmer, ein Bad und einen eigenen Keller.', 'Merchator');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (53, 'Drecksloch : Drecksloch, die oder das. Stadt und gleichnamiges Archipel der nördlichen Gruppe. Wichtige Handelsstadt n.H. .', 'Drecksloch');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (54, 'Einhörner : Einhörner, die. Einhörner sind selten. Nur auf den Ironischen Inseln ist es den Einwohnern gelungen sie zu domestizieren. Sie züchten die bekannten weißen Einhörner. Von ihner Milch wird der Käse der I.I. gemacht. Einhörner sind nicht beliebt, was wohl an ihrem gar nicht jungfräulichen Image liegt. Man pflegt sie auch Schiemären oder Schiegen zu nennen..', 'Einhörner');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (55, 'Mahlstrom : Mahlstrom, der. Urgewalt, naher Verwandter der Ewigwährenden, der Zeit, Bräutigam der &#187;Schwarzen Braut&#171;. Kein Bestandteil der Geographie, aber in seinen wesentlichen Charakterzügen ihr sehr ähnlich. Geographisch unterscheidet man auch den Mahlstrom occidentalis und den Maelstrom orientalis, womit seine beiden Hauptströmungen bezeichnet werden.', 'Mahlstrom');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (56, 'Barbrandt :  Barbrandt, das (Land). Insel im Nebelmeer. Die Bewohner nennen sich selber Nebellungen, obwohl diese Insel all zumeist aus dem Nebel hervorragt. Höchster Punkt im Nebelmeer.', 'Barbrandt');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (57, 'Nebellungen : Nebellungen, die. Die Bewohner des Nebelmeeres im allgemeinen, besonders aber Ratten und Doedel, sowie im speziellen die Bewohner von Barbrandt.', 'Nebellungen');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (58, 'Niederlande : Niederlande, die. Tiefer gelegene Region zwischen die Gotland im Süden und Barbrandt im Osten, Kajütland im Westen und Nordmark im Norden. Nicht mit dem noch tiefer gelegenen Hundrya, das Land der Hunden, zu verwechseln.', 'Niederlande');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (59, 'Zottland : Zottland, das. Land der Zoten (auch als Zotten bekannt) s?d?stlich von Barbrandt, am ?u?ersten Rand vom Nebelmeer gelegen. Bekannt f?r sein schlechtes, kaltes, feuchtes und nebeliges Wetter.', 'Zottland');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (60, 'Zote : Zote, der. Die Zoten, auch als Zotten bekannt, sind bekannt f?r ihren Kampfesmut, ihre Standfestigkeit, insbesondere beim Genuss von alkoholischen Getr?nken und ihren sparsamen Humor. H?ufige und beliebte Vornamen bei den Zotten sind Max, Nat oder Xap, wobei h?ufig dabei das A weggelassen wird, z.b. Mx MxH''gen. Zoten sind eben auch sonst sehr sparsam.', 'Zote');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (61, 'Gote : Gote, der. Entweder ein ?berbringer guter Nachrichten, oder einfach nur einer der von Gotland stammte.', 'Gote');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (62, 'Bote : Bote, der. Überbringer von Nachrichten. In Barbrandt unterschied man zwischen Goten und Boten, welche man sofort köpfte, weil man davon ausging, dass es schlechte, böse Nachrichten seien, sowie den Zoten, die für ihre Kampfeslust bekannt waren. Ihren Nachrichten sagte man einen zweifelhaften Charakter nach, während sie selber von deren Zuverlässigkeit ausgingen.', 'Bote');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (63, 'Hunde : Hunde, der.(Plural: Hunden, die) Angehöriger des barbarischen, wenn nicht sogar d?monischen Stammes der Hunden, welcher Kläffer genannte Tiere zum reiten nutzte. der Schlachtruf der Hunden lautete: <BR>\r\n&#187;Hunde, wollt ihr ewig leben!&#171;\r\n', 'Hunde');
INSERT INTO `doc_lexical` (`id_lexical`, `lexical`, `keyword`) VALUES (64, 'Es geschehen seltsame Dinge im Internet. Gerüchte, Halbwahrheiten und Wahrheiten, verschwiegene und offenbare, die keiner von uns zur Kenntnis nehmen mag, kusieren in diesem neuen Medium. Banale Erinnerungen tummeln sich neben neuesten Nachrichten, phantastische Geschichten mischen sich unvoreingenommen mit neuesten, wissentschaftlichen Erkenntnissen. Das Internet hat uns unerwartet ein neues Fenster, eine neue Tür, eine neue Sicht auf unserer Welt eröffnet. Ach was sage ich, nicht nur eine Tür, Türen sind es, Tore sogar. Aber nicht nur das: auf den Straßen des Internets tauschen wir uns weltweit aus.<br />\r\nWeltenweit wäre freilich genauer, denn seit geraumer Zeit, ich muss es gestehen und kann es doch selbst kaum glauben, stehe ich im Kontakt mit einem Wesen aus einer anderen Welt.<br /><br />\r\nÜber das Internet, und technisch vermag ich es nicht zu erklären, erhalten ich von Zeit zu Zeit neueste Nachrichten aus dem Dritten Zeitalter. Im wesentlichen, so wurde mir erklärt, befasst man sich dort mit der Erforschung des Zweiten Zeitalters. Das Zweite Zeitalter sei eine überaus interessanten Materie zur Erforschung und reich an Geschichten. Tatsächlich ist es auch das einzigste, was man  dort im DZ durch die Teleskope sehen kann.<br />\r\nEs scheint aber so, dass ein ungewöhnlicher Ausnahmefehler des Teleskops es dem Wesen, HMA von Namen, ermöglicht, sein Teleskop mit unserem Internet zu verbinden. So erhielt ich anfangs EMails von HMA, von denen ich zunächst dachte, es sei zwar bemerkenswert merkwürdige, doch unerwünschte Werbung. Schon auf die zweite EMail antwortete ich. Es war das Jahr 1997.<br /><br />\r\nWie ich von HMA nach einiger Zeit erfahren hatte, dachte (er) zunächst, unsere Welt sei das lange vermisste EZ. Eine Tatsache die ich mehr als beunruhigend empfand. Freilich führte eine Diskussion mit anderen Wesen aus dem DZ HMA zu der Erkenntnis, das unsere Welt lediglich möglicherweise und auch nur vielleicht das gesuchte EZ sein könne. Diese Erkenntnis vermochte mich allerdings nur ein Wenig zu beruhigen, aber immerhin, es schläft sich wieder besser und man gewöhnt sich an Alles.<br /><br />\r\nHMA und ich vereinbarten also weiterhin in Kontakt mit einander zu bleiben, was sich durchaus als nicht immer einfach erwies und ich holte von ihm die Erlaubnis ein, "die Erkenntnisse des DZ über das Weltgeschehen des ZZ, mit besonderen Augenmerk auf die Enstehung von Letzteren", hier im Internet zu veröffentlichen.<br /><br />\r\nIch denke, es wird Sie interessieren.\r\n<br /><br />\r\nVorsicht:<br />\r\nWenn Sie diese Seiten lesen, betreten Sie die Welt des Zweiten Zeitalters.', 'Einleitung');
