INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (1, '2007-05-16 15:56:47', 'de', 1, 'Continued', 'Continued', ' Continued : - &#187;...to be continued&#171; - wird fortgesetzt. ', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (2, '2007-05-16 15:56:47', 'de', 1, 'Hammelsprung', 'Hammelsprung', ' Hammelsprung : Keinswegs mit dem &#187;deHundschen Wahlverfahren&#171; zu verwechseln. Die Schafe glauben nicht an die Demokratie, sondern immer noch an das Führerprinzip. &#187;Null Bock&#171; ist bei ihnen ein wirklich trauriger Zustand, bedeutet es doch, dass die Herde ohne Hammel, geschweige denn Leithammel ist. ', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (3, '2007-05-16 15:56:47', 'de', 1, 'Schuettelbier', 'Schuettelbier', 'Schuettelbier, William ''Vlad'' : Autor von zahlreichen, meist epischen Theaterwerken. Am bekanntesten ist &#187;Der Ring Der Weisen&#171;, einem Zyklus von 4 Theaterstücken:&#187;Langsam Dämmert Es Der Dämmerung&#171;, &#187;Ein Feld, Ein Herr, Ein Hügel&#171;, &#187;Führer Komm, Wir Verfolgen Dir&#171;, &#187;Einsicht, Gicht, Aussicht&#171;. Diese Epen beschreiben auf eindringliche Weise mit dichterischer Freiheit die Zeit kurz nach Himmelfahrt bis zur Schlacht um Hammeln. [br]mehr&#187;[br]K?NIGSTUNIER&#187;[br]HIMMELFAHRT&#187;[br][br]IN 80 TAGEN ...(Auszug)&#187;', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (4, '2007-05-16 15:56:47', 'de', 1, 'Drachen', 'Drachen', ' Drachen : auch Ohs, waren im &#187;Zeiten Zeitalter&#171; häufige Reisegefährten. Galten Sie zunächst als zuvorkommend und höfflich, hielt man sie später für gefährlich. Tatsächlich waren sie hochexplosiv. Es gab unterschiedliche Drachenarten, allerdings sollte man sie nicht mit Lindwürmern oder Schlangen verwechseln.[br]mehr&#187;[br]', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (5, '2007-05-16 15:56:47', 'de', 1, 'Lama', 'Lama', ' Lama, das : Das bekannteste Orakel des &#187;Zeiten Zeitalters&#171;. Befragte man es, so erhielt man einen weisen Spruch als Antwort. Diese Antwort wurde dringend benötigt. Man musste nur noch herausfinden von wem. ', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (6, '2007-05-16 15:56:47', 'de', 1, 'DailyLama', 'DailyLama', 'DailyLama : Haus und Hofpostille des &#187;Dritten Zeitalters&#171;. Bennant nach einem legendären Orakel. ', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (7, '2007-05-16 15:56:47', 'de', 1, 'Geographie', 'Geographie', 'Geographie, die : Vom &#187;Ersten Zeitalter&#171; sind keine Karten erhalten. Es soll 6 Kontinente gegeben haben. Diese Zahl ist aber nicht gesichert. Auch weis keiner, was Kontinente sind. Hier eine Karte des &#187;Zweiten Zeitalters&#171;', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (8, '2007-05-16 15:56:47', 'de', 1, 'Luftschiff', 'Luftschiff', 'Luftschiff : umgangssprachlich Schiff, auch als Gondeliere bekannt. Großes Transportfahrzeug am Ende des &#187;Zweiten Zeitalters&#171;. ', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (9, '2007-05-16 15:56:47', 'de', 1, 'Kerkerdimensionen', 'Kerkerdimensionen', 'Kerkerdimensionen: Nicht jedes Land oder jede Insel hatte eine Kerkerdimension. Sie befanden sich üblicher Weise immer unten und sind sehr alt und feucht. Ihren Namen hatten sie erhalten, weil sie gelegentlich als Kerker benutzt wurden und vielschichtig, gerade zu labyrinthisch multidimensional angelegt waren. Sie stammten nicht aus dem &#187;Zweiten Zeitalter&#171;. Manche Kerker wurden erst beim Bau von Kellern, Kanalisationen oder Katakomben entdeckt. In den Kerkerdimensionen wohnten Dämonen.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (10, '2007-05-16 15:56:47', 'de', 1, 'Dämonen', 'Dämonen', 'Dämonen: Auch Bestien genannt. Das beste Buch über Dämonen ist die &#187;Daemonologiae Von Jacub & Sieglinde&#171;. Bekannte Dämonen sind Bären, Elfender, Einauge und Zwölfhänder, sowie Sieglinde.[br][br]mehr &#187;', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (11, '2007-05-16 15:56:47', 'de', 1, 'Sieglinde', 'Sieglinde', 'Sieglinde: Sieglinde, einst einer der vielen namenlosen Dämonen, ernährte sich von Ratten und wurde zur Strafe gefanggesetzt. Erhielt ihren Namen durch ihren Sieg bei der Linde über Jakub.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (12, '2007-05-16 15:56:47', 'de', 1, 'Mountainhigh', 'Mountainhigh', 'Mountainhigh, FastBerg : Der Fastberg ist das Ei eines Weltendrachens. Das Ei ist interdimensional. Deswegen ist es immer zugleich verfault, noch in Brut oder bereits der Drachen geschlüpft. Im Inneren der Schale ist der Sternenhimmel zu sehen, der Gleiche, den man auch bei Nacht sieht. Nur ist das Ei halt interdimensional, wodurch man einen guten Blick in Vergangenheit, Zukunft und Gegenwart und auf den eigenen Planeten hat. Die Forscher/Bibleothekare der Stadt haben im Inneren des Eis ein gigantisches Teleskop errichtet', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (13, '2007-05-16 15:56:47', 'de', 1, 'Jetzt Lesen', 'Jetzt Lesen', 'Jetzt Lesen : Bücher, Nachrichten, Vermerke die so unter/überschrieben sind sollten jetzt gelesen werden. SOFORT! häufig auch fett, in großen Lettern und mit roter Tinte geschrieben. siehe auch Hans Magnus Alberts', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (14, '2007-05-16 15:56:47', 'de', 1, 'Herrhiering', 'Herrhiering', 'Herrhiering :  Herrhiering ist der stets Wiedergeborene, und der Meister des Ringes der Weisen. ER fand IHN und verlegte ihn ebenso sorgfältig. Es ist allgemein nicht bekannt, wer Herrhiering ist.(siehe auch->ER, Hans Magnus Alberts', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (15, '2007-05-16 15:56:47', 'de', 1, 'Weltendrachen', 'Weltendrachen', 'Weltendrachen : das Universum', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (16, '2007-05-16 15:56:47', 'de', 1, 'Magnus', 'Magnus', 'Magnus(,der) : Höchster der Bibleothekare', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (17, '2007-05-16 15:56:47', 'de', 1, 'Zauberer', 'Zauberer', 'Zauberer : Schriftkundige, neuzeitlich auch als Bibleothekare bekannt. Zur Heilkunst und anderen noch nicht bekannten Fortschritten fähige Zeitgenossen. Sind zu mehr oder weniger präzisen Zukunftsweisagungen befähigt, ins besondere was das Wetter angeht. Sind auch fähig, andere wahrheitsgemäß zu verleugnen.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (18, '2007-05-16 15:56:47', 'de', 1, 'Redhill', 'Redhill', 'Redhill : Der Hügel aus rotem Sand, bewachsen mit roten Ahornbäumen, auf dem eine Teleskopwerkstatt errichtet wurde. Redhill stellt heute noch Betriebsanleitungen für Nachrichtenteleskope her. Die jeweils neueste Version ist nicht nur stabiler (und schwerer) als die vorherige, sondern garantiert auch mit weniger schon bekannten Fehlern und Sicherheitslücken ausgestattet. Der Redhill liegt zwischen Suchdireinengutennamenfürdiestadtaus und dem Fastberg.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (19, '2007-05-16 15:56:47', 'de', 1, 'Hammeln', 'Hammeln', 'Hammeln : Hammeln ist ein Ort, wo man im Zweiten Zeitalter als erstes Schafe fand.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (20, '2007-05-16 15:56:47', 'de', 1, 'Schafe', 'Schafe', 'Schafe : Schafe sind sowohl von den Ratten als auch von den Doedels begehrte Tiere. Sie eignen sich f?r die K?seproduktion, zum Einbinden von B?chern, zur Herstellung von leichtem R?stzeug und Kleiderwaren, doch wirklich begehrt sind sie als Reittiere.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (21, '2007-05-16 15:56:47', 'de', 1, 'Thema', 'Thema', 'Thema : Wenn ich Thema sage, meine ich Thema. Und wenn ich ein anderes Thema sage, meine ich ein anderes Thema, und zwar ein gänzlich anderes Thema. Ich meine, ich meine, was ich sage ... und zwar immer ... meistens ... gelegentlich ... ist das Thema jetzt erledigt?', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (22, '2007-05-16 15:56:47', 'de', 1, 'Hafen', 'Hafen', 'Hafen : Hafen,der [media]. Eine Anlage zum Be- und Entladen von Schiffen.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (23, '2007-05-16 15:56:47', 'de', 1, 'Schiff', 'Schiff', 'Schiff : Wie gedenken Sie den in einer Welt ohne Ozeane zu reisen? Schwimmen? Fliegen? ... ja, genau sie habens erfasst.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (24, '2007-05-16 15:56:47', 'de', 1, 'Rechtsform', 'Rechtsform', 'Die Rechtsform einer Gesellschaft oder Firma bestimmt auf welcher Weise man sein Geld zu verdienen gedenkt. Am Gel?ufigsten sind dabei die GDNA -> GEHT DICH NICHTS AN!, und die ngB -> nur gegen Barzahlung. Bekannt ist auch die Stobe, in ungesitterten Gegenden auch Stube, -> Stirb oder bezahle. Die aGuV ist hingegen seltener -> auf Gedeih und Verderb. ', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (25, '2007-05-16 15:56:47', 'de', 1, 'Warnung', 'Warnung', 'Warnung, oder auch Warnhinweise. Sie wurden häufig in einer altertümlichen Sprache verfasst, dem Angelsächsischen. Eine typische Warnung war &#187;&lt;DATUM&gt;...DANGER handle with care!&#171;, womit das erwartete Erscheinen von Drachen angekündigt wurde.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (26, '2007-05-16 15:56:47', 'de', 1, 'Schöpfung', 'Schöpfung', '[Neu]Schöpfung : Doedels nennen die Schöpfung Himmelfahrt. Die Schöpfung tritt immer zum Anfang oder Ende eines jeden Zeitalters ein.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (27, '2007-05-16 15:56:47', 'de', 1, 'Moiry', 'Moiry', 'Moiry : Kakerlaken mit extrem hoher Intelligenz. Sie tragen immer Sonnenbrillen und warten den Computer des G.O.D (siehe auch-> Bugs). Im &#187;Dritten Zeitalter&#171; verdingten sich ihre Nachfahren als Spezialsten für Nachrichtenteleskope.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (28, '2007-05-16 15:56:47', 'de', 1, 'Historie', 'Historie', 'Historie -> eine der drei Schwester. Ihren schlechten Ruf trägt sie wohl zu Unrecht, obwohl sie die nachgeborene Zwillingsschwester der Geographie ist. Diesen schlechten Ruf, blutrüünstig zu sein, trägt sie  wie ihre Stiefschwester, die schwarze Braut, zu unrecht. Wo immer die Geographie ihren Tribut einfordert, den Boden mit Blut zu düngen, folgen sie hernach, um ihren Job gründlich und gewissenhaft zu vollenden. Das einzige, was man der Historie nachsagen kann, ist, dass sie etwas vergesslich ist.  ', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (29, '2007-05-16 15:56:47', 'de', 1, 'Village Vanguard Boys', 'Village Vanguard Boys', 'Village Vanguard Boys: Gegründet als &#187;Who Is Afraid Of Yellow, Red And Blue?&#171; mussten sie sich anfangs mit kleinen Auftritten bescheiden. Ihr Manager Bernadette Neumann holte noch Greenleaves und Zeitweiseorange in die Gesangestruppe, womit der Erfolg begann. Am Ende stieß noch Violentdreams hinzu. Damit endete auch ihre Karriere. ', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (30, '2007-05-16 15:56:47', 'de', 1, 'Sokratie', 'Sokratie', 'Sokratie, die : Herrschaftsform nach den Lehren des Weisen Soso (circa 600 v.H.).  Sokratie besagt, dass es so und nur so geht. Eine verschärfte Form lehrt, dass es so oder so besser geht. Auf jeden Fall erfordert diese Herrschaftsform sehr viel Bescheidenheit und Weisheit.', 3, 1, '0000-00-00 00:00:00');
