INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (32, '2007-05-16 15:56:47', 'de', 1, 'Rattenzahn', 'Rattenzahn', 'Rattenzahn : Erster Herrscher über das Reich. Berühmter und vielgeachteter Sokritiker, genannt der Hammer. ', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (33, '2007-05-16 15:56:47', 'de', 1, 'Soso', 'Soso', 'Soso: Soso, circa 600 v.H. Weiser aus dem Morgenland. Der bekannteste Auspruch des Weisen war, nachdem ihn ein unbedeutender Zeitgenosse seine Meinung gesagt hatte, mit einem leichten Kopfschüttel :[br]&#187;Soso ... ?!&#171;', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (34, '2007-05-16 15:56:47', 'de', 1, 'Sokritiker', 'Sokritiker', 'Sokritiker : Sokritiker, der. Anhänger der Sokratie.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (35, '2007-05-16 15:56:47', 'de', 1, 'Gunfried', 'Gunfried', 'Gunfried : Erster Held von Drecksloch, doch er selbst würde sich nie so sehen. über ihn werden viele Geschichten erzählt, ihm werden viele Heldentaten zugeschrieben. [br][br]mehr&#187;', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (36, '2007-05-16 15:56:47', 'de', 1, 'Krawall', 'Krawall', 'Krawall : Krawall, auch als &#187;silentium nullum charavallum&#171; bekannt. Stadt auf der gleichnamigen Insel. Einst größte Handelsmetropole im ZZ. Endete mit einem gro?en Krawall . Sie war für ihre Kneiptouren und ihre demokratische Tyrannei bekannt. [mehr]', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (37, '2007-05-16 15:56:47', 'de', 1, 'Archie und Noel', 'Archie und Noel', 'Archie und Noel : Gebrüder Archie und Noel, SNC, Handwerker. In späteren Zeiten wurden sie als die Gründungsmeistern der Zimmermänner, Tischler, Maurer, Klempner, eigentlich aller Handwerkersberufe betrachtet, wobei jeder Handwerker natürlich bestritt, dass Archie oder Noel, Gründungsmeister irgendeines anderen Berufes als seines eigenen sei.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (38, '2007-05-16 15:56:47', 'de', 1, 'Martinshorn', 'Martinshorn', 'Martinshorn : Martinshorn, das. Allseits bekanntes und beliebtes alkloholisches Getränk, welches gerührt oder geschüttelt getrunken wird. Auf jeden Fall gehört in das Getränk mindestens eine Olive. In guten Gaststätten und Restaurants erhalten sie zwei, in der Lounge des &#187;Merchators&#171; sogar drei. Der Streit, wie das Getränk zuzubereiten sei, führte bei einer plötzlich einsetzenden Olivenknappheit zu einem Krieg.', 3, 1, '0000-00-00 00:00:00');
