INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (41, '2007-05-16 15:56:47', 'de', 1, 'GI Busch', 'GI Busch', 'GI Busch : Busch, George im. Nicht verwand mit Willhelm im Busch. Besitzer eines Saftladens in Dreckloch. Bankrotteur und niemals Bürgermeister von Drecksloch.[br]', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (42, '2007-05-16 15:56:47', 'de', 1, 'Willhelm im Busch', 'Willhelm im Busch', 'Willhelm im Busch : Busch, Willhelm im. Berufe: Kinderschreck, Hühnerdieb, versuchter Held, Einbein und Märchenonkel. Kam auf tragische Art und Weise ums Leben. [br]mehr&#187;[br]', 3, 1, '0000-00-00 00:00:00');
