INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (45, '2007-05-16 15:56:47', 'de', 1, 'Ironische Insel', 'Ironische Insel', 'Ironische Insel : Ironische Insel, die. Bekannt sind die inneren und die äußeren ironische Insel. Etwas kleineres Archipel der nördliche Archipele, zwischen denen von Drecksloch und Latifundien gelegen. Allseits beliebt sind die Küche und die Getränke der ironischen Inseln.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (46, '2007-05-16 15:56:47', 'de', 1, 'Merchator', 'Merchator', 'Merchator : Merchator, das. Erste und edelste Adresse f?r Handlungsreisende und andere Helden in Krawall. Eine Suite hat eine magische T?rsicherung, ein Schlafzimmer, ein Bad und einen eigenen Keller.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (47, '2007-05-16 15:56:47', 'de', 1, 'Drecksloch', 'Drecksloch', 'Drecksloch : Drecksloch, die oder das. Stadt und gleichnamiges Archipel der nördlichen Gruppe. Wichtige Handelsstadt n.H. .', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (48, '2007-05-16 15:56:47', 'de', 1, 'Einhörner', 'Einhörner', 'Einhörner : Einhörner, die. Einhörner sind selten. Nur auf den Ironischen Inseln ist es den Einwohnern gelungen sie zu domestizieren. Sie züchten die bekannten weißen Einhörner. Von ihner Milch wird der Käse der I.I. gemacht. Einhörner sind nicht beliebt, was wohl an ihrem gar nicht jungfräulichen Image liegt. Man pflegt sie auch Schiemären oder Schiegen zu nennen..', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (49, '2007-05-16 15:56:47', 'de', 1, 'Mahlstrom', 'Mahlstrom', 'Mahlstrom : Mahlstrom, der. Urgewalt, naher Verwandter der Ewigwährenden, der Zeit, Bräutigam der &#187;Schwarzen Braut&#171;. Kein Bestandteil der Geographie, aber in seinen wesentlichen Charakterzügen ihr sehr ähnlich. Geographisch unterscheidet man auch den Mahlstrom occidentalis und den Maelstrom orientalis, womit seine beiden Hauptströmungen bezeichnet werden.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (50, '2007-05-16 15:56:47', 'de', 1, 'Barbrandt', 'Barbrandt', 'Barbrandt :  Barbrandt, das (Land). Insel im Nebelmeer. Die Bewohner nennen sich selber Nebellungen, obwohl diese Insel all zumeist aus dem Nebel hervorragt. Höchster Punkt im Nebelmeer.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (51, '2007-05-16 15:56:47', 'de', 1, 'Nebellungen', 'Nebellungen', 'Nebellungen : Nebellungen, die. Die Bewohner des Nebelmeeres im allgemeinen, besonders aber Ratten und Doedel, sowie im speziellen die Bewohner von Barbrandt.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (52, '2007-05-16 15:56:47', 'de', 1, 'Niederlande', 'Niederlande', 'Niederlande : Niederlande, die. Tiefer gelegene Region zwischen die Gotland im Süden und Barbrandt im Osten, Kajütland im Westen und Nordmark im Norden. Nicht mit dem noch tiefer gelegenen Hundrya, das Land der Hunden, zu verwechseln.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (53, '2007-05-16 15:56:47', 'de', 1, 'Zottland', 'Zottland', 'Zottland : Zottland, das. Land der Zoten (auch als Zotten bekannt) s?d?stlich von Barbrandt, am ?u?ersten Rand vom Nebelmeer gelegen. Bekannt f?r sein schlechtes, kaltes, feuchtes und nebeliges Wetter.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (54, '2007-05-16 15:56:47', 'de', 1, 'Gote', 'Gote', 'Gote : Gote, der. Entweder ein ?berbringer guter Nachrichten, oder einfach nur einer der von Gotland stammte.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (55, '2007-05-16 15:56:47', 'de', 1, 'Bote', 'Bote', 'Bote : Bote, der. Überbringer von Nachrichten. In Barbrandt unterschied man zwischen Goten und Boten, welche man sofort köpfte, weil man davon ausging, dass es schlechte, böse Nachrichten seien, sowie den Zoten, die für ihre Kampfeslust bekannt waren. Ihren Nachrichten sagte man einen zweifelhaften Charakter nach, während sie selber von deren Zuverlässigkeit ausgingen.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (56, '2007-05-16 15:56:47', 'de', 1, 'Hunde', 'Hunde', 'Hunde : Hunde, der.(Plural: Hunden, die) Angehöriger des barbarischen, wenn nicht sogar d?monischen Stammes der Hunden, welcher Kläffer genannte Tiere zum reiten nutzte. der Schlachtruf der Hunden lautete: [br][br]&#187;Hunde, wollt ihr ewig leben!&#171;[br]', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (57, '2007-05-16 15:56:47', 'de', 1, 'Einleitung', 'Einleitung', 'Es geschehen seltsame Dinge im Internet. Gerüchte, Halbwahrheiten und Wahrheiten, verschwiegene und offenbare, die keiner von uns zur Kenntnis nehmen mag, kusieren in diesem neuen Medium. Banale Erinnerungen tummeln sich neben neuesten Nachrichten, phantastische Geschichten mischen sich unvoreingenommen mit neuesten, wissentschaftlichen Erkenntnissen. Das Internet hat uns unerwartet ein neues Fenster, eine neue Tür, eine neue Sicht auf unserer Welt eröffnet. Ach was sage ich, nicht nur eine Tür, Türen sind es, Tore sogar. Aber nicht nur das: auf den Straßen des Internets tauschen wir uns weltweit aus.[br][br]Weltenweit wäre freilich genauer, denn seit geraumer Zeit, ich muss es gestehen und kann es doch selbst kaum glauben, stehe ich im Kontakt mit einem Wesen aus einer anderen Welt.[br][br][br]Über das Internet, und technisch vermag ich es nicht zu erklären, erhalten ich von Zeit zu Zeit neueste Nachrichten aus dem Dritten Zeitalter. Im wesentlichen, so wurde mir erklärt, befasst man sich dort mit der Erforschung des Zweiten Zeitalters. Das Zweite Zeitalter sei eine überaus interessanten Materie zur Erforschung und reich an Geschichten. Tatsächlich ist es auch das einzigste, was man  dort im DZ durch die Teleskope sehen kann.[br][br]Es scheint aber so, dass ein ungewöhnlicher Ausnahmefehler des Teleskops es dem Wesen, HMA von Namen, ermöglicht, sein Teleskop mit unserem Internet zu verbinden. So erhielt ich anfangs EMails von HMA, von denen ich zunächst dachte, es sei zwar bemerkenswert merkwürdige, doch unerwünschte Werbung. Schon auf die zweite EMail antwortete ich. Es war das Jahr 1997.[br][br][br]Wie ich von HMA nach einiger Zeit erfahren hatte, dachte (er) zunächst, unsere Welt sei das lange vermisste EZ. Eine Tatsache die ich mehr als beunruhigend empfand. Freilich führte eine Diskussion mit anderen Wesen aus dem DZ HMA zu der Erkenntnis, das unsere Welt lediglich möglicherweise und auch nur vielleicht das gesuchte EZ sein könne. Diese Erkenntnis vermochte mich allerdings nur ein Wenig zu beruhigen, aber immerhin, es schläft sich wieder besser und man gewöhnt sich an Alles.[br][br][br]HMA und ich vereinbarten also weiterhin in Kontakt mit einander zu bleiben, was sich durchaus als nicht immer einfach erwies und ich holte von ihm die Erlaubnis ein, "die Erkenntnisse des DZ über das Weltgeschehen des ZZ, mit besonderen Augenmerk auf die Enstehung von Letzteren", hier im Internet zu veröffentlichen.[br][br][br]Ich denke, es wird Sie interessieren.[br][br][br][br]Vorsicht:[br][br]Wenn Sie diese Seiten lesen, betreten Sie die Welt des Zweiten Zeitalters.', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (58, '0000-00-00 00:00:00', 'de', 1, 'Scharfe Schafe', 'scharfeschafe_6', '[br]Die Expedition der Ratten hatte dann und wann eine Pause eingelegt, damit sich die Länder entfernen und andere annähern konnten. Die kleine Ratte lernte viel, vielmehr als in der Schule und aus Büchern. Sie lernte wie man sich in der wilden Natur zurecht fand, welche Kräuter genießbar waren, wie man Fische fing, wie man sich nicht verlief. Sie lernte Entfernungen richtig einzuschätzen.[br]Bei jeder Unterbrechung frischten Arbeitstrupps die Vorräte auf, flickten die Seile, verbesserten das Katapult und zeichneten Karten von den Ländern und verzeichneten die Sterne und die Winde. Einige Länder wirkten größer, andere kleiner als sie waren. Einmal waren sie einem Tier begegnet. Es war ein wildes, garstiges, borstiges Tier mit großen blanken Eckzähnen gewesen, daß sie in einem Wald überraschte. Sie wichen dem Tier so schnell wie möglich aus und liefen alle weg. Man sammelte sich erst spät am Abend weit entfernt vom Wald und von dem Tier. Niemad war ernsthaft verletzt. Man hatte nochmal Schwein gehabt. Hoffentlich waren Schafe nicht so gefährlich. Und dann endlich hatten sie ihr Ziel, das Schafsland, erreicht.[br]Das Schafsland war größer, viel größer als sie gedacht hätten. Es war zu einer Hälfte von dicht bewaldeten Hügeln umgeben, die von einem hohen Berg bekrönt wurde. Auf der anderen Seite erstreckte sich eine weite Ebene. Die Expedition schlug das Lager auf. Ab und an hörte man das Geblöke einiger Schafe aus der Ferne. Weit in der Ferne konnte man immer noch das Heimatland erahnen. Es schien jetzt viel höher zu liegen. Es war das erstemal, daß die kleine Ratte an ihre Eltern dachte. [br][br]Am nächsten Tag teilte man zwei Erkundungstrupps ein. Der Erste sollte das Land kartographieren und nach Vorräten suchen, der Zweite hatte die Aufgabe Schafe zu finden. Am Abend war der erste Trupp schon lange wieder im Lager. Man wartete, schickte Kundschafter los den zweiten Trupp zu finden. Erst nach dem späten Abendessen tauchte der Trupp auf, zerbeult und lädiert. Man hatte Schafe gefunden. Es waren man große Tiere. Die Schultern ragte einem über den Kopf. Es waren drei an der Zahl gewesen. Zwei hatten keine Hörner, eines zwei mächtige Schnecke. Die Schafe hatten neugierig geschaut. Doch als man sich ihnen zu nähern wagte, stürmte das Gehörnte los rammte einen Laboranten gegen einen Baum, stieß zwei andere Ratten um und trappelte über die anderen hinweg. Die beiden anderen Schafe folgten ihm. Als man endlich wieder erwachte, waren die Schafe weg. Man versorgte die Wunden und kochte noch mal Essen. Am nächsten Tag führte Peirät einen anderen Trupp auf die Suche nach den Schafen. Man gedachte die Schafe mit Seilen zu fangen. Am Abend kamen sie zerbeult, zerlumpt und niedergetreten wieder. Man pflegte wieder die Wunden, was inzwischen die Aufgabe der kleinen Ratte war. Und wieder schickte man zwei Trupps los. Derjenige, der die Schafe finden sollte, kam schon am Mittag wieder, zerlumpt, verbeult und bluten. Zwei gebrochen Arme und ein gebrochenes Bein hatte man zu beklagen. Man war zehn wilden Schafen gerade noch so entkommen. Die Expedition rätselte, wie man der Schafe Herr werden könnte. Doch am Abend war der Erkundungstrupp immer noch nicht da. Peirät stellte einen kleinen Suchtrupp zusammen und die kleine Ratte durfte mit. Wohl auch weil sie als einzigste noch nicht verletzt war. Sie gingen in die Richtung, in der sie die anderen vermuteten. Peirät fand ihre Spuren und auf einmal standen sie vor ihnen. Sie standen wie Statuen da. [br][br]&#187;Seit leise!&#171; wurden sie aufgefordert. Einige zeigten in Richtung eines kleinen Sumpfes. [br][br]&#187;Was ist das?&#171; Sie schauten alle Peirät an. Es war Stille, die das mächtige Gebrumme eines rötlich schimmernden geschuppten Etwas zertrennte. Dann und wann räkelte es sich und durchwühlte den Sumpf. Es schlief. [br][br]&#187;Kommt alle mit zurück. Leise!&#171;[br][br] flüstere Peirät so leise daß man es für das Flüstern des Windes hielt. Ein heller Schein durchfuhr die Nacht und unweit des Geschuppten stand ein dorniger Busch in Flammen. Am Morgen erreichte sie mit zitternden Knien, übermüdet, aber wohlbehalten ihr Lager. Jetzt erst wagten sie zu sprechen. Der Erkundungstrupp wusste einiges zu berichten.[br]Eine Horde von mehr als zwanzig wilden Schafen wollte am Sumpf Wasser trinken. Doch der Geschuppte hatte alle mit einem einzigen Flamenstoß vertrieben, dabei einige Schafe geröstet und verschlungen. Die Schafe mussten Angst vor dem Feuer haben, denn sie flüchteten sofort. Dummer Weise hatten alle Ratten in ein Auge des Ungeheuren geschaut und ihn war so, als würde er sie beobachten, selbst als er schon schlief. Darum hatten sie nicht gewagt sich zu  fortzubewegen aus Angst entdeckt zu werden. [br][br]Nun wussten alle, wie man die Schafe fangen würde. Am nächsten Tag würde sie mit Feuer zusammentreiben.[br]Auf der anderen kampierten die Doedels. Nachdem der Drachen, Sir C.V.J. Mongolfier , sie mehrere Tage über mehrere Inseln hinweg getragen hatte, hatte er sich von der Gruppe getrennt. Er hatte sich in einen kleinen Sumpf zurückgezogen. Man hatte sich schon häuslich eingerichtet. Die seltsamen Dollies einzufangen war aller Begehren. Doch die ersten Begegnungen waren alles andere als vielversprechend. Am ersten Tage rammten zwei gehörnte Dollies einige Doedels in den Boden. Die Blessuren konnte man nur mit Kräuterverbänden stillen. Am zweiten Tage beschloss man, den Schafen eine Falle zu stellen. Man drehte einen großen Korb um, in dem mehrere Doedels Platz gefunden hatten, als man zur Insula gereist war. Stützte ihn mit einem Pfahl auf, so daß ein Dolly hinein laufen konnte. Würde ein Dolly gegen die Wandung des Korbes rennen, so würde er sich über dem Dolly schließen. Bis zum Abend hatte man ein kleines, junges, unerfahrenes Dolly gefangen. Gerade als man es herausholte, stürmte der ganze Familienverband  heran um es zu befreien. Voller Entsetzen und Panik griff einer Doedels den Pfahl und schwang ihn gegen die Dollies, die darauf allesamt reis aus nahmen. Nun hatte man kein Dolly mehr, aber man war mit höchster Mühe und Not ihnen ohne Verletzungen entgangen. Und man hatte eine wertvolle Erfahrung gemacht. Dollies hatten Angst vor Knüppeln.', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (59, '0000-00-00 00:00:00', 'de', 1, 'Scharfe Schafe', 'scharfeschafe_7', '[br]Am nächsten Morgen standen die Ratten wie die Doedel auf. Man trieb immer größere Gruppen von Schafen, Dollies vor sich her. Noch wollte es nicht gelingen sie einzukreisen. Die Schafe entwischten ihnen immer wieder. Gegen Abend hatte jeder eine Herde von Schafen bei einem kleinen Hügel versammelt. Man atmete schwer. Alle ruhten sich in diesem Moment aus, dem einen Moment vor dem letzten Zug.[br][br] Die Schafe standen in einem großem Ring um den kleinen Hügel, die Ratten mit den Fackeln auf der einen Seite und die Doedels gegenüber trugen schwere Knüppel. Nun galt es. Es musste gelingen. Die Schafe mussten eingefangen werden. So bewaffnet stürmten beide gleichzeitig aufeinander zu, ohne von einander zu wissen. Doch die Schafe wichen abermals aus, blökend vor Entsetzen vor den geschwungenen Fackeln einerseits, andererseits vor den durch die Luft wirbelnden Keulen. Kein Schaf wurde getroffen, und die Doedels und die Ratten rannten aufeinander zu. Mitten auf der Erhebung des Hügels trafen sie sich, sahen sich zum ersten Mal und blieben vor Erstaunen stehen. Alle standen still und starr. Der Ring der Schafe schloss sich wieder. Die Böcke erhoben ein grimmiges Geblöke, die Schafe ein zustimmendes Gemähe. Sie waren allesamt in der Stimmung die Störenfriede in einer Stampede niederzumetzeln. Immer mehr Schafe umringten den Hügel. Sie waren wütend.  [br][br] Die kleine Ratte sah erstaunt in das Gesicht ihres Gegenüber. Ein kleiner, rundlicher Kerl mit Augen so groß, wie sie noch keine gesehen hatte. Seine Ohren waren nicht spitz, sie sahen eher aus wie [br] Flügel, große runde Flügelohren. Der Kerl trug einen Rock mit einem großen kariertem Muster. Viele dieser Leute trugen solche seltsame Kleidung. Es waren eindeutig keine Ratten. Der Kerl grinste [br] sie verlegen an und sengte seine Keule, worauf die kleine Ratte ihre Fackel sengte. Nun löste sich die allgemeine Starre und alle sengten ihre Fackel oder Keulen oder sie warfen diese auf einen[br] großen Haufen in der Mitte. Im Lichte des Lagerfeuers begutachtete man sich erstaunt gegenseitig. Ein leises Gemurmel erhob sich, während die Schafe wütend weiter blökten. [br]&#187;Ich bin ein Doedel, heiße Ben, und du?&#171;[br][br]Das Erstaunen nahm kein Ende, dachte die Ratte. [br][br]&#187;Eine Ratte.&#171;[br][br]Ihr Knie zitterten, sie stotterte und die Schafe blickten auf. Der Doedel lächelte. [br][br]&#187;Ihr wolltet wohl auch die Schafe fangen?&#171;[br][br]&#187;Ja.&#171;[br][br]Ihre Stimme wurde schon etwas fester. Der Doedel grinste jetzt freundlich. [br][br]&#187;Eine missliche Situation. Wir sind alle von den Schafen umringt.&#171;[br][br]&#187;Dann sollten wir uns alle hinsetzten und uns überlegen, wie wir aus dieser Lage wieder heraus kommen!&#171;[br][br] Inzwischen hatten wohl schon alle bemerkt, daß man sich gegenseitig verstand. Und die meisten setzten sich. Ben hatte angefangen, den Knüppel zu bearbeiten. Er könne dabei besser denken, hatte er [br] gemeint. Die kleine Ratte schaute verlegen zu den wütenden Schafen unten am Hügel. Es schienen immer mehr zu werden. Der Ring war geschlossen. Bens Knüppel hatte inzwischen schon überall Löcher, an der Seite, oben ein kleines und ein großes unten. Auch er schien verlegen. Er lächelte wieder, nahm den Knüppel in den Mund und blies hinein. Dem Knüppel entfuhr ein lautes Quietschen. Die Schafe [br] schwiegen. Es war ein grausames, plötzliches Schweigen&fn=6'',300,200)">[6].  Ben blies noch einmal in den Knüppel und legte die Finger auf die Löcher in der Seite. Der Knüppel begann zu singen auf eine sehr träge Weise eine schläfrige Melodie. Die Schafe blickten immer noch auf, doch sie rührten sich nicht. Einer der ältern Doedel griff einen der Knüppel und rannte zu den Schafe  hinunter. Dort schlug er einem Schaf sanft gegen den Kopf. Es fiel um. Ratten und Doedel griffen nun nach Knüppeln, andere nahmen die Seile mit, und rannten zu den Schafen. Schafe fielen betäubt um und wurden gefesselt. Auf diese Weise konnte man nicht nur eine Bresche durch den Belagerungsring schlagen, endlich gelang es sogar diese Schafe zufangen. Die Schafe wachten wieder auf, aber nun trotteten sie davon. Die gefesselten Schafe wurden auf den Hügel gezerrt und in der Nähe des Feuers abgelegt. Endlich waren alle Schafe entweder geflohen oder gefangen. Da erhob sich ein fürchterliches Geblöke eines einzelnen Schafes. Ben, am Fuße des Hügels, rannte nach oben, voller Grauen schwang er seine Tröte und traf da das Schaf mit voller Wucht am Kopf. Das Geblöke erstarb, sowie leider auch das Schaf. Leider lag aus zu nah am Feuer. Es war das erste Schaf das geschlachtete, gehäutet und gegrillt wurde. Ratten und Doedels versammelten sich bei den Schafen und teilten ihre Beute redlich. Alle lobten Ben seiner Taten wegen, nannten ihn den Retter, einen wahren Helden. Er war verlegen. Die kleine Ratte lächelte ihn mit verträumten Augen an. Sie feierten noch ein großes Fest mit Kräutern, frischen Wasser, Obst, Blumen im Haar und einem Festtagsschmaus. Es war die Schlachttag, ein wahrer Festtag. [br][br] Das war die Schlacht um das Hammel. Später sollte man die Insula, das Land als Hammeln kennen, dort, wo die Schafe herkamen. Und noch heute feiert man die &#187;Die Schlacht um Hammel&#171;.[br] Daheim angelangt, schlug die kleine Ratte das Buch auf Seite 513 wieder auf. Stolz war sie über das gelungene Abenteuer und ihre Eltern waren stolz auf sie. Sie lächelte. Sie lass über Keplers Himmelsmechanik. Sie schüttelte den Kopf. Wie in aller Welt sollte das funktionieren? Sie war verwirrt. Dann sah sie etwas, was sie vorher noch nie und nicht dort gesehen hatte. Am Rand stand in winzig kleiner Lettern, man musste das Buch an der Nase vorbei ganz nah an die Auge führen:[br] Randbemerkung 712d_a4ix2 btr. J.K. -> will mir scheinen, daß diese Gesetze schon länger nicht mehr gültig, ii.v.h., die Erde drehe sich nicht um die Sonne, sondern diese sich um das Schwerkraftloch der Erde und die Planeten auch![br] HMA ', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (60, '2002-12-01 00:00:00', 'de', 1, 'Schwarze Braut', 'schwarzebraut', '[br][br]Die Schwarze Braut des Schwarzen Windes[br][br]Eine Biographie[br][br][br][br]Die schwarze Braut wurde ohne Namen geboren. Sie war eine der drei Töchter ihrer Mutter. Wenn man es genauer nahm, war sie die Stieftochter ihrer Stiefmutter. Ihre Stiefschwestern waren verzogene, blutrünstige, wahrhaftige Monster. Es waren die Geographi&#235; und die Histori&#235;. Eigentlich war nur die Geographie blutrünstig, der Historie wurde das immer nur nachgesagt. Die Geographie ließ ihren Boden mit Blut tränken und mit Leichen düngen. Die Historie hechelte immer von Ort zu Ort hinterher, um die Geschehnisse zu verzeichnen. Der Schwarzen Braut Tat war es, der Historie gleich, von Ort zu Ort zu eilen, um dann ihre Ernte zu einzufahren. Sie hielt reiche Ernte. Die Schwarze Braut war, ist tot. Sie ist der Tod und der Tod ist, wie alles andere wichtige im Leben, weiblich.[br]Die schwarze Braut des Windes kam erst kurz vor ihrer Hochzeit zu ihrem Namen, den sie von ihrem ersehnten Manne erhielt, dem schwarzen Wind, der auch besser unter dem Namen allesvernichtender, allesüberwältigender, allesverzerrender Mahlstrom bekannt ist. Die Hochzeit fiel erfrischender Weise aus, denn sie hätte das Ende aller Zeiten bedeuten. [br]Von der Braut ist bekannt, daß sie in dunkler, sternenloser Nacht über den Horizont reitet&media=5'',400,300)">[media]. Sie sitzt dabei auf einem schwarzen Schafsbock mit großen geschneckten, eisernen Hörnen. Bedeckt ist er mit einer schwarzen Decke. Er träg ein ehernes Nasenschild. Wann immer man die schwarze Braut reiten sieht, kann man sich gewiss sein, daß sie Ernte hält. Man selbst ist allerdings schon tot. Sie hatte die Angewohnheit immer mit den Verlieren zu reiten.[br][br]Die Schwarze Braut führt ein sehr bezeichnendes Wappen&media=6'',400,275)">[media] für ihr Gewerbe. Es ist eine rote Sichel die eine rote Sense kreuzt auf dem Feld der dunkelsten Nacht. Unter ihnen liegt die geschnittene goldene Ähre, Symbol der reichen Ernte. Trotzdem ist es verwunderlich, daß sie in einigen Gegenden als Fruchtbarkeitsgöttin&fn=1'',300,200)">[1] verehrt wird.[br] [br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (61, '2002-11-24 00:00:00', 'de', 1, 'Auch du, ...?', 'rattenzahn', 'Auch du, ? ?[br][br]Es waren noch einige Jahre, bevor die Welt begann, die Zeit zu berechnen. Der Dorfvorsteher wusste, dass heute kein guter Tag war. Er betrat die Halle der Sieger[1]. Die Ernte war dieses Jahr besonders schlecht ausgefallen. Wilde Hirten hatten ihre Schafe in den Feldern grasen lassen. Was die Schafe nicht aßen, hatten sie nieder getrampelt. Es war kein gutes Jahr gewesen, und heute war kein guter Tag. Er war sich gewiss, er würde gleich sterben. [br][br]Die Halle war ein großer dunkler Bau. Es sah so aus, als würde das Dach von gigantischen Rippen getragen werden. Am hinteren Ende thronte der Hammer. Sein Name war das Gesetz seines Reiches. Vor dem Gesetz waren alle gleich. Jede Ratte, jeder Hamster und alles Getier war sein Knecht, auf Gedeih und Verderb ihm ausgeliefert. Sich zu rechtfertigen, war eine schlechte Idee. Der Dorfvorsteher würde sich seinem Schicksal ergeben, doch er wollte, er musste verhindern, dass sein Dorf dieses teilen würde. Er hatte dieses Jahr nicht viel Tribut zu geben. Das war sein sicheres Todesurteil. Mit hängendem Kopf wartete er, bis er an der Reihe war, vor den Thron zu treten.[br][br]Rattenzahn genoss die heutigen Tributzahlungen. Aus dem ganzen Reiche waren Untertanen gekommen, um ihre Gaben dazureichen. Er liebte es, die seinen in ihrem Hochmut und ihrem Elend zu beäugen. Seit er die Dörfer geeint hatte, gestützt auf seinen Ruf als Sieger im Kampf gegen den Lindwurm, war sein Wort die Macht im Reiche. Er war Rattenzahn der Hammer, Reichsgründer und Tyrann. Auf seinem Banner hinter dem Throne stand sein höchster Wahlspruch, damit jeder wisse, mit wem er es zu tun hatte. Von seinem schwarzen Throne herab, zu dessen Füßen der erschlagene Wurm lag, betrachtete er wohlwollenden sein Adoptivkind Jacub. Jacub war ein Hamster, was Rattenzahn nur recht war, denn damit wurde deutlich, dass jedermann, ob Ratte oder Hamster, die gleichen Chancen hatte. Das förderte die Einheit des Reiches. Es konnte sich keiner benachteiligt fühlen. Er forderte nur striktes Gehorsam und hohen Tribut, denn Geschäfte des Staates, die Wachen, Aufseher und Spione wollten bezahlt werden. [br][br]Rattenzahn fiel Jacubs Blick auf. Er verriet ungewöhnliche Neugier. Jacub hatte eher die Angewohnheit zu offiziellen Anlässen gelangweilt zu sein. Rattenzahn verfolgte Jacubs Blick. Ja, dachte sich Rattenzahn, dieser Dorfvorsteher war eine auffällige Person. Rattenzahn erinnerte sich, der Dorfvorsteher kam von einem der Dörfer bei den Bergen. Er war immer korrekt gekleidet, doch dieses mal sah er ärmlich aus und zeigte mehr Demut vor dem Thron, als alle anderen. Solches Verhalten verhieß keine gute Botschaften. [br][br]»Trete vor, Dorfvorsteher!«, gefiel es Rattenzahn aufs gerade Wohl. [br][br]»Was du uns hast heute zu bieten?«[br][br]»Meine Gaben sind heute bescheiden gering. Es ist alles, was wir zu geben haben, mein Herr.« , entgegnete der Dorfvorsteher. Er wurde dabei sichtlich kleiner . [br][br]» Ich weis um mein Los und um das der Meinen, denn dort hängt der Hammer! « , wobei der Dorfvorsteher auf den Hammer wies.[br][br]» Es scheint ein guter Vorschlag. «, erwiderte Rattenzahn sichtlich unbeeindruckt, [br]» Doch führt ihn weg. Uns gefällt es, uns näher mit ihm zu befassen. «[br][br]Der Dorfvorsteher wurde abgeführt. Geschickt, dachte Rattenzahn, war der Dorfvorsteher. Er wusste die Klippen zu umgehen. Niemand würde so auftreten, wenn er nicht wahrhaftige Gründe hätte. Normalerweise jammerten und wehklagten die heuchlerischen, säumigen Bittsteller, die es nicht fertig gebracht hatten, die fälligen  Tribute einzutreiben. In solchen Fällen half nur noch die harte Hand. Auch der Dorfvorsteher würde den Hammer spüren, das wussten beide, aber das Dorf würde er diesmal vielleicht verschonen. Es kam ganz darauf an, ob der Dorfvorsteher Wichtiges zu berichten hatte. Rattenzahn sah zu seinem Kind und war beeindruckt. Was hatte Jacub schon erfahren? Jacub lächelte.[br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (62, '2002-12-01 00:00:00', 'de', 1, 'Auch du, ...?', 'rattenzahn2', 'Ein Tag, an dem Rattenzahn Tribute entgegennahm, währte durchaus lange. Er wurde müde und ungeduldig. Je müder er wurde, desto unfreundlicher wurde er. Das Ende der Schlange der huldvollen Darbietungen fertigte er im Schnelldurchgang ab. Endlich war Abend. Vor dem Tor der Halle vergnügten sich die Untertanen. Rattenzahn ließ die Torwache aufmarschieren und die Tor wurden geschlossen.[br]Doch zeigte er sich noch für einen kurzen Moment auf der Außenkanzel der Halle, um die Huldigungen des Volkes entgegen zunehmen. Jubel brach aus. Jetzt waren Jacub und er alleine in der Halle. [br][br]»Geben und Nehmen, merk es dir, mein Kind!« [br][br]Sein Gemütszustand näherte sich rasender Rastlosigkeit. Er war hungrig, begierig zu erfahren, was der Dorfvorsteher zu berichten hatte und Jacub schon zu wissen schien. Er musterte sein Kind. [br] Jacub lächelte. [br][br]Das war beunruhigend. Rattenzahn ließ sich ein wenig Brot und Wasser bringen, dann hieß er Jacub mit in den Kerker zu kommen. Am hinteren Ende , hinter dem Thron führte eine kleine Tür zu einer Treppe, die man nach unten steigen musste. Unten war der Wachraum. Dort saß Dorfvorsteher in Ketten auf einer Bank. Zwei Wachhabende standen vor der Treppe. Links und Rechts gingen weiter Türen, Gänge und eine Treppe ab. Die Treppe führte weiter nach unten. Rattenzahn lies den Dorfvorsteher in eines der Zimmer bringen und befahl den Wächter die Tür zu schließen und draußen zu warten.[br]Er nahm Dorfvorsteher die Ketten ab, setzte sich hinter den Tisch und nahm ein Blatt zur Hand. [br][br]»Erzähle!« forderte Rattenzahn den Dorfvorsteher auf. [br][br]Er starrte ihn mit dunklem Blick an. [br][br]Dorfvorsteher atmete tief durch und begann. [br][br]»Es fing zur Frühlingszeit an. Zunächst waren es nur einige Fremde, die bei uns Hasen jagten. Es waren dunkle, verwegene Gestalten, die aus den Regionen hinter den Bergen, hinter den Klippen, wo nichts ist und nichts sein sollte, gekommen waren. Wir verfolgten sie, auch wenn wir an den Klippen ihre Spur verloren. Daher sind wir uns sicher, dass sie daher kamen. Im Sommer kamen wiederum welche. Sie schlugen ein Lager bei den Klippen auf, kundschafteten unser Dorf aus. Sie nahmen sich einfach das Recht zur Jagd und stahlen uns Euer Wild. Sie führten seltsame Tiere mit sich. Hamster hohe Tiere, trieben sie in die Feldern zum Grasen, Herr. Aus alten Schriften erfuhren wir, dass es sich um Schafe handeln könnte. Wir stellten und vertrieben sie, fanden ihr Lager und schlugen sie in die Flucht, doch auch dieses mal konnten wir ihnen nicht weiter folgen, als bis zu den Klippen. Sie waren wie vom Boden verschluckt. Wir waren glücklich und dachten sie würden nie mehr wiederkommen. Im Herbst, kurz vor der Ernte, waren sie wieder da. Sie waren bewaffnet, brachten eine Herde ihrer Tiere mit und ließen sie die Felder abweiden. Sie zerstörten die ganze Ernte, stahlen Wild, zerstörten die Mühle und raubten sogar Obst. Das schlimmste aber waren, ihre Vorsteher. Ein bärtiger Barbar, ein Hamster, so groß und kräftig, wie ich noch keinen gesehen habe und einen Dämon, groß wie ein Baum. Sie machten gemeinsam Jagd auf die Ratten unseres Dorfes. Dann verschwanden sie, dem Herrscher sei Dank, ebenso überraschend, wie sie gekommen waren. Am Ende war es die zwei Kiepen Obst und der Sack Korn, den wir Euch geben konnten.« [br][br]Der Dorfvorsteher hielt noch immer Rattenzahns Blicken stand. Innerlich war Rattenzahn besorgt. Eine Horde Wilderer plünderte die Grenzen seines Reiches. Eine wilde Horde, geführt von einem Dämonen, stellte die Ordnung, sein Recht in Frage, machte Jagd auf die Ratten und verschonte die Hamster. Solche Vorkommnisse waren dazu geeignet, die mühsam hergestellte Einheit zu spalten. Rattenzahn war sich des Dorfvorstehers sicher. So freimütig, wie er jetzt zu berichten wagte, so verschwiegen war er allen anderen gegenüber gewesen. Trotzdem musste Rattenzahn so schnell wie möglich handeln, damit es zu keinem Gerede kam. Er musste dem Dorf helfen. [br][br]»Habt ihr für den Winter genug zu essen?«', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (63, '0000-00-00 00:00:00', 'de', 1, 'Der Fuss Der Welt', 'pedisterra', '[br][br]Pedis terrarum [br] Der Fuß der Welt[br][br]Die größte zusammenhängende Landmasse der Welt. Sie scheint unmittelbar in dem Mahlstrom zu ruhen. Sie hat die Form eines dreizehigen Fußes&media=7'',640,480)">[Karte]. Jeder Zeh wird durch eine Halbinsel gebildet, auf dem sich ein kleines Gebirge befindet. Auf der westlichen Halbinsel steht ein Kloster, auf der östlichen eine Burgfeste, dazwischen findet man einen Marktplatz. Am Anfang der Welt war der Fuß der Welt die größte Stadt. Es handelte sich dabei weiniger um eine Stadt, als um ein zusammenhängendes Siedlungsgebiet. Der höchste Berg der Welt erhebt sich über der Ferse. Den Ortsteil zu seinem Fuße nennt man Wadenbein. Den Berg zu besteigen, weilt 80 Tage. Man muss einem spiralförmigen Pfad folgen. Nach jeder Tagesstrecke findet man mindestens ein Gasthaus, manchmal auch ein kleine Ansiedlung. Nach 40 Tagen muss man einen labyrinthartigen Tunnel durchqueren. Wer nicht am nächsten Tag auf der anderen Seite herauskommt, gilt als verloren. Die Bergdörfer tragen so poetische Namen, wie Dasistdergipfel, Fallnichtrunter, Wolkenkratzer, Soweitbistduschon, Schaunicht- nachunten, Denknichtdaran, Tunneleingang, Ruhdichjetztaus, Duhastesdirverdient, Machweiterso, Derletztegang und Wolkenkuckucksheim. Wolkenkuckucksheim, auf dem Gipfel des Berges, beherbergt gleichzeitig die unbekannte Universität für magische Angelegenheiten. Die unbekannte Universität, so man sie denn findet, steht allen wissbegierigen Lebensformen offen. Gerüchteweise hat das DailyLama hier studiert. Ein anderes Gerücht besagt, es wäre der erste Dekan dieser Einrichtung gewesen. [br]', 1, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (64, '0000-00-00 00:00:00', 'de', 1, 'Nebel Insel', 'nebula_1', '[br][br]Die Nebelinsel[br][br]In Mitten des Nebelmeeres lag die Nebelinsel. Es war der abgeschiedenste Ort der Welt. Seine Bewohner bewirtschafteten die umliegenden Eisenbäume, legten in deren Geäst ihre Felder an. Die Insel selbst war sehr klein. Niemals wagten die Einwohner sich in die tieferen Regionen des Eisenwaldes. Hier errichtete man Hängebrücken schon weit vor der Zeit von Hammeln, aber die besondere Technologie des Erbauens gelangte nie, auch nicht in der Zeit des Kontaktes, zu den Inseln des Mahlstromes.  [br] [br]', 1, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (65, '0000-00-00 00:00:00', 'de', 1, 'Mons Vulcanis', 'atlanticus', '[br][br]Der große Vulkan[br][br]Die Region um den große Vulkan, in der ruhigen Zone des Mahlstroms gelegen, war die Heimat der Quellfrösche und der Schmiede. Die Schmiede waren ein garstiges Volk von Doedels und Ratten, die sich mit ihrer unwirtlichen Umgebung arrangiert hatten. Sie stellten besondere Legierungen auf der Basis von Metallen und Silikaten her. Sie waren die Lieferanten für die Anker- und Halteketten der großen Hängebrücken von Drecksloch. [br][br]Bei den Quellfröschen wusste man nicht so recht, ob sie zu den Dämonen und Bestien gezählt werden sollten oder, ob sie nur eine absonderliche Form der heimischen Fauna waren.[br] [br][br]', 1, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (66, '0000-00-00 00:00:00', 'de', 1, 'Das Nebelmeer', 'nebula_2', '[br][br]Das Nebelmeer[br][br]Über die Entstehung des Nebelmeeres wusste man recht wenig. Der Nebel ragte an manche Stellen weit über die Höhe der Wolken hinaus. Das &#187;Meer&#171; lag in der Mitte des südlichen Seitenstromes des großen Mahlstroms. In ihm sollten viele unterschiedliche Dämonen gehaust haben, so unter anderem Rotstiere, Ungestalten, Lindwürmer und gefiederte Feuermolche. An einigen Stellen des Nebelmeeres wuchsen die Eisenbäume, deren Kronen bis unter die Zone der Wolken gereicht haben[br] [br]', 1, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (67, '0000-00-00 00:00:00', 'de', 1, 'Insulae Nordicus', 'archipel_1', '[br][br]Nördliche Archipele[br][br]Der Name die Nördlichen Archipele leitete sich von der Tatsache her, daß sie zum Lichterkranzfest am nördlichsten Punkt des Mahlstroms standen. Die Sprache des Norden wurde nahezu einheitlich auf allen Archipelen gesprochen. Daß Dreckloch, gelegen auf einem der vier Hauptinselgruppen, schon früh mit dem interinsularen Handel begann, mag diesen Zustand befördert haben. [br][br] [br]', 1, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (68, '0000-00-00 00:00:00', 'de', 1, 'Terrae Australis', 'archipel_2', '[br][br]Südliche Archipele[br][br]Man vermochte insgesamt 3 größere Inselgruppen auszumachen. Die Bewegungen der Länder erschienen erheblich angeregter, wenn nicht sogar heftiger als bei den nördlichen Gruppen. [br][br]In den späteren Jahren waren diese Archipele auch als die barbarischen Länder bekannt, weil sich die Gepflogenheiten und die Sprache sowohl von Insel zu Insel, als auch von denen des Nordens unterschieden. [br] Von einer dieser Länder stammte W.Schuettelbier.    [br][br]', 1, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (69, '2002-12-08 00:00:00', 'de', 1, 'Auch du, ...?', 'rattenzahn3', 'Dass das Leben kein Zuckerschlecken war, wusste der ehemalige Dorfvorsteher nur zu genau. In Rattenzahns Reich war niemanden ein Rosengarten versprochen. Er hatte aber erwartet, den Hammer zu spüren, würde eine kurze und schmerzvolle Angelegenheit werden. Er würde vielleicht als Blume oder Fisch wiedergeboren werde. Über solche Dinge würde Gottes Wille entscheiden. Doch was ihm widerfahren war, hatte er nicht erwartet. Nach dem Verhör hatte ihn Rattenzahn  alleine einen langen, dunklen Gang hinunter begleitet, der der Richtung nach, zum Rande der Insel führte. Rattenzahn schien nicht zu fürchten, dass er, der Dorfvorsteher, flüchten könnte. Aus irgendwelchen Gründen hatte Dorfvorsteher sich auch nicht gefürchtet. Er war sehr ruhig und gefasst gewesen, obwohl er sich dem Tode nahe wähnte. Jetzt verstand er das nicht mehr. Am Ende des Ganges öffnete sich dieser zu einem kleinen Raum, mit einer verschlossen, verriegelten und vergitterten Tür und einem sehr großen Gong. Rattenzahn hatte die Tür geöffnet, dahinter lag noch ein kleiner dunkler Raum. Der Herrscher teilte ihm, den ehemalige Dorfvorsteher, mit, von nun an sei er ein namenloser Niemand. Er möge seine Aufgaben und seine Familie vergessen, mit seinem vorherigen Leben abschließen und den kleinen Raum betreten. Rattenzahn hatte die Tür geschlossen, den Hammer geschwungen und der Gong erschallte. Der tiefe, dunkle Klang durchfuhr Mark, Beine und Glieder des Dorfvorstehers. Ihm schwanden die Sinne, vielleicht war er auch schon bewusstlos gewesen. [br][br]Dann war es wie ein heller Schein, das Licht durchflutete den kleinen Raum, und er der namenlose, ehemalige Dorfvorsteher, wurde nach draußen geführt. Im ersten Moment war ihm, als sei soeben gestorben und ins Sternenreich aufgestiegen. Später wurde ihm klar, er hatte festen Boden unter den Füßen. Ein alte graue Ratte, ihr Name war Kleementis, hatte ihn angesprochen, ihm erklärt, dass er noch lebe, und gefragt, wie es ihm ginge. Kleementis war der »Boss« im Kerker, wie Renatu, so nannte sich der ehemalige Dorfvorsteher jetzt, erfuhr. Kleementis, einst Führer von Rattenzahns Clan, galt unter den »Lebenden« schon lange als tot. Angeblich war diese Ratte Rattenzahns erstes Opfer in den unruhigen Zeiten der Einigung des Reiches. [br] [br]Der Renatu war nach Wochen immer noch erstaunt, über sein neues Leben, über seine Umgebung. Wer unter dem Sternenzelt hätte sich einen Kerker so vorgestellt. Unterhalb der Burg, verdeckt für jeden Einblick aus dem Reich, lag ein Dorf. Hier hatte Rattenzahn fast alle seine Opfer versammelt. Ratten und Hamster, die ihm Widerstand geleistet hatten, die sich aber immer schon Kluge und Gelehrte gewesen waren. Die Priester von unterschiedlichsten Glaubensvorstellungen mussten sich hier miteinander arrangieren, oder sich gegenseitig an die Kehle gehen. Ehemalige Häuptlinge von Rattenclans und solche von Hamsterclans bildeten einen gemeinsamen Rat.  Wer hier aber den Frieden anderer störte, der fand sich nun endgütig in den Tiefen der Klippen wieder. Man hatte dem Renatun die Käfige über dem See im Inneren der Klippe gezeigt. Jeder der im Reich die Ordnung gestört hätte, fand sich in diesem Dorfe wieder, um nach seinen eignen Vorstellungen glücklich zu werden, oder endgültig vom Leben Abschied zu nehmen. Erstaunlicher Weise kam man hier besser miteinander zu Recht, als in den Grenzen des Reiches. Das Dorf hatte eine eigenes Badehaus, die besten Laboratorien, ein eigene Bibliothek, auch Rattenzahn benutzte sie, einen Park und erdenkliche andere schöne Gebäude. Nirgends sah der Renatu aber Felder für Getreide. Das Dorf wurde vom Reich versorgt, aber Rattenzahn herrschte hier nicht. Eigentlich sah das Dorf wie ein großer Garten aus, ein Rosengarten. [br][br]Derweil lies Rattenzahn das Grenzdorf wiederaufbauen und auch noch befestigen, zog kampfkräftige Ratten und Hamster ein und bildete eine neue Truppe aus, um gegen die Barbaren ins Feld zu ziehen. Jacub unterwies er in der Führung des Reiches. Er sollte in seiner Abwesenheit die Verwaltung übernehmen. Jacub aber war anfangs alles andere als erfreut über die große Aufgabe. Er wollte als junger Heißsporn unbedingt mit auf den Feldzug. Manchmal verstand Rattenzahn einfach diesen Hamster nicht. Sein Kind, seine Erziehung, und doch manchmal so unverständig, störrisch und bockig. Krieg war Rattenzahns Überzeugung nach stets nur das letzte, allerletzte  Mittel. An Kämpfen war nichts heroisches, auch wenn er sich einen anderen Ruf erworben hatte. Zu Guter Letzt hatte Jacub doch seine Rolle angenommen. Nun konnte der Feldzug beginnen. Die Zeit wurde knapp, der Barbaren Herr zu werden. Bald würde es Frühling werden und damit Zeit für die Aussaat. Damit würde ihm nur noch die Hälfte der Truppen zur Verfügung stehen.   [br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (70, '2002-12-15 00:00:00', 'de', 1, 'Auch du, ...?', 'rattenzahn4', 'Von der Brüstung aus hatte Jacub den Abmarsch der Truppen beobachtet. Sein Wohlverhalten seinem Elter [2] gegenüber, hatte ihm die Chance, dass Reich vorübergehend zu führen, eingebracht. [br][br]Doch sein Innerstes brannte lichterloh vor Ehrgeiz. Seiner Überzeugung nach, hätte er selbst den Feldzug führen sollen. Was wusste Rattenzahn schon über die Geschichte des Grenzlandes, wie  ahnungslos war die alte Ratte über die Vorkommnisse dort. Wofür hatte er einen geheimen Spionagedienst eingerichtet, um an Nachrichten zu gelangen, die im Reiche nicht bekannt waren, wenn er diese Informationen jetzt nicht nutzen konnte. Rattenzahn würde direkt zum Grenzdorf ziehen. Jacub kannte einen anderen Weg. Niemand war besser geeignet, jetzt diesen Feldzug zu führen, als er Jacub, Adoptivkind des Hammers. Ihm hätte es gebührt, sich als würdiger Nachfolger zu beweisen. Nun heimste der alte Herrscher wieder den Ruhm des Kampfes und der Siege ein. Langsam, da war sich Jacub sicher, wurde diese alte Ratte weich, nachgiebig, nachlässig, vertrauensseelig und senil. Schließlich vertraute Rattenzahn ihm, Jacub, die Geschäfte des Reiches an. Das würde er büßen. Alle würden dafür büßen,. Alle würden seinen gerechten Zorn zu spüren bekommen.[br][br]Am Abend ließ Jacub als erstes die beiden Gefängniswärter öffentlich hinrichten. Sie hatten ihm nicht sagen können, wo die beiden langen Gänge im Inneren des Gefängnisses hinführten. Auch konnten sie nichts über den Verbleib des Dorfvorstehers aussagen. Jede weitere Nachforschung hatte ergeben, dass die Gänge blind endeten. Also hatte Rattenzahn nicht alles offenbart. Auf der Kanzel hatte Jacub die Hinrichtung auf dem Marktplatz genossen. Das Schweigen des versammelten Volkes und das Knacken der Schädel waren Musik in seinen Ohren. Er lächelte. Die lustigen Zeiten waren für das Volk vorbei. [br][br][br]Der Heereszug schob sich wie ein Lindwurm durch die Lande. Überall wo sie ankamen wurden sie ernsthaft, aber freudig begrüßt. Den Dörflern war die Lage nur zu bewusst. Freiwillig wurden die alten Eide erneuert. Einst hatte Rattenzahn in vielen kleinen Kriegen die Eide, die Einheit und das Ende ewiger blutiger Auseinandersetzungen erzwungen. Damit aber schuf er den Jahrzehnte währenden Reichsfrieden und diesen wollte keiner mehr missen. Handel und Wohlstand standen in Gefahr. Man wünschte dem Heer und seinem Herren Glück, denn man wünschte sich einen kurzen Krieg, einen großen, glorreichen Sieg. Und Rattenzahn trieb das Heer zur Eile, denn der Winter ging zu Ende und die Aussaat stand bevor.[br][br][br]So gelangte das Heer in das Dorf, der geschundenen Grenzregion. Dunkle Schatten hatten sich über das Land gelegt. Die Mühle brannte. Die Barbaren waren schneller gewesen. [br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (71, '2002-12-22 00:00:00', 'de', 1, 'Auch du, ...?', 'rattenzahn5', 'Die Palisaden,  sie waren allen strategischen und taktischen Erfordernissen nach geplant worden, waren an vielen Stellen eingedrückt. An einigen Stellen waren sie sogar durchbrochen. Rattenzahn wagte seinen Augen kaum zu trauen. Im Dorf standen drei Ruinen. In einer glimmte noch Feuer, die anderen schienen schon alt. Von irgendwo her krochen die Dorfbewohner her. Sie hatten sich Schutzkeller gebaut. Das sind kluge Leute, dachte Rattenzahn bei sich. Das Heer sicherte das Dorf und nahm seine Stellungen ein. Rattenzahn ließ die Dorfältesten und seine Hauptmänner zu sich rufen. [br][br]Die Berichte klangen kaum anders, als das, was er schon erfahren hatte. Dieses Mal allerdings waren die Barbaren in zwei Gruppen vorgegangen. Der Dämon hatte die kleinere Gruppe gegen die Mühle außerhalb geführt, der Barbarenhäuptling die größere mit den Schafen gegen das Dorf. Dreimal hatten die Barbaren im Schutze der Dunkelheit angegriffen, dreimal hatte man ihnen widerstanden, doch dann hatte der Dämon die Mühle geplündert und in Brand gesteckt. Immer noch töteten die Barbaren bevorzugt Ratten, aber inzwischen waren auch Hamstern bei der Verteidigung gestorben. Immerhin war es gelungen, drei Schafe zu töten. Rattenzahn sah sich die Beute an. Es waren wirklich Schafe. Die Palisaden würden einen weiteren Ansturm kaum standhalten, wenn eine wild gewordene Herde von einem Dämonen getrieben gegen sie stürmen würde.[br]Rattenzahn musste sich eine andere Strategie überlegen. [br][br]In dieser Nacht bleib es ruhig. Wohl möglich hatten die Barbaren mitbekommen, dass ein Heer im Dorfe lagerte. Rattenzahn ließ die Soldaten rund um die Uhr arbeiten. Die Palisaden wurden zu einem Teil weiter geschwächt, der andere Teil wurde verstärkt. Einen Teil des Heeres ließ Rattenzahn vor dem Dorfe lagern. Nun brauchte man nur noch lange, schwere Piken, die drei Hamster und Ratten halten mussten. Am Morgen schickte Rattenzahn Läufer in Gruppen aus. Sie hatten die Aufgabe, das Lager der Barbaren zu finden. Alle waren sicher, dass sie noch in der Nähe vor den Klippen lagerten. Man durfte ihnen keine Zeit geben, eigene Pläne zu schmieden. Einmal noch mussten sie das Dorf noch angreifen, darum zog sich ein Teil des Heeres zurück. Im Schutze der Nacht würde es das Dorf umgehen. Nun war Rattenzahn für die Schlacht gegen die Barbaren bereitet.[br][br]Die Barbaren reagierten, wie erwartet. Die Läufergruppen hatten schon lange den nahenden Feind gemeldet, weit bevor man ihn im Dorfe ausgemacht hatte. Eine kleine Truppe Rattenzahns hatte sich vor der Palisade aufgebaut. Hier würde sie keinen Ansturm überstehen und tatsächlich stürzten  sich die Barbaren auf die Truppe. Die wilde Horde trieb die Schafsherde direkt auf die geschwächte Palisade, die sofort nachgab und als baldigst zusammenbrach. Der Dämon hielt sich im Hintergrund. Er rief in dumpfen, unverständlichen, lauten Worten Befehle die scheinbar befolgt wurden. Die Schafe brachen durch. Doch die Barbaren erlebten eine böse Überraschung. Denn während die Schafe weiterhetzten durch ein Tor mitten im Dorf auf die verstärkten und erhöhten Mauern zu. Die Tore schlugen hinter den Schafen zu, von den Seiten schoben sich schwer bewaffnete Soldaten zwischen das Tor und die Horde. Die Barbaren waren von ihrer stärksten Waffe den Schafen abgetrennt. Der Dämon brüllte, gegen ihn rückten die Lanzenknechte vor. Der Dämon wurde zurückgedrängt. Wendet er sich einer Gruppe zu, stachen die anderen auf ihn ein. Er gelangte nicht zu den Barbaren. Verwundet wendete er sich  zur Flucht und da er schnell war, entkam er bevor die Truppe, die das Dorf umgangen hatte, ihn abfangen konnte. Doch die Barbaren mussten sich nun von zwei Seiten bedrängt dem offenen Kampfe stellen. Dreihundert Hamster und Ratten schlugen aufeinander ein, doch der Barbarenhäuptling fand schreiend vor Wut keinen Gegner. Niemand wollte sich mit ihm schlagen. Rattenzahn hatte bisher noch nicht in den Kampf eingegriffen. Nun erhob er sich, schulterte den Hammer und schritt dem Häuptling entgegen. Der Barbarenhäuptling hörte auf zu schreien, der Kampflärm ebbte ab. Alle starrten auf die beiden Kontrahenten. [br][br]Eigentlich war die Schlacht für die Barbaren verloren. Rattenzahn hätte sich nicht dem Zweikampf stellen, sondern nur noch warten müssen. Doch dies war die schnellste Art die Schlacht zu beenden.[br][br][br]Aug in Aug standen sich der Häuptling und Rattenzahn gegenüber. Der rote Umhang Rattenzahns wölbte sich im Wind der Stille wie eine dunkle Ahnung. Ein letztes Durchatmen, schon stürzte der Häuptling auf Rattenzahn zu. Der Häuptling holte mit dem Schwerte aus, gleich würde der Streich Rattenzahn treffen, doch in diesem Momente schlug Rattenzahn mit dem Hammer zu. Er schlug auf das Schild. Der edle Schild zersprang unter der Wucht in zwei Teile. Der Häuptling aber stolperte, ihm entglitt sein Schwert, er fiel. Rattenzahn aber ließ den Hammer durchschwingen. Dann trat er vor, setzte seinen rechten Fuß auf das Brustharnisch des Häuptlings, den Hammerkopf stellte er auf dessen Schwerthand ab. Der Häuptling stöhnte auf. Die Schlacht war beendet. Die Barbaren ließen ihre Waffen fallen.[br][br] » Der Hammer. Es lebe der Hammer! « [br][br]schallte ein Ruf aus vielen Kehlen über das Schlachtfeld. Immer wieder und immer lauter. Die schlimmste Gefahr war gebannt. Nun konnte die Aussaat beginnen. Doch Rattenzahn wusste, noch wartete eine Aufgabe auf ihn.    [br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (72, '2003-01-01 00:00:00', 'de', 1, 'Über Drachen', 'drachen', '[br][br]Wissenswertes über Drachen[br][br][br]Über die Herkunft der Drachen&media=9'',400,300)">[media] wußte man wenig. Sie waren einfach vom Anbeginn des &#187;Zweiten Zeitalters&#171; da. Ihre Hauptnahrung bestand aus den Ingredientien der Sümpfe, also viel Wasser, Pflanzen und gelegentlich einem Fisch. In ihrem ballonartigem Magen wurde das ganze zu viel heißer, brennender Luft vergoren. Am Anfang begnügten sie sich damit, sich wie Wolken dahintreiben zu lassen, den ihre Verdauung bescherrte ihnen genügend Auftrieb. [br][br]Wie bereits gesagt, wußte man über die Herkunft der Drachen wenig. Ebenso wußte man so gut wie Nichts über ihre Fortpflanzung. Zwar war bekannt, daß die Drachen gelegentlich Brutgelege behütteten, niemand konnte aber sagen, ob es sich dabei um ihre eigenen handelte. Selbst sie wußten nicht, was sie da gerade ausbrüteten. Drachen in Brut waren sehr leicht reizbar. [br][br]Von den alten Drachen sagte man, daß sie besonders höflich waren. Unter den Doedels und Ratten waren sie zeitweise als &#187;Ohs&#171; bekannt. Die Beobachtungen ergaben, daß jüngere Drachen zunehmend unfreundlicher wurden, auch wenn sie sich den Doedels gegenüber immer noch gesellig gaben. Außerdem bevorzugten jüngere Drachen andere, schnellere Bewegungsformen. So nutzten sie das Austoßen heiser Luft zur Fortbewegung. Sie steckten sich ihre Ziele immer höher, bis in die Fernen des Alls. Die Doedels sagten, die jungen Drachen seien gewillt, das Auge der Weisheit erblicken. Die jungen Drachen waren vom schlanken Wuchs und zu meist kleiner als ältere. [br][br]Die Jüngsten aller Drachen, also jene gegen Ende des &#187;Zweiten Zeitalters&#171;, neigten zu birnenförmigen Körpern und waren wohl auch die größten Drachen der Welt und aller Zeitalter. Sie konnte durchaus mehr als einen Kopf haben. Das war zu jenen Zeiten alles andere als selten. Die jüngsten Drachen waren wahre Himmelsstürmer. [br][br]Drachen hatten durchaus die Neigung von Zeit zu Zeit mit Doedels zusammen zu leben. In Drecksloch kannte man die Drachenreiter. Hier gab es sogar eine Drachenflugschule. In dieser Regionen folgte man der Geplogenheit, in der schwarzen Arena den Konzerten der berühmten Village Vanguard Boys zu lauschen, einer Teenypopgruppe singender Drachen. Anderseits schienen Drachen und Dämonen gemeinsame Nachfahren zu haben, die gefürchteten Drachenlords. Drachen und Drachenlords konnte man nur schwer unterscheiden. Ganze Heldenscharren bemühten sich der Landplage der Drachenlords Herr zu werden. Dabei haben die Helden offentsichtlich den einen oder anderen allzu unfreundlichen Drachen gleichfalls beseitigt. Andere, die sich nur für Helden hielten, machten diesen feinen Unterschied überhaupt nicht. Dachten diese Doedels und Ratten doch, daß Drachenlord die Bezeichnung für diejenigen Helden sei, die sich als Bezwinger von Drachen erwiesen hatten. Nebenbei bemerkt, schienen solche Umstände die Erklärung dafür zu sein, daß Drachen immer unfreundlicher, misstrauischer und weniger zahlreich wurden.[br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (73, '2003-01-26 00:00:00', 'de', 1, 'Die Kleine Ratte', 'lepetitrat', '[br]Die Kleine Ratte [br][br]Le Petit Rat[br][br][br]Da stand Sie nun der Küste des Landes. Ihr war bewusst, daß man das Land durchaus auch eine Insel nennen könnte. Die Doedels nannten Länder so. Immer wenn sie an die Doedels dachte, dachte sie an den einen.[br]Sie schaute in die Ferne und dachte an Ben. Sanft wurden ihre Gedanken unterbrochen. Ihr Schaf Dunkelhaupt stupste der kleinen Ratte in den Rücken. [br][br]Seit sie von der Expedition nach Hause gekehrt war, hatten die Ratten das Reiten gelernt. Peirät hatte es ihnen beigebracht. Er sagte, einst hätte man auf Pferden geritten. Die kleine Ratte hatte kichern müssen&fn=0'',300,200)">[0]. Bis dahin dachte sie Pferde wären nur eine Legende. Aber das waren Schafe und Drachen auch gewesen, bevor sie welche entdeckt hatten. Peirät hatte lange überlegt, wie man die Schafe reiten könnte. Am Ende hatte er ein altes Buch über das Reiten entdeckt. Es war dünn gewesen, sehr schlecht gebunden und hatte einen verrückten Titel. Blase, dämonenartige Gestalten ritten darin auf etwas, was in den Texten als Pferd bezeichnet wurde. Peirät entwarf einen Sattel und Zaumzeug für die Schafe. Dann begannen sie in ihrer Herde nach den geeigneten Schafen Ausschau zu halten. Allerdings fanden nicht sie die Schafe, sondern die Schafe fanden sie. Dunkelhaupt hatte die kleine Ratte erwählt. Peirät wurde von einem jungen Bock mit geraden kurzen Hörnen und zottigem, bräunlichen Fell ausgesucht. [br][br]Dunkelhaupt hatte die kleine Ratte lieb. Das wusste die kleine Ratte. Sie streichelte ihrem Schaf über die Nase. [br][br]Die kleine Ratte war nie wieder zur Schule gegangen. Statt dessen hatte Peirät sie in das Labor gerufen. Sie hatten die auf Blätter und Baumrinde gezeichneten Karten ausgewertet. Dann und wann brach Peirät zu neuen Expeditionen auf und immer nahm er die kleine Ratte mit. In dieser Zeit hatte die Ratte viel gelernt. Die Ratten hatten eine feste Verbindung zu einer Nachbarsinsel aufgebaut. Auf die Insel hatte man ein weiteres Dorf errichtet. Dort wurde die Schafsherde versorgt. Peirät hatte sich zu Letzt ganz der Schafszucht verschrieben. Das Labor wurde inzwischen von einem Gremium der Assistenten geführt, seine Bücher und die Expeditionen hatte er der kleinen Ratte anvertraut. Peirät war sehr alt geworden. Er hatte inzwischen ein schneeweißes Haupt. Die Ratte wusste was Schnee war. Sie selbst hatte das gefrorene Wasser auf den Gipfel der höchsten Berge einiger Länder entdeckt. Nicht jedes Land hatte so hohe Berge. [br][br]Nun stand sie hier am Rande des Landes. Nirgendwo von hier aus war Land zusehen. Dieses Land war schon jenseits der bekannten Länder, jenseits der verzeichneten. Sie stand auf der Klippe. Über ihr wölbte sich der Sternenhimmel, unter ihr wütete der schwarze Mahlstrom. Gelegentlich entfachte eine Feuer im Mahlstrom und ein funkelnder Stern antwortete. Noch nie hatte sie den Mahlstrom so deutlich gesehen. Die kleine Ratte brach die Beobachtung ab. Sie band Dunkelhaupt an einen Baumstumpf und nahm das Gepäck ab. Nie hatte sie sich wirklich an das Reiten gewöhnen können, aber als Lastenträger hatte sich Schafe als sehr nützlich erwiesen. Wesentlich schneller kam man auch reitend nicht voran. Die kleine Ratte bereitete ihr Nachlager. Am Lagerfeuer klappte sie das Buch, ihr Buch auf. Es hatte einen kostbaren alten, braunen Einband. Auf dem Buchdeckel waren Sterne, der Mond und die Sonne eingeprägt. Seit sie das erstemal den Kommentar auf Seite 513 entdeckt hatte, waren immer wieder neue aufgetaucht. Irgendwann hatte sie das Gefühl gehabt, sie müsse darauf antworten. Sie fügte dem Buch selber einen kleinen Kommentare hinzu, in denen sie Bezug auf die andere Bemerkung nahm. Am nächsten Tag hatte das Buch ihr geantwortet. So entwickelte sich ein Dialog zwischen ihr und dem Buch&fn=1'',300,200)">[1].    [br][br][br][br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (74, '2003-03-09 00:00:00', 'de', 1, 'Über den Wolken', 'zugvogel', '[br]Über den Wolken[br][br][br][br][br]Schweiß lief ihm über das Geschicht. Er legte sich mächtig ins Zeug, keuchte und stöhnte. Er zog so gut er konnte. Seine Kammeraden zogen mit. Zeit seines Lebens hatte er noch nichts anderes getan. Die wenigen Ruhepausen, die ihnen vergönnt waren, reichten gerade, um etwas Luft zu schnappen, Wasser zu trinken und den einen oder anderen trokenen Brotkrummen zu sich zu nehmen. Mehr war ihnen nicht vergönnt. Der Baron trieb sie  voran. Der Baron hatte es wie immer eilig. Seine Kammeraden und er waren schon blind vor Anstrengung, immer nur weiter und weiter, immer voran. Dieser Gedanken trieb sie, verengte ihren Blick. Er war noch nie dicklich gewesen, ein Fettpolster hatte er noch nie besessen. Er kannte sowas gar nicht, auch wenn der Gedanke an das Unbekannte sein Herz erwärmte. Er war rank und schlank, spindeldürr, wie seine Kammeraden. Die ganze Zuglast ruhte auf ihren dünnen, dürren Schultern. Schon als kleiner Zögling war er an diese Arbeit gewöhnt worden, kaum daß er groß genug gewesen war. Der Baron schrie, trieb sie an, [br] &#187;Faules Pack, nun fliegt dahin!&#171; [br], und unterstrich seine Worte mit der Peitsche, die donnernd über ihre Köpfe hinwegschnalzte. Elmare Goeswithewind zuckte nur kurz. Das war sein Leben und er war es nicht anders gewöhnt. Er war stolz darauf, denn er war ein Zugvogel.[br][br]Zeit war Geld und so schrie er wieder, [br][br]&#187;Faules Pack!&#171;[br]Es war nicht besonders einfalls-, aber sehr hilfreich. Das hatte ihm die Erfahrung gelehrt, wie er meinte. Er ließ die Peitsche über den Köpfen donnern. Die Vögel sollten sich nach unten orientieren. Ein Griff in die Zügel bewirkte ein leichtes Abschwenken nach rechts. Nun zog er mit der Ruderpinne nach und das Schiff begab sich auf den gleichen Kurs. Sein Ziel war eine kleine Insel rechts unten und sie hatten nur noch eine, vielleicht zwei Stunden bis zur Dämmerung. Danach noch zu fliegen, hieß sein Glück zu versuchen. Doch das Leben als Handelsbaron war ein hartes Brot, es war ein Spiel mit den Winden, auf und ab und jenen, die einen schneller vorwärts trieben oder direkt ins Gesicht bliesen. Ein Leben in harten Grenzen, an einem Seil unter einem Ballon, in engen Terminen, denn die Waren wollten rechtzeitig ausgeliefert werden. [br][br]Langsam zog das Schiff seine Kurven in denen es seinen Sinkflug beschrieb. Die Anker lagen bereit und Baron Lee ließ nur wenig heiße Luft ab. Auf einer Lichtung zu laden war stets ein heikles Unterfangen, selbst für einen erfahrenen Schiffersmann wie ihn. Die Vögel, dieses Lumpenpack, mussten mit voller Kraft nach unten ziehen, derweil er die Anker warf, den Wind ausglich mittels der Ruder und somit das Schiff zu Boden zwang. Eine letzte kleine Böe vor der Landung, bedeutete einen erneuten Versuch, ein weiteres Zerren an seinen Kräften und seinen Nerven. An die Vögel dachte er dabei natürlich nicht. Wenn man ihn gefragt hätte, er war Handelsbaron durch und durch, Inhaber eines Patents, stolzer Besitzer einer Montegolfiere, reich und wohlhabend. Er hatte es nicht mehr nötig auf solche Reisen zu gehen, hätte sich zu jeder Zeit niederlassen können und ein geruhsames Leben führen können, anstatt sich alleine auf die gefährlichen Reisen zu begeben. [br][br]Und er war Besitzer von zwölf lausigen Vögeln. Er reiste nur noch den Vögeln zuliebe. Er war ein wahrer Vogelfreund. Kurz gesagt, er mochte das Federvieh nicht. Statt dessen lies er wieder und wieder die Peitsche sprechen. [br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (75, '2002-12-29 00:00:00', 'de', 1, 'Auch du, ...?', 'rattenzahn6', '[br]Derweil hatte Jacub für reichlich Nachschub gesorgt. Niemand von den Dörflern, die die erhöhten Abgaben zu zahlen hatten, wagte es zu murren oder zu meckern. Jeder wusste, Jacub würde nicht nur mit dem Tode drohen. Einen Dorfvorsteher hatte er schon beseitigen lassen. Diese Ratte hatte es gewagt, über die Zahl des geforderten Säcke Mehl in kleiner Runde zu murren . Jacub hatte einen seiner Spione zum neuen Dorfvorsteher ernannt. Es war der Buchhalter des Dorfes. Der Buchhalter wurde nun vom Schuster bespitzelt, der Schuster aber von einem Jäger. Jacub hatte ihn neu angeworben. Es brauchte immer mehr als einen Spitzel, mehr als eine Quelle. Er traute niemanden.  Jeder wusste, Jacub würde bei dem geringsten Anlass die höchste Strafe vollstrecken. Man achtete ihn nicht, aber man fürchtete ihn. Es war das blanke Entsetzen, das herrschte. Die Dörfer sehnten Rattenzahns Regentschaft schon nach wenigen Tagen herbei. Jacub war sich seiner Sache aber sicher, die prompte Unterstützung des Feldzuges würde Rattenzahn gewiß schmeicheln. [br][br]Am Morgen nach der Schlacht zog der Siegesruf wie die ersten Strahlen der wärmenden Sonne durch die Gemüter der geknechteten Dörfler. Rattenzahn würde zurückkehren. Er hatte die Bedrohung des Reiches abgewehrt. Auf Geheiß von Rattenzahn wurden die meisten Barbaren nach Hause geschickt, auch wenn Rattenzahn nur zu genau wusste, daß auf der anderen Seite der Dämon noch über viele Doedels herrschte. Es war einfach unmöglich eine so große Anzahl Gefangener zu versorgen. Den Häuptling und die Edlen aber ließ er in Ketten legen. Er würde sie auf den Triumphzug mit sich führen und zur Schau stellen. [br][br]Die Ruinen wurden eingerissen, das Schafsgatter vergrößert und die Mühle wieder aufgebaut. In aller Heimlichkeit waren seine Späher den Barbaren gefolgt. Sollten sie sich bis zum nächsten Winter in Sicherheit wiegen, doch nun wusste er um den geheimen Weg durch die Klippen. Es waren sehr alte Wege durch ein Labyrinth einer Kerkerdimension. Selbst wenn die Grenzdörfler den gut versteckten Zugang gefunden hätten, sie hätten ihn nicht zu betreten gewagt. Am Eingang wurde eine Festung errichtet. Nun kontrollierten Rattenzahns Soldaten den Zugang zum Reich. [br][br]Doch in aller Stille hatte Rattenzahn den ältesten seiner Vertrauten, den alten Waldläufer zu Klementis und Renatu geschickt. Der ehemalige Dorfvorsteher hatte sich als klug, umsichtig und von hohem Verstande erwiesen. Er hatte es verdient, zu wissen, daß es seiner Familie gut ging. Auch brauchte der Herrscher den Rat der beiden.  Sie mussten in der Bibliothek nach alten Karten suchen, denn zu jedem Dorf führten geheime Wege durch die Kerkerdimensionen. Vielfach waren die Tunnel schon brüchig und drohten zu verschütten, aber warum sollte beide Labyrinthe nicht in Verbindung stehen? Wenn es einen anderen Weg zu der anderen Seite der Grenzklippen und ihrer unüberwindbaren Berge gab, dann würde Waldläufer ihn mit der Hilfe der beiden Ratgeber finden. Sie hatten jetzt fast ein ganzes Jahr Zeit den zweiten Feldzug vorzubereiten. Es stand zu hoffen, der Rosengarten könnte eine zweite schlagkräftige, kampferprobte Truppe zur Verfügung stellen und der Besitz der Schafe  sich als taktischer Vorteil erweisen. [br][br]Rattenzahn und das Heer kehrten unter dem Jubel des Volkes Heim. Freudige Rufe erschallten von allen Feldern, man bereitete die Aussaat vor, aus allen Häusern und Kehlen. Die gefangenen Edlen der Barbaren verfehlten ihre Wirkung nicht. Man hatte einen mächtigen Feind gemeinsam niedergeworfen. Jacubs Begrüßung viel verhaltener, würdig seines Amtes aus. Er hatte seine Sache gut gemacht, dachte Rattenzahn, hatte er doch nach eigenem Bekunden drei Verräter eliminiert. Der Nachschub war immer pünktlich geliefert worden. Rattenzahn überließ ihn von nun an zwei Dörfer zur Verwaltung bis zum zweiten Feldzug. Während dieses Feldzuges würde Jacub wieder das Reich führen. Er würde noch ein guter Nachfolger werden. Freilich hätte er gewusst, was Jacubs Lächeln wirklich sagte, er wäre umsichtiger gewesen. [br][br]Die Fackel von Jacubs Zorn waren noch lange nicht verraucht. Seine Seelenlandschaft glich einem Waldbrand, Erdbeben durchpflügte sein Innerstes. Nun hatte der alte Narr doch vom Land hinter den Klippen erfahren und auch den zweiten Sieg wollte die Ratte ihm stehlen. Sollte sie nur, es würde ihr letzter Sieg und ihre größte Niederlage.  [br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (76, '2003-01-05 00:00:00', 'de', 1, 'Auch du, ...?', 'rattenzahn7', '[br]Die Zeit zog ins Land. Die Aussaat war schon lange aufgegangen, der Buchweizen schon verblüht, die Obstbäume trugen reichlich Früchte. Die ersten Lämmer waren geboren. Es würde eine reiche Ernte werfen. Die Einwohner des Rosengartens hatten reichlich geforscht und gearbeitet, nachdem der geheime Rat der Weisen sein Einverständnis zum zweiten Feldzug gegeben hatte. Der Rosengarten rüstete ein zweites Heer aus. Kampfwagen und schwere Katapulte waren entwickelt worden. Mit den Schafen standen nun Zugtiere zur Verfügung. Der Herbst stand bevor und damit begann die Ernte. Die Barbaren hatten getrieben von dem Dämon einen Durchbruchversuch unternommen. Doch hatte Rattenzahns Soldaten ihn mit Leichtigkeit abwehren können. Sie hatten den Dämon abermals schwer verletzt. [br] [br]Die Späher waren bis tief in das Land der Barbaren jenseits der Klippen vorgedrungen. Das Dorf der Barbaren war gelegen zwischen zwei Ebenen, seitlich begrenzt von dem Fuße eines Berges und einem Sumpf. Es war kaum befestigt. Wenige Barbaren wohnten in Häusern, die meisten in Zelten und es waren viele Einwohner. Im ausgedehnten Sumpf machte der Dämon Jagd auf die dortigen Einwohner. Mehr als drei Tagesmärsche weit entfernt vom Dorf der Barbaren lag ein kleines Dorf von Sumpfratten. Freilich wussten sich die dort ansässigen Einwohner ihres langjährigen Peinigers zu erwehren. Auf Dauer aber zahlte man seine Tribut und an Frieden war nicht zu denken. In Verhandlungen fand Rattenzahn einen weiteren Verbündeten.[br][br][br]Das Herbstlaub fiel, der Winter nahte und immer noch hatten Waldläufer, Klementis und Renatu keinen zweiten Weg durch das Labyrinth gefunden. Rattenzahn und seine Berater planten für den zweiten Feldzug einen schweren Schlag durch das Labyrinth hindurch. Nichts hielt die Barbaren davon ab, die gleichen Abwehrmassnahmen zu ergreifen, wie seine Truppen. Um den Bewurf mit Steinen zu entgehen baute man bedachte Rollwagen. Doch der letzte Späher war noch unbehelligt durch den unteridischen Gang gelangt. Vielleicht waren all die Vorbereitungen überflüssig, denn es sah nicht so aus, als wenn das Dorf der Barbaren sich auf einen Angriff vorbereitete. Vielleicht vertrauten sie all zu sehr auf ihre Stärke. Rattenzahn wollte darauf nicht vertrauen. [br][br]Der Kundschafter, ein junger Doedel, hatte die Aufgabe mit den neuen Verbündeten, den Sumpfratten, Kontakt aufzunehmen und sie von dem Termin des bevorstehenden Angriffs in Kenntnis zu setzen. Ünglücklicherweise blieb die Rückkehr von Kundschafter aus. Waldläufer hatte es immer noch nicht auf gegeben, den erhofften zweiten Zugang zu finden. Doch was er fand, war sehr unerfeulich. Manchmal bedarf es das Glück eines Unglücklichen, um entscheidene Vorteile zu erlangen. Waldläufer fand in den Gängen des Labyrinths den schwer verletzten Kundschafter. Der junge Doedel wusste nichts zu berichten. Er konnte sich an nichts mehr erinnern. Doch Waldläufer konnte die Blutspur zurückverfolgen. Was er entdeckte war hinter einem Trümersturtz und einem Berg von Schafs- und Rattenschädeln gelegen die Höhle des Dämonen. Die Hindernisse hatten, wohl auch zum Glück aller Bewohner des Reiches, dem Dämon den direkten Zugang zu den Tunneln verwehrt. [br] [br]Weitere umsichtige Erkundungen ermöglichten Rattenzahns Heeren einen neuen Plan. Das Hauptheer, mehr als zwei Hundertschaften, würde durch die künstlichen Tunnelverlängerungen geschützt, wie schon geplant, gegen die Barbaren vorrücken. Heimlich hingegen und von allen ungesehen konnte das Heer des Rosengartens mit seinen erfahren Kämpen, den Katapulten und Kampfwagen direkt in die Höhle des Dämons durchbrechen, ihn überraschen und niederwerfen. 50 Lanzenknechte standen diesem Heer zur Verfügung. Von der dritten Seite würden auch noch die Sumpfratten gegen die Barbaren vorrücken. Besser konnte ein Feldzug nicht vorbereitet sein. Die letzten Funken schlugen in den Essen der Schmieden, die Soldaten waren eingekleidet und trainiert, die Zugänge zum Land der Barbaren waren gesichert. Langsam zogen die Truppen in ihre Bereitstellungsräume. Man wartete auf den dritten Tag des Winters. Es war der Tag, an dem  der Feldzug beginnen würde, die Gefährdung durch die Barbaren für immer zu beenden.      [br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (77, '2003-01-12 00:00:00', 'de', 1, 'Auch du, ...?', 'rattenzahn8', '[br]Am frühen Morgen jenes Tages fielen die ersten Schneeflocken. Über die Landschaft zog ein dünner, weißer Hauch. Der Atem schien zu gefrieren und in den beiden Tunnelgänge standen zwei Heere. [br][br]Das Reichsheer hatte schon in dem bekannten Zugang zum Lande der Barbaren genächtigt. Während die Sonne vorsichtig die ersten Sonnenstrahlen über den Horizont schickte und einzelne Wolken die Landschaft beschneiten, schickten sich Rattenzahns Männer an den Tunnel zu verlassen. Über zweihundert Mann begannen die künstlichen Tunnelstücken zu besetzen und zu schieben. Der künstliche Lindwurm begann sich Wagen um Wagen rumpelnd aus der Tunnelöffnung zu schieben. Ein Warnschrei ertönte, denn den Zufall konnte niemand planen. Ein Schafshirte und seine Gehilfen trieb gerade seine Herde verspätet von Wiesen in den Klippenbergen. Was konnte man anderes von Barbaren erwarten. Die Hirten hielten inne, bewarfen die Wagen von oben mit Steinen und erschwerten so den sicheren Vormarsch des Heeres. Das Land der Barbaren war nun schon alarmiert. Die Überraschung des Einmarsches war dahin. Als bald tauchten die ersten Barbaren auf, erst einzeln, kurz darauf begannen sie sich in Gruppen zu sammeln. Ihre Hörner bliesen Signale. Das Heer des Rosengarten musste noch mit dem Dämonen beschäftigt sein, wo bleiben die Sumpfratten? Also wies Rattenzahn sein Heer an sich auf einem kleinen Hügel zu formieren. Die Wagen wurden gerade rings um den Hügel als Barrikaden verteilt und umgeworfen, da brach der erste Ansturm auf sie herein. Von beiden Seiten wurden Schafsherden gegen die Barrikaden getrieben. Nur mit Mühe und Not konnten die Lanzenknechte die Herden zurück treiben und schon wieder rollte die nächste Welle heran. Die Barbaren schossen mit Pfeilen im hohen Bogen über die Sperren. Einige zogen sich halb auf die Schafe und versuchten mit dem so gewonnen Schwung die Barrikaden zu überwinden. Mit jedem Angriff, der abgewehrt wurde, wurde die Verteidigung schwächer und es folgte der nächste der nächste Ansturm. Leise fiel der Schnee, doch er vermochte die Spuren des Blutes nicht zu verwischen. Tapfer verteidigten Rattenzahns Soldaten, Leichen von Schafen, Barbaren, von Verteidigern lagen vor und hinter den geschwächten Barrikaden. Gegen Mittag schloss sich der Kreis des Todes um das sichtlich geschwächte Reichsheer, da hielten die Übermacht der Barbaren plötzlich inne. [br][br]Die Sumpfratten, die sich mit Rattenzahns Heer sich hätten vereinigen sollen, hatten inzwischen ganz andere Probleme. Nicht sie hatten sich nicht an den gemeinsamen Plan gehalten, sondern der Dämon. Vom Hunger getrieben, war er noch Nachts zum entlegenen Dorf der Sumpfratten aufgebrochen, als förmlich ihm sein Essen in die Arme lief. Den Sumpfratten blieb nichts anderes übrig, als in möglichst viele Richtungen zu fliehen. Sie versuchten den Dämon in Gebiete des Sumpfes zu lenken, in dem der schwere Dämon stecken blieb. Aber auch der Dämon kannte den Sumpf und er hatte schon immer Ratten gejagt. Wann immer die Sumpfler ihn entkamen, wusste er ihnen den Fluchtweg zu umgehen und schlug erbarmungslos zu. Er verschlang Ratte um Ratte roh. Als sich die Sumpfratten endlich in die Nähe des Barbarendorfes gelangten, beschloss die kleine Schar sich nun endlich zu wehren, denn sie hofften auf Verstärkung. Den Dämon, träge und müde durch die Jagd, verwunderte dies, war es doch nicht der Ort, an dem sich die Ratten hätten in Sicherheit wiegen sollen. So trug auch er seine Wunden davon und stürmte ins Dorf. [br][br]Das Heer des Rosengarten hatte sich bei Nacht durch das andere Labyrinth die an die Höhle des Dämonen herangeschlichen. Sie durchbrachen die Mauern, die die Höhle gegen den Tunnel verschloss und fanden die Wohnung des Dämons leer. Fünfzig Pikadöre und fünfzig Schwertkämpfer fanden kein Ziel. Ihr Plan den Dämon im Schlafe zu überwältigen, war gescheitert. Man hielt Rat, was zu tun sei, schickte Kundschafter und Waldläufer aus, um die Spuren des Dämons zu verfolgen, versperrte dem Dämon den Rückzug indem man den Zugang zu seiner Wohnhöhle verschloss. Kurz vor Mittag, der Schneefall war dichter geworden, hatte man die Katapulte gegen das Dorf der Barbaren in Stellung gebracht, als Waldläufer zurückkehrte. Die Sumpfratten bekämpften geradewegs auf der anderen Seite des Dorfes den Dämon, Rattenzahns Reichsheer war auf einem Hügel gefangen und Kundschafter versuchte zu ihm durchzubrechen. Klementis erkannte die Situation. Er befahl den Sturmangriff. [br] [br]Rattenzahn wusste die unerwartete Pause zu schätzen. Sie konnten einem weiteren Zangenangriff kaum mehr standhalten. Die Barrikaden würden zerbrechen. Von den Seinen konnten kaum mehr als die Hälfte noch Kämpfen und die anderen atmeten kaum, wenn sie noch lebten. Kundschafter war es gelungen an den Barbaren vorbei zum Hügel vorzudringen. So erfuhr Rattenzahn von der Gesamtlage. Er befahl den Verwundeten sich auf die Bergseite zu begeben, denn dort waren die Kräfte der Barbaren schwächer. Sie sollten, wenn sie konnten, so schnell wie möglich heimkehren. Mit dem Rest würde er in Kürze einen Ausfall auf das Dorf wagen. Noch war sein Heer mürrisch und kampfesmüde, doch da wies Ratenzahn auf das Dorf und schrie: [br][br]&#187;Seht, die Geister der Vorzeit sind auferstanden. Sie kämpfen auf unserer Seite. Vorwärts, der Sieg ist unser!&#171;[br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (78, '0000-00-00 00:00:00', 'de', 1, 'Gute Nachrichten', 'gutenachrichten_1', '[br]Von Eiern und anderen Dingen. [br][br][an''''he''hole''orld is egg!][br][br]Gute Nachrichten stinken immer [br][br][Good News always stink][br][br][br][br]Suchdireinengutennamenfürdiestadtaus&fn=0'',300,200)">[0] war genau das, eine Stadt ohne guten Namen. Man kann nicht behaupten, daß die Einwohner darüber sonderlich erfreut gewesen wären. Ganz im Gegenteil waren sie eher sauer, griesgrämig, missgelaunt und überaus herzergreifend unfreundlich. Der allgemeine Umstand, daß die Stadt schlecht roch, trug auch nicht zur Verbesserung der Stimmung bei. War man neu in der Stadt, ergab sich der Eindruck, der Geruch sei die Ursache für die Launen der Einwohner. War man hingegen schon länger in dieser Stadt, so bemerkte man die Umstände nicht mehr. Es sei hier betont, man hatte schlechte Laune. Es roch nach faulen Eiern in Suchdireinengutennamenfürdiestadtaus.[br]Solange man neu war, verstand man nicht, wie es zu den üblen Launen der Einwohner und dem strengen Geruch kam. Die Stadt lag schön in der Landschaft, umgeben von flachen Hügeln. Ein einzelner Fast-Berg, eine hohe Hügelkuppe, war die einzige und deutliche Erhebung in weitem Umkreise. Gärten und Obstplantagen umsäumten den Rand der Stadt. Solange man die Stadt nicht betrat, dachte man wäre in einem großen blütenreichen Park. Ein kleiner Fluss schlängelte sich am Rand der Stadt vorbei. Dadurch wurde der romantische Eindruck nur noch verstärkt.[br]Und selbst die Stadt vermittelte auf den ersten Blick, und auch auf den zweiten, den wunderschönen Eindruck. Die Strassen waren sauber gefegt, die Häuser stets gepflegt. Dies hielt bis zum ersten Atemzug. Niemand war nicht vorgewarnt! Die Bauern der Umgebung vermieden es die Stadt zu betreten&fn=1'',300,200)">[1], und sie sagtem jedem, ob gefragt oder ungefragt, man möge doch stehenden Fußes kehrt machen. Fragte jedoch der Angesprochene zurück, warum man das solle, so zuckten sie lediglich mit den Schultern. Und so kam es, daß hin und wieder  Reisende Suchdireinengutennamenfürdiestadtaus betraten. Aber dann machte man entweder stehenden Fußes kehrt, und zwar schnell, sehr schnell, oder man hatte dringende Geschäfte zu erledigen, wirklich dingende. Und die Stadt hatte einen Einwohner mehr. So kam es, daß die Stadt durch einen langsamen und bedächtigen Strom von Zuwanderern wuchs.  Die Städter waren wirklich ein eigener Schlag. Eher hoch gebaut und schmal, mit einer eindeutig anderen, dunkleren Hautfarbe, zeugten sie von einer langen und alten Abstammungslinie, die nur unterbrochen wurde durch die gelegentlichen Zuwanderer. Die im Umland ansässigen Bauern hingegen waren eher klein und untersetzt. Obwohl ihre Haut von der ständigen Arbeit auf dem Lande vom Wetter gegerbt wurde, waren sie hellhäutig. Echte Landeier. Zog es einen Städter von Zeit zu Zeit auf das Land, und das war notwendig, Bauern kamen wie gesagt nicht in die Stadt, so hielten sie sich in der Nähe von Jauchegruben auf. Sie hielten den Geruch zu Recht für streng, aber irgendwie wohlig verträut. Die Alleen von Obstbäumen durchwanderten sie schnell, zum einen weil es das Tempo der Stadt war, zum anderen&fn=2'',300,200)">[2], wegen diesem weichen, aromatischen, höchst verwirrenden Düften. So hatten die Dörfer im Umlande stets zwei Marktplätze, einen in der Mitte, wo man sich traf, tanzte und feierete&fn=3'',300,200)">[3], und einen außerhalb, bei der Jauchegrube, dort wo die Städter einkauften.[...][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (79, '0000-00-00 00:00:00', 'de', 1, 'Gute Nachrichten', 'gutenachrichten_2', 'Obwohl nur wenige Besucher bis in die Stadt kamen, und dort blieben, gab es mehr als einen guten Grund, sie aufzusuchen. Suchdireinengutennamenfürdiestadtaus war auf der Welt die wohl bekannteste Stadt. Sie hatte die größte, umfangreichste und einzigartigste Bibliothek der Welt. Sie war der größte Produzent von Nachrichtenteleskopen. Sie war die Stadt der höchsten Gebäude der Welt. Sie war die Stadt des Fast-Berges. Sie war die Stadt von Hans Magnus Alberts, des Bibliothekars. Wissen wurde in dieser Welt wirklich hoch geschätzt.[br]Hans Magnus Alberts war der Gründer der Bibliothek und der Erfinder des Nachrichtenteleskop. Im Fast-Berg hatte er seine erstes und einzigstes Teleskop gebaut. Alle anderen Teleskope wurden nach der Vorlage leicht abgewandelt in sogenannten Stall- und Kellerwerkstätten gebaut. Sie lagen alle an der Linsenstraße, die vom Stadtzentrum, der Bibliothek, in Richtung Fast-Berg verlief und dabei den Redwood, in dessen Mitte der Redhill lag, passierte. Der Redhill war ein gefürchteter Ort. In einer großen Schreibstube wurden dort die Betriebsanleitungen für die Nachrichtenteleskope geschrieben.[br]HMA pendelte jeden Tag von seiner Wohnung im obersten Stockwerk der Bibliothek zu seinem Arbeitsplatz im Fast-Berg. Dort wartete schon sein Assistent, William Hawk. Er hatte sein Leben ganz und gar der Erforschung des Fast-Berges gewidmet. Am Abend ging HMA verließ den Fast-Berg wieder. Er nahm einen kleinen Abstecher zum Redhill vor und informierte dabei den Leiter der Schreibstube, Stephan King, über die wichtigsten Neuerungen am Nachrichtenteleskop. Stephan King und William Hawk waren Zwillingsbrüder. Am Abend war er zu Hause, in der Bibliothek, wo er noch die neuesten Nachrichten aus vom Fast-Berg aus der Neu- und Vorzeit verkündete. Mit Spannung wurden dann die Nachrichtenblätter am nächsten Morgen gelesen.[br]Suchdireinengutennamenfürdiestadtaus wurde mit Recht das Zentrum der Welt genannt.[br]Um so mehr verwundert es, daß gelegentlich einige Bibliothekare die Stadt verließen. Sie wurden mit speziellen Aufgaben ins weite Land geschickt, gelegentlich sogar bis an den Rand der Welt. So jemand war Buzz Allesdrin. Er war an den Rand der Welt, dem Zusammenfluß des heißen und des kalten Stroms, gekommen, um von hier aus den Ereignishorizont zu beobachten. Der Zeit saß er vor einem seiner Nachrichtenteleskope. Es war jenes, mit welchem er die Verbindung nach Suchdireinengutennamen- fürdiestadtaus hielt. Er hatte gerade eine neue Linse eingebaut und versuchte nun die Betriebsanleitung auf das neueste Datum einzustellen. Zu diesem Zwecke hatte er die Betriebsanleitung der Schublade in der Verkleidung entnommen. Er übertrug die neuen Anweisungen aus dem Brief, der mit der pferdelosen Kutsche&fn=4'',300,200)">[4] aus Redhill gekommen war, auf kleine gelbe Zettel. Er legte die Zettelchen, wie er hoffte, an die richtigen Stellen im Buch ein. Die Buchstaben durften nicht zu groß und nicht zu klein geschrieben sein und keines Falls durften die Zettel verrutschen. An einigen Stellen hatte er das Gehäuse des Teleskops aufgeschraubt, Kabelverbindungen kontrolliert und Schrauben nachgezogen. Der Moiry begutachtete ihn aus dem Gehäuse heraus, wie ihm schien, sicher konnte man sich da nicht sein. Bedächtig klappte er das Buch zusammen. Er legte es in die Schublade zurück, schloss das Gehäuse und betätigte die kleine Startkurbel. Der Fächer am oberen Ende begann sich bedächtig zu bewegen. Er hörte wie der Moiry das Buch auf- und sofort zuklappte.[br]Ein rotes Lämpchen blinkte auf und ein dünnes Stimmchen wiederholte stoisch die Worte[br]&#187;Funktionstörung, bitte ausschalten!&#171;[br][br]Enttäuscht kurbelte er in die Gegenrichtung. Der Fächer stoppte.  Er öffnete die Schublade, nahm den Brief und kontrollierte die Anweisungen. Er grübelte. Immerhin war es möglich, daß zwei Zettel an der falschen Stelle lagen. Hatte er sich verschrieben? Nach einiger Zeit unternahm er einen zweiten Versuch das Buch einzulegen, dann noch einen und noch einen. Bis zum Abend hatte er das System wieder am laufen. Der Fächer wedelte, der Moiry summte fröhlich vor sich hin und ab und zu raschelte die Betriebsanleitung, wenn der Moiry in ihr las. Buzz war zu Frieden. Er gönnte es sich, den Wohnraum mit einem hundertjährigen Ei zu beduften, und atmete tief durch. Er war froh. Die Lieferung der Eier war mit der Kutsche mitgekommen und würde ihn für einige Zeit mit heimischen Düften versorgen. Morgen würde er sich dem Putzen der Linsen beim Multilinsenundmoiry- Teleskop zu wenden. Wäre diese Arbeit abgeschlossen, könnte er sich schon jetzt seiner eigentlichen Aufgabe widmen. Irgendwie bedauerte er es übermorgen nicht in Suchdireinengutennamenfürdiestadtaus zu sein. Es war das Datum des Jubiläums, HMAs hundertjährigen Neuerscheinens. Auf der anderen Hand war er froh hier am Rand der Welt, fern seiner Heimat zu sein, bot das Jubiläum doch die Möglichkeit einen wahren Ereignisschauer zu beobachten. Morgen noch die Linsen putzen und neu kalibrieren, dachte Buzz, bei sich, dann schlief er in seinem Armsessel ein. Träume umfingen ihn, derweil die Teleskope vor sich hinsummten. ', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (80, '0000-00-00 00:00:00', 'de', 1, 'Gute Nachrichten', 'gutenachrichten_3', '[br]Die Sonne schien mit einem brennenden Strahl durch das Butzenfenster auf Buzz hernieder. Er fühlte sich wie gerädert. Buzz räkelte und streckte sich. Als er endlich wahrnahm, daß die Sonne durch das Zwölf-Uhr-Fenster schien, wurde ihm einiges schlagartig klar: [br][br]Er hatte verschlafen. [br][br]Es war Mittag. [br][br]Er würde es heute nicht alle Linsen vom großen Teleskop putzen. [br][br]Er hatte keine klare Sicht auf alle über den Horizont tretenden Ereignisse. [br][br]Er musste sich einen Kaffee kochen. [br][br]Dringend, als aller Erstes, sofort nachdem er aufgestanden war. [br] [br]Also kochte Buzz sich einen Kaffee. Am Abend hatte er sich wenigstens einiger Maßen auf die kommende Nachschicht zum Jubiläum vorbereitet. Doch irgendwie gerieten die Dinge heute durcheinander. HMA erschien nicht neu. Er hatte sich gar nicht schlafen gelegt. Folgerichtig konnte er auch seinen Tod nicht verschlafen und neu erscheinen. Aber er starb auch nicht. Vielmehr war er nach dort gegangen, nicht zum Tod, sondern wo auch immer das sei. Es klopfte an der Tür, an der Tür des Beobachtungsposten am Rande der Welt, mitten in der Nacht.[br]Buzz öffnete die Tür. Da stand er, Hans Magnus Alberts, leibhaftig, draußen vor der Tür.[br]Buzz fiel in Ohnmacht.     [br][br]Die Sonne schien mit einem brennenden Strahl durch das Butzenfenster auf Buzz hernieder. Er fühlte sich wie gerädert. Buzz räkelte und streckte sich. Als er endlich wahrnahm, daß die Sonne durch das Zwölf-Uhr-Fenster schien, wurde ihm eines schlagartig klar: [br][br]Er hatte schon wieder im Ohrensessel geschlafen. [br][br]Dann fiel ihm ein kleiner gelber Zettel auf dem frisch gedeckten Mittagstisch auf. Daneben stand eine Pott mit heißem Kaffee. Aus dem Zettel stand in roten fett und großgeschriebenen Lettern:[br][br][br]JETZT LESEN[br][br][br]Führen Sie jetzt folgendes Update ihres Gedächtnisspeichers durch:[br][br]Ich war nicht hier. [br][br]Es ist nichts geschehen. [br][br]Ihnen geht es gut. [br][br]Putzen Sie die Linsen! [br][br]Schönes Jubiläum.[br][br]HMA  [br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (81, '0000-00-00 00:00:00', 'de', 1, 'Die Ratte und Ich', 'ratteundich', '[br][br]Die Ratte und ich[br][br][br]Das Gegenüber war ein kleines Wesen in einem zerlumpten Mantel und einem großen Hut mit breiter Krempe, welches es tief in Gesicht hängen lies. An und für sich war nichts besonderes an ihm, was als Umstand schon besonders in solchen Lokalitäten ist. Dort wo Helden sich treffen, sind laute Gespräche, Prahlereien, auffällige Kleidung, Reichtum, blinkende Rüstwerke, schwerste Schilde, auffällige Wappen, federverzierte Helme und Zöpfe, in die man die Köpfe der erschlagenen Gegner eingeflochten hat, wahrlich nichts Besonderes, sondern alltägliche Gewohnheit. Doch der Wanderer roch nicht sonderlich streng, verhielt sich nicht auffällig, auch drängte er sich nicht in irgendwelche dunklen Ecken. Er bestellte ein Bier, setzte sich nicht zu weit in den Raum, in dessen Mitte das unausweichliche einem seiner täglichen Höhepunkte entgegenschritt, legte seinen hölzernen Stock beiseite und schob die mehr praktische Kopfbedeckung eines Schäfers sanft nach oben. [br]Wer meint, daß so was keine Aufmerksamkeit verdiente, der irrt, aber die besonderen Dinge erhalten erst dann ihre in gebührende Aufmerksamkeit, wenn alles vorbei ist. Gunfried und seine Kumpane legten nach mühevollen Kleinholzhacken, so nett man in diesen Kreisen die Erschlagung von 17 Drachenfürsten auf einen Streich bescheiden, eine kleine Entspannungspause ein. Es war eine mehrtägige Feier, bei der ebensoviel Blut wie Wein und Bier fließt. Gunfried und seine Kumpane waren nicht mehr sonderlich aufmerksam. Das joviale Gegröle der Zechkumpanei, ihr neckisches Spiel, bei dem die Tat von Zeit zu Zeit nachgestellt wurde und jeder Zweifler zweifelsohne seinen vorzeitigen Abschied von dem Weltlichen nahm, steuerte mal wieder jener Szene&media=1'',600,400)">[media] in der Drachenhöhle entgegen, in dem der Held seinen letzten Versuch entgegeneilte noch mit heiler Haut zu entkommen, zuzustoßen, bevor der heiße Odem des Drachen der Drachen den Helden, Gunfried, gegrillt hätte, um einem kleinen genüsslichen Brathändel gleich in der Speisekammer des Drachen zu laden. Das wäre wohl auch so Gunfried wiederfahren, wenn er bei dem Kampf so getorkelt hätte wie jetzt. Mehrere Stühle entkamen mit letzter Mühe und Not dem Kampfgeschehen, indem sie zu Bruch gingen, ein Kumpan erklomm den Rücken des Drachens, einen hohen Tisch, um auf seinen Nacken einzustoßen, drei andere gedachten dieses aber verhindern, sie wollten nämlich ein gebratenes Schwein vor dem entgültigen Aus bewaren. Das ganze ähnelte weniger einen Drachenkampf, als einer komischen Inszenierung von Willicombaldus Schüttelbiers Tragödie &#187;Der Heilige Kampf Um Den Heißen Brei&#171;. Ohne weitere Umstände fiel der Stab um. Es entfuhr ihm ein flammender greller Strahl, der den Drachenkopf, dargestellt vom Schweinebraten, traf. Dieser war nun mehr kaum größer als eine Haselnuss, eine Wallnuss vielleicht, schwarz und sehr heiß.[br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (82, '0000-00-00 00:00:00', 'de', 1, 'Schuettelbier', 'schuettelbier_2', '[br]W.Schuettelbier kam in jungen Jahren nach Dreckloch und genoss an der dort ansässigen Akademie eine Ausbildung als Schreiber und Zeichner. Hernach nahm eine Stelle bei einer der vielen Tausch- und Austauschbörsen ngB an, wo er für Kapitänen und Handelsleuten Kontrakte und Dokumente verfertigte. Ein Kapitän forderte ihn auf, ihm eine Karte einer Schiffroute nach seinen mündlichen Beschreibungen anzufertigen. Diese Karte gefiel dem Kapitän so gut, daß er W.S. in seine Mannschaft als Schiffskontorist und Kartograph aufnahm. In diesen Zeiten war das durchaus noch nicht üblich. Es galt das Prinzip, weniger Mannschaft, weniger Unkosten, mehr Fracht, mehr Gewinn, den man möglichst auch nicht teilen musste. [br][br]Schüttelbier tat sich durch seine Karten so hervor, daß ihm der geschäftlich Erfolg erblühte. Andere Kapitäne kauften seine Karten und ließen ihn bereitwillig kostenlos mitfahren. Er schnappte die eine oder andere Geschichte und Legende auf. So nebenbei bereiste er die ganze bekannte Welt und auch einige unbekanntere Ecken. Nach den Jahren der Reisen, sichtlich gealtert und erfahren lies er sich wieder in Drecksloch nieder. Sein bisheriger Geschäftserfolg hatte ihm soviel Kapital eingebracht, daß er es gefahrlos investieren konnte. Er gründete die Zentralbörse aGuV, die die vielen kleinen Börsen mehr oder weniger vollständig überflüssig machte und in sich vereinte. Inzwischen hatte er soviel Erfahrung mit der Vermehrung des Geldes gemacht, daß er der Meinung war, er müsse dieses Wissen mit der Welt teilen. Er schrieb sein erstes Buch: &#187;DAS KAPITAL, Erwerb, Vermehrung und Hege&#171;. Auch dieses Buch&fn=5'',300,200)">[5] wurde, wen wundert es, ein geschäftlicher Erfolg. Das Schreiben lies ihn nun nicht mehr los. Es wurde zu seiner wahren Leidenschaft. Und so verfasste seine ersten Reiseberichte, angereichert mit einem umfassenden Kartenwerk, dem &#187;Interview Mit Der Geographie&#171;, dem Standartwerk der Geographie des Z.Z. . Entspannung suchte er in den vielen kleinen Bühnen. Meistens war dort eine Kneipe angeschlossen. Doch die dortigen Aufführungen waren selten von guter Qualität, und wenn sie von guter Qualität waren, fanden sie vor zu kleinem Publikum auf zu kleinen Bühnen in verrufenen Gegenden statt. [br] [br]Er lies sich ein eigenes Theater mitten in der Stadt in bester Lage bauen. Es hatte einen achteckigen Zuschauerraum, einen Orchestergraben und die modernste Bühnentechnik&fn=6'',300,200)">[6] der Zeit. Es war das Oktogon-X. Zunächst blieb der Erfolg aus. Die guten Stücke kannte keiner, die schlechten waren einfach nur schlecht. Im Oktogon-X erfolgte der Ausschank nur während der Pausen. Die schlechten Stücke hatte meistens gar keine. Also beschloss Willicombaldus Schuettelbier seinen guten Namen mit den guten Stücken zu verbinden und schrieb sie selber. Darauf trat der geschäftliche Erfolg in das Haus der hohen Künste mit reichlich Theaterdonner ein. W.S. schenkte uns so bekannte Stücke wie &#187;Himmelfahrt, Ein Komando&#171;, &#187;Der Heilige Kampf Um Den Heißen Brei&#171;, den Zyklus &#187;Der Ring Der Weisen&#171; und andere unvergessene Werke.', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (83, '0000-00-00 00:00:00', 'de', 1, 'Scharfe Schafe', 'scharfeschafe_1', '[br][br]Scharfe Schafe[br][br][.die Schlacht um Hammeln.][br][br][br]Das wohl bekannteste Ereignis im &#187;Zweiten Zeitalter&#171; war &#187;Die Schlacht Um Hammeln&#171;&media=3'',600,400)">[media]. Es lag wohl daran, daß die Zeitrechnung jener Epoche sich auf dieses Geschehnis bezog. Man rechnete im allgemeinen mit v.h., vor hammelnia, und d.h., de hammelnia. Eine auch häufig zu findende Zeitangabe war  i.d., irgendwann davor, wobei dann nicht unbedingt, aber durchaus in den meisten Fällen die Schlacht gemeint war. I.v.h., irgendwann vor den Hammeln, und nicht ii.v.h. , irrsinnig viele Jahre irgendwann davor, begab es sich, daß ein Doedel auf einem, seinem Berg saß. Es war der höchste Berg der Insula, von dem man den besten Rundumblick hatte. Über dem Himmel sah man die Sterne. Das war durchaus üblich, wenn nicht sogar komplett normal, denn die Insula befand sich schon ziemlich weit oben im Himmel&fn=1'',300,200)">[1]. Von dieser Stelle aus sah Benmea Talp auf viele andere Inseln herab, was nicht so zu verstehen sei, daß er hochmütig gewesen wäre. Er war eigentlich ein ganz netter Kerl. Er sah zu wenigen Inseln herüber. Das waren die Inseln, welche ungefähr auf gleicher Höhe waren. Solche Inseln waren aber schon ein wenig weiter weg. Auf einer dieser fernen Inseln meinte er etwas zu sehen, was er zuvor nach nie gesehen hatte. Es waren Blumen, weiße und große Blumen, und sie bewegten sich. Er schüttelte den Kopf. Da war ihm wohl die Höhe zu Kopf gestiegen, aber er sah die Blumen immer noch und sie bewegten sich. Auf keiner anderen Insel am Horizont oder in der Nähe hatte er je so etwas gesehen. Er beschloss den Berg hinabzusteigen und mit den Alten&fn=2'',300,200)">[2] darüber zu sprechen.[br] Auf einer andern Insel, jenseits, des Horizontes, saß eine kleine Ratte auf der höchsten Erhebung einer alten, sehr alten Ruine und las eine Buch. Besser gesagt, sie versuchte zu lesen. Irgendwie [br]war sie heute abgelenkt. Sie lies ihren Blick in die Ferne schweifen und träumte vor sich hin. Es wäre nur zu schön, wenn man mal in die Ferne reisen könnte, zu den Sternen oder in eines der fernen Länder am Himmel. Manchmal kamen einige Länder ja schon bedenklich nahe. Zu nahe, wenn sie sich auf gleicher Höhe befanden, standen sie in Gefahr zu kollidieren. Aber könnte es möglich sein, zu einem Land unterhalb zu springen? Die Länder tanzten einen gemächlichen langsamen Tanz am Himmel, mal auf und ab, mal zur Seite oder wieder zurück. Das war ein seltsames Geräusch. Sie hatte bei denen im Labor, wo die Alten arbeiteten, schon einiges über Himmelsmechanik gelernt. Da war es schon wieder. Ihre Alten, sie fühlte sich ihnen so fern, so fern, wie dieses Geräusch war. Da drüben tanzten kleine Wolken über dem Land. Da war ein anderes Geräusch, wo die Wolken tanzten. Sie schaute genauer hin, nicht über, sondern auf dem Land tanzten die Wolken. Manchmal kam das eine oder andere Geräusch von der Insel. Wenn ihre Eltern nur verstehen  würden, daß sie ihre eigenen Träume hatte. Das waren seltsame Wolken. Wolken, waren das nicht Tiere? Große Tiere mussten das sein. Das Land war doch so fern. Sie musste das jemanden im Labor erzählen, jemanden bestimmten. Sie klappte das Buch zusammen, nicht ohne sich zu merken auf welcher Seite sie war, stand auf und eilte davon.', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (84, '0000-00-00 00:00:00', 'de', 1, 'Scharfe Schafe', 'scharfeschafe_2', '[br]Bens Weg war lang, aber wider Erwarten des geneigten Lesers, nicht beschwerlich. Ein wenig musste er schon darauf achten nicht von der Klippe oder dem äußeren Rand zu fallen, denn es wurde allmählich später Abend, aber er kannte den Weg schon im Schlaf. Vom Fuße des Berges wandte er sich in die Inselmitte dem Dorfe zu an dem sumpfigen Teich vorbei, wo man gelegentlich einen Frosch, manchmal gar einen Fisch fing. Die Alten würden schon warten, ob er etwas neues zu erzählen hätte. Bens Aufgabe, als junger Spund, war es gelegentlich ein gute Geschichte zur allgemeinen Erbauung zu erzählen. Die Alten waren der Meinung, daß die Jungen noch mehr Phantasie hätten. Nun hatte er auch etwas zu erzählen, doch es war keine Geschichte, sondern die Wahrheit. Am Abendhimmel verglühte die Sonne, in der Tiefe glühte die Ferne, am Himmel erblühte der Silbermond. Am Dorfeingang stand schon der Älteste und grinste erwartungsvoll. Ben schüttelte den Kopf, er habe keine neue Geschichte, meinte er. Der Älteste zog ihn in das große Haus. Sein Blick war scharf, wie der eines Adlers und durchbohrte ihn fragend. Was sollte die Redewendung nur bedeuten? Selbst der Älteste konnte ihm das nicht erklären, und auch nicht der Bärtige. Der Weise mit dem Bart hielt es für eine interessante Frage, erörterte sie und kam zu dem Schluss, daß zuviel Wissen verloren gegangen sei. Der Älteste wandte sich seinen Webarbeiten zu, versponn Pflanzengarn und bespannte den Webrahmen.[br]&#187;Nun, was hast Neues zu berichten, Benmea Talp?&#171;[br]war die Frage des Bärtigen, gerade als Ben zum Schluss kam, daß es an der Zeit, sei mit der Wahrheit herauszurücken. Er hatte Acht darauf gegeben, daß die Alten es nicht für eine weitere gut erfundene Geschichte hielten.[br]&#187;Ein wenig ratlos bin ich. Ich sah etwas auf einer Insula, etwas, was ich nicht kenne. Es sah aus, wie sich bewegenden große, weise Blumen. Ich würde gerne wissen was es ist. Ich brauche Rat.&#171;[br]Ein Gemurmel erhob sich, Spekulationen wurden laut, ein Lob viel, das sei was Neues, ein geschickter Geschichtenerzähler sei er. Doch der Weise mit dem Bart hörte nicht darauf. Er lies die anderen reden. Von Zeit zu Zeit frage er dies und das, wie weit die Insula entfernt gewesen sei, wie die Blumen aussahen. Er fragte nah Details, stopfte sich seine Pfeife und schmauchte daran. Krautiger Geruch erhob sich, die anderen erzählten schon längst eine Geschichte von großen Blumen in sich wogendem Wind, doch er fragte immer wieder mal weiter. Spät am Abend nickte er. Es sei Zeit zu Bett zu gehen. &#187;Morgen gehen wir auf den Berg!&#171; meinte der Weise, &#187;und nun geh zu Bett.&#171;[br]Ben war schon müde, er tat, wie ihm geheißen.[br]Kaum hatte Ben die Augen geschlossen, da stand schon der Bärtige am Bett und rüttelte ihn wach. Die Sonne erhob sich gerade aus ihrem Bett am Firmament. Ben gähnte, der Weise zog ihn aus dem Bett, goss einen kalten Eimer Wasser über Bens Kopf. Schlagartig war Ben wach, er rieb sich noch mal die Augen, da war er schon angezogen und der Bärtige zog ihn aus seinem Zimmer. [br][br]&#187;Nimm den Knüppel mit dem Essen dran. Wir gehen heute auf den Berg. Pack dich und eile dich!&#171;[br][br]Der Weise war keinesfalls in Plauderstimmung. Aber Ben war schon wach, doch wurde er immer noch mehr geschoben als das er selber ging. Der Alte wollte wirklich keine Zeit verlieren. Das war erstaunlich. Es ging am Teich vorbei. Ben erholte sich, er führte den Weisen zum Fuße des Berges, von dort zum Rand und dann den gleich Weg hinauf, den er Gestern hinabgestiegen war. Dann und wann blieb der Bärtige stehen schaute hinaus und fragte Ben, ob die Insula schon zu sehen sei, und wo Sie ungefähr liege. Ben verneinte, doch die Richtung konnte er schon bestimmen. Der Bärtige war sehr aufmerksam, er betrachte auch alle Blumen und Sträucher am Wegesrand. Ihm fielen die Unterschiede zu den Blumen im Tal auf, neue Arten bestimmte er zielsicher in ihrer Zugehörigkeit, dann wandte er sich wieder um und trieb Ben an. Seinen Namen trug er wohl zu recht, dachte Ben, man nannte ihn den Bärtigen Weisen und selbst der Älteste fragte ihn um Rat. Auf dreiviertel der Höhe schien Ben es, als könne er die Insula schon sehen. Ein Stück des Weges war er sich seiner Sache sicher. Er sagte es dem Weise, der blickte in die Ferne und nickte. Ein Stück weiter nach oben müssten Sie schon gehen, von oben könne man am Besten sehen, beschlossen Sie gemeinsam. [br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (85, '0000-00-00 00:00:00', 'de', 1, 'Die Ratte und Ich', 'ratteundich_2', '[br]Der Wanderer sah nicht auf, beugte sich vorn über, und lehnte den Stab wieder sachte gegen die Wand. [br] [br]Für einen Moment herrschte eine Totenstille, die selbst Tote nicht vermocht hätten einzuhalten. [br][br]Es wären wohl nicht Helden anwesend gewesen, wenn nicht zwei der Kumpane Gunfrieds sofort auf den Wanderer zugestürzt wären. Gunfried selbst aber zückte sein Schwert um diesen Einhalt zu gebieten, und es wären wohl auch baldigst weniger Kumpane gewesen, die das Zechgelage hätten genießen können, wenn der Wanderer sich nicht unmerklich und bedächtig sich erhoben hätte, mit einer Hand Einhalt gebot und mit der anderen den Stab umschloss, welcher wohl so groß wie Gunfried selbst war, und somit größer als der Wanderer selbst. [br]Er hob ihn leicht vom Boden, und sah somit wie ein beherrschter und geübter Schäfer aus, der einer Herde wildgewordener Schafe das Zählen beibrachte. Sofort höhnte einer der Kameraden, welch ein lächerlicher Holzstab dies doch sei. Er eigne sich noch nicht mal dazu, ein gescheites Feuer zu machen. Der Stab war aus Holz, das war wohl zu sehen, aber später konnte man sich nicht einig werden, ob aus Zeder, Kiefer, Esche oder Eiche. Dunkles Mahagoni kam ebenso in betracht wie Pappelholz, Eibe oder Teak. Schaute man für eine Weile auf den Stab so war eben noch knorrig, dann ebenmäßig und glatt, Astlöcher wanderten auf ihm umher, die Fasern des Holzes schienen sich in wellenförmigen Bewegungen auf das obere Ende hinzubewegen, um sich dort zu einer kleinen metallene Spitze zu verdichten, der ein schwaches Glimmen, ein leuchtendes Feuer entsprang. [br] [br]Es geschah nichts weiter. [br] [br]Gunfried schob das Schwert wieder in die Scheide und setzte sich zu dem Wanderer an dem Tisch. Er bestellte einen weiteren Krug Bier und einen Braten. Gunfried schien schlagartig nüchtern geworden zu sein und schweigsam. Seine Kumpane nahmen die Drachentötung wieder auf, wo sie geendet hatte, und verlagerten das Kampfgeschehen in eine andere Richtung. Die Stimmung fing wieder an zu wabern. Helden sprachen, lachten, tanzten, rauften, prahlten mit ihren Taten oder waren einfach nur hungrig oder durstig. Gegen den späten Abend waren dann Gunfried und der Wanderer verschwunden. Sie hatten zwar ihre Zeche bezahlt, aber wann, daran mag sich keiner mehr zu erinnern. [br][br]Mit ihnen ging Gladiel das Flammenschwert. [br]Gunfried starb bei einen seiner letzten Abenteuer, er war wohl nicht mehr in Begleitung von seiner abendlichen und schweigsamen Bekanntschaft gewesen. Er brachte seiner Heimat und seinem Volke Ruhm, Ehre, Wissen und Reichtum, blieb dabei stets bescheidener, als er in jungen Jahren war. Vieles verdanke er seiner Begleitung, der Ratte mit dem Flammenschwert, jener machtvollen Gestalt, von der es heute nur noch heißt, sie sei ein Mythos. Dieser aber weiß davon zu berichten, daß sie, der Wanderer, das Feuer, das Lesen und das Wissen um die Magie in die Welt gebracht habe. überaus hilfreich und weise sei sie, vielen Helden habe sie das Leben bewahrt. Nur ein Mythos, so wird es gesagt, ich weiß, doch ich war dabei und haben den Wanderer gesehen. Und nun verzeiht, ich muss weiter auf meiner Suche, meiner letzten großen Reise. [br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (86, '0000-00-00 00:00:00', 'de', 1, 'Scharfe Schafe', 'scharfeschafe_3', '[br]Oben angelangt setzten sie sich nieder. Der Bärtige schaute in die Ferne und sprach leise mit sich selbst. Aus einer Tasche zog er einen durchsichtigen Gegenstand an einem Stiel. Um besser sehen zu können, meinte der Weise. Er schob das Glas vor seinen Augen hin und her. Hielt es mal weiter weg, dann wieder näher. Er erzählte Ben, was er sah, verglich seine Beobachtungen mit denen von Ben. Die Insula war bedeutend näher als Gestern. Ben war, als hörte er Stimmen aus weiter Ferne. Der Bärtige meinte, es seien keine Blumen. Das, was Sie beide sahen, müsste etwas sein, von dem er, der Weise vor langer Zeit nur Gerüchte weise gehört habe. Es seinen Tiere, Wanderblumen bestimmt nicht, aber bestimmt doch Tiere. Als Benmea fragte, was diese Tiere seinen, sagte der Alte nur, [br]&#187;Tiere.&#171;[br] [br]Benmea Talp war ernsthaft verwirrt. Was waren diese Tiere?[br][br]Der Weise Bärtige band das Essensbündel vom Knüppel, legte das Tuch zu recht und machte eine Feuer. Er kochte eine Gemüsesuppe. Gab Benmea ein Schüssel und einen Kanten Brot und teilte noch eine Räucherfisch. Dann nahm er sich selbst zu Essen. Sie diskutierten die Theorie der Tiere. Der Weise teilte ihm mit, was er unter Vorbehalt wusste. Sie erwogen das Für und Wider ihrer Theorie der Tiere, bis Sie sich sicher waren das es so sein müsste. Der Bärtige fragte, wie man wohl zur Insula käme. Ben meinte zu einer anderen Insula hinunterzuspringen und von dort aus wieder weiter, wäre ein möglicher Weg. Ben kannte die Choreographie der Inseln am Himmel schon recht gut. Der Alte schüttelte den Weg. Es sei ein zu gefährlicher Weg. Man sei nie sicher, daß man die nächste Insula erreiche. Der Weg sei zu lang und zu beschwerlich. Ein Einzelner möge das vielleicht bewerkstelligen, viele jedoch nicht. Das sah Ben ein. Sie erörterten diese Frage, allmählich fiel ihn nichts mehr ein was sie nicht wieder sofort verwarfen. Der Weise zog sich zurück, pflüge eine Blume und sog nachdenklich an ihrem Stiel. Ben schaute in die Ferne. Er stierte auf die Insula. Ihn hatte das Reisefieber gepackt.[br][br]Eine kleine Wolke warf ihren Schatten auf den Berg. Der alte Weise mit dem Bart säuselte vor sich hin. Er schlief. Ben sah angestrengt in die Ferne. Die Wolke sengte sich. Überraschen packte sie den Weisen, zog ihm empor in die Höhe. Erschrocken, nein, entsetzt, blickte Benmea auf, und sah eine Wolke wie er sie noch nie gesehen hatte. Die Wolke hatte Schuppen und war blassrosa. Sie krallte den Bärtigen fest in ihren Klauen. Ben schrie, schwang den Knüppel und warf ihn nach der Wolke. Er traf die Wolke nicht, doch der Knüppel traf den Alten an dem Fuß. Der, nun wach, regte sich und schrie vor Schmerz. Er zappelte in den Klauen der Wolke. Da ertönte eine Stimme, wie eine große, dunkle Glocke. [br][br]&#187;Oh, welch Verzückung. Es ist sprechendes Fleisch!&#171;[br][br]Ein großer Kopf neigte sich von der Wolke herunter und schaute mit einem großen Auge dem Weisen direkt ins Gesicht. Mit dem anderen erkundete er die nähere Umgebung und erspähte Benmea. Ben war nicht wohl. ihm zog sich Magen zusammen. Ihm wurde kalt. [br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (87, '0000-00-00 00:00:00', 'de', 1, 'Scharfe Schafe', 'scharfeschafe_4', '&#187;Oh?&#171;[br][br]stotterte der Weise mit dem Bart leise. Der Drachen lächelte? [br][br]&#187;Oh&fn=3'',300,200)">[3], ja , ich bin ein Drachen! Gestatten Sie mich vorzustellen? Mein Name ist Copernicus Vigilantes Johanniter Mongolfier.&#171;[br][br]fauchte der Drachen freundlichst derweil er zu Bergspitze zurück trieb. [br][br]&#187;Und wie sei Euer werter Name, wenn es gestattet ist?&#171;[br][br]&#187;Weiserbart Weisbart Weisdas nennt man mich. Und ich habe schon viel über Ohs, Drachen gehört, doch noch nie bin einem begegnet! Wenn ihr mich herunterlassen würdet?&#171;[br][br]Ben hatte noch nie Weisbarts vollen Namen gehört! [br][br]&#187;Oh, immer habt diese Eile. Aber natürlich gerne.&#171;[br][br]schmunzelte der Drachen bedächtig. Er schwenkte elegant, Ben wagte kaum seinen Augen zu trauen, über die Bergspitze hinweg und setzte dabei den Weisen Bart sanft ab. Dann erhob er seinen Kopf und blies mit einem lauten, dröhnenden Pfeifen heiße, feurigen Luft in den Himmel. Er, die Wolke, der Drachen sang herab, wurde dünner und dünner und lies sich auf seinem Schwanz und seien beiden Klauen nieder. Er wand sich wie eine ringförmige Schlange. Der Kopf neigte sich dem einen oder dem anderen zu. Doch stets ruhte eine Auge auf einem der Doedels. Ben zitterte wie Espenlaub, der Weisen Bart schien sich schon längst gefangen zu haben. Der Oh, der Drachen wandte sich ihm zu. Nichts schien Ben bis jetzt schlimmer, als daß das ein Auge eines Drachen auf ihm ruhte. Doch nun erschauderte er vor der ganzen Zuwendung der Drachen. Er blickte in zwei Augen, ihm wurde heiß und zwei Augen blickten auf ihn. [br][br]&#187;Oh, nun seid nicht bang. Euren Namen erführe ich auch zu gerne, werter Herr.&#171;[br][br]&#187;Gestatten, Benmea Talp!&#171;[br][br]entfuhr es Ben mit überraschend fester Stimme. Er brannte, ihm brannte die Kehle, [br][br]&#187;Wünscht Ihr etwas Wasser? Ich hätte gerne einen Schlug.&#171;[br][br]&#187;Oh, Danke, ja, gerne. Wie höflich Ihr seit!&#171;[br][br]Man teilte sich den Wassersack, das Restbrot und den Rest der Gemüsesuppe. Und so entbrannte ein langes Gespräch, im Laufe dessen die beiden Doedels erfuhren, daß die Wanderblumentiere, Tiere waren.[br]Doch nannte man sie Dollies. Der Drachen war auf dem Weg zu eben jener Dolly-Insel gewesen. Dort könne man als Drache gute Vesper halten. Mit vielen Ohs entschuldigte er sich immer wieder bei Weisbart für den Missgriff, ihn für ein kleines Häppchen zwischendurch gehalten zu haben. Man überlegte, wie die Doedels zu den Dollies gelange könnten. Die klügste Idee schien es große Körbe zu bauen, sich schlafen zu legen und sich so von Drachen zur Dolly-Insel tragen zulassen. Als C.V.J.M hörte, daß beim Dorfe eine Teich war, beschloss er, zu aller Überraschung, auch der seinen, hierbei zu helfen. Er selber würde bei diesem Unterfangen die tragende Rolle spielen. Es war schon spät, als sie sich auf den Weg hinab begaben, Drachen können im allgemeinen nur dann fliegen, wenn sie gut und reichlich gegessen haben. Der Drache wankte bedenklich am Rand entlang, und das eine oder andere Mal sahen Ben oder Weisbart ihn die Klippe hinabstürzen. Doch dem war nicht so, und so ernteten sie ein freundliches Augenzwinkern oder leise Oh-Lachen, wenn sie herbeieilten, um zu helfen. Drachen hatten einen fürchterlichen Watschelgang. Es war noch später am Abend, als sie das Dorf erreichten. Der Drache wurde bestaunt. Es war ein fabulöses Ereignis für das Dorf. Um so weniger war es erstaunlich, daß alle im Dorf dem Plan zustimmten. Der Drache begab sich zum Teich, um ein Bad zunehmen, er vesperte, die Doedels legten sich Schlafen. Sie versuchten es wenigsten, so aufgewühlt, wie sie waren. Am nächsten Tage brach man auf.', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (88, '0000-00-00 00:00:00', 'de', 1, 'Scharfe Schafe', 'scharfeschafe_5', '[br]Als die kleine Ratte nach Hause kam, war es noch nicht ganz Abend. Sie sprach ihre Eltern testweise an, ob sie noch in das Labor gehen könnte, sie habe einiges nicht verstanden und noch eine Frage, die man dort wohl zu beantworten wüsste. Ihre Eltern beharrten allerdings darauf, daß sie es erklären könnten. Die kleine Ratte überlegte sehr, um eine möglichst schwierige Frage über die Themen aus dem Buch zu stellen. Ihre Eltern versuchten eine verständliche Erklärung zu geben, doch die kleine Ratte blickte sehr angestrengt, fragend und bemüht. Ihre Eltern schüttelten den Kopf und schickten sie in das Labor. Sie solle sich aber beeilen. Außer Hauses atmete die kleine Ratte tief und erleichtert durch. [br][br]Im Labor angelangt ging sie schnurstracks auf Peirät zu. Der blickte sie verwundert an. Ohne auf eine Aufforderung zu warten, erzählte sie ihm, was sie gesehen hatte. Die umstehenden Ratten waren sauer über soviel ungebührliches Benehmen, doch Peirät blickte sie interessiert an. Er lächelte, blickte in die Runde und wies so die Anwesenden zu Recht. Peirat war nicht irgendwer, er war die höchste Autorität des Clans, der alte und vielgereiste Chef des Labors, der Herr der Bücher. Er hatte nur noch ein Auge, das andere war vernarbt. Er trug immer eine Lederjacke aus alten Zeiten. Alle anderen im Labor trugen weiße Kittel. Er forderte die kleine Ratte auf sich zu setzen und die anderen sollte zu hören, was sie beobachtet hatte. Sie begann noch einmal alles von vorne zu erzählen. An der einen oder anderen Stelle wurde sie unterbrochen und sie musste das noch einmal genauer erklären. Am Ende nickten alle. [br][br]&#187;Du hast Recht. Was du gesehen hast, sind Tiere, Schafe, um genau zu sein.&#171;[br][br]Peiräts Erklärung lief daraus hinaus das es nützliche Tiere sein und man sie holen solle. Zu ihrer Überraschung wurde sie, die kleine Ratte, gefragt, ob sie sich dazu schon eigene Ideen hätte. Das konnte sie nur bestätigen. Man müsse Seile zu nahe liegenden Inseln werfen und sich daran entlang ziehen. Die Laborratten bejahten, begannen aber sofort die Idee zu verfeinern. Man konnte Eisenanker biegen und an dem Ende des Seils befestigen. Damit war ein stabile Verbindung zu anderen Insel gegeben. Den Anker würde man mit einen Katapult herüber schießen. So konnte man größere Entfernungen überwinden. Jede Expeditionsteilnehmer müsste einen Gurt tragen und würde mit einem Seil gesichert. Peirät stimmte dem Plan zu. Gleich Morgen würde man aufbrechen, doch nun sei es Zeit für sie nach Hause zu gehen. Es war schon Abend, spät am Abend, nach der Essenszeit.[br]Ihre Eltern warteten schon am Eingang. Sie waren wütend. Sie hätte sofort wieder nach Hause kommen sollen. Keineswegs hätte sie im Labor herumtrödeln und die Nachtschicht von der Arbeit abhalten sollen. Das Labor sie kein Spielplatz. Die kleine Ratte vermochte nichts zu erwidern. Sie hatte einen Kloß im Hals. Zu allem Überfluss bekam sie auch noch Hausarrest. Sie wurde ohne Essen ins Bett geschickt. [br][br]Als ihre Eltern am Morgen zur Arbeit ins Labor gehen wollten, in dem Moment, in dem sie die Tür aufmachten, erschraken sie. Vor der Tür stand Peirät, und nicht allein. Eine Gruppe Laborratten, die eher aussahen wie Banditen&fn=4'',300,200)">[4], begleitete ihn. Aber keiner von ihnen trug weiße Kittel. Sie trugen alle praktische Kleidung und unübliche Sachen wie Seile, Haken, Stangen aus Metal, schoben Karren mit Proviant, Werkzeug und Baumaterial. Nicht alle Ratten kamen aus diesem Dorf. Man hatte offensichtlich in der Nacht noch Boten in die anderen Dörfer des Landes verschickt. Dies waren nur die Besten der Besten. Eine solche Abordnung hatte noch nie jemand in diesem Land gesehen. Noch zitternd klopften ihre Eltern an die Tür ihres Zimmers. Ohne jeden Vorwurf sagten sie der kleinen Ratte, Peirät selbst habe gesagt, sie solle mit auf die Reise. Die kleine Ratte war zunächst erstaunt. Damit hatte sie nicht gerechnet. Sie legte ihr Buch auf ihr Bett, zog sich feste Kleidung an und gab ihren Eltern einen Kuss. [br]  [br]Peirät hatte Kundschafter ausgeschickt, die beste Stelle für den Übertritt zu finden. Dort schlug man zwei Pfähle ein und sicherte sie. An diesen befestigte man jeweils ein Ende der Seile an den Pfählen, das andere Ende, die Anker, schoss man auf das andere Land&fn=5'',300,200)">[5]. Das Katapult war groß, doch lies es sich auseinander nehmen. Man zog an den Seilen, damit die Anker sich im Boden verhakten. Eine kleiner Trupp Arbeitsratten wurde hinüber geseilt. Diese sicherten das andere Ende mit Pfählen und dann zog man einen an Seilen hängenden Steg hinüber. Die Ratten bauten eine Hängebrücke. Gegen Abend hatte man das Katapult, den Proviant und alle anderen Ausrüstungsgegenstände zum nächsten Land geschafft. Man zog den Steg ein und löste die Seile. So näherte die Expedition sich von Tag zu Tag ihrem Ziel.   [br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (89, '0000-00-00 00:00:00', 'de', 1, 'Schöpfungsgeschichten', 'schoepfungsgeschichten', '[br][br]Schöpfungs Geschichten[br][br][br]Die Doedels erzählen eine andere Geschichte als die Ratten oder Drachen. Alle diese Geschichten die sich auf die Schöpfung beziehen stammten aus dem zweiten Zeitalter. Jede der Geschichten stimmt teilweise.[br][br]Bei den Drachen heisst die Schöpfungsgeschichte &#187;Alle Welt Ist Ei&#171;. Die Ratten erzählen sich die Geschichte &#187;Wie Das Wissen Aus Den Kerkerdimensionen Befreit Wurde&#171; und andere Geschichten. Sie, die Ratten, nennen das Ereigniss der Schöpfung die &#187;Geburt des Wissens&#171;.[br][br]Die Doedels betracheten den &#187;schlafenden Gott&#171; als Weltenschöpfer, ohne dabei zu wissen wer oder was der Gott ist. Auch kennen sie die Abkürzung G.O.D nicht. Statt dessen verehren sie den Stern am nächtlichen Himmel, welcher der G.O.D ist, als &#187;das wachsame Auge&#171;, welches in ihren mythologischen Vorstellungen der Begleiter Gottes ist. Jeder Schlafende, auch oder gerade ein Gott, braucht einen solchen Freund. Die Doedels bezeichnen die Schöpfung als &#187;Himmelsfahrt&#171;, weil sie vom Himmel herunterfuhren. Genaueres wissen darüber allerdings auch nicht. In späteren Zeiten, also so gegen Ende des zweiten Zeitalters, nannten Sie die Himmelfahrt oder die Schöpfung nur noch den Fall. Nur um dann zu erleben, wie dieses Zeitalter mit einem grossen Rums zu Ende ging. [br][br]Keine der Geschichten verzeichnet hingegen die historischen Tatsachen, so wie sie von den Moiry zusammengetragen und rekonstruiert wurden. Die Moiry berichten von drei bekannten Zeitaltern:[br][br]Das Zeitalter vor der Schöpfung wird als das &#187;Industrielle Zeitalter&#171; bezeichnet. Es ist nur wenig über dieses Zeitalter bekannt. Einzig die Moiry wußten, daß der G.O.D zu dieser Zeit gebaut wurde. Er diente ihnen im &#187;Zweiten Zeitalter&#171; als Behausung.[br][br]Im Zeitalter nach der Schöpfung ist die Welt der Doedels in tausende Stücke zersprengt. Viele Völker, Ratten, Drachen leben auf vielen Teilplanetoiden. Die Kerkerdimension entstanden offensichtlich nicht in dieser, sondern in einer früheren Zeit. Die Zeitrechnung der Epoche bezieht sich aber nicht auf die Himmelfahrt, sondern auf das erste allgemein bekannte Ereigniss der Geschichte, &#187;die Schlacht um Hammeln&#171;. &#187;n.H.&#171; heist also nach Hammeln.[br][br]Das dritte Zeitalter heist &#187;Nach Dem Fall&#171; (des G.O.D). Der G.O.D., oder was von ihm übriggeblieben ist, ist nunmehr als das Weltenei bekannt, oder auch der Weltendrachen. In ihm ist es möglich per Teleskop Nachrichten von zukünftigen, möglichen Welten und von vergangenen Welten zu empfangen. In diesem Zeitalter stellt man sich die Welt/das Universum als ein ringförmiges Band vor, das über eine Bruchstelle, den Ereignisshorzont verfügt. Tritt eine Ereigniss über diesen Horizont, so verdreht sich das Band um 180°Grad zufällig nach links oder rechts. So tritt ein Ereigniss entweder in eine alte, bekannte Seite der Geschichte ein, oder in eine komplett veränderte. Zwei Ereignisse die vorher zusammen gehörten folgen einander nie. Zu Anfang dieses Zeitalters haben die Weltenteile sich wieder zu einem ganzen Planeten vereint. Einige Teile werden aber durch Meere oder aber auch durch gigantische Lavaseen(Weltenbruch) getrennt.[br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (90, '0000-00-00 00:00:00', 'de', 1, 'Himmelfahrt', 'Von  William Vlad Schüttelbier MDBXXL', 'GOTT erwachte eines Tages aus einem tiefen Schlaf ,[br]schaltete das Licht an und sah:[br][br]nichts... [br][br]nichts geschah zu seiner Unterhaltung. Wie er sich so [br]langweilte, beschloss er ,dass es wieder Zeit sei, eine Welt [br]zu erschaffen, und es war die Welt der Rodents. GOTT sah [br]das es gut war und wunderte sich:[br][br]nichts... [br][br]nichts geschah für seine Unterhaltung. Erzürnt wollte [br]er schon die Welt zerstören, da kam ihm eine Idee. Es [br]wäre unter diesen Umständen klug eine neue Kreatur [br]zu erschaffen, und er erschuf die Hamster, indem er sie [br]vom Himmel fallen lies. Wie GOTT sein Werk betrachtete, [br]fand er, dass es gut war. Er beschloss das Ganze eine [br]Weile zu beobachten. Wie er so schaute wurde er langsam [br]aber sicher müde, denn es geschah: nichts... [br][br]nichts, außer, dass GOTT einschlief und ein Buch vom Himmel fiel... [br]Dort wo das Buch landete entstand ein Turm zu seinem [br]Schutze. Die Hamster kamen und bestaunten den Turm und [br]fanden, dass er gut genug war, um darin zu wohnen, enthielt [br]er doch interessanten Lesestoff. Wenn man nur zum lesen  [br]käme, dachten die Rodents, sie hatten so wenig Zeit, eine [br]solche Flut von Ereignissen überrollte sie: [br][br]Denn in jenem Momente, in dem das Buch die Erde berührte, [br]trennten sich das Gute von dem Bösen, verbreitete sich [br]das Wissen über die Macht in den Sphären der Welt, entstanden gute Bücher und böse, neue Lichtgestalten und [br]dunkelste Dämonen...[br][br]...und die Rodents waren ganz alleine. [br][br]...und GOTT schlief tief und fest den schlafe des Gerechten... ', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (211, '2007-06-06 11:48:00', 'de', 1, 'Ratte', 'Ratte', 'Ratte, die:[br]Eine weitläufige Bezeichnung für einen Roden der Rasse Ratte oder eines weiblichen Rodents.[br]Gelegentlich auch abfällig gemeint , "du, Ratte, du!", was aber durchaus zu Missverständnissen führen kann.[br]In Muddy Waters zB. wurde die Beleidigung die königliche Ratte zu einem Ehrentitel umgedeutet. ', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (91, '0000-00-00 00:00:00', 'de', 1, 'Aus dem Kerker', 'kerker', '[br][br][br][br]Aus dem Kerker[br][br][br]Dies sei, was ich ungl&uuml;ckselige Seele euch zu [br]berichten habe. [br][br]Einst war ich ein Held, gefeiert und umjubelt. [br]Doch ich greife der Geschichte vor. So h&ouml;ret nun: [br]Als Wanderer kam ich in jenes Land, fand den Pfad, [br]und schliesslich in die Stadt ... Stadt ... Stadt [br]konnte man das Kaff nun wirklich nicht nennen. Es [br]war einfach nur schrecklich, klein und einen Namen, [br]den hierzu erw&auml;hnen es sich nicht lohnt. Denn er [br]bezeichnet diese St&auml;tte der Ungl&uuml;ckseligkeit nur [br]zu trefflich. [br][br]Doch wohl seit gewahr: Es hatte einen K&ouml;nig, oder [br]zumindestens nannte er sich so. Er wusste um eine [br]schaurige Geschichte, die er nun jedem berichtete, [br]der sich dorthin, so wie ich einst, verirrte. [br]Die Pracht des Ortes sei l&auml;ngst vergangen, die [br]Untertanen entf&uuml;hrt oder geflohen. Der Rattenk&ouml;nig, [br]jenes Fabeltier h&auml;tte sie mit Hilfe der Wesen aus [br]den Kerkerdimensionen, verhext, und ihm, dem K&ouml;nig, [br]seine Krone gestohlen. Wenn einer es schaffte die [br]Stadt wiederherzurichten, die Untertanen zu [br]befreien und den Rattenk&ouml;nig zu besiegen, um die [br]Krone wieder zu beschaffen, so k&ouml;nne er die Krone [br]und das Reich behalten. Er hoffe nur, es gel&auml;nge[br]mir, damit seine Seele endlich zu Ruhe k&auml;me, denn [br]die schwere B&uuml;rde erdr&uuml;cke ihn. [br][br]Und so kamen all jene, die sich zum Helden berufen [br]f&uuml;hlten, um in einen Wettstreit um die Krone zu [br]treten. [br][br]Doch seit gewarnt, sonst endet ihr ... [br]wie  I C H ...[br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (92, '0000-00-00 00:00:00', 'de', 1, 'Regelwerk Königstunier', 'Regelwerk des königlichen Nachfolgeturniers  Ausgeführt von William Vlad Schüttelbier MDBXXL', 'Es sei Kundt getan,[br]Zwei Prinzen treten an,[br][br]Erwählen sich zwei Getreue,[br]Schreiten Zug um Zug,[br]Beweiset dabei Schläue,[br]Verloren der, der unklug.[br][br]Gelanget Ihr in ein Ecken,[br]Erwählet Pferd oder Stecken,[br]Bleibet das Andere über,[br]Hüpfe er schnell hinüber.[br][br]Einmal erwählt ist''s vergeben.[br]Beides zu erlangen ist''s Bestreben,[br]Wer nachzieht auf ein Feld,[br]Nun dieses in den Händen hält.[br][br]Und des Königs Steckenpferd,[br]Jenes Zeichen der Bürde,[br]Ist den Prinzen Welten wert.[br]So schlaget Euch mit Würde.[br][br][br][br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (208, '2007-06-06 11:06:48', 'de', 1, 'Rodent', 'Rodent', 'Rodent, der/das: [br]Allgemein übliche Bezeichnung für Hamster und Ratten im Zweiten Zeitalter. Der Ausdruck ist beliebt und geläufig, weil er Geschlechts unspezifisch ist. ', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (93, '0000-00-00 00:00:00', 'de', 1, 'Schuettelbier', 'schuettelbier', '[br][br]William Vlad Schuettelbier[br][br]Eine Biographie[br][br][br][br]Willicombaldus Schuettelbier&media=4'',600,400)">[media], Vielbereister, Schriftsteller und Geograph, Gründer des Oktogon-X Theaters von Drecksloch, wurde auf einem unbedeutenden Archipel des Mahlstroms geboren, der Saufenraufen-Gruppe. Dieses Archipel war nie für ihre intellektuelle Ausrichtung bekannt geworden. Vielmehr stand sie in dem Ruf, daß dort barbarische Sitten herrschen würden&fn=1'',300,200)">[1].[br][br]Drecksloch war selbst zu seiner Blütezeit nicht die größte Stadt des &#187;Zweiten Zeitalters&#171;. Sie war stets nur die Zweitgrößte, dafür aber die bekannteste. Drecksloch war die Stadt großer Geister, wie eben W.S., aber auch von Gunfried, der in Drecksloch geboren wurde. Die Stadt, und das Archipel, verdienten ihren Namen mit Recht. Zu keinem Zeitpunkt unterlies man es, etwas dafür zu unternehmen. Überhaupt waren sehr viele Unternehmer, Geldverleiher und andere, professionellere Banditen ansässig. [br][br]Es war ein reges Treiben und Handeln in den Straßen und Gassen der Stadt. Drecksloch hatte den größten Hafen der Welt. [br] [br]Das ganze Archipel war an die Kette genommen worden. Die Inseln waren fest miteinander verankert und mit Hängebrücken verbunden. Unter den Inseln wehte ein günstiger Wind, so daß man dort Windmühlen platziert hatte. In Drecksloch selber rußten die Schornsteine der Schmieden und Werkstätten. Den Namen hatte die Stadt und das Archipel allerdings aus anderen Gründen bekommen. Schuld daran war nur eine Insel, die man nie in den Verbund aufgenommen hatte. Sie sah aus wie ein gigantisches, überdimensioniertes Amphitheater dessen Mitte und offener Rand ein Sumpf bildete. Es war die Insula Dragonis&fn=2'',300,200)">[2]. Sie schwebte über dem ganzen Archipel. Hin und wieder schwappte die eine oder andere Fuhre muffiger Brühe über den Rand und fiel auf eine der Inseln. Das machte sie zwar besonders fruchtbar, aber auch furchtbar anzuschauen. Zu den Zeiten von Schuettelbier erblühte die Stadt mal wieder. Über ihr lag dieser besondere, nebelige Duftschleier des Erfolges. Die Flying Dragons, die beste Drachenflugstaffel der Welt, war auf der Insula Dragonis stationiert worden. Endlich hatte man seinem Leidwesen einer sinnvollen Nutzung zugeführt. Ja, gut, es war auch die einzige Drachenflugstaffel der Welt. Wahre Helden&fn=3'',300,200)">[3] ritten auf den pfeilschnellen Drachen jener Zeit und boten dem Schiffsverkehr Sicherheit und Ordnung. Nicht daß es Sicherheit und Ordnung nicht vorher schon gegeben hätte. Es war einfach nur gut zu wissen, daß sich ab jetzt jemand darum kümmern würde.[br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (160, '2007-05-16 15:56:47', 'de', 1, 'Einleitung', 'Einleitung', 'Es geschehen seltsame Dinge im Internet. Gerüchte, Halbwahrheiten und Wahrheiten, verschwiegene und offenbare, die keiner von uns zur Kenntnis nehmen mag, kusieren in diesem neuen Medium. Banale Erinnerungen tummeln sich neben neuesten Nachrichten, phantastische Geschichten mischen sich unvoreingenommen mit neuesten, wissentschaftlichen Erkenntnissen. Das Internet hat uns unerwartet ein neues Fenster, eine neue Tür, eine neue Sicht auf unserer Welt eröffnet. Ach was sage ich, nicht nur eine Tür, Türen sind es, Tore sogar. Aber nicht nur das: auf den Straßen des Internets tauschen wir uns weltweit aus.[br][br]Weltenweit wäre freilich genauer, denn seit geraumer Zeit, ich muss es gestehen und kann es doch selbst kaum glauben, stehe ich im Kontakt mit einem Wesen aus einer anderen Welt.[br][br][br]Über das Internet, und technisch vermag ich es nicht zu erklären, erhalten ich von Zeit zu Zeit neueste Nachrichten aus dem Dritten Zeitalter. Im wesentlichen, so wurde mir erklärt, befasst man sich dort mit der Erforschung des Zweiten Zeitalters. Das Zweite Zeitalter sei eine überaus interessanten Materie zur Erforschung und reich an Geschichten. Tatsächlich ist es auch das einzigste, was man  dort im DZ durch die Teleskope sehen kann.[br][br]Es scheint aber so, dass ein ungewöhnlicher Ausnahmefehler des Teleskops es dem Wesen, HMA von Namen, ermöglicht, sein Teleskop mit unserem Internet zu verbinden. So erhielt ich anfangs EMails von HMA, von denen ich zunächst dachte, es sei zwar bemerkenswert merkwürdige, doch unerwünschte Werbung. Schon auf die zweite EMail antwortete ich. Es war das Jahr 1997.[br][br][br]Wie ich von HMA nach einiger Zeit erfahren hatte, dachte (er) zunächst, unsere Welt sei das lange vermisste EZ. Eine Tatsache die ich mehr als beunruhigend empfand. Freilich führte eine Diskussion mit anderen Wesen aus dem DZ HMA zu der Erkenntnis, das unsere Welt lediglich möglicherweise und auch nur vielleicht das gesuchte EZ sein könne. Diese Erkenntnis vermochte mich allerdings nur ein Wenig zu beruhigen, aber immerhin, es schläft sich wieder besser und man gewöhnt sich an Alles.[br][br][br]HMA und ich vereinbarten also weiterhin in Kontakt mit einander zu bleiben, was sich durchaus als nicht immer einfach erwies und ich holte von ihm die Erlaubnis ein, "die Erkenntnisse des DZ über das Weltgeschehen des ZZ, mit besonderen Augenmerk auf die Enstehung von Letzteren", hier im Internet zu veröffentlichen.[br][br][br]Ich denke, es wird Sie interessieren.[br][br][br][br]Vorsicht:[br][br]Wenn Sie diese Seiten lesen, betreten Sie die Welt des Zweiten Zeitalters.', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (192, '2003-01-31 00:00:00', 'de', 1, 'Gunfried', 'gunfried', '[br][br]Gunfried Lehrjahre[br][br][br]Dereinst war einer Schäferfamilie ein Kindlein geboren und sie gaben ihm den Namen Gunfried. Es war ein guter Name für ein Kindl, denn er zeugte von Tapferkeit, auch wenn es dem Plan seiner Eltern nach Schäfer werden würde. Schäfer war ein überaus anständiger Beruf in Latifundien, einer Insel in den nördlichen Archipelen. Man konnte den Tieren durch die frische Luft hinterhergehen, wenn man Zeit dafür hatte oder es musste. Es gab immer frische, nahrhafte Milch zu trinken, man musste die Schafe ja nur melken. Warme Sachen zum Anziehen oder bestes, zartes Fleisch zum Essen, gehörten zum Lebensstil, falls es einem gelang ein Schaf zu überwältigen. Nun es sei hier noch einmal erwähnt, Gunfried war ein Doedel und Schafe sind größer als Doedel. Ihre Schulter sind so hoch, wie Doedel groß. Insofern war Tapferkeit eine durchaus erwünschte Eigenschaft bei Schäfern. Wer Schafe mal bei einer Schur beobachtet hat, weis warum. Oder würden Sie sich gerne schlachten lassen? [br][br]Gunfried wuchs also zu einem tapferen, kräftigen Doedel heran. Nur zum Leidwesen seiner Eltern zog es ihn in die frische Luft hinaus. Er trieb sich für den Geschmack seiner Eltern allzu häufig mit der Herden und ihren Hirten umher oder besuchte eine ältere, kleine Ratte, welche von Zeit zu Zeit seinen Eltern in der Milchwirtschaft zur Hand ging. Ein anständiger Schäfer lernte zwar sein Handwerk von der Pike auf, aber natürlich kümmerte er sich auch um die Buchhaltung, die Molkerei, die Webereien und des Weiteren um den Verkauf der erwirtschafteten Produkte. Nebenbei, Gunfrieds Eltern hatten mehr als eine Schafsherde. Sie hatten mehr als tausend Schafe. Man könnte es also durchaus für eine Untertreibung halten, wenn man sie als vermögend bezeichnet hätte. Sie waren so reich, wie es sich für einen Gutherren, Großgrundbesitzer und Schäfer gehörte. [br][br]Die Umtriebigkeit und der Freigeist ihres Kindes veranlasste Gunfrieds Eltern, ihn in eine höhere Schule nach Drecksloch zu schicken. Es war ein Ort der schon zu dieser Zeit den besten Ruf in den nördlichen Archipelen hatte, wenn es um die Ausbildung von Händlern, Buchhaltern und akademischen Landwirte ging. Genau das, Landwirt, sollte Gunfried nach dem Willen seiner Eltern erlernen. Zunächst studierte Gunfried auch ganz brav, aber alsbald hatte es ihm das Studium der Bücher der alten Heldensagen und der Rechtswissenschaften weit mehr angetan. Nebenbei erlernte er zur körperlichen Ertüchtigung das Kriegshandwerk.  [br][br]In den Strassen von Dreckloch tummelte sich zu allen Zeiten viel Volk. Gute und schlechte Doedel gingen geschäftig ihren Tätigkeiten nach. Manche stahlen, andere handelten, doch das Rechtswesen war zu Gunfrieds Zeiten ein Sache, die erst erforscht wurde. Es war ein junge Wissenschaft und praktische Anwendungen, wie etwa die Polizei, gab es noch nicht. Gunfried wohnte, wie es sich für einen Studenten von weiter Ferne gehörte, in einer der entlegeneren, engen und dunklen Seitengassen, in denen man weniger teure Zimmer mieten konnte. Auch wenn seine Eltern reich waren, bestanden sie darauf, daß Gunfried mit dem ihm zugewiesen Geld haushalte &fn=1'',300,200)">[1]. Gunfried war damit durchaus sehr zu Frieden, konnte er doch eine ganze Etage bewohnen und sich ein schwarzes Reitschaf mit Stall, Stallratte und Verpflegung leisten. Eine solche edle Erscheinung, wie Gunfried es zu sein pflegte, errang der Natur gemäss  in diesen abseitigen Gassen ein gewisses Aufsehen. Leider waren es nicht nur die netten und freundlichen Zeitgenossen, sondern auch einige weniger erfreuliche, deren Aufmerksamkeit Gunfried zu Teil wurde. In regelmäßigen Abständen musste er sich mit einigen kleinen verlausten Dieben oder Meuchelmördern prügeln. Er gewann diese mehr rhetorisch aufzufassenden Auseinandersetzungen immer. Die Besiegten beschlossen daraufhin meistens, sich einem anderen Handwerk zu zuwenden oder das Quartier zu verlassen. Dummerweise wuchsen dadurch allmählich die Kosten für Gunfrieds bescheidenen Lebensstil, so daß er mal wieder in ein anderes Viertel umziehen musste &fn=2'',300,200)">[2].    [br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (166, '2003-01-19 00:00:00', 'de', 1, 'Auch du, ...?', 'rattenzahn9', '[br]Was aber die Barbaren machten, war mehr als ungewöhnlich und höchst seltsam. Es schien als würden sie fliehen. Erst wandten sie sich in aller Unschuld dem Sumpf zu. Sie hatten bemerkt, daß dort auf ihrer Flanke der Dämon kämpfte, in Bedrängnis geriet und in ihr Dorf floh. Sie eilten ihm zur Hilfe hinterher. Sie liefen mitten in den Angriff des Rosenheeres. Kampfwagen überrollten sie, Lanzenknechte hetzten den Dämon, Katapulte schleuderten Steine und Feuerkrüge und fünfzig ausgeruhte, schwerbewaffnete Kämpfer traten ihnen entgegen. Das Dorf brannte. Das Durcheinander war heillos. Auf Seite der Barbaren man wusste nicht recht, was man machen sollte. Zu löschen oder zu kämpfen, beides schien im Feuerhagel aussichtslos. Die Angriff durchschnitt die Reihen der Barbaren wie eine scharfe Klinge, zerschlug sie in viele kleine Gruppen. Kaum daß sie sich zur Flucht aus dem brennenden Dorf entschieden hatten, gab Rattenzahn seinerseits das Signal zum Angriff. Der Kampf währte noch bis zum Abend, doch die Entscheidung war gefallen. Die vielen kleinen Gruppen waren eine leichte Beute. Man nahm sie gefangen oder rieb sie auf. Der Schneefall wurde immer dichter. Er webte den Toten sein bleiches Leichentuch. Den Dämonen aber hetzte man sieben Tage, bis man ihn am verschlossen Eingang seiner Höhle stellte und gefangen nahm.    [br][br]So bewegt, wie die einfachen Doedel und Ratten des Reichsheeres auch von dem Erscheinen der tot Geglaubten während der Schlacht gewesen waren, so unheimlich schien ihnen es danach. Rattenzahn hatte die Toten herbeigerufen, die meisten kannte man nur noch aus Legenden. Rattenzahn hatte die Macht des Dämonen gebannt. Seine Macht, seine Kraft musste schier unermesslich sein! Und doch, das Reichsheer wollte keinen Moment länger in diesen barbarischen Landen verweilen, in denen es gelang die Toten zu erwecken. Man wollte nie wieder hier her und mit ihnen etwas zu schaffen haben. So blieb Rattenzahn nichts anderes übrig, als Klementis und Renatu mit der Verwaltung dieser Länder zu beauftragen. Daraufhin befahl er den Abmarsch. Zum Beweis seines Sieges führte man den Dämonen mit. Der direkte allen bekannte Zugang zum Reich wurde ein für alle Male versiegelt.[br][br]Die Heimkehr war ein Triumphzug. Die Erleichterung über das erhoffte Ende aller Kriege, das Erstaunen über den gebändigten Dämonen, die Tatsache, daß keine Gefahr mehr drohte und der Weg sicher verschlossen war überwog die Trauer um die Gefallenen. Gewiss der Sieg war teuer erkauft, doch mehrte es nur Rattenzahns Ruhm und die Ehre für die Überlebenden. Den Verwundeten wurde alle Aufmerksamkeit und Pflege zu Teil. Den Veteranen machte man auf den Wegen Platz. Von Dorf zu Dorf musste Rattenzahn immer wieder den Dämonen zeigen, feiern, innehalten. Er konnte gar nicht so schnell zur Halle der Sieger zurückeilen, wie er wollte. [br][br]Der Jubel war groß, als er endlich am fünfzehnten Tage dort ankam. Die Häuser waren festlich geschmückt mit bunten Fahnen und Wimpel. Man spielte Musik und tanzte auf der Strasse. Das Volk bestaunte den Dämonen nur kurz, bewarf ihn mit Dreck und mit Steinen. Nachdem es seine Abscheu Ausdruck verleihen hatte, war es erleichtert, als Rattenzahn den Dämonen ins tiefste Verlies sperren lies. Jacub stand auf der Balustrade der Siegerhalle und grüßte die Heimkehrer wie ein Herrscher. Rattenzahn war stolz auf sein Kind. Er würde dereinst einmal ein würdiger Nachfolger werden. Jacub hatte in der Halle der Sieger ein Bankett aufbauen lassen. Anlässlich des Sieges hatte er für alle ein Festmahl arrangiert. Man feierte bis spät in die Nacht. Die Letzten waren Heim gekehrt und legten sich gerade schlafen, als schon die Morgensonne sich erhob. Jacub lächelte Rattenzahn an. [br][br]&#187;Nun ist der König im Triumph zurückgekehrt.&#171; [br][br]Jacubs Lächeln wurde breiter. [br][br]&#187; Er hat die letzte Schlacht geschlagen!&#171; [br][br]&#187; Wenn ich mich bald zur Ruhe setze, wirst du hier herrschen!&#171; [br][br]entgegnete Rattenzahn. In Jacubs Leib kochte sein Blut, so sehr missgönnte er Rattenzahn den Sieg. Niemand würde ihn respektieren. Für sein Leben war Rattenzahn eine Gefahr. Jacub grinste.[br][br][br]&#187;Alle Feinde sind geschlagen, alle ... doch sitzend wirst du nicht ruhen! &#171; [br][br]Sprach es und stach mit einem Dolch zu. Rattenzahn riss die Augen auf. Ungeahnte Heimtücke hatte ihm eine tödliche Wunde zugefügt. Sein Herz zerriss vor Leiden. Noch wollte er seine Hand erheben, da sank er nieder und röchelte, [br][br]&#187;Auch du ...?&#171; [br][br]Jacubs Augen glänzten.[br][br]Die Sonne schien rot am Firmament. Der Morgen erhob sein blutiges Haupt. Seine Anhänger, die Jacub um sich versammelt hatte, wies er an, alle Getreuen Rattenzahns jetzt und noch im Schlafe zu  beseitigen. Ihre Häuser sollten brennen. Niemand, der seine Autorität gefährden könnte, durfte leben. So begann die Regentschaft des Tyrannus Rex.[br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (167, '2003-02-02 00:00:00', 'de', 1, 'Die Kleine Ratte', 'lepetitrat2', '[br][br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (168, '0000-00-00 00:00:00', 'de', 1, 'Gunfried', 'gunfried2', '[br][br][br]So ergab es sich, daß der ganze Abschaum von Drecksloch sich in einem Quartier sammelte und Gunfried in keinem anderem Quartier mehr Obdach fand. Hier, im Viertel namens Abseits, fanden sich viele, die meinten, sie hätten mit Gunfried noch eine Rechnung offen. Gunfried Erscheinungsbild war nach wie vor noch immer nicht weniger auffällig, wieso sollte sich auch ein stattlicher junger Doedel vor anderen verbergen. So war Gunfried bald das Gesprächsthema im Viertel, auch die Stadt begann nun von ihm wohlwollend Notiz zu nehmen. Wenn böse Gestalten sich freilich treffen und ein gemeinsames Ziel finden, dann entstand daraus noch nie etwas Gutes. Ein Gruppe von hinterhältigen Gassendoedeln und Strassenratten beschloss Gunfried ein für allemal zu beseitigen. Was keinem von ihnen je alleine gelungen war, sollte doch gemeinsam gelingen. [br][br]Des Abends ging Gunfried üblicher Weise von der Schule für angewandte Wissenschaften, an der er eingeschrieben war, den Weg nach Hause. Kaum das er vor das Tor der Schule getreten war, sah er eine seltsame gedrungene Person auf dem Platz vor der Schule stehen. Gehüllt war sie in einen weiten Mantel, einen großen Schlapphut tief in das Gesicht gezogen, so daß man es nicht erkennen konnte, und in der linken Hand einen großen Wanderstab, der sie überragte. Man könnte sie jederzeit für einen Doedel mit bösen Absichten halten, würde diese unauffällige Person einem auffallen. Die Person sah ihn auch. Beide gingen eilig aufeinander zu. Freudig umarmten sie sich, denn es war ein alter guter Bekannter von Gunfried. Er kannte ihn noch von dem Hof seiner Eltern. Es war die kleine Ratte. Die kleine Ratte war viel älter als Gunfried, der Meinung seiner Eltern nach kein richtiger Umgang für Gunfried, aber immer schon wussten die Erzählungen und Beschreibungen der kleinen Ratte Gunfried zu begeistern. Erst hier hatte er aus alten Büchern erfahren, daß alles was die Ratte erzählte auf Wahrheit beruhte. Wenn es Heute nicht mehr so war, so war es doch so gewesen &fn=3'',300,200)">[3]. Eigentlich hatte er sich noch vorgenommen, seine Kampfübungen abzuhalten, doch Gunfried erlaubte es sich, die kleine Ratte höflich zu ihm nach Hause in seine bescheidene Studentenbude einzuladen. Erfreut nahm die Ratte an. Gemeinsam gingen sie über einen Markt. Gunfried hatte noch Besorgungen zu machen. Er hatte nicht Besuch gerechnet. Mit der Zeit wurde die kleine Ratte immer aufmerksamer und nachdenklicher. Gunfried kannte sie nur zu gut. [br][br]&#187;Was ist? Was machst du dir Sorgen?&#171; [br] ,fragte Gunfried verwundert. Er solle sich nicht umdrehen, entgegnete die Ratte, und seine Besorgungen fortführen. Wenig später, nachdem sie sich sicher war, meinte die kleine Ratte, daß sie verfolgt würden. Sie gingen durch die lange Allee, bogen in die Strasse zum Abseits ein und von dort wandten sie sich Gunfrieds Wohnung zu. Die Gassen wurden enger, dunkler, die Verfolger mehrten sich. Vor ihnen standen Doedel und Ratten mit Knüppeln und Messern, hinter ihnen eilten die Verfolger ebenfalls bewaffnet herbei. Sie waren in einen Hinterhalt geraten. [br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (169, '0000-00-00 00:00:00', 'de', 1, 'Gunfried', 'gunfried3', '[br][br][br]Gunfried zückte sein Schwert, die Ratte lüpfte ihren Hut. Die Straßendoedel und Gassenratten, die übelsten Banditen und Halsabschneider von Drecksloch, griffen an. Ohne Probleme konnte es Gunfried mit fünfen von ihnen aufnehmen. Doch es waren mehr, wesentlich mehr. Es würde ein blutiger Kampf auf Messers Schneide. Die kleine Ratte wirbelte den Stock durch die Luft und  streckte zwei nieder. Gunfried wehrte einen Angreifer ab und stach auf einen anderen ein. Aber die Banditen ließen sich durch nichts abschrecken. Sie waren fest entschlossen ihr Problem zu bereinigen. Dabei achteten sie nicht auf die kleine Ratte, sondern nur auf Gunfried. Der Stab begann in den Händen der kleinen Ratte zu glühen, Gunfried hieb zwei weitere Mörder nieder, es donnerte, blitzte und krachte. Die kleine Ratte ließ den Wanderstab &fn=4'',300,200)">[4] wieder sinken. Der Kampf war vorbei. Von den Banditen war niemand mehr, der noch ein Sterbenswörtchen hätte sagen können. Denn jene die überlebten, schworen alle ein und für alle Male dem Verbrechen ab. Sie schämten sich sogar ihrer Taten, so sie sich derer noch bewußt waren. manchmal ist es leichter ein neues Leben zu beginnen, wenn man vergißt. Niemand wurde je wieder	Bandit, Verbrecher oder Halsabschneider. [br]  Gunfried war für einen kurzen Moment erstaunt. Die kleine Ratte vermochte es immer noch ihn zu überraschen. Dann nickte sie kurz und sie gingen stumm nach Hause. Wann auch immer Gunfried jemals gefragt würde, wer die Banditen aus dem Abseits besiegt hätte, so solle er sagen, er sei es ganz alleine gewesen. Niemand sollte erfahren, das sie, die kleine Ratte, dabei gewesen war. [br][br]Viele Leute hatten beobachtet, wie sich der übelste und letzte Abschaum von Drecksloch sich zusammenrottete. Alle hatten gesehen wie diese Banden Gunfried verfolgten. Doch niemand hätte gedacht, daß man ihrer Herr werden könnte, geschweige den, daß man sie besiegte. Es gibt kein Feuer, daß sich schneller in den engen Gassen und den weiten Strassen einer Stadt ausbreitet, als das eines wohlgenährten Gerüchtes. Dieses war sogar mit hoher Gewissheit wahr und freudiger Natur. Gunfried hatte die Banditen besiegt! [br][br]Man gratulierte Gunfried, dankte ihm. Die Stadt feierte eine Fest zu seinen Ehren. Und die klügsten Köpfe der Stadt hatten eine Idee. Wenn Gunfried, ein Student, die Banditen besiegen konnte, dann könnten das doch auch andere Doedel. Man würde einige Doedel und Ratten einstellen, so daß das Übel des Meuchelmops nie wieder aufkäme. Gunfried wurde zum außerordentlichen Professor für die angewandten Rechtswissenschaften ernannt. [br][br][br]Monate später, viele Jahre, Gunfried war längst nicht mehr in der Stadt, errichtete die Stadt ihm ein Denkmal. Es war das erste Denkmal, daß keinem Stadtvater, Bürgermeister, König oder Tyrannen gewidmet war, sondern in den Augen vieler nur einem einfachen Doedel. Es war von bescheidener vollendeter Natur und zeigte Gunfried in lebensgroßer Gestalt, vielleicht etwas größer als er selbst je war. Es zeigte einen verdammt großen, kräftigen und stattlichen Krieger&media=13'',400,300)">[media]. So hatte man ihn in Erinnerung behalten. An dem flachen Fuß war ein kleines Schild angebracht. Darauf stand: [br][br]GUNFRIED[br] Erster Polizist [br] und [br] wahrer Held [br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (170, '2003-04-12 00:00:00', 'de', 1, 'Helden Im Busch', 'Helden im Busch - die Geschichten von Willhelm im Busch  Teil1', 'Es war ein schöner Tag, an dem ich eine lange Wanderung heraus aus Muddy Waters und den heimatlichen Gefilden unternahm. So gegen Mittag bekam ich Hunger und schaute mich um. Ich sah eine alte, große und wohl gekleidete Ratte. Ich beschloss, sie nach dem Weg zu fragen. So kamen wir ins Gespräch über allerlei und jenes, was unlängst geschah. Die Ratte wusste mir eine Geschichte zu erzählen. Sie sprach: [br] »Dies ist die Geschichte von Willhelm im Busch, und wenn ihr sie hören wollt, so will ich sie euch erzählen. « [br] Ich wollte und ich hörte zu. [br]Seine Eltern riefen ihn immer: [br][br]»Will Helm, komm aus dem Busch hervor!« [br][br]weil Willhelm, wie immer, sich im Busch versteckte und seinem Unwesen nachging. Aber dieser Name war den anderen Bewohner des Dorfes zu lang. Deswegen hieß er schlicht und einfach Willhelm im Busch, wo er ja auch immer saß. Man hoffte es zumindest. Nun, wenn Willhelm sich tatsächlich einmal wieder in der elterlichen Stube einfand, dann bestanden seine Worte und Erwägungen aus einem einfachen Satz. [br][br]»WILL HELM« [br][br], pflegte er dann laut zu grunzen. Wie sie sehen, war sein Charakter bescheiden, doch recht zielgerichtet und deterministisch strukturiert. Seine Eltern seufzen nur noch leicht, sie wussten seinen Vornamen trug er zu Recht. Willhelm verschlang nur sein Essen röchelnder Weise und ward meistens nimmer gesehen. Man durfte ihn halt nicht aus den Augen verlieren. Seine Eltern, im Dorf galten sie als reiche und auch angesehene Bewohner, ihr Bauernhof war nicht verschuldet, wussten sich aber mit einem Trick zu behelfen. Sie schafften es tatsächlich, ihn für eine länger Weile festzuhalten, indem sie ihm Geschichten vorlasen. Seine Eltern waren gute Vorleser, und die Geschichten waren sehr spannend. Es wahren Heldengeschichten, die von großen Helden und ihren noch größeren Taten berichteten. Solche Geschichten zogen Willhelm in ihren Bann. Sie fesselten ihn förmlich. An den besonders spannenden Stellen entfuhr Willhelm sogar manchmal ein Kommentar, was seine Eltern durchaus verzückte. Es waren Kommentare, wie »REIN ER WILL DA « , wo bei er mit dem Finger auf das Buch zeigte, oder »JA''N!« , was zwar keiner verstand, doch in seinen Eltern doch die Hoffnung weckte, Willhelm würde eines Tages einen anderen Namen tragen, und sei es nur ein anderer Vorname [1]. [br][br]Diese Hoffnung sollte sie trügen.[br][br]Im Dorfe sah man überhaupt nicht gerne, was Willhelm da so trieb. Ständig saß er unvorhergesehen in irgendwelchen Büschen und brabbelte wirres und unverständliches Zeugs vor sich hin. Es waren die Geschichten, die ihm seine Eltern vorlasen. Wenn andere Kinder, insbesondere kleinere, ihm zu nahe kamen, sprang er aus dem Busche und erschrak die Armen, sie sahen ihn ja nicht. Er rief, [br][br] » ''AUT AB! « [br][br] Das verfehlte seine Wirkung nicht, denn die Kinder liefen vor Angst weg. Doch sie verstanden ihn nicht, dachten anderes und erzählten es jedem, Willhelm wolle ihnen die Haut abziehen. So entstehen Gerüchte und ein schlechte Ruf. [br][br]Willhelm wurde älter und je älter er wurde, desto weniger ließ er sich zum Essen zu Hause blicken. Er hatte ja schon fast alle Heldengeschichten gehört. Jene, die er noch nicht gehört hatte, wollte er selbst erleben. Seine Eltern wussten sich abermals zu helfen. Sie legten ihm Butterbrote vor die Tür. Auf diese Weise verwöhnt, dachte Willhelm  jedes herrenlose Butterbrot sei für ihn bestimmt. So wurde er zum Dieb. [br][br]Dann und wann roch Willhelm jene köstliche Verführung, die ein Hühnerbraten vorstellt. Lange schon hatte er so was  nicht mehr gegessen. So versuchte er sich im Hühner stellen und jagen. Dabei verschreckte er die Hühner, die sofort ein extra Ei legten, weil er sie als Drachen beschimpfte. Zumeist, eigentlich immer wurde er ohne weitere Folgen von den Bauern verjagt. Doch eines Tages gelang es ihm ein altersschwaches Huhn auf seinem elterlichen Hof zu ergattern, es zu erlegen und über einem Feuer zu braten. Seine Eltern waren darüber nicht erfreut, ein Suppenhuhn so entschwinden zu sehen. Das Dorf wusste das Ereignis allen Regeln gerecht auszuschmücken. Willhelm habe das arme Huhn bei lebendigen Leibe die Federn ausgerupft. Willhelm sollte das Dorf verlassen, bevor er noch Schlimmeres anstellte, wohl möglich noch die Felder verwüstete[2]. Er musste gehen. [br] Zum Abschied, er war nun vierzehn Lenzen alt, schenkten ihm seine Eltern das, was er sich so sehnlichst gewünscht hatte, einen Helm, seinen Helm.  [br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (210, '2007-06-06 11:43:25', 'de', 1, 'Hamster', 'Hamster', 'Hamster, der:[br]Allgemeine Bezeichnung für einen Rodent, im Besonderen für einen der Hamster Rasse und auch für einen Rodent männlichen Geschlechts. siehe auch -> Ratte.  ', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (171, '2003-04-18 00:00:00', 'de', 1, 'Helden Im Busch', 'bushman2', '  [br]So verlies er das Dorf, die Heimat und die Büsche seiner Kindheit und Jugend. Schnurstracks schlug er sich seinen Weh in die weiteste Ferne, die ihm bekannt war, das Nachbardorf. Weiter konnte er nicht schauen, von mehr ahnte er nur. Im Dorfe rissen die Einwohner alle Büsche aus, auf das sich so etwas nie wieder wiederholen möge. [br][br][br]Freilich hatte man im Nachbardorf schon von Willhelm gehört&fn=3'',300,200)">[3].. Ehe er sich versah, geschweige ein Wort sagen konnte, bewarfen ihn die Kinder mit Steinen, die Erwachsenen riefen ihm üble Dinge nach. Das übernächste Dorf umging Willhelm. Er war nun schon weiter als jemals zuvor. Er dachte nach. War er einem Hühnerstall zu nahe gekommen, wen hatte er erschreckt? Er kam zum Schluss, daß es besser sie, sich mit den Kindern gut zu stellen. Und was könnte Kinder mehr glücklich machen, als eine gute Geschichte. So ersann er sich eine Geschichte von einem wahren Helden. es war die Geschichte eines Helden, der den Mob pöbelnder Steinewerfer besiegte. [br][br] Es wurde Abend, Nacht und wieder Morgen. Willhelm betrat das nächste Dorf. Er setzte sich in die Mitte des Dorfplatzes, weit genug entfernt von allen Hühnerställen und begann zu erzählen. Manche kamen vorbei und schüttelten den Kopf, manches Kind blieb auch neugierig stehen und hörte für ein Weilchen zu. Man hielt ihn für einen harmlosen Trottel. Irgendetwas machte er noch falsch. Gegen Abend gab ein freundlicher, alter Doedel eine Stulle Brot und einen Schluck frischen Wassers. Willhelm zog Gedanken verloren weiter. Er nächtigte in einem Busch. [br][br]Noch ein Dorf weiter von seiner Heimat entfernt, trat er erst Mittags auf den Gemeinde Platz. Er machte es sich unter einem schattigen Baum bequem, bevor er seine Stimme erhob und tönte, wer er sei. Er, Willhelm, der Dämonentöter, und nur zu gerne sei er bereit seine Geschichte zu erzählen. Das versprach vielmehr, als Willhelm zu halten vermochte, doch die Dörfler hörten es und strömten herbei. Jemand versprach eine gute Geschichte zu erzählen, Neuigkeiten aus der fernen Welt. Dergleichen hörten die Dörfler gerne. Es war ihnen egal, ob es auch wahr sei. So sicherte sich Willhelm eine reichliche Mahlzeit und ein warmes Bett. Er hatte gerade erlernt, wie man schwindelt. [br][br]Die Zeit verging und Willhelms Kreise zogen ihn immer weiter von der Heimat fort. Er hatte ein gutes Einkommen als Möchtegernheld und Gaukler. Wenn ihm auch nicht immer das ganze Dorf zu hörte, so fand sich immer eine Schar Kinder, was ihm die Älteren dankten. Nicht immer bekam er eine warme Mahlzeit und ein Bett, aber für gutes Brot und frisches Wasser reichte es. Neue Geschichten fanden sich am Wegesrand. Der Vorrat an Heldengeschichten, den ihm seine Eltern mitgaben, und seine Phantasie reichten aus, sie auszuschmücken. So wurden aus zwei Bauern, die sich um eine Fuhre Mist stritten, zwei sich streitende Könige, die von einem Helden versöhnt wurden. Beide Bauern befanden, daß es eine gute Geschichte sei, luden Willhelm ins Gasthaus zu einem Bier und einer Mahlzeit ein, und stritten sich weiter. das war Willhelms leben bis hierhin. Ihm wurde das fad. [br][br]Langsam, so dachte Willhelm bei sich, würde es allmählich Zeit, seinen Worten auch Taten folgen zu lassen. Bei nächster Gelegenheit, so meinte er. [br][br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (172, '2003-04-21 00:00:00', 'de', 1, 'Helden Im Busch', 'bushman3', '  [br]Einige Tage später gelangte Willhelm in eine Landschaft, wie er sie noch nie in seinem Leben noch nie gesehen hatte. Er war am Rand des Landes. Heftige Wind und kalte Nächte, Wolken und Nebel prägten das Wetter. Die Sonne ging über  nichts auf und wieder unter. Am meisten jedoch beeindruckte Willhelm der Mahlstrom in seiner wütenden Glut und, daß es andere Länder, andere Insel gab! Würden sie auch genauso sein wie dieses Land? [br][br]Wenn Doedel oder Ratten in der Mitte von Ländern wohnten, dann konnte es bei einfachen Leuten vorkommen, daß sie sich nicht vorstellen konnten, daß es andere Länder gab. Sie glaubten an Grenzen, aber daß sie wirklich waren, daß der Mahlstrom existiert, daß Länder schwebten, schien ihnen unwirklich. In den Dörfern der Mitte erzählten die Eltern ihren Kinder nichts von den Ammenmärchen des Randes. So stand Willhelm vor etwas für ihn wirklich Neuem. Zum aller ersten Mal verstand er die Welt, mehr als je zu vor. [br] [br][br]Willhelm suchte sich einen Weg am Rand entlang. Unentwegt fragte er nach dem Wege, wo und wie man auf eine andere Insel gelangen könnte. Seine Heldengeschichte wurden verwegener, wagemutiger, denn er war ein Held. Er hatte den Rand gesehen. So gelangte er in seine erste Stadt. es war eine kleine Stadt, kaum größer als ein Dorf. Doch sie lag am Rand und war das eine Ende einer Brücke. Ein solches Bauwerk faszinierte Willhelm. Schon wollte er die Brücke ohne Aufenthalt stürmen, als ihn viele Arme zurückhielten. Die Brücke war defekt. Das war gar nicht in seinem Sinne, noch in dem der wartenden Kaufleute oder des Stadtrates. Just zur Zeit suchte man wagemutige Bauarbeiter, welche die Brücke reparierten.[br]Und Willhelm war wagemutig, er war ja ein Held, er war sogar übermütig. Er log, daß sich die Balken bogen. Er erhielt den Auftrag, mit der Arbeit zu beginnen. [br][br]Es kam, wie wohl jeder ahnt, wie es kommen musste. Willhelm wusste der von der Arbeit an Brücken so gut wie nichts. Wäre es ein Steg über einen Bach gewesen, hätte er wohl nichts falsch machen können. Doch es war eine Brücke, was ja bekanntlich hieß, daß sie sich über weniger als Luft, über das Nichts hinweg spannte. Er sah zwar, daß die Balken, welche die Fahrbahn trugen morsch geworden waren. Aber anstatt sie einzeln nach einander auszuwechseln, schlug er mehrere auf einmal aus. Stück für Stück brach die Fahrbahn ein. Was viel schlimmer war, er hatte die Ankerketten nicht gesichert, und so spannte sich die Brücke nun unter der fehlenden Last immer mehr. Brücken waren trotz ihrer Größe wahre Meisterwerke filigraner Baukunst. Sie waren wie feinmechanische Uhrwerke, bis auf die letzte Kleinigkeit genau ausgewuchtet, mit Gegengewichten, Spanngurten, Entlastungsgraten, Windankern und Spann- und Gegenspannseilen. Ankerketten und Seile waren zum Bersten gespannt. Ein einziger Schlag noch, ein leichter Hauch des Windes würde genügen, die Brücke zu zerbrechen.  Willhelm holte mit dem Hammer aus, und die Ankerketten brachen mit einem dunklen Donner entzwei. Holz und Eisen wirbelten durch die Luft, die Konstruktion zerbarst. Willhelm fiel. Das war sein Ende. Ein dunkler Schatten war über ihm. Er sah die Länder schon von unten. Der Mahlstrom raste auf ihn zu. Seine erste und letzte wirkliche Heldentat. Er war ein Narr. Doch trotz aller Fährnisse war ihm das Schicksal holt. Eine Kralle packte ihn. [br] [br][br][br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (173, '2003-05-04 00:00:00', 'de', 1, 'Helden Im Busch', 'bushman4', '[br]Es war ein schicksalhafte Begegnung, denn es war ein Drache, ein wirklicher und wahrer Drachen, dessen Namen wir hier nicht nennen wollen, der Willhelm da packte und sein Leben rettete. Willhelm der gerade noch mit seinem Leben abgeschlossen hatte, war verwundert. Ein Ruck und er schwebte empor. Zwar sah er den Mahlstrom unter sich nun deutlicher als jemals zuvor, er sah auch Wolken von oben, doch hatte er nicht mitbekommen, was ihn nach oben trug. Sie durchflogen eine Wolke. Willhelm wurde ohnmächtig. So groß war sein Schock. Der Drachen flog in einem ruhigen und weiten Bogen wieder aufwärts und setzte Willhelm sanft auf dem neuen Land ab. Willhelm hatte neues Land betreten. Er war auf einer fremden Insel. Er war immer noch ohnmächtig. Der Drachen sammelte schnell Holz, blies ein-, zweimal auf den Holzhaufen und entzündete so eine Lagerfeuer. Das sollte Willhelm wärmen. Er fächelte Willhelm mit seinen Flügeln frische Luft zu, damit der arme Doedel zu seinen Füssen wieder zu sich kam. Alles in Allem war der Drache mehr als nur hilfsbereit. [br][br][br]Willhelm kam wieder zu sich. Noch nicht ganz, den ihm war als hätte er schlecht geträumt. Er wäre von einer Brücke gefallen, die zerborsten wäre, als er versucht hätte, diese zu reparieren. Es fiel ihm schlagartig wieder ein, er hatte nicht geträumt. Er war von der Brücke gefallen, dem Mahlstrom und seinem Tod nahe hatte ihn das Schicksal empor getragen, bis hoch zu den Wolken. [br][br][br]Er machte die Augen auf. Ein Drache starrte ihn an.[br][br]&#187;Dämon!&#171; [br][br]Willhelm Einstellung Drachen gegenüber hätte man nicht deutlicher zum Ausdruck bringen können. Für ihn waren Drachen eine Plage, die es zu bekämpfen galt. Drachen waren Drachenlords. Er kannte keinen Unterschied. Er kannte weder das Eine noch das Andere. Drachenlords waren natürlich Dämonen.[br][br][br]Sein Herz schlug heftiger als je zuvor. Er war entsetzt, empört, zu Tode erschrocken. Sollte dies schon wieder sein Ende sein? Er griff blitzschnell nach einem großen Holzscheit aus dem Feuer. Willhelm stürmte mit erhobener Faust auf den Drachen zu.[br]Er würde seine Haut so teuer wie nur irgend möglich verkaufen. Lauter schrie er,[br][br] &#187;Dämon!&#171; [br][br]und der Drachen sagte nur[br][br]&#187;Oh ... &#171; [br][br]leitete der Drachen seinen Satz, wie gewohnt, ein. Weiter kam er nicht. Was folgte war wenig ein Streitgespräch, als eine heftige, körperliche Auseinandersetzung. Willhelm bedrängt den Drachen immer wieder mit bloßer Faust oder der Fackel, schlug wild um sich und geriet immer mehr in Rage und blinde Wut. Der Drachen hüpfte ein paar Schritte zurück, nach links oder rechts. Willhelm schrie [br] &#187;Dämon!&#171; [br]  und  stürzte nach vorne der Drachen wich ihm wieder aus. Der Drachen kam nicht zu Worte. Willhelm stürmte, drängte schrie immer wieder. Er wurde unterdessen nicht müde und auch heiser. Dann geschah, womit keiner zu rechnen wagte.[br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (174, '2003-05-10 00:00:00', 'de', 1, 'Helden Im Busch', 'bushman5', '[br][br]Nach dem der Drachen stundenlang Willhelm ausgewichen war, verlor für einen sehr kurze Moment seine Kontenance. Nicht das ihm die Fackel Angst gemacht hätte, oder ein Faustschlag von Willhelm ihm etwas hätte anhaben können. Die ganze Zeit über hatte er über sich wüste Beschimpfungen ergehen lassen und kam nicht zu Wort, noch das er hätte wegfliegen können. Ständig eilte immer dieser ungehobelte Kerl herbei. Statt auszuweichen, blieb der Drachen stehen und stupste Willhelm an. Ein Drache war immer höflich, sehr höflich. Das war seine Natur. Und ein solches Verhalten war gänzlich gegen seine Natur. Noch nie hatte ein Drache jemanden gestupst, geschweige denn geschlagen und das sollte auch nie wieder geschehen. [br][br]Willhelm war so überhitzt, daß er davon umfiel. Eine Drachenklaue ist auch sehr groß, so groß wie ein Brotmesser und scharf, scharf wie eine Rasierklinge. Der Drachen erschreckte mehr als Willhelm. Der war wieder ohnmächtig. Als der Drachen sich besah, was er angerichtet hatte, schämte er sich so sehr, daß er ungesehen verschwand. So einem lästigen Kerl, wie Willhelm, würde der Drache nicht noch einmal helfen.[br][br][br]Von nun an würde Willhelm eine kleine Narbe auf der Nase und einen sehr breiten Scheitel, man könnte es auch Glatze nennen, tragen. Den Helm hatte er schon beim Sturz von der Brücke verloren.[br][br]Zwei Alte, die zufälligerweise des Weges daherkamen, fanden Willhelm ohnmächtig und offensichtlich verletzt. Sie dachten er sei überfallen worden. Weil Willhelm das Schicksal immer noch gnädig und  sie hilfsbereit waren, nahmen sie ihn mit nach Hause. Sie versorgten seine Wunde, gaben ihn zu Essen und ein Bett. Willhelm erzählte den beiden Alten, seine Geschichte, wie er verletzt wurde. Wahrheitsgemäß, wie er dachte. Es klang nach eine Heldentat. [br][br]Ein Drachenlord hätte ihn überfallen, seinen Helm geklaut, ihn immer wieder zum Narren gehalten und nur mit höchster Mühe und Not sei er, Willhelm, dem tödlich Schlag entkommen. Das es ein Drache gewesen war, wusste Willhelm nicht, noch kannte er den Unterschied. So dachten die beiden Alten auch, es müsste sich um einen Drachenlord handeln. Das erschien ihnen nur zu wahrscheinlich.  [br][br][br]Drachenlords waren jene bösartigen dämonischen Wesen, die nur annähernd wie Drachen aussahen, in den seltensten Feuer speien konnten und hundsgemein waren. Sie waren nicht wie Drachen höflich und zuvorkommend, stets hilfsbereit, beredet und intelligent. Sie waren vielmehr schlau und gerissen, heimtückisch und verschlagen, verlogen und mörderisch hungrig, eine echte Plage.[br][br][br]Auf der Insel, auf der Willhelm jetzt weilte, jenem für Willhelm neuen Land fern der Heimat, gab es eine solche Plage. Weit weg zwar auf der anderen Seite der Insel, aber es gab sie. So erschien den beiden Alten diese Geschichte auch glaubhaft. Sie hatten schon von der Plage gehört. Warum sollten also solche Vorkommnisse sich nicht auch hier bei ihnen ereignen. Möglich war es. Sie hatten Angst und sie waren froh, daß Willhelm bei ihnen war. Gerne versorgten sie Willhelm, der für sie ein echter Held war, pflegten ihn, damit er wieder zu Kräften kam. Sie gaben dem Doedel, der mit bloßer Faust einem Drachenlord widerstanden hatte, das edelste, was sie in ihrem Besitz hatten, ein kampferprobtes Schwert und Unterricht im Fechten. Von Zeit zu Zeit besuchten sie die umliegenden Dörfer und erzählten stolz, wer bei ihnen zu Hause gastierte. So eilte Willhelm&media=15'',400,300)">[media], noch ehe er aufgebrochen war, ein Ruf voraus. Es war Ruf eines Drachenlords, eines Drachenlordtöter. [br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (175, '0000-00-00 00:00:00', 'de', 1, 'In 80 Tagen um den Fuß der Welt', 'achtzig_78', 'In Achtzig Tagen Um Den Fuß Der Welt[br]und in vieren wieder zurück[br]Ein Reisebericht von William Schuettelbier[br][br][br]78.ter Tag:[br][...] [br][br]Es war an diesem Tage, so kurz vor der Mittagszeit, wir überquerten gerade einen steilen Abhang, eine natürliche Hochweide, auf der kaum etwas anderes als Steine, Moos und ein paar verzweifelte, geduckte Gräser und Blumen zwischen dem Schnee des vergangenen Winters wuchsen, da begegnete uns er, der wahre Herrscher dieses einzigartigen Berges. [br]Auf der anderen Seite der Hochwiese erhoben sich Felsen steil, wie ein Burg, die eine schmalen Durchbruch, wo unser Pfad weiterführen sollte, bewachte. Die Wolken zogen in zwei Schichten unter uns, über uns war der Gipfel schon zum greifen nahe. Vereinzelte Wölkchen umspielten ihn. Dort oben musste Wolkenkuckucksheim liegen. In den diesen Höhen sieht man das Ferne erstaunlich nah. Ich konnte der Versuchung nicht widerstehen nach einer verspielten Wolke zu greifen, die Luft ist in den Bergen auch sehr dünn. So verlor ich fast das Gleichgewicht, fast wäre ich den Abhang heruntergerutscht und in die Tiefen gefallen, hätte mich unser Übersetzer, der Schärpe Twroqwn, nicht festgehalten. Kaum das ich mit zitternden Knie wieder einigermaßen sicher stand, ließ er mich schon wieder los, eilte zwei Schritte zurück und wies nach oben. Schweigend wies er zu den Felsen und es entfuhr ihm kaum hörbar leise: »Da!« [br][br]Auf dem höchsten Felsen trohnte er, fest auf allen Vieren stehend, Klauen bewehrte starke Beine, die ihm einen sicheren Tritt in diesem unwägbaren Gelände verliehen. Sein Erscheinen verkündete wahre Majestät.  [br]Der Steinbock. [br]Nicht irgendein gewöhnliches Schaf, nicht irgendein gewöhnlicher Steinbock, wie sie ihn vielleicht aus den Bergen ihres Landes kennen. Nein, es war der Steinbock der Böcke. Capricornus Augustus Maximus, jenes edelstes aller Geschöpfe. Sein Fell glänzte im Sonnenlicht, fast gülden, ein wenig Kupfer und Bronze wahren auch dabei. Seine Klauen sahen aus wie geschmiedeter, polierter Stahl, silbern glänzten seine Hörner. Er selbst war ein und ein halbes mal so groß wie ein gut gewachsener Hamster, seine Hörner solang wie eine ausgewachsene Ratte. Wie jämmerlich erschienen mir die Berglöwen dagegen! [br]Erst jetzt bemerkte ich, dass unsere Schärpen alle zur tiefer gelegenen Seite, zurück zum Pfad gelaufen waren. Sie nahmen Deckung. Meine beiden Gefährten und der Twroqwn war ein Stück weit mit gelaufen. Nun standen sie zwischen mir und den Trägerschärpen. Hatten die Schärpen uns nicht immer erzählt, das gefährlichste Geschöpf des Berges sei der Berglöwe. Und wie tapfer hatten sie uns gegen ein ganzes Rudel hungriger Löwen verteidigt, ihm nachgesetzt, es sogar angegriffen. Mir kamen Zweifel. Doch ich stand stocksteif, eben schlotterten mir noch die Knie, jetzt war ich vom Augenblick ergriffen. Erhobenen Hauptes schaute ich direkt in das Gesicht des Bockes. Er erhob den Kopf zum Himmel. Ein markerschütterndes Blöcken entfuhr seiner Kehle. Der Berg erzitterte. Kleiner und größere Steine, gerieten in Bewegung. Sie rissen den Schnee mit sich. Wie ein Fels in der Brandung stand ich ungerührt mitten in der Wiese. Es mochte das dümmste aller Verhalten gewesen sein, Twroqwn und meine Begleiter warfen sich flach zu Boden, doch mir geschah nichts. Meine Gefährten hatten ein paar Schrammen und blaue Flecken abbekommen. In ihrem Versteck jammerten die Schärpen. Ich schwöre, ein so lautes Rufen hatte ich noch nie gehört und nie wieder auf all meinen Reisen vernommen.  [br]Wo eben noch ein spärlich gedecktes, steiniges Feld war, hatte sich der Tisch grün gedeckt. Jemand atmete erschrocken sehr laut! Über uns zeigten sich weitere Augenpaare. Zwanzig, vielleicht dreißig Mutterschafe, Lämmer, Jungböcke und greise Schafe, eine ganze Herde von Steinböcken betrachtete uns oder war es vielmehr die Wiese von oben interessiert. Ohne Furcht betrat ein Schaf nach dem anderen  die Wiese, die meisten nutzten hierzu den Durchbruch durch die Felsen. Die Jungböcke hatten die Weide umrundet und trieben nun die verängstigten Schärpen auf die Wiese. Dann kam er. Er stieg direkt vom steilen Felsen herab. Fast senkrecht war sein Weg. Dabei behielt er uns ständig im Auge. [br]Nun stand er vor uns. Lange fixierte er mich, ich wagte nicht zu atmen noch mich zu regen. Fast schien es mir als blickte er in meine Seele. Dann trat er einen Schritt auf mich zu, neigte den Kopf nach unten und verpasste mir mit der Schnauze einen Kinnhaken. Wunderlicher Weise blieb ich stehen. [br]»Mähähäh! « [br]machten die Lämmer, Mutterschafe und die Greisen nickten anerkennend. Mir schien, die Jungböcke grinsten. [br]Einen halben Tag lang verbrachten wir mit den Steinböcken auf der Wiese. Des Abends lagerten wir unterhalb des Felsens vor Wind und Wetter geschützt. Die Schafe gesellten sich zu uns. Die Lämmer waren immer noch verspielt, doch müde. Selbst der Steinbock suchte sich ein Platz im Lager - nahe bei mir. So fiel über uns die Dämmerung herein, die Nacht begann sternenklar und wir schliefen ein.[br]Ein leises Mäh begleitete unsere Träume. [br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (176, '0000-00-00 00:00:00', 'de', 1, 'In 80 Tagen um den Fuß der Welt', 'achtzig_79', 'In Achtzig Tagen Um Den Fuß Der Welt[br]und in vieren wieder zurück[br]Ein Reisebericht von William Schuettelbier[br][br][br]79.ter Tag:[br]Wir erwachten wohl ausgeruht schon am frühen Morgen. Die Schafe nahmen auf der Wiese ihr Morgenmahl. Ein kleine feuchte Schnauze eines neugierigen verspielten Lammes hatte mich geweckt. So begann unser Tag. Bald schon würden wir uns von unseren Freunden den Steinböcken verabschieden müssen, um unseren Aufstieg fortzusetzen. [br]Doch der Steinbock ließ uns nicht weg. Er blökte ein paar kurze Kommandos, schon luden die Schafe unser Gepäck auf ihre Rücken und zu guter Letzt uns. Der Steinbock nahm mich mit den Hörnen und beförderte mich schwungvoll, aber sanft auf seinen Rücken. Wir durften auf den Schafen reiten. Es waren wohlgemerkt wilde Tiere! [br]Schneller, sicherer als auf ihren Rücken, hätten wir nie diese Wegstrecke bewältigen können. Den ganzen Tag ritten wir ohne Unterbrechung und ohne Rast zielstrebig immer weiter nach oben. Teilweise überwanden die Schafe dabei Strecken, die fast senkrecht nach oben führten. Sie trugen dabei uns und unser Gepäck! So schnell hätten die Schärpen, welche erfahrene Bergführer waren, den Weg nicht finden können. Des Abends setzten uns die Schafe unweit des Gipfels ab. Es war nur noch eine schwierige Passage zu bewältigen nur noch ein Tag leichten Fußmarsches wartete auf uns.  [br]Wir schlugen unser Lager auf. Alsbald waren die Steinböcke fort. Noch einmal hörte ich sein Rufen. [br]Ich fragte Twroqwn wie lange wir für diesen Aufstieg benötigt hätten. Seine Antwort war erschütternd. Wenn wir nicht zwischenzeitlich abgestürzt wären, was bei diesem brüchigen Pfad durchaus möglich gewesen wäre, hätten wir vier Tage, wenn nicht sogar fünf benötigt. Normalerweise hätten wir erst den Berg halb umrundet, um dann einen gefährlichen aber gangbaren Weg zu nehmen. Das hätte uns zwei Wochen Zeit gekostet.  [br]Dann lachte Twroqwn. Und fragte mich, warum ich mir darüber überhaupt den Kopf zerbreche, schließlich könnte ich es ja mit den Steinböcken aufnehmen. Ich sei selbst ein halber, wenn nicht sogar ein ganzer. [br]Das gab mir zu denken. Das Feuer brannte noch bis Stunden in die Nacht hinein. Wir alle waren froh und gut gelaunt und sangen gemeinsam Lieder. So endete dieser Tag.[br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (177, '2003-05-18 00:00:00', 'de', 1, 'Helden Im Busch', 'bushman6', '[br]Von nun an wurde Willhelm, wo immer er auftauchte, begrüßt und umjubelt. Für ihn gab es das beste Zimmer in der Herberge, wo es keine Herberge gab, das beste Zimmer im besten Hause, stets das beste Essen. Man muss kein Hellseher sein, um zu wissen, daß Willhelm dieses Leben gefiel. Von Mal zu Mal wurde seine Geschichte um seinen Kampf mit dem Drachenlord verwegener, sein Wagnis größer, seine Kampfeskraft überwältigender. Willhelm, dieses sollte man ihm zu Gute halten, wusste es ja nicht besser. Den Leuten gefielen diese Geschichten. Endlich war da ein Held, freundlich und offen ließ er die Bevölkerung an seinem Leben teilhaben. Er ganz anders als die anderen, bei weitem nicht so verschwiegen und griesgrämig, wie die Unglücklichen, die gegen die Drachenlords zogen und nie wiederkamen. Ja, den Leuten gefielen die Geschichten und Willhelm. Dieser eine würde Erfolg haben. [br] Was noch wichtiger war Willhelm gefiel dieses Leben, umschwärmt, bewundert von allen zu sein. So bemerkte er nicht, was er tat, zu lügen und zu betrügen, das Vertrauen anderer zu missbrauchen. [br]Er bemerkte auch nicht, daß es ihn immer näher an das drohende Unheil schob, förmlich von Dorf zu Dorf zog  Weg von den sicheren Städtchen, Dörfern und Gemeinden zu immer unsicheren Gegenden hin. Er wanderte dem Drachenlord entgegen.      [br][br][br]Es war nur einer, aber er erschien in den Nachrichten aus dem unglückseligen Tale, welches noch viele Jahre so heißen würde, als wären es derer viele eine Unzahl, so groß seien die Verwüstungen. Bis jetzt hatte der Drachenlord noch jeden, der sich ihm offenen Kampfe entgegenstellte, besiegt, schwersten verwundet oder getötet, bei lebendigem Leibe verspeist.[br][br]Man sieht, je unüberprüfbare Nachrichten sind, desto unglaublicher erscheinen sie, was ihrer Glaubwürdigkeit aber keinen Abbruch tut.[br][br][br]Willhelm hatte einen Plan. Er hatte lange und reiflich überlegt. Er hatte ja Zeit genug gehabt. Bislang war jeder im Kampfe verschieden. Jeder Held war so töricht gewesen, sich dem Drachen, Drachenlord auf freiem Felde zu stellen. Er würde sich hingegen verstecken, den Drachenlord erst auskundschaften, ihm im Walde stellen und dort bekämpfen. Wann immer er auf seiner Reise Gelegenheit dazu gefunden hatte, hatte sie Willhelm in der Kunst des Schwertes geübt. Er hatte sich mit den besten, die er fand gemessen und nun war er schon ein recht ansehnlicher Schwertkämpfer. Stets hatte er aufgrund seiner Beharrlichkeit am Ende gesiegt. Er hatte seine Gegner erschöpft. Das müsste ihm von Nutzen sein. [br]Bis jetzt hatte er den Drachenlord noch nicht gesehen. Er kannte nur einen Drachen, welcher ihm immer wieder ausgewichen war. So ging Willhelm in seinen Überlegungen genau von diesem Verhalten aus und hörte nicht auf die Geschichten, welche ihm hoffnungslos übertrieben schienen.[br][br]So in Hoffnung und doch bang, dessen was ihn erwarten würde, gelangte er in Tal seiner ersten Heldentat. Seiner ersten? [br]Für Willhelm waren es schon die Dritte. Er hatte sein Leben bei der Reparatur einer fast vollkommen zerstörten Brücke gewagt und beinahe verloren, hätten ihn nicht günstige Winde das Leben gerettet. Er hatte einen Drachenlord über eine Klippe gestürzt. Er würde wieder einen töten. [br]So in Hoffnung und gar nicht bang, mit Stolz geschwellter Brust voran, schritt er ins Tal der Heimsuchung. Man muss seine Lügen nur fest genug glauben, dann werden sie zur Wirklichkeit.[br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (178, '0000-00-00 00:00:00', 'de', 1, 'Das Huhn', 'huhn', '[br]Das Huhn[br][br]Von allen Vögeln der Dümmste, so wurde das Huhn schon in Krawall bezeichnet. Keineswegs zu Unrecht, wie viele meinen. [br][br]Alle anderen Vogelarten zum Beispiel, sein es die Singvögel auf Latifundien, die Spatzen in Drecksloch, die Zugvögel überall, die Laufemus in den Weiten Afakirs oder die Raben am Fuße der Welt. Nicht die Ratten noch die Doedel, noch nicht einmal der dümmste aller Dämonen schätzte die Hühner wegen ihrer Intelligenz. Vielmehr wurde es gemocht ob seines Geschmackes beim Verzehr. [br][br]Hühner hatten sich den Spott, die Verachtung aller Vögel in allen Zeiten zugezogen. Sie sind die erfolgloseste Vogelart auf allen Inseln und zu allen Zeiten, obwohl oder weil sie Doedels und Ratten immer schon begleiteten. Weder konnten sie sich als Zugtiere durchsetzen, schon in Krawall hatte man damit erfolglos experimentiert mehr als ein Huhn vor den Karren zu spannen, noch waren sie als Nachrichtenträger zuverlässig. Man wartete auf die Rückantwort vergeblich, denn das übermittelnde Huhn wurde, so es den sein Ziel überhaupt erreichte, verspeist. Zur Unterhaltung wagte man sie kaum einzusetzen, weil Hühner nicht singen können. Lediglich in barbarischen Kulturen genoss man den Hahnenkampf, Hennen waren hierzu aber ungeeignet. [br][br]Dieser selbstaufopfernde Charakterzug, war es auch, der den Spott der Vögel hervorrief. Raben nutzten ihn aus und verbreiteten unter den Hühnern den Glauben vom großen Spieß&media=16'',400,300)">[media], welcher es bewirkte, daß das Huhn, welches an ihm endete, Erlösung von allem irdischen erfuhr und als Rauch in den Himmel aufflog. Fliegen konnten Hühner nicht, noch waren Sie als Reittiere zu gebrauchen. [br][br]Aus eben diesem Grunde opferten die Hühner nicht nur sich selber gerne, sondern auch den eigenen Nachwuchs, ihre Eier. Den Raben, Ratten und Doedeln war das nur Recht, hatten sie dadurch doch geschmackvolles Fleisch zu essen. Im Falle der Raben war es der immer noch nahrhafte Abfall solcher Mahlzeiten, die Hühnerknochen. [br][br]Hühner galten seit Alters her als talentlos und sexversessen. Sie waren die seltsamsten Vögel, die man kannte. Ein Hahn trieb es mit einer Henne in aller Öffentlichkeit, ohne Scham und ohne jede Reue. Noch verwunderlicher war, das ansonsten die Hennen getrennt vom Hahne lebten, wobei sie sich am wohlsten in engen Gemeinschaftspferchen fühlten. Derweil hockte der Hahne auf dem Miste und versuchte sich als Zeitansager. Mehr als ein morgendliches Gekrächze brachte aber auch er nicht zustande. Jedem war klar das zu dieser Zeit der Morgen war. Das sah man ja schon am Stand der Sonne.[br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (179, '0000-00-00 00:00:00', 'de', 1, 'Krawall', 'krawall2', 'Sie sind aber auch sehr leichtgläubig![br][br]Anders als ihr Name es verraten zu scheint, war die Stadt nämlich sehr friedlich. Es kamen viele Reisende von nah und fern. In Krawall&media=17'',400,300)">[media] bestand man sehr auf Ruhe und Ordnung. Die Bürger hatten sogar Straßenlaternen für die nächtliche Beleuchtung auf gestellt. Dieses basisdemokratische Mittel war sehr wirksam gegen nächtliche Ruhestörungen und gegen allzu machtgierige Herrscher. Krawall wurde von  demokratischen Tyrannen beherrscht, welche darauf bedacht waren nach zehn Jahren nicht mehr in Amt und Würden zu sein. man kann sich durchaus denken warum. [br] [br]Auf Betrunkene hatten Laternen eine ähnliche erzieherische Wirkung. Selbige wurden von den Laternen angezogen, wie die Motten von dem Licht. Diese nächtliche Bekanntschaft verschaffte dann beiden sehr schnell Ruhe, dem bewusstlosen Trunkenbold und der Stadt. [br][br]Denn rasenden Händlern hingegen war die Beleuchtung eine wahre Hilfe. Sie ließ sie ihre Handelskarren besser durch die Kurven manövrieren. In Krawall herrschte ein Tagesfahrverbot für schwere Lastenkarren von Morgendämmerung bis Mitternacht. Die Händler waren es, die Krawall mit den Waren belieferten, die dort weiter verarbeitet oder zum Austausch gegen andere Produkte angeboten wurden.[br]Die Lastkarren zog man selbst über die Berge, denn Schafe gab es keine auf der Insel. Wollte man bergab ins Tal, so setzte man sich auf den Karren und ließ ihn hinunterrollen. Kurz vor der Stadt wurde er dann mit quietschenden Rädern abgebremst, was auch der Grund war für die hohen und dicken Mauern und Wälle die Krawall umgaben. Es waren Lärmschutzmaßnahmen. War der Wagen zum stillstandgekommen, legte man ihm gepolsterte Reifen an. Auf diese Weise konnte man ihn schnell und leise durch Straßen von Krawall zu seinem Bestimmungsort ziehen.[br][br]Sie wollen immer noch wissen, woher Krawall seinen Namen hatte? [br][br]Nun diese Stadt endete mit einem solchen Krawall, daß dieses Ereignis in der Erinnerung aller haften blieb. Aber das ist eine andere Geschichte. [br][br][br]S.N.C, wie Krawall von seinen Bürgern stolz und mit Nachdruck genannt wurde, war eine besonders schöne Stadt. In ihrem Zentrum lag der Snowwater-Park, mit einem See gefüllt von fleißigen Helfers Händen. Bananenstauden und Palmen sorgten dort für Kühlung. So war der Park bei alt und jung beliebt. Im Norden des Parkes erhob sich der Tempel, eine kleine, unfertige Stufenpyramide. Im Süden lagen die Villen der reichen Händler. Das größte aller Gebäude war aber das Hotel Merchator, am Eastpark-Boullevard gelegen. Es war für alle anderen Häuser Krawalls stilprägend, mit Ausnahme des in einem exentrischen Baustil errichteten "Banana-Boots-Shops", einem sehr exklusiven Schuhladens. Die Gassen von Krawall waren sehr verwinkelt. Man baute einfach dort wo Platz war das nächste Gebäude&media=18'',810,475)">[media].[br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (180, '0000-00-00 00:00:00', 'de', 1, 'Der Weise Soso', 'soso', '[br][br]Der Weise Soso[br][br][br][br]Der meistgefragte Doedel von Krawall, die Einwohner bevorzugten die Abkürzung des Orginalnamens, S.N.C&fn=1'',300,200)">[1], war ohne jeden weiteren Zweifel der Bademeister und Hüter des Snowwater-Parkes, Master Soso. Man nannte ihn so, weil dieses seine Lieblingssilbe war&fn=2'',300,200)">[2]. Einige Bürger von S.N.C meinten, die Tratschen mit den bösen Zungen, er wäre ziemlich einsilbig und kein wirklich guter Ratgeber. Tatsächlich aber hatte er sich seinen Beinamen "Weiser", unter dem er später zur unsterblichen Legende wurde, redlich verdient. Er schwieg meistens und ließ die anderen reden. Dann und wann ließ er eine kleine Randbemerkung fallen oder fügte so die eine oder andere Fußnote ins Gespräch ein. Das veranlasste die Zuhörer zum Nachdenken. Seine Lieblingsäußerungen waren "So oder so ähnlich ... !" und "So geht das aber nicht!". [br][br]Als Hüter des Snowwater-Parkes schickte er gelegentlich Bewohner zur Erholung in die Berge. Nebenbei, so sein Auftrag, könnten sie etwas Schnee&fn=3'',300,200)">[3] mitbringen. Meistens brachten die Einwohner immer einige teils unbekannte Pflanzen mit, denn der Weise Soso war ein Pflanzenliebhaber wie fast alle Einwohner der Stadt. Die Rückkehrer fragten den Bademeister, was dies für eine Pflanze sei, und er ließ sich von ihnen erzählen unter welche Umständen&fn=4'',300,200)">[4] sie die Pflanze gefunden hatten. Dann pflanzte er die Blume, den Strauch oder Baum, was es immer auch sei, an und umhegten und pflegte ihn. Auf diese Weise wurde Master Soso zu einem gefragten und erfahrenen Pflanzenexperten und der Snowwater-Park wurde von einer Einöde mit einer unahsehnlichen Schlammkuhle zu einer grünen Oase mitten in der Stadt in der Mitte einer Wüste. [br][br]In dieser grünen Oase traffen sich Einwohner und Besucher der Stadt, führten angeregte Gespräche oder kamen zum allmorgentlichen Frühsport mit Meister Soso&media=19'',400,300)">[media]. Was kann es Schöneres geben?[br][br]Der Weise Soso hatte es nie nötig Tyrann von Krawall zu werden, um sich seinen Einfluss zu sichern. Auf ihn ging sogar die Idee mit der Straßenbeleuchtung zurück&fn=5'',300,200)">[5], die für die Stadt und das Funktionieren  der demokratische Tyrannei so wichtig war. [br][br]Ursprünglich also nur für den Bau und die Wartung des Parkes zuständig, wurde der Master Weiser Soso zu einem sehr einflussreichen Mann. So kann es auch nicht verwundern, daß er zur Legende wurde ...[br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (181, '2003-07-31 00:00:00', 'de', 1, 'Sprichwörtlich Schwein', 'piggy', '[br]Sprichwörtlich ein Schwein[br][br]&#187;Schwein muss man haben&#171;[br]und andere Sprichwörter charakterisieren am besten die Rolle des Schweins als Wirtschaftswesen.[br][br]Diese Rolle war weit mehr als nur symbolisch zu verstehen. [br][br]Besitzer von Schweinen konnten sich glücklich schätzen, galten sie auf der Insel von Krawall doch als wohlbegüterte, angesehene, vom Schicksal begünstigte Bürger. Was wohl auch an der Tatsache lag, daß sie es waren. [br][br]&#187;Schwein muss man haben&#171;,[br][br]&#187;Er hat sehr viel Schwein&#171;, [br][br]&#187;Ihm stünde ein Schwein&#171;, [br][br]waren beliebte Redewendungen, um vom Glück Begünstigte zu charakterisieren. Anderseits waren Ausrufe wie[br]&#187;Drecksschwein&#171;, [br][br]&#187;Er stinkt, wie ein Erfolgsschwein&#171;, [br][br]&#187;Dumme Sau&#171;, [br][br]&#187;Möge man seine letzte Sau schlachten&#171;, [br][br]eindeutige Anzeichen von Missgunst. [br][br]&#187;Er hat Schwein gehabt&#171;, [br][br]bezeichnete einen ehemals reichen, nun verarmten Doedel oder eine verarmte Ratte. Schweine waren intelligente  Tiere, viel zu klug um für irgendwen Arbeit zu verrichten. Man musste schon Glück haben und das Schwein einem wohlgesonnen sein, damit es für einen etwas tat. Hierauf spielt das Sprichwort &#187;Du kannst kein Schwein vor deinen Karren zwingen!&#171; an. [br]Schweine, hochgeachtet, wurden selten geschlachtet. Ihr Fleisch war Spende zu hohen Festen, stand also selten auf dem Speiseplan&fn=1'',300,200)">[1]. &#187;Glückseber&#171; nannte man Leute, die selbiges nie zu verlassen schien. Eber schlachtete man nicht. Niemand wollte sich mit diesen kräftigen Tieren anlegen. [br][br]Schlachter wohnten auf der Insel von Krawall in Häusern mit roten Türen, außerhalb der Ortschaften&fn=2'',300,200)">[2], denn es war immer schon eine anstrengende und lärmende Tätigkeit. Auch wollte niemand &#187;das Ende der Schweine&#171; mitansehen&fn=3'',300,200)">[3]. [br][br]Widerborstig nannte man solche Mitbürger, die verrucht, aber erfolgreich waren, sich mit dunklen Geschäften befassten, oder schlichtweg durch ihre Wildheit&fn=4'',300,200)">[4] auffielen. Es war ein Verweis auf die Wildschweine. Wildschweine waren in den Bergen rund um Krawall ansässig, ließen sich nicht zähmen, sehr angriffslustig und allgemein gefürchtet. Die Nachtwache von S.N.C. nannte man nicht von ungefähr &#187;die Wildsäue&#171;, einen einzelnen Wächter schon mal &#187;Keiler&#171;, natürlich nur hinter vorgehaltener Hand. Mussten die Nachtwachen in eine Wirthausschlägerei eingreifen, so pflegte man es eine Wirtshauskeilerei zu nennen. Jemanden, von dem man sich erhoffte, er möge endlich dem Rechtswesen zugeführt werden, wünschte man ordentlich viel Keile. [br][br][br]Ist hier darauf hinzuweisen, daß eigentlich alle Sprichwörter aus den Zeiten von Krawall bis zum heutigen Tage überlebten?[br][br][br]In diesem Sinne: [br][br]Möge das Glücksschwein mit dir sein![br][br][br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (182, '2003-08-31 00:00:00', 'de', 1, 'Tempel von S.N.C', 'krawall_tempel', '[br][br]Der Tempel von Krawall[br][br][br][br]Direkt am Zentrum von Krawall, dem Snowwater-Park, lag der Tempel. Er war zunächst nur zufällig durch die Aushubarbeiten am Bassin des Snowwater-Parkes entstanden. Eine Ansammlung von steinernen Stelen auf einigen zufällig verteilten Bauschutzhügeln. Baldigst forderten die Bürger von S.N.C zurecht diese Schandmäler in der Stadtlandschaft zu beseitigen. Statt dessen sollte ein zentrales Tempelareal entstehen. Von den unterschiedlichsten Entwürfen gewann der Entwurf zwei Arbeiter, die bereits an den Ausschachtungsarbeiten beteiligt gewesen waren. Es war der Entwurf der Geschwister Archie und Noel. Anstatt wie von fast allen anderen Entwürfen vorgesehen, die Hügel einfach einzuebnen, sahen Archie und Noel es vor, eine zentrale Tempelpattform, eine dreistufige Zikkurat, zu errichten. So wurde der Zentraltempel', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (183, '2003-05-18 00:00:00', 'de', 1, 'Helden Im Busch', 'bushman7', '[br]Hier setzt der Orginaltext plötzlich aus, denn die weiteren Teile bis zum Ende der Geschichte scheinen verloren gegangen zu sein. Mag also ab hier eine Nacherzählung die Lücken füllen:[br][br][br]Einige Zeit konnte Willhelm sich so durchschlagen, ohne das er dem Drachenlord begegnete. [br]Doch es wurde unvermeidlich. Willhelm suchte den Dämonen in seinem Wald auf seinem Baum auf. In Büschen kannte er sich ja aus. Der Drachenlord konnte ihn nicht sehen und so nicht töten. Doch anstatt ihn zu erschlagen, bot er ihm einen Handel an. Der Drachenlord hatte diese Gegend nun schon Genüge geplündert. Man können hier wirklich nichts mehr ernten. Es wäre doch besser er liese sich offiziell erschlagen und suche statt dessen eine weiter entfernte Gegend auf. Natürlich musste man den Dörflern eine gute Show bieten, bei der der Drachenlord scheinbar stürbe. Später würde Willhelm ihm dann folgen. Nun sind Drachenlords schlau und dieser Drachenlord besonders und es stimmte, die Gegend war bis auf das letzte Weizenkorn geplündert. Der Drachenlord willigte in den Handel ein und so lies er sich unweit des Dorfes von Willhelm zum Schein erschlagen. Die Täuschung gelang perfekt. [br]Die Dörfler waren froh nur ein paar Schuppen waren von der Bestie geblieben. Sie wollten Willhelm schon das letzte Hemd geben, denn zu essen hatten sie gar nichts mehr, aber Willhelm lehnte verschlagen ab. Er hatte gelernt. Sein Ruhm mehrte sich und er wurde hofiert und vorzüglichst bedient, derweil er dem Drachenlord nachreiste. Von Zeit zu Zeit zogen beide ihre wohl inszenierte Show ab und sie wurden dabei immer besser.[br][br][br]Doch eines Tages war alles anders. Aus dem Spiel wurde Ernst. Der Drachenlord war müde und schlief auf einem großen Baum ein. Dort wurde er von einem finsteren Kerl, dem bösartigsten Wesen, daß man sich vorstellen kann, im Schlafe überrascht und erschlagen. Es war ein anderer Drachenlord. [br]Dieser Drachenlord fand sich, wie es eigentlich mit dem toten Feund vereinbart war am Kampfplatze ein. Er wollte mal diesen Willhelm Im Busch, von dem man ja schon soviel gehört hatte, etwas kitzeln, bevor er ihn grillte und verspeiste. Während des Kampfes bemerkten beide Kontrahenten, das etwas nicht stimmte. Kurz gesagt, der Drachenlord biss Willhelm ein Bein ab, worauf der fast Ohnmächtig vor Wut und in seinem Schmerz zu Zorne entbrannt den Drachenlord erschlug.[br][br][br]Die Dörfler eielten zur Hilfe und pflegten ihn gesund. Doch ohne Bein und ohne Kompangnion war Willhelm aus dem Geschäft. So musste er durch die Lande tingeln, um von seinem Ruf als Held zu zerren. Zu letzt erzählte er wieder kleinen Kinder Geschichten. [br][br][br]Nun setzt der Orginaltext wieder ein:[br][br][br]Bis er hierherkam. Hier begegnete er unter einer Klippe einem kleinen Doedel. Er könne nicht den steilen Pfad hinauf mit nur einem Bein, sagte er dem kleinen Doedel. Dieser ganz ohne Arg, erkannte das Problem und schlug Willhelm vor er möge sich doch an einem Seil nach oben ziehen. Er würde dabei auch helfen. So holte der junge Doedel das Seil um den alten herauf zu ziehen. Der junge Doedel wand das Seil einmal um einen Baum und lies beide Enden herunter. Dann rannte er den steilen Pfad herunter um den alten Willhelm zu helfen. Das eine Seilende banden sie zu einer Schlinge und befestigten sie um den Stumpf Willhelms. Dort würde die Schlinge bestimmt nicht abrutschen. Dann zogen beide, der junge und der alte Dodel, am anderen Ende. Willhelm im Busch schnellte in die Höhe, doch er verlor das Gleichgewicht. Der Junge konnte das Seil alleine nicht halten. Darum fiel Willhelm aus der Höhe auf den Boden un blieb dort liegen. Er schloss die Augen. [br]&#187;Junge&#171; ,sprach er, &#187;Junge komm her und fürchte dich nicht. Höre gut zu ...&#171;[br] [br]Der junge Doedel kam und hört. So erfuhr er, die ganze und wahre Geschichte von Willhelm im Busch.[br]Dann hauchte der alte Doedel sein Leben aus, einfach so, denn verletzt war er nicht, nur müde, unendlich müde.[br][br]&#187;Ach eins noch, werte Ratte, wer war der junge Doedel und wo kann ich ihn finden?&#171; [br]&#187;Nichts leichter als das!&#171; [br], sagte die alte Ratte, [br]&#187;Ich bin seine Zofe!&#171; [br]Und dann rief sie: [br]&#187;Gehoorge! George im Busch! KOMM hervor ...&#171; ', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (184, '2003-09-30 00:00:00', 'de', 1, 'Der Yeti', 'yeti', '[br]Yetis sind die lokale Variante der Dämonen auf der Insel von Krawall. [br][br]Weiß, zottelig behaart, sehr groß, gewaltig sind sie[media]. [br][br]Diese schlichte Feststellung sollte einen aber nicht all zu sehr erschrecken. Man sollte jedoch stets bedenken, Yetis sind hungrig, immer und sie essen nahezu alles. Also einem Yeti, der von sich schon sagt, daß er hungrig ist, sollte man besser weiträumig ausweichen. So weit, daß man die Aussage schon nicht mehr mitbekommt. Ansonsten sind Yetis in schneereichen, vorzugsweise höher gelegenen und deswegen auch kalten Hochgebirgslagen sesshaft. Woanders würden sie ja auch kaum einen kühlen Unterschlupf finden, nahe dem Äquator. [br][br]Einige Besucher behaupten immer wieder steif und fest, sie hätten Yetis auch in Krawall, insbesondere im Hotel Mercator, aber auch in der Kanalisation von Krawall gesehen. Ersteres ist eindeutig ein Gerücht, verbreitet von redseligen Plappermäulern, die zuviel der lokalen Spezialitäten&fn=1'',300,200)">[1] genossen hatten. Die langen Kerls, welche das Hotel betreiben sind zwar groß und weißhaarig wie Yetis, doch sie sind entschieden zu freundlich und zu zuvorkommend&fn=2'',300,200)">[2], um Yetis zu sein. Im anderen Falle kann hingegen bestätigt werden, daß in der Kanalisation schon Haarbüschel von Yetis gefunden wurden. Große haarige Gestalten treiben sich dort auch herum. Man vermag aber nicht zu erkennen, ob diese weißes Fell haben oder braunes, wie viele glaubhaft bezeugen, denn hierfür bleibt einem einfach keine Zeit&fn=3'',300,200)">[3]. Ein längerer Aufenthalt in der Kanalisation ist nicht erholsam und somit zu vermeiden. Aus jenem Grund konnte bis zum heutigen Tage noch nicht geklärt werden, ob es Yetis in der Kanalisation von Krawall gibt.[br][br]Die Yetis in den Bergen lieben ihre all zeitige Schneelandschaft. In tieferen Lagen verstecken sie sich schon mal zwischen den Bäumen, wenn es frisch geschneit hat. So warten die baumlangen Kerls still und gut getarnt auf ihre Opfer, erschrecken von Zeit zu Zeit nichts ahnende Wanderer und Schneehasen. Weibliche Yetis sollen angeblich Angst vor Ratten und Mäusen haben. Sie lassen sich optisch nicht von ihren männlichen Artgenossen unterscheiden.[br][br]Yetis wohnen allerdings nicht im freien. Ein Rest Kultur scheint bei ihnen Bestand zu haben. Sie wohnen in den höheren kaum zugänglichen Lagen in selbst gebauten Wohnhöllen im tiefen Schnee. Auch die Benutzung von Feuer ist ihnen nicht unbekannt, doch schrecken sie zumeist davor zurück. Der Schnee schmilzt ansonsten. Ein Yeti ist friedliebend und gesellig. Sie lieben es derbe Scherze zu machen, vorzugsweise auf Kosten anderer. Yetis leben in Clans organisiert zusammen. Dem Clan steht ein Mamayeti vor. Dieses höchste aller Wesen ist gleichzeitig Clanvorstand und dem Glauben der Yetis nach der einzig wahre Gottheit. Um den Mamayeti hinreichend zu verehren, erbauen die Yetis vor ihren Höhlen Skulpturen von dem Mamayeti aus Schnee', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (185, '0000-00-00 00:00:00', 'de', 1, 'Geschichte von Drecksloch', 'his_drecksloch_1', '[br][br][br] Der unaufhaltsame Aufstieg der Stadt Drecksloch [br][br][br] Die Gründung  [br][br][br]Die Geschichte von Drecksloch&media=24'',700,480)">[media] beginnt mit dem Ende der großartigen Stadt von Krawall. Es steht nämlich zu vermuten, daß die ersten Einwohner von Drecksloch ehemalige Bewohner von S.N.C waren. [br] Sie landeten auf der Hauptinsel nahe der &#187;Bay&#171; genannten Bucht und gründeten dort ihre ersten Siedlungen. Zunächst verdienten die Bewohner ihren Lebensunterhalt nur als Bauern, aber ihr ererbtes Talent im Handel machte sie als bald zu Kaufleuten. In der Mitte der Siedlungen richteten sie einen vielbesuchten Marktplatz ein, jene Keimzelle, aus der die Stadt entstand. Der offene Marktplatz lockte aber nicht nur Kaufinteressierte an, sondern auch allerlei diebisches Gesindel, Räuberbanden und leider auch feindliche Heerscharen. Der Erfolg bezeugt sich oft durch neidische Nachbarn. [br] So kam es zu einigen Überfällen, die der jungen Stadt fast den Garaus bereitet hätten. Doch die Bewohner von Drecksloch wußten sich zu helfen. Sie organisierten selbst ein Heer, setzten einen erfahrenen Heerführer[1] ein und befestigten die Stadt großzügig mit Palisaden.Der Bau der Stadtmauer sollte 100 Jahre dauern und als sie fertig war, lag schon die halbe Stadt außerhalb.[br] [br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (186, '0000-00-00 00:00:00', 'de', 1, 'Geschichte von Drecksloch', 'his_drecksloch_2', '[br][br][br] Der unaufhaltsame Aufstieg der Stadt Drecksloch [br][br][br] Fürstenzeit [br][br][br]Drecksloch wurde daraufhin mal von einem Fürsten oder einem Tyrannen regiert oder meheren Fürsten und Tyrannen gleichzeitig. Es war die Zeit steter Ausdehnung des Einflußbereiches von Drecksloch, so daß man Ende dieser Zeit das kleinere Drittel regierte der Insel. Dieses Land hieß ebenfalls Drecksloch, denn die beiden Nachbarländer, Einerseits und Andererseits von Drecksloch waren diesem Land alles andere als wohlgesonnen. Ihr Name für Drecksloch lautete &#187;inferior&#171;. [br][br]Drecksloch teilte jetzt die Insel in drei Teile, wobei Drecksloch von der Bay bis zur Archipelküste verlief. Die anderen beiden Länder konnten nur noch über Drecksloch Waren austauschen. Auf diesem Wege wurde Drecksloch und seine Fürsten immer reicher. In Drecksloch erstarkte das Fürstentum und entfaltete seine volle Blüte. Scließlich war der beim passieren der Grenzen fällige Zoll eine stete Einnahmequelle. Die Fürsten verzichteten sogar darauf im Lande selbst Steuern zu erheben. Wodurch in Drecksloch ansäßige Kaufleute begünstigt waren. Aber es war auch eine Zeit der Kriege. Die vermögenden Fürsten von Drecksloch mußten immer wieder neue Heere ausstatten. Bald war das kleinere Drittel das größere. Und aus Drecksloch inferior wurde Drecksloch superior. [br][br]In jener Zeit wohnte in Einerseits eine geniale Ratte, die in alten, unglaublich klingenden Geschichten davon gelesen hatte, man können einen Übergang von einer Insel zur anderen schaffen, in dem man eine Hängebrücke erbaue. Er legte seinem Fürsten nahe, der mal wieder wegen des Zolles mit Drecksloch Krieg führte, den Krieg so schnell wie möglich zu beenden. Er solle stattdessen den Bau einer Hängebrücke finanzieren, die von Einerseits nach Andererseits von Drecksloch quer über die Bay führte. Der König befand den Plan für durchführbar. Er schloß so schnell wie möglich mit den Fürsten von Drecksloch Frieden, verkaufte sogar drei Dörfer an diese, um den Bau der Brücke zu finanzieren. [br] [br]Der Bau der Brücke war ein riskantes un schwieriges Unternehmen. Man hatte ja keine Erfahrungen mit so einer Unternehmung. Doch nach zwei Versuchen gelang das Unternehmen. Man hatte sich mittels geheimer Botschaften mit Andererseits verständigt. 10 Jahre stand die erste Bay-Brücke. Sie war Drecksloch ein Dorn im Auge, untergrub sie doch die Vormachtsstellung von Drecksloch auf der Insel. Zwar konnte man nicht alle Waren über die Brücke tranferrieren, weil man unter anderem auf günstige Windbedingungen warten mußte, doch die Zollausfälle waren deutlich spürbar. Die Fürsten von Drecksloch fassten hierauf einen Plan.  [br][br][br]Man studierte die Konstruktion der Brücke eingehend. Stellte ihre Schwächen und ihre Stärken fest un dlegte die Pläne der Brücke den eingenen Wissenschaftern und Baumeistern vor. Der Plan reifte. Sollte Drecksloch ruhig die Vormachtsstellung auf der Insel verlieren, man würde eine neue erobern. Die Fürsten planten den Bau einer Brücke zur nächsten Insel. Man würde den archipelen Handel[2] ausweiten. [br][br]Natürlich blieben solche umfangreichen Tätigkeiten nicht verborgen. Man mutmasste Spionage, vermutete, daß Drecksloch plane, die Brücke zu zerstören. Einerseits und Andererseits begannen einen fünfjährigen Krieg, in dem sie Drecksloch in arge Bedrängnis brachten. Drecksloch verlor einen Großteil seiner neuen Besitzungen. Der Bau der neuen Brücke war für diese Zeit unterbrochen. Der &#187;grüne Regen&#171;[3] führte zu einem Waffenstillstand. Kurz darauf setzte eine Dämonenplage in Andererseits ein. Dort tauchten mehrere Drachenlords auf. Decksloch[br]war das Glück noch einmal hold. Man began mit dem Bau der &#187;Neuen Brücke&#171;.[br][br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (187, '0000-00-00 00:00:00', 'de', 1, 'Geschichte von Drecksloch', 'his_drecksloch_3', '[br][br][br] Der unaufhaltsame Aufstieg der Stadt Drecksloch [br][br][br] Das Ende der ersten Brücke  [br][br][br]Es ist nicht ganz klar, woher Willhelm d.E. stammte, noch wie alt er war, als er in Einerseits das erstemal in Erscheinung tratt. Tatsächlich war bis zu diesem Zeitpunkt ein unbeschriebenes Blatt im Buche der Geschichte. Er fand Anstellung bei einem der Brücken-Reperaturtrupps. Die erste Bay-Brücke war alles andere als eine sichere Konstrucktion. Sie bestand nur aus Holz und Seilen. Dewegen musste sie ständig dem unbeständigen Wetter in der Bay Tribut zollen. Es ist sicher, daß es schon kurz nachdem Willhelm beim Trupp angeheuert hatte zu einem Brand mitten auf der Brücke kam. Ob der unerfahrene Hilfsarbeiter hierfür wirklich die Verantwortung trug, ist nicht mehr in Erfahrung zu bringen und nur in unglaubwürdigen Quellen bezeugt. Fest steht, daß ihm die Flucht vor dem Feuer nach Andererseits gelang, noch ehe die Brücke auseinanderriß und verbrannte. Willhelm, jetzt ohne festen Wohnsitz, in Einerseits als Brandsifter gesucht und wieder ohne Arbeit, heuerte kurzentschlossen bei der Drachentötern an, die verzweifelt versuchten der Dämonenplage in Andererseits Herr zu werden. Sein Mut und seine Entschlossenheit führten ihn. Das Blatt wendete sich und die Dämonenplage war vergessen. Damit war leider auch die Dankbarkeit der Herrschaft von Andererseits erschöpft. Sie sah in Willhelm einen Gefahr, hatte sie doch geheime Botschaften aus Einerseits erhalten. [br][br]Die Herrschaft wollte ihn gefangen nehmen lassen, doch seine ehemaligen Kameraden, die Drachentöter, wussten dieses zu verhindern. In Andererseits entbrannte ein Bürgerkrieg. Die Einwohner der ehemaligen Provinzen von Drecksloch verbündeten sich mit den Drachentötern und Willhelms Führung. Noch herrschte ein Patt. Einerseits hob Truppen aus, um Drecksloch daran zu hindern, die Truppen Willhelms zu unterstützen. Dann überfiel Einerseits sogar Dreckloch. Andererseits stellte Willhelms Truppen bei Flaggenfels. Die Schlacht schien für Willhelm schon verloren, da wendete sich das Schicksal. Nebel zog auf und verschaftte dem Heer von Willhelm Deckung. Den Drachentötern gelang es, sich in den Rücken des Feindes zu schleichen. So besiegten Willhelms Truppen die Armee der Herrschaft von Andererseits. Herrschaft von Andererseits floh. Es gelang ihr sich nach Einerseits abzusetzen. [br][br]Nun war es an Willhelm Drecksloch beizustehen, denn die Truppen der Fürsten waren in arge Bedrängniss geraten. Die Armee des Fürsten von Einerseits hatte sie bis tief in ihr Land gedrängt[br]. Hoch war der Blutzoll gewesen den Drecksloch schon zahlen musste. [br][br]Die vereinigten Truppen stellten den Feind zwischen Wegezoll und Brückenkopf[4]. Es war eine offene Feldschlacht. Das Schlacht war blutig. Sie währte lang. Zwei Tage und eine Nacht soll sie gedauert haben. Am Ende führte Willhelm den letzten entscheidenen Angriff. Seine Truppen waren siegreich. Die Insel von Drecksloch geeint. Die Herrschaft von Andererseits, der Fürst[br]von Einerseits und viele Edle von Dreckloch waren gefallen. Doch auch Willhelm d.E. erhob sein Haupt nicht mehr. Seine letzten Worte sind bezeugt. Er, der stets keinen Helm getragen hatte, soll gesagt haben: [br][br]&#187;Jetzt weiß ich, warum ich heuer einen Helm tragen wollte.&#171; [br][br]Noch in der selben Nacht verstarb Willhelm der Eroberer an einer tötlichen Kopfwunde. [br] [br]Aus den Dörfern Wegezoll und Brückenkopf wurde der Stadtteil Blutfeld. Zwischen Blutfeld und Altdrecksloch legten die Fürsten einen Park an, den Willhelminus. In ihm und nur in ihm blüht[br] der goldene Flieder, eine Pflanze die sonst nirgends wächst. Rote Ahornbäume säumen noch heute die Alleen, die Blutfeld mit AltDreckloch verbinden.[7][br][br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (188, '0000-00-00 00:00:00', 'de', 1, 'Geschichte von Drecksloch', 'his_drecksloch_4', '[br][br][br] Der unaufhaltsame Aufstieg der Stadt Drecksloch [br][br][br] Baumeister, Kaufleute und Schafe [br][br][br]In dieser Zeit gelang es unter der Herrschaft der Fürsten von Drecksloch die größten und wichtigsten Inseln miteinander zu verbinden. Man verwendete immer noch hauptsächlich Holz und Seile für die Konstruktion der eigentlichen Brücke. Aber die Haltbarkeit und die Sicherheit wurde wesentlich erhöht. Vielfach verwendete man Schwere Steine als Gegengewichte. Ankerpfeiler und Tragetürme wurde auch aus Stein erbaut. Bei weniger wichtigen Verbindungen baute man gar keine Vollbrücke, sondern nur eine Fährbrücke. Diese Konstruktion konnte sogar bei starken Winden eingeschränkt benutzt werden.[br] Über die neuen Verbindungen kamen die Schafe auf die Insel von Drecksloch. Wagen und Pflüge mussten nicht mehr mit der Hand gezogen werden, was eine wesentliche Verbesserung in der Wirtschaft bedeutete. Die Fürsten von Drecksloch dehnten ihren Herrschaftsbereich über die Nachbarinsel aus. Häufig kamen sie nicht mehr als Eroberer. Dörfer und Gemeinden schlossen sich freiwillig an, versprachen sie sich doch Teilhabe am wirtschaftlichen Erfolg von Drecksloch und Schutz vor räuberischen Nachbarn. [br][br]Die immer mehr Fürsten zogen auf das Land. Sie errichteten in den neuen Territorien ihre Gehöfte und Schafsfarmen, sicherten sich so ihren eigenen Machtbereich. Zwar behielten alle immer noch Hofhaltungen in Drecksloch, die sie gerne unbedeuteren Anverwandten überliesen, aber am Ende dieser Zeit regierten nur noch zwei Fürsten direkt über Drecksloch. [br] [br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (189, '0000-00-00 00:00:00', 'de', 1, 'Geschichte von Drecksloch', 'his_drecksloch_5', '[br][br][br] Der unaufhaltsame Aufstieg der Stadt Drecksloch [br][br][br] Wenn Zweie sich streiten ...  [br][br][br]... obsiegt der Dritte[br][br][br] Die Zeit der Könige  [br][br][br]König Rocky, der Erste [br] Der Fels, der ruht. Ein Königreich für ein Schaf. (Ein Schaf für ein Königreich?) [br][br]König Fuchs, der Zweite [br] [br]König Blutbart, der Dritte [br] Herr des Archipels [br] [br]König Haim, der Vierte [br] genannt der Löwe, Gunfried [br][br]König Sam &#187;Gevatter&#171; Hain, der Fünfte [br] Eiwantju, König von Drecksloch und Latifundien, die Bedeutung des Hallowein und der Karnevallisten, Entstehung des Samhain-Festes [br][br][br][br] Tyrannen, Fürsten, Revision  [br] und zwei glücklose Könige[br][br][br] Die letzten Könige [br][br][br]König Hain Rich, der Achte [br] Sieben Gefährten sollt ihr sein. (6 verstarben vorzeitig), Glaubensfreiheit? [br][br][br]König Mary, der Neunte [br] Bloody Mary[5], Wiederaufleben der Revision[br][br][br]Eliza, der Erste [br] Die königliche Ratte(Big Rat)[6], die Eiserne (Brücke), habeas corpus für alle, die Amada der Puristen, Glaubensfreiheit, fünfzig Jahre Herrschaft, das Vermächnis (genannt Glorious Revolution)[br][br][br] Die Zeit der ersten Bürgermeister [br][br][br]Ein Aufstrebenes Handelsreich, der Streik der Zugvögel, Bau von Bayland, G.I.Busch[br][br][br] Die Revolution der Kapitalisten [br][br][br] Neue Zeiten, moderne Zeiten [br][br][br]Bayarea, Drachenreiter, Die Erfindungen der Tweedle-Mail, Der Flug der Drachen, Auf der Tweedlebahn, Die Village Vanguard Boys, Mehrkopfdrachen und Datenhelme[br][br]ENDE des ZEITALTERS[br][br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (190, '0000-00-00 00:00:00', 'de', 1, 'Der Zornige Nick', 'zornig_1', '[br]Der zornige Nick[br][br]Ein Wintermärchen[br][br] Das Jahr wurde bescheidener. Es verlangte ihm nicht mehr nach allzu viel Wärme und Licht. Es hatte keine Zeit mehr. Die Tage wurden kürzer, dunkler und auch kälter. Gerade so, wie es dem alten Jahr noch gefiel. Es war müde. [br] Es wurde Winter, wie jedes Jahr um diese Zeit. [br][br] In Drecksloch fiel der erste Schnee. Die schweren Wolken krochen schon seit dem Morgen über die Kais des Hafens und entluden ihre weise Pracht. Hoch droben focht die Sonne einen unerbittlichen Kampf mit den Wolken. Heute jedoch würde sie verlieren. Blaß nur war sie durch das Treiben zu sehen. In den Straßen herrschte die normale Hektik, jene geschäftige, die für Drecksloch so typisch war. Die Kamine rauchten. Und ehe der Schnee gefallen war, war er schon grau. Grau war die Stadt. Der Matsch füllte die Straßen. [br] [br] Wütend stapfte er durch die Straßen. Er zog seinen viel zu dünnen, alten Mantel, den roten mit dem Pelzkragen, enger an sich heran. Die Knöpfe schlossen nicht richtig. Auch war der Mantel viel zu weit. Er hatte nicht die Statur seines Herrn und Meisters. Der war groß und kräftig, dick und rund. Ihm hatte der Mantel einst viel besser gestanden, als er noch neu und ungetragen war. Hernach war der Mantel durch viele Hände gewandert. Jetzt gehörte er ihm. [br] [br][br] Lauthals schrie er seine Predigten durch die Gegend, klopfte sich auf die Schultern, jedes Wort unterstreichend, daß er gegen das schlechte Wetter führte, gegen die Schuld und die Sünde dieser Welt, dieser Stadt und insbesondere ihrer Einwohner, gegen alle jene, welche das schlechte Wetter verursachten. Alle Jahre wieder ... [br][br][br][br] Er war ein Prediger. Das Leben eines Straßenpredigers war hart. [br][br] Genau genommen war er sogar nur ein Hilfsstraßenprediger. [br] Noch genauer betrachtet war der zornige Nick&fn=0" target="#_parent" onMouseOver="popup(''/story/footnote.php?show=&fn=0'',300,200)">[0]. Sein freudigstes Erlebnis im Jahr war die hohe Messe, wenn der Kelch herumgereicht wurde, aus dem sonst der Prediger alleine trank. Doch er war nun schon solange dabei, man lies ihn gewähren, wenn er sich einen Hilfswanderprediger nannte. Er war nur der Gehilfe von Gehilfen. Das Beste, was ihm je wiederfuhr, war, daß er Kehrknecht Ruppert&media=26" onMouseOver="popup(''/story/media.php?show=&media=26'',620,650)">[media] den Besen halten durfte. Prediger Kneehigh Jones hatte er nur vor der Ferne gesehen.[br] [br][br] Ach, hätte er doch nur einen Schal. Dann wäre ihm wärmer. So wärmten ihn nur seine Gedanken, seine Stimme war rauh und kehlig, sein Rufen schallten durch die Gassen. [br] [br][br] Hastig eilten die Leute an ihm vorbei. [br][br] Wer wollte schon mit so einem Verrückten zu tun haben. [br][br] Wer hätte ihm auch noch zugehört? [br][br] Oder gar, wer hätte es gewagt mit ihm zu sprechen? [br][br] [br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (191, '0000-00-00 00:00:00', 'de', 1, 'Der zornige Nick', 'zornig_2', '[br]Der Wind pfiff durch die Ritzen. In der Kirche war es kalt. Kneehigh Jones stand vor dem Altar und betete. Nun man konnte es glauben. Vielmehr brummelte er vor sich hin und grübelte. Bedächtig rückte er das Tischtuch auf dem Altar zurecht. Es war der einzeige Gegenstand der einwenig Pracht des Glaubens entfaltete. Der Altar selber war eine alte hölzerne Kiste, die Kirche ein alter Lagerschuppen. Die Gebäude der Kirche waren eine aufgelassene Handelsniederlassung. Ihr Zustand neigte sich dem stetigen Verfall entgegen. Es war das günstigste, was sein Vorgänger in der Mission, hatte erweben können. [br][br]Kneehigh Jones dachte an die Zeit in Rum zurück. Wie hatte er nur hier landen können? Er, ein vielversprechendes Kind seiner Kirche, saß hier im hintersten Winkel dieses dunklen kalten Loches fest. Unter lauter Ungläubigen vermochte er niemanden zu locken. Selbst die Prediger der alten Götter hatten es hier schwer. Dabei konnte man nicht behaupten, daß die Bewohner von Drecksloch unkultiviert waren. Auf ihre Art waren sie es. Doch was hier zählte waren Geschäfte, ... ,Geschäfte, Handel und Gewinn. [br][br]Was war das Geschäft der Kirche? [br][br]Worin lag der Gewinn des Glaubens? [br][br]In Kneehigh Jones rumorte der Zweifel. [br][br][br]Er blickte sich um. Wie sollte man mit einem solchen vermoderten Gebäude so weit abseits&fn=3" target="#_parent" onMouseOver="popup(''/story/footnote.php?show=&fn=3'',300,200)">[3]! [br][br]Unaufhaltsam war er im Colloquium und später im Collegium aufgestiegen, Stufe um Stufe, jede Pflicht demütig erfüllend. Zum Dank hatte man ihn hierher verbannt. Es gab immer Neider. [br][br]Sein unmittelbarer Vorgänger, der alte Drückeberger August, seines Zeichens jetzt als Augustus Augustulum in den Stand der Heiligen erhoben, hatte diese Mission gegründet. Drückeberger war nie aufgefallen, zu mindestens solange nicht, bis das jemanden aufgefallen war. Daraufhin hatte man ihn hierher geschickt, abseits der Kirche von Rum. August hatte dieses Gebäude gekauft und sich in weniger als zwei Jahren zu Tode getrunken. Die normale Jahresration der Mission betrug vier Vollfässer Rum. Er hatte sie ganz alleine getrunken. Daraufhin wurde er von der Kirche zu einem Märtyrer, alsbald sogar zum Heiligen ernannt. Immerhin war er volltrunken&media=28" onMouseOver="popup(''/story/media.php?show=&media=28'',620,650)">[media]. [br][br]Er seufzte. [br][br]', 1, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (195, '2004-06-20 00:00:00', 'de', 1, 'Die Funkfische sind wieder da!', 'Funkfish Games hat wieder eine eigene Seite. [br]Die Projekte sind nicht mehr l?nger in die Homepage von dem Dailylama-Projekt und seinen Geschichten integriert. Vielmehr habe ich mich entschlossen alle meine zuk?nftigen und in Entwicklung befindlichen Sp', 'Funkfish Games hat wieder eine eigene Seite. [br]Die Projekte sind nicht mehr l?nger in die Homepage von dem Dailylama-Projekt und seinen Geschichten integriert. Vielmehr habe ich mich entschlossen alle meine zuk?nftigen und in Entwicklung befindlichen Spiele hier vorzustellen. [br] [br]Immerhin gibt es mindesten drei Projekt, die hier zu erw?hnen w?ren: [br][br][URi]http://www.dailylama.net[/URi]Das &#187;Dailylama&#171; Projekt[UR/], die Geschichte eine Nagerwelt und des Zweiten Zeitalters.[br] [br][URi]http://www.tentakel-jones.de[/URi]The Fade of(f) LaLaLa [UR/].Aus sehr bekanntem Anlass- wie haben es schon wieder getan -ein brandneues Adventure.[br] [br]Das Funkfish [b]TALEnviroment[/b] und die dazu geh?rigen Java-Pakete.[br][br]Hatte ich noch nicht erw?hnt? Alle meine Spiele erforndern Java. Also holt euch das [URi]http://java.sun.com/getjava/[/URi]J2SDK von Sun[UR/].[br][br]Falls ihr euch wundert, was der blaue Kasten rechts soll:[br]Das ist englisch.', 2, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (196, '2004-08-30 00:00:00', 'de', 1, 'Mini Krawall', '\r[br]\r[br]Scene a("die Strasse"): in einem kleinen Dorfe\r[br] links stehen 4 und rechts 5 H?user("t?r 1"-"t?r 9")\r[br]   vorne wird die Strasse durch ein "grosses Haus" abgeschlossen.\r[br]       Man sieht aber, dass es "links" und "rechts" weiter geht.\r[b', '\r[br]\r[br]Scene a("die Strasse"): in einem kleinen Dorfe\r[br] links stehen 4 und rechts 5 H?user("t?r 1"-"t?r 9")\r[br]   vorne wird die Strasse durch ein "grosses Haus" abgeschlossen.\r[br]       Man sieht aber, dass es "links" und "rechts" weiter geht.\r[br]\r[br]Scene b("grosses Haus"): in dem "grossen Haus".\r[br]\r[br]Scene c("vor der Kneipe"): \r[br]  an diesem Ende der Strasse steht eine "Kneipe".\r[br] "rechts" der "Kneipe" f?hrt ein Weg weiter.\r[br]   man sie das Haus links nur ansatzweise\r[br]Scene d ("w?ste W?ste"): eine w?ste W?ste. Geht man Richtung der "Berge",\r[br]      kommen diese nicht n?her.\r[br] In der W?ste befindet sich ein "Skellet". Es fragt einen nach Wasser.\r[br]        Man bekommt selber Durst. \r[br]        Man kann jetzt  [a: umkehren] \r[br]                    [b: verdursten]\r[br]Scene e ("in der Kneipe"):\r[br]\r[br]"rechts" f?hrt jeweil in die  Scene d ("W?ste")\r[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (197, '2004-08-30 00:00:01', 'de', 1, 'im Haus', 'Scene ("im Haus"):[br]wenn man das Geb?ude betritt, sieht man rechts/links/mitte eine "Treppe" [br]hinten links/rechts/ sieht man ein "Fenster" mit "Blumenpott" und "Gardienen"[br]das "Zimmer" ist leer.[br]dreht man sich um, sieht man ein weiteres "Fenste', 'Scene ("im Haus"):[br]wenn man das Geb?ude betritt, sieht man rechts/links/mitte eine "Treppe" [br]hinten links/rechts/ sieht man ein "Fenster" mit "Blumenpott" und "Gardienen"[br]das "Zimmer" ist leer.[br]dreht man sich um, sieht man ein weiteres "Fenster" links/rechts, [br]auf der anderen Seite die "T?r" zur Strasse[br]Scene ("oberes Zimmer"):[br]ein Dachzimmer. Man sicht ein Gauben-"Fenster" und im Boden eine "Klappe"/"T?r".[br]Scene ("die K?che"):[br]Zu betreten durch die Klappe im Dachzimmer.[br]Man sieht eine "T?r" nach drausen (W?ste)[br]die Treppe von hinten[br]die Treppe nach unten den Keller[br]Scene ("im Keller"):', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (198, '2007-06-05 15:35:54', 'de', 1, 'Eine kurze Beschreibung des Projekts', 'Kurze Beschreibung des Projekts: Ganz kurz gesagt handelt es sich um ein "old-school" Adventure.', 'Kurze Beschreibung des Projekts:[br]Ganz kurz gesagt handelt es sich um ein "old-school" Adventure.[br]Etwas ausführlicher beschrieben handelt es sich um ein Adventure bei dem man eine eigene kleine Welt erkundet. Es kommen 8 große Lokations vor, die in Szenen, Levels und Quests zerlegt gespielt werden. Das Spiel läuft nicht linear ab, d.h. Quests können zu jeder beliebigen Zeit(- Level) gelöst werden. [br]Zur Story:[br]Nachdem das hochtechnisierte "erste Zeitalter", es fertiggebracht hat sich mittels einem Garagenexperiment selbst zu vernichten, fliegt die Welt sprichwörtlich in Trümmern. Nein, sie liegen nicht, die Trümmer,  sie fliegen. Es brechen barbarische Zeiten an.[br]Die Pedestrians sind die einzigen intelligenten überlebenden. Wir würden sie schlichtweg für Ratten odeer Hamster halten. Sie selber nennen sich unteranderem Doedel(nl.), Dudel, Doodles, Ratten, Hamster oder Rodents. Die Doedel sind auf der Suche nach dem verlorenen Buch des Schöpfers, besser gesagt, nach den einzelnen Seiten dieses Buches...[br][br](Geplante) Features:[br]Point&Click Steuerung,[br]gute, alte 2DGrafik und Musik,[br]Spaß ...[br]siehe auch Todo-Liste[br][br]Technik:[br]Java 2(J2Sdk 1.4) und Java 5(JDK 1.5), ich liebe diese Verwirrung die Sun da[br]betreibt. Es wurde bereits ein eigens kleines Package erstellt, welches immer[br]noch erweitert wird. Das(die) Spiele werden als eigene Resourcen-Packages[br]erstellt. Hintergründe bevorzugt als JPG-Grafiken, Animationen und[br]Objekt-Grafiken als 24Bit-PNGs mit Alpha Transparenz. Sounds und Musik als[br]wav-Dateien. Für die Musik wären auch MIDIs möglich.[br][br]ToDo-Liste (optional):[br]Noch eine Menge, als da wären: [br]Dialoge für den Singleplayer-Modus,[br]Dialog-System überarbeiten.[br]Quests überarbeiten, teilweise neu storyboarden,[br](ohne die grobe Storylinie zu verlassen)[br]Z-Maschine für die Steuerung von kooperativen NPCs,[br]weitere Evaluierung des Mutiplayermodus,[br]Datenmodel und Datenbanksystem für selbigen.[br]Editor(en) für das Package (Single und Multiplayermodus) [br][br]Verwendete Tools (optional):[br]Ein(jeder beliebige) Texteditor mit Syntax-Highlightning und Compiler-[br]Einbindung. [br]CVS (wird auf Subversions umgestellt)[br]Für die Grafik verwende ich PaintShop Pro 8, demnächst 9. PSP hat sich als [br]erheblich sinnvoller erwiesen als die Kombination von Adobe PS und Ilu, [br]unter anderem weil man in PSP Vektorgrafik mit Rastergrafik mischen kann. [br][br]Systemanforderungen (Prozessor, RAM, HD-Speicher, ... - optional):[br]Auf meinem Pentium 133MHz(96MB Ram) geht das Spiel, auf meinem Celeron-Notebook [br]1GHz(256MB Ram) nicht. Der ist inzwischen aber auch durchgebrannt. Auf einem PII[br]400MHz(512MB Ram) und einem PIV 1,4MHz (1GB Ram) läuft das Spiel. Mit anderen[br]Worten allzu hohe Anforderungen stellt das Spiel nicht. Auf aktuellen System[br]sollte die Applikation funktionieren. Es ist keine besondere (3d)Grafikkarte[br]notwendig, da das Spiel komplett 2D ist, viel Arbeitsspeicher ist da[br]sinnvoller.[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (199, '2004-06-15 00:00:00', 'en', 1, 'A todo-list PART1', 'the project of funkfish TALE[br]a T.extA.dventureL.ovelyE.viroment[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* * *[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;awip.[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* * *[br]a z-like-mashine:[br]based on this basic commands:[br]&nbsp;&nbsp;&n', 'the project of funkfish TALE[br]a T.extA.dventureL.ovelyE.viroment[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* * *[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;awip.[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* * *[br]a z-like-mashine:[br]based on this basic commands:[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;GOTO (simular to the crosshair cursor)[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;HAND (manipulate objects with the hand, eg. MOVE, DROP, PICKUP etc.)[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;EYE (see, view, lok at the object. Should return a desciption of what you see)[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;MOUTH (simular to speak to/with the object. Objects can also be persons - npcs)[br]//&nbsp;&nbsp;&nbsp;INVENTORY[br]//&nbsp;&nbsp;&nbsp;LOCATION[br]//&nbsp;&nbsp;&nbsp;FIGURE[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;?HELP[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;!EXIT[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;!QUIT[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&gt;LOAD[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;SAVE[br]COOKIES may used to remember status of the game[br]storing the game to restart where you have been[br][br]location descriptor [br]a written text. Descipts what you see generaly and give you highlighted inline overview about the objects.[br]eg:[br]Some FIVE MEN are standing in a dark room with one CANDLE.[br]They look angry. So you can''t reach the DOOR behind them.[br][br]ACTIONS: blow candle(MOUTH CANDLE), GOTO DOOR[br][br](a) special output and input line(s) simular to statusline,[br]but you may also make decide(select) what to make/speak/see... next[br][br]the normal input line simular to chat[br][br]usefull for a multiplayer games to send desciptins over the internet[br][br]a view of the room picture/maybe the backgroundimage instead', 2, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (200, '2004-06-22 00:00:00', 'en', 1, 'A todo-list PART2', 'the project of funkfish TALE\r\n[br]a T.extA.dventureL.ovelyE.viroment\r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* * *\r\n[br]build a game/location enviroment to run the game\r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* * *\r\n[br]a gamepanel sytems with different output -  status', 'the project of funkfish TALE\r\n[br]a T.extA.dventureL.ovelyE.viroment\r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* * *\r\n[br]build a game/location enviroment to run the game\r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* * *\r\n[br]a gamepanel sytems with different output -  statusbars\r\n[br]for checkbox or radiobutton selections\r\n[br]interaktive text input (commandostyle)\r\n[br]and output of eventmessages\r\n[br]the gamepanel will have a general look and feel\r\n[br]but may be part of the location\r\n[br]it will clearly by part of the locationview\r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* * *\r\n[br]the projectmanager\r\n[br]before you can load a project you have to build one\r\n[br]a new project button\r\n[br](you have to set the project directory, before you can create a project))\r\n[br]-  input dialoy for the project name\r\n[br]warning dialogs on:\r\n[br]delete (project) button \r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- show delete project dialog than\r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-  a listbox with all projects\r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;buttons "go" / "cancel"\r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if ("go") show dialog (you are going to delete the project [projectname])\r\n[br]run (you have to create a project, before you can test it)\r\n[br]open (you have to create a project, before you can test it)\r\n[br]store (you have to create a project, before you can test it)\r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-  show dialog with all locations in the project\r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-  if there are any, show warning (choose location and create a new one)\r\n[br]default font -  show dialog all selectable fonts in the fontfolder and sansserif, serif, monospaced\r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;in a listbox twice -  one labed default font the other titlefont\r\n[br]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;add colorchoosers to select the fontcolors\r\n[br]default background -  show dialog with a colorchooser&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;and a special button to browse for a background image\r\n[br]', 2, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (201, '2004-10-27 00:00:00', 'de', 1, 'Ratten-Gehirn fliegt Kampfjet', 'zitiert von http://www.golem.de/0410/34388.html\r[br]\r[br]Experiment soll helfen, Funktion und Interaktion von Hirnzellen zu erforschen \r[br]Um einen besseren Einblick in die Funktion von Hirnzellen zu erlangen, entnahm Thomas DeMarse, Professor an der Uni', 'zitiert von http://www.golem.de/0410/34388.html\r[br]\r[br]Experiment soll helfen, Funktion und Interaktion von Hirnzellen zu erforschen \r[br]Um einen besseren Einblick in die Funktion von Hirnzellen zu erlangen, entnahm Thomas DeMarse, Professor an der Universit?t Florida, rund 25.000 lebende Neuronen bzw. Nervenzellen aus einem Ratten-Gehirn und kultivierte diese in einer Glasschale. Dennoch konnte das "Ratten-Hirn" ein simuliertes Flugzeug steuern. \r[br]... \r[br]Jetzt sieht man, wo ich die Ideen f?r meine Geschichten her habe -&gt; solchen absonderlichen Meldungen. z.B. 14j?hriger baut Atommeiler in Garage, noch so ein wahrer Fall, US-Milit?rs planen Robotkakerlake, ...\r[br]...\r[br]Das extrahierte Gehirn soll Wissenschaftlern erlauben, die Funktion von Hirnzellen in Echtzeit zu beobachten. Gelingt es, das Zusammenspiel zwischen den Hirnzellen besser zu verstehen, k?nnen sich in Zukunft m?glicherweise Nervenkrankheiten wie beispielsweise Epilepsie besser behandeln lassen. Zudem k?nnen Hirnzellen vielleicht eines Tages als eine Art Mini-Computer eingesetzt werden, um unbemannte Flugzeuge zu steuern oder um Aufgaben zu erf?llen, die f?r Menschen sehr gef?hrlich sind. \r[br]\r[br]"Es geht uns darum, zu untersuchen, wie das Gehirn funktioniert", erkl?rt Thomas DeMarse. Das Gehirn bietet nicht nur eine enorme Speicherkapazit?t, es erlaubt es auch, T?tigkeiten nebenbei auszuf?hren, zu denen ein Computer nicht in der Lage ist. Zwar sind Computer bef?higt, bestimmte Berechnungen sehr schnell durchzuf?hren, an die Flexibilit?t des menschlichen Gehirns reichen sie aber nicht heran. \r[br]\r[br]Das experimentelle "Gehirn" von DeMarse steuert einen F-22-Kampfjet in einer Simulation, wobei 60 Elektroden zum Einsatz kamen. Auf diese wurden die Hirnzellen aufgetragen, die, so DeMarse, sich schnell wieder miteinander verbanden und so ein lebendes neuronales Netz bildeten. Gehirn und Simulator entwickelten dann eine Zwei-Wege-Verbindung, ?hnlich wie Nervenzellen ihre Signale gegenseitig interpretieren, um den menschlichen K?rper zu steuern. Durch Beobachtung der Nervenzellen wollen die Forscher nun die Funktion des neuronalen Netzes dekodieren. \r[br]\r[br]Erstmals an den Simulator angeschlossen war das Gehirn zwar nicht in der Lage, das Flugzeug zu kontrollieren, denn das Flugzeug driftete in zuf?llige Richtungen. Das neuronale Netzwerk reorganisierte sich aber langsam, wodurch es zunehmend in der Lage war, das Flugzeug zu steuern. Dabei konnte es auch auf unterschiedliche Wetterbedingungen reagieren.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (202, '2004-11-05 00:00:00', 'en', 1, 'Do Not Feel Embarrassed And Ashamed', 'I was shocked too - in the first moments of the election night.[br]Then I was starting thinking. Here are my final results:[br][br]Do not feel ashamed.[br]It is in fact not about Americans, not a typical "American" think.[br]I''m sure that in every other c', 'I was shocked too - in the first moments of the election night.[br]Then I was starting thinking. Here are my final results:[br][br]Do not feel ashamed.[br]It is in fact not about Americans, not a typical "American" think.[br]I''m sure that in every other country of the world this could happen too.[br][br]There are indeed more than 56% in your country still believing that G.W.B  is an Idiot. It''s about nearly 100%, accept one. It''s a proven fact. But this idiot has spoken out loud and often enough, that you still do not know anything about the other guy. And this time he was honestly true.\r\n[br]People do not like to inform their self. They try to avoid this.[br][br]It''s like thinking : a hard job and a lot of work anywhere in the world.[br][br]So that''s why 51% were voting for G.W.B, because they know he''s an idiot.\r\n[br]\r\n[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (203, '2004-11-06 00:00:00', 'en', 1, 'Me In The Windows', 'Look the guy on the right side, that is me.\r\n[br]If you wanna meet up, search for me in the windows or the lobby of the sfcc, Odeonsplatz, munich.\r\n[br]I Usaly stay there on saturday', '[img]http://www.funkfish.net/image/sfcc.jpg[imgw]340[imgh]262[/img]\r\n[br]Look the guy on the right side, that is me.\r\n[br]If you wanna meet up, search for me in the windows or the lobby of the sfcc, Odeonsplatz, munich.\r\n[br]I Usaly stay there on saturdays afternoons and sometimes even on sundays. ', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (204, '2004-11-06 00:00:00', 'de', 1, 'America is still a mirical', 'Trotz englischen Titels, werde ich jetzt nichts ?ber die USA schreiben.[br]Vielmehr geht es hier um das Tentakel-Jones-Projekt.\r\n[br]Ich suche nach: Mitarbeitern und ?bersetzern,[br]...[br]Mit-Grafikern, Mit-Programmierer ,und was man sonst so noch f?r ei', 'Trotz englischen Titels, werde ich jetzt nichts ?ber die USA schreiben.[br]Vielmehr geht es hier um das Tentakel-Jones-Projekt.\r\n[br]Ich suche nach: Mitarbeitern und ?bersetzern,[br]...[br]Mit-Grafikern, Mit-Programmierer ,und was man sonst so noch f?r ein Projekt braucht, kurz um Mit-Streitern.[br][br]Hier f?r euch das neueste Bild und ann?hernde Final von Tentakel-Jones:[br][br][img]http://www.tentakel-jones.de/img/tentakel_jones_nv.jpg[imgw]340[imgh]300[/img]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (205, '2005-02-11 00:00:00', 'de', 1, 'Gehirn-Lawinen helfen bei Gedächnisschwund', 'Versuche mit Rattenhirnen zeigen selbstwachsende Netzwerke Bei Experimenten mit Rattenhirnen haben US-Forscher einen neuen Effekt beobachtet, den sie "Gehirn-Lawinen" nennen.', 'zitiert von golem: http://www.golem.de/0502/36092.html [br] [br]Versuche mit Rattenhirnen zeigen selbstwachsende Netzwerke[br][br]Bei Experimenten mit Rattenhirnen haben US-Forscher einen neuen Effekt beobachtet, den sie "Gehirn-Lawinen" nennen. Eine einzelne Erinnerung löst dabei eine Kettenreaktion aus. Die Erkenntnisse sollen später einmal bei nachlassendem Gedächtnis helfen.[br][br]Wissenschaftler der Universität Indiana hatten Ende 2004 Teile eines Rattenhirns an Mikroelektroden angeschlossen. Dabei stellten sie fest, dass die Nervenzellen sich gegenseitig aktivierten - dies aber nicht langsam und stetig, sondern schubweise. Die Forscher prägten dafür den Begriff der "Gehirn-Lawine" oder "brain avalanche".[br][br]In einer Computersimulation bildeten die Wissenschaftler das Muster der Aktivierung nach. Dabei brachten die Rechner nach kurzer Zeit eine Reihe stabiler Muster zustande, wie sie auch bei früheren Versuchen mit den Gehirnen von Affen beobachtet worden waren. Die Primaten zeigten diese Muster, nachdem sie einen Lernprozess abgeschlossen hatten.[br][br]Daher gehen die Forscher jetzt davon aus, dass diese lawinenartigen Abläufe auch an dem Mechanismus der Erinnerung beteiligt sind. Das Ziel der Untersuchungen ist es, die neuronalen und chemischen Auslöser zu entschlüsseln, um vielleicht einmal Mittel gegen Gedächtnisschwüche zu finden. Die Ergebnisse aus Indiana werden am 4. Februar 2005 in der Zeitschrift "Physical Review Letters" ausführlich veröffentlicht.[br] [br] [br][br]Die Funktion von biologischen neuronalen Netzen steht schon länger im Zentrum der Gehirnerforschung. Bereits im Oktober 2004 war es in einem ähnlichen Experiment an der Universität von Florida gelungen, Zellen eines Rattenhirns zur Steuerung eines Flugsimulators einzusetzen. Auch dabei organisierte sich das neuronale Netz selbst.[br] [von Nico Ernst][br]  ', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (206, '2005-03-06 00:00:00', 'en', 1, 'A small part of my adventure editor is ready to run', '[img]image/screenshot_1.jpg[/img] [br]\r\n[br]...or should I say this is an standalone tool?\r\n[br]Well, anyway, it''s creates vector images so far, and -  haven''t finished the GUI for the video toolset so far - can create movie-files(*.mov) with and with out', '[img]image/screenshot_1.jpg[/img] [br]\r\n[br]...or should I say this is an standalone tool?\r\n[br]Well, anyway, it''s creates vector images so far, and -  haven''t finished the GUI for the video toolset so far - can create movie-files(*.mov) with and with out sound. You write an imagelist, call tool NO.1 on the console, get a silent movie, merge this movie with a wav file an than finally concatenate that with another movie. On the console ..., but I will change this.[br]Also a dialogeditor is include, a storyboard-writer, too.[br]The format(s) to save all projectfiles is based on XML; SVG for the images, selfmade for the other types.[br] [br]See here a image that I made with the image-editor: [br] [br] [img]image/morgendunst.jpg[imgw]340[/img][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (207, '2005-04-28 00:00:00', 'de', 1, 'Am Scheideweg', 'Am Scheideweg? Wird das Projekt aufgegeben? Niemals! Von den mehr als 100 Szenen sind 60 bereits "fertig" gezeichnet. Mit anderen Worten, ich weiß,wie sie aussehen werden. Das Storyboard wächst unaufhörlich, was mich allmählich beängstigt. Von den Editore', 'Am Scheideweg? Wird das Projekt aufgegeben? Niemals! Von den mehr als 100 Szenen sind 60 bereits "fertig" gezeichnet. Mit anderen Worten, ich weiß,wie sie aussehen werden. Das Storyboard wächst unaufhörlich, was mich allmählich beängstigt. Von den Editoren, ins besondere den grafischen, arbeiten die meisten. Und genau hier liegt das Problem.[br][br]Es gilt folgendes zu entscheiden: Wird die Grafik weiterhin mit Hilfe von PSPro9 entwickelt oder steige ich ganz auf den eigenen SVG-Editor um. Damit ließe sich dann die Grafik beliebig skalieren, die Bildschirmauflösung würde keine Rolle mehr spielen.[br][br]Netter Weise kann man aber auch mit solcher Grafik -reine Vektorgrafik- hervorragend 3 Dimensionen darstellen, ohne dass das ganze nach Pixel-Soße aussieht. Es sieht vielmehr nach 2d Grafik aus.[br][br]Nachdem ich das Problem kurzfristig angerissen habe, PSP, SVG oder gar 3dV, hier meine hoffentlich weise endgültige Entscheidung:[br][br]Ich widme mich ab sofort, wieder vermehrt den Skripten, dem Storyboard und allerlei Skizzen. Sowas sollte nicht übers Knie gebrochen werden ...[br][br]Nebenbei habe ich fast alle Charaktere im Spiel noch einmal, und wahrscheinlich nicht das letzte Mal, überarbeitet. Neben den beiden Hauptcharakeren, "Hamster Dudels" und "I-Rat", werden im Spiel das Lama, Meister Soso, Archie und Noel, Waldbewohner und Hühner, Blumenkinder, Schweine und andere mehr oder minder bekannte Zeitgenossen auftreten.[br] [img]http://www.funkfish.net/spiele/images/pic_of_the_week/hamster_and_rat.gif[imgw]340[imgh]250[/img]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (212, '2007-06-06 11:59:24', 'de', 1, 'Pedestrian', 'Pedestrian', 'Pedestrian, der:[br]Bezeichnung für einen Adeligen. In Muddy Waters (Drecksloch) wird diese Bezeichnung für den unteren Adel verwendet.[br]', 3, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (213, '2007-08-27 15:31:29', 'de', 1, 'Es war einmal vor langer Zeit die GCDC', '... und jetzt bin ich wieder zurück.', 'Was heißt hier wieder zurück?[br]Ich bin umgezogen von München nach Hamburg, weil meine der Sitz meiner Firma verlegt worden ist.[br]Ich war in San Francisco zur GDC und besuchte telltalegames.com. Die Hemden von D.Grossman sind beeindruckend. [br]Meine Mutter ist gestorben. Dazu möchte ich nicht mehr sagen.[br]Ich war krank. Trotzt der modernen Medizin nimmt eine Lungenentzündung im Sommer einen ganz schön mit. Und neulich, wie Ceaser sagen würde, war ich auf der GCDC und der GC in Leipzig. Mit anderen Worten:[br]letzte Woche.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (214, '2007-10-18 17:50:50', 'en', 1, 'A file format proposal for the three dimensional web.', 'ACME - A file format proposal for the three dimensional web.', 'A file format proposal for the three dimensional web.[br][br]The format could have the mime type ?text/acme? with the ending ?.acme?. Another name could be oakland with the ending ?.oak?.[br]It should be human readable.[br][br]The file is similar to a html-file.[br]It''s an xml-file with the encoding ?UTF-8? or ?ISO-8859-1?.[br]Instead of a head and a body section, it is splatted into a definition section ?def? and a environment section, that describes the 3d space. [br][br]The definition section contains scene width definitions like materials, linked external and global definitions, that can be used over the complete web (web page only?) and scripts of any type like javascript, groovy, beanshell, jlua(lua), jphyton(phyton), quercus(php) etc.[br][br]The environment section contains the background definitions and the object-list section. Each stateless object can contain more objects. Objects may be stateless collections of objects or primitives. There are four predefined primitives: box, cone, sphere and cylinder. [br][br]A object can be loaded from a external source.[br][br]What the file format should be able to do:[br][br]link to a external source.[br]Connect via hyper reference to another file ? html or acme.[br]Use 2D-Files as textures.[br]Use media-files as textures.[br]Use Applications as beans. [br][br]Link to server sided applications via sockets(chat, movement, profiles etc.).[br]', 2, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (215, '2007-10-18 17:51:40', 'de', 1, 'A file format proposal for the three dimensional web.', 'ACME - A file format proposal for the three dimensional web.', 'A file format proposal for the three dimensional web.[br][br]The format could have the mime type ?text/acme? with the ending ?.acme?. Another name could be oakland with the ending ?.oak?.[br]It should be human readable.[br][br]The file is similar to a html-file.[br]It''s an xml-file with the encoding ?UTF-8? or ?ISO-8859-1?.[br]Instead of a head and a body section, it is splatted into a definition section ?def? and a environment section, that describes the 3d space. [br][br]The definition section contains scene width definitions like materials, linked external and global definitions, that can be used over the complete web (web page only?) and scripts of any type like javascript, groovy, beanshell, jlua(lua), jphyton(phyton), quercus(php) etc.[br][br]The environment section contains the background definitions and the object-list section. Each stateless object can contain more objects. Objects may be stateless collections of objects or primitives. There are four predefined primitives: box, cone, sphere and cylinder. [br][br]A object can be loaded from a external source.[br][br]What the file format should be able to do:[br][br]link to a external source.[br]Connect via hyper reference to another file ? html or acme.[br]Use 2D-Files as textures.[br]Use media-files as textures.[br]Use Applications as beans. [br][br]Link to server sided applications via sockets(chat, movement, profiles etc.).[br][br]Here is a little [URi]http://tentakel-jones.de/test.acme[/URi]test.acme[UR/] file.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (216, '2008-02-26 01:06:25', 'de', 1, 'GDC is over', '... and so am I.', 'Pretty soon on Wednesday evening I have to leave San Francisco again. I took the "writes trail" at GDC. [br]Mark Travis lecture was fun stuff, although it was about directing and how this can make the development/writing of games more efficient. Not directly writing, but it was giving some new ideas to me. [br][br]Had a nice evening with the girls from writerscabal. They celebrated the first anniversary.  [br][br]On Tuesday i went to the Casual Games. There was a discussion going on with the topic of "storytelling in casual". Totally unexpected. [br][br]Wednesday I met someone (NAMES!) from Avaloop, an austrian company. [br][br]...', 2, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (217, '2008-03-19 10:09:37', 'de', 1, 'Neurosen und andere blumige Mittwöchlichkeiten', 'Heute ist Mittwoch, 2008-03-19. Karwoche ...', 'Heute ist Mittwoch, der Tag vor Donnerstag, Gründonnerstag. Übermorgen wäre dann Karfreitag. Voraussichtlich ist das so, aber zwischenzeitlich kann ja immer noch die Erde untergehen und nicht, wie sonst üblich, immer nur die Sonne. Das wäre mal eine Abwechslung.[br][br]Eine Abwechslung wäre es auch, wenn heute Aschermittwoch wäre. Dann würde die Fastenzeit statt  elendiger 40 Tage nur noch 2 Tage dauern. Heute und morgen. Freitag ist dann Schluss.[br] [br]Also lasst uns feststellen, wir haben die Karwoche. Ist Ihnen schon aufgefallen, dass der Vatikan seit Jahrtausenden mit der Karwoche Werbung für Karstadt macht. Das nenne ich mal Produktplacement.[br][br]Aber wir haben die Karwoche, oder heist das Kehrwoche? Denn der Frühjahrsputz muss ja  auch gemacht werden. Morgen also wedeln wir mit Palmenzweigen. Ist ja Gründonnerstag und irgendwer muss den  Hausputz machen. Ansonsten hängt der Segen schief.[br]Und ein Schild am Kreuze, Aushilfsputze gesucht.[br]Man kann ja nicht jemanden ans Kreuz nageln, ohne vorher geputzt zu haben. [br][br]Wie gesagt: heute ist Mittwoch.[br]Woraus sich ergibt, das der morgige Donnerstag grün ist.[br]Freitag nageln wir dann Jupp - ans Kreuz natürlich, das hat ja schon Tradition.[br]Samstag ist Eiersuchen angesagt.[br]Das große Finale ist dann am Sonntag, Ostersonntag. Darum sage ich euch: Wer unter euch ohne Sünde sei, der werfe das erste Ei. Möge die Sonne ewig scheinen, die Erde niemals untergehen. [br]Montag aber können wir alle später aufstehen. Jupp hat da ja so seine Probleme mit dem Aufstehen ? wie gesagt.[br][br]Heute ist Mittwoch.[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (218, '2008-03-20 10:22:57', 'de', 1, 'Grün, grün, grün, wenn Spaniens Blüten blühen', 'Grün, Blüten, Wetter, Frühling, Karl der Kahle', 'Falls Spaniens Blüten blühen.[br]Also gut heute ist Gründonnerstag.[br]Es lies sich nicht vermeiden. Wir haben schließlich Ostern.[br][br]Gestern sind wir im Büro auf den Hund gekommen. Das darf man ganz wörtlich nehmen. Wir hatten einen Hund im Büro. Nur für einen Tag und als Gast.[br]Das Wetter ist allerdings auch auf den Hund gekommen. Ja ein Beitrag über das Wetter und das in einem Blog! Es hat geschneit. [br]Es ist kalt. [br]Es scheint die Sonne. [br]Im Garten blühen die Osterglocken. [br]Auf den Dächern, da liegt der Schnee. [br]Man fühlt sich, als wäre Weihnachten ? bitte nicht schon wieder. [br]Dabei, ich möchte es betonen, haben wir Ostern.[br]Draußen sollte es feucht und kalt sein. [br]Es sollte Katzen und Hunde regnen! [br][br]Aber Wetter wir können uns wehren und nicht nur übers Wetter wettern![br][br]Ab sechsuhrachtundvierzig wird zurück geschossen! Mit Pollen und Salaten.[br]Wir haben Frühlingsanfang.[br][br]Heute gestatte ich mir einen kleinen Ausblick auf die Zukunft. Morgen blogge ich dann wahrscheinlich über Karl den Kahlen, schließlich wird Kar(l)freitag sein.[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (219, '2008-03-21 11:20:45', 'de', 1, 'War Karl der Kahle wirklich kahl?', 'Jupp am Kreuze, Karl der Kahle, von Kaisern und anderen Leuten ohne Kleider.', 'Heute ist Karlfreitag.[br]Naja, eigentlich ist Karfreitag, aber auf schleichende Werbung stehe ich nicht so. Außerdem haben alle Geschäfte geschlossen, auch Karstadt. Also wenden wir uns Kaiser Karl dem Kahlen zu. Eine schöne Alliteration, nicht wahr?[br]Aber war Kaiser Karl wirklich kahl?[br]Hatte er wirklich eine Glatze oder wurde ihm das nur angedichtet?[br]Von Dichtern die nicht ganz dicht waren? Zu jener Zeit konnte man für solche Behauptungen noch enthauptet werden. Zumal die Zensur noch streng war. [br]Oder war Karl der Kahle gar Vorreiter der FFK-Bewegung? Ein Naturbursche sozusagen und Vorbild für die Geschichte µDes Kaisers neue Kleider«?[br][br]Ist es Ihnen schon aufgefallen das auch Osterhasen häufiger keine Kleidung anhaben?[br]War Karl der Kahle wohl möglich ein Osterhase?[br]Feiern wir deswegen Karlfreitag zu Ostern?[br]Ist das überhaupt von Bedeutung?[br][br]In diesem Sinne ...[br][br][img]http://www.rabbiators.com/rabbi_2.jpg[imgw]400[imgh]500[/img][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (220, '2008-04-01 09:59:45', 'de', 1, 'Gerüchte über Häschen', 'Hasen, Löwen, Grubenarbeiter der Welt vereinigt euch. Nikolaus ist auch dabei!', 'Über das Häschen in der Grube habe ich gehört, dass es dort in der Grube des Häufigeren Besuch hat und gräbt. Zusammen mit dem Besuch -  es nimmt gerne  jede Hilfe an. Ob auch  von  Löwen und Füchsen,  das war nicht  in Erfahrung zu bringen.[br]Vielmehr wurde betont, jede Hilfe würde akzeptiert.[br][br] Abschließend ist über dieses  Gerücht zu sagen:[br]Wer mit anderen eine Grube gräbt, ist selten allein.[br][br]Ein anderes Gerücht betrifft Schoko-Osterhäschen. Es ist definitiv unwahr, wenn behauptet wird, dass Schoko-Osterhasen umverpackte Nikoläuse seien. Dieser unverforenen Verleumdung, dieser Unwahrheit wird hier ein für alle Mal widersprochen. [br]Ich gebe ihnen mein Ehrenwort.[br]Ich wiederhole: Ich  gebe ihnen mein Ehrenwort.[br][br][img]http://rabbiators.com/NikolausWrapsOsterhase.jpg[/img][br][br]Na gut, das Gerücht beruht auf Tatsachen ? teilweise.[br]Es ist genau umgekehrt. [br]Die Osterhasen helfen dem Nikolaus aus. Deswegen sind alle Schoko-Nikoläuse umverpackte Schokohäschen oder zu mindestens mit Hilfe von eingeschmolzenen Schokohasen hergestellt. Was soll man auch sonst mit der Überproduktion machen.[br][br]Selber essen? Davon wird man nur fett.[br]Und das ist kein Gerücht.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (221, '2008-04-01 10:04:26', 'de', 1, 'Morgens Frühstück-abends Elmex*', 'Von Hasen, die sich die Zähne putzen und arbeitslosen Fachberatern.', 'Wie den meisten bereits aufgefallen sein dürfte:[br]Ostern ist endgültig vorbei, und ich kann nur betonen, Ostern ist sowas von vorbei, vorbeier geht es gar nicht[br][br]Was machen wir also mit den Resteiern von Ostern?[br]Und wie putzen sich Osterhäschen eigentlich die Zähne?[br][br] Also gut, an Karotten kauen ist auch gut  für die Zähne, aber ist das die finale Lösung?[br][br] Was sind Osterhäschen eigentlich nach Ostern?[br]Sterben sie oder sind sie jetzt nur noch einfache Häschen oder sind sie ARGE-Häschen, weil sie ja nun arbeitslos sind?[br][br]Der fröhliche Arbeitslosenberater rät ihnen auf jeden Fall:[br]Morgen Frühstück und abends Elmex.[br]Und das hat sogar einen tieferen Sinn. Es hilft ihnen beim sparen. [br]Frühstück ist die Mahlzeit, die am häufigsten ausgelassen wird. So ähnlich ist es auch mit dem Zähneputzen. Es ist eine der unbeliebtesten Tätigkeiten. Wer steckt sich schon freiwillig Seife in den Mund? Hasen mit an Sicherheit grenzender Wahrscheinlichkeit nicht.[br]Daher auch die Empfehlung des ARGE-Fachberaters. Es kommt im statischen Mittel so selten vor, dass man frühstückt, da reicht auch eine Tübchen Elmex, denn Elmex kann man in diesen winzigen Portionstuben kaufen. Da trocknet die Zahnpasta wenigstens nicht aus.[br][br]Sie meinen das sei alles nur Quark ? da sag ich nur noch: Käse![br][br]*Tolles Markenplacement. [b][br] Dieser Titel ist gesponsert von Odol -[br] da fühlt sich jedes Hasenzähnchen wohl![br][/b]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (222, '2008-04-02 12:09:45', 'de', 1, 'Häschen hüpf und Mörchen flieg', 'Obwohl Frühjahr ist, ist es nicht mehr ganz so früh im Jahr.', 'Der April hat sich geschickt eingeführt. Ganz schmerzlos mit schönstem Aprilwetter, Sonnenschein pur, schickte er uns vergnüglich, heiter, voller Freude in den April, ohne uns zu veräppeln, in das zweite Quartal dieses Jahres, in den Frühling.[br][br]Wie doch die Zeit vergeht. So schnell wird man alt und älter. Die jungen Springensfelde hüpfen schon wieder durch die Gegend, Frischlinge im Jugendwahn. [br][br]Noch einen Brennnesseltee?[br]Noch ein Möhrchen?[br]Frühlingsgefühle?[br][br]Ersten: der April ist noch nicht vorbei.[br]Zweitens: Heute ist erst der zweite des Monats.[br]Und drittens: ist doch sowieso alles egal.[br][br]Frühlingsdepressionen?[br][br]Frühlingsfrische läßt sich am Besten durch einen Frühjahresputz erreichen. Nur so als Tipp: das hilft auch ungemein gegen schlechte Laune.[br][br]Wie im Fluge vergeht die Zeit![br]Oder haben sie Flugangst?[br]Dann bleibt ihnen immer noch die Möglichkeit früh aufzustehen. [br]Frühaufsteher haben mehr vom Tag. [br]Seit der Zeitumstellung ? Sommer- und nicht Frühlingszeit ? wird es auch wieder früher spät. Dafür bleibt es länger hell.[br][br]Andere haben jetzt die Frühjahrsmüdigkeit für sich entdeckt. Aus den Federn zu kommen, bereitet ihnen Schwierigkeiten. Unsere lieben geflügelte Freunde, wie lieblich sie doch schon in frühester Morgenstund singen, machen es uns vor.[br][br]Jupp hat auch so seine Schwierigkeiten mit dem Aufstehen, aber sein großer Tag kommt erst noch, keine Sorge, so sicher wie der Tag der Arbeit. Dann ist Himmelfahrt angesagt. Nichts für Leute mit Flugangst, wohl bemerkt. Jupp aber hat Flugangst. Das erklärt auch seine Probleme mit dem Aufstehen.[br][br]Das ist kein Wunder, sowie mancher Dronnbusch brennender Weis, vorzugsweise Rosen, oder noch besser Neurosen. Pfingstrosen gibt es nicht nur zu Pfingsten![br][br]Ja, ich gestehe ich liebe Häschen, seinerweis Bug Bunny![br][br]Mit Ostern ist an Pfingsten Schluss! [br]Endgültig aus und vorbei!![br]NIE WIEDER!!![br] [br] Für dieses Jahr ...[br][br][URi]http://www.funkfish.net/spiele/blog_Neurosen_und_andere_blumige_Mittwoechlichkeiten.html[/URi]... und heute ist Mittwoch.[UR/]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (223, '2008-04-02 12:38:16', 'de', 1, 'Vorschreiben,  Vorschriften, Zeitungen und Blöcke', 'Der Blog ist ein elektronischer Block? Was passiert, wenn man die falsche Zeitung erhält. Wozu vorschreiben gut ist, erklärt keine Vorschrift.', 'Heute, morgen ist das schon gestern, habe ich die HAZ bekommen, statt der FAZ. [br]Das erscheint den Meisten nicht so tragisch, aber man sollte es vielleicht erklären. [br][br]Die HAZ ist die Hamburger Allgemeine Zeitung, so eine Art gehobenes Käseblatt für den hamburger Norden. So etwas liest man, wenn man über Leuchttürme im Norden oder die aktuelle Käseproduktion informiert werden wil. (Zitat: "Hamburg ist ein Leuchtturm der Beschäftigung in Nordeuropa")[br][br]Die Frankfurter Allgeimene Zeitung, kurz die FAZ, berichtet über die Welt, die Welt der Hochfinanzen, Literatur und Theater nicht nur im deutschsprachigen Raum und diverse andere internationale Angelegenheiten.[br][br]Gut, Hamburg ist groß, deswegen ist die HAZ auch nicht nur ein  Lokalblättchen, aber ärgerlich ist es schon. Sie denken es sei eine wilkommene Abwechslung? Nicht wenn man gerade die FAZ für zwei Wochen testet. Die HAZ kenne ich schon, da brauche ich keinen direkten Vergleich. ich hatte mich bewusst für die FAZ für meine Altpapiersammlung entschieden.[br]Da darf man sich fragen, handelte es sich um agressive Werbung der HAZ oder um die Schusseligkeit des Lieferanten.[br][br]Wie dem auch sei, das kann hier nicht geklärt werden. [br][br]Klar aber ist, dass in Deutschland Rauchverbot herscht. In alle öffentlichen Räumen, so auch Kneipen, und auf allen Bahnhöfen, auch denen der HVV. Um so verwunderlicher ist es, daß sich einige Erwachsene im Beisein ihrer Kinder nicht an die Vorschrift halten.[br]Das ist ein schlechtes Vorbild. Auf den Boden zu aschen und damit den Bahnsteig zu verdrecken ist der wahre Grund für das Rauchverbot auf Bahnhöfen. [br]Machen diese Eltern das auch bei sich zu Hause, in der Küche, im Bad, im Schlaf- und Wohnzimmer ? im Kinderzimmer gar? [br]Rauchen in Gegenwart von Kindern ist ein Übel, egal wo.[br]Also, auch nicht auf Bahnhöfen rauchen!  [br][br]Dieser Artikel wurde im Übirgen am Mittwoch vorgeschrieben. [br]Wie sie vielleicht bemerkt haben, hatte ich am ersten April zwei Beiträge eingestellt.  Am Montag hatte ich es schlicht vergessen.[br][br]Vorschreiben ist gut. Dann hat man schon mal Vorschriften, an die man sich halten kann.[br][br]Man kann ja nie wissen. ', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (224, '2008-04-03 17:52:59', 'de', 1, 'Achten sie auf ihre Zeit, denn es ist die ihre', 'Zeit ist Geld und andere abhängende Pflegel', 'Die Zeit, die es braucht eine Zeitung zu lesen, muss man erst einmal finden. Was man dann damit macht, ist eine andere Frage. Warum ich meine Zeitung nur testweise lese, ist auf jeden Fall klar. Ich habe keine Zeit, dass heißt, eigentlich  habe ich sie, schreibe aber lieber diesen und andere Beiträge. Oder ich zeichne. Zeitungen kosten Geld. Zeit ist schließlich kostbar.[br][br]Hier anbei ein kleiner Rat: pflegen sie ihre Zeit.[br] [br]Es ist immer gut seine Zeit zu pflegen. Nehmen sie recht rege an ihrem kulturellen Umfeld teil. Wie sie das machen, bleibt jedem selber überlassen. Ob schreiben, malen, zeichnen, gärtnern, ..., kochen oder lesen, was immer sie auch machen sprechen sie darüber. tauschen sie sie sich aus. Regen sie andere, an indem sie sich anregen lassen. Sie werden feststellen sie haben mehr von ihrem leben, ihrer Zeit.[br][br]Jupp nimmt sich zum Beispiel Zeit, um richtig ordentlich abzuhängen. Das ist sein nicht nur sein Hobby, das ist seine Profession. Es ist immer gut, wenn man sein Hobby zu seinem Beruf machen kann. [br]Aber wer ist eigentlich Jupp, werden sie sich fragen. Diese Frage zu klären, so viel Zeit muss sein. [br][br]Aber wenn es Andere gibt, die dies besser können, so sollten doch diese das erklären.[br]In diesem Sinne gebe ich an folgende beiden freundlichen Zeitgenossen ab:[br][br][include]comicpanel.php[/include][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (225, '2008-04-04 20:36:19', 'de', 1, 'Rabbits in the underground-rabbiat im Untergrund', 'Einen Ball mit Hörnern hat noch niemand gesehen...', 'Na, das ist mal eine Übersetzung, oder?[br]Naja, dieses Spiel englische Texte in der deutschen Übersetzung zu verballhornen, in dem man Wortklang gleiche Wörter findet, ist schon seit Otto bekannt. Otto find ich gut. [br][br]Nun, nicht wirklich. Weder den Komiker, das war einmal, noch die Versandfirma, und das wird nicht mehr. [br][br]Hasen leben nicht im Untergrund, Kaninchen schon ? meine Osterhäschen kommen von den Osterinseln und heißen Rabbiators ? ein Kunstwort aus Rabbits und Gladiators.Sie boxen halt gerne, so wie echte Hasen.[br][br][img]http://rabbiators.com/rabbi_9.jpg[imgw]600[imgh]363[/img][br][br]Zu einem ganz anderem Thema, scheinbar:[br][br]Ich fahre mit der U-Bahn zur Arbeit und nach Hause. Das dauert seine Zeit. Anstatt nur dumm in der U-Bahn rum zu sitzen, schreibe ich solche Beiträge auf meinen Laptop oder zeichne, vorzugsweise seit einiger Zeit Häschen. Was für ein Zufall?[br][br]Ich zeichne aber nicht auf dem Laptop,  versprochen, mit den Fingen auf dem Touchpad, denn das würde so wie folgt aussehen.[br][br][img]http://rabbiators.com/rabbitUnderground.jpg[imgw]400[imgh]360[/img][br][br]Im Übrigen ist bald wieder mal eine Fußballmeisterschaft, genauer gesagt die Fußballeuropameisterschaft. Ich überlege mir gerade ob Häschen überhaupt Fußball oder Football spielen. Schon allein wegen der Sache mit den Eiern ist das noch so eine Sache, die man nicht wirklich übersetzen kann.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (226, '2008-04-08 11:19:36', 'de', 1, 'Nichts sagen, nichts sehen, nichts hören', 'Plappermäuler unterwegs', 'Wenn man nichts zu sagen hat, dann sollte man den Mund halten.[br]Aber gilt das auch für die Augen: schließe die Augen. Hier gibt es nichts zu sehen! [br]Oder für das Hören? Halt dir die Ohren zu, denn hier gibt es nur Geplappere.[br][br]Lassen wir also die Wörter plätschern. Sie können sich derweil die Ohren zu halten und die Augen schließen. [br][br]Oder sie lesen diesen kurzen Artikel.[br][br]Es sind meine Ohren, in denen es noch immer schallt: Erst Aussteigen lassen, dann einsteigen. Klassen unterwegs sind schrecklich. Die eine Hälfte drängelt sich vor, die andere brüllt: Erst Aussteigen lassen, dann einsteigen. Okay, ihr habt ja Recht. Ich, der am aussteigen war, gebe es zu, ihr hattet Recht. Erst Aussteigen lassen, dann einsteigen, aber die andere hören euch nicht. Seht ihr denn nicht, sie sind schon im Zug, schallisoliert.[br][br]Nebenbei bemerkt: es waren meine Ohren.[br] [img]http://rabbiators.com/rabbi_22.jpg[imgw]600[imgh]269[/img]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (227, '2008-04-08 23:04:42', 'de', 1, 'Sehen, Sagen, oh verdammt', 'Die drei chinesischen Häschen und ein Wort mit fünf Buchstaben', 'Nichts ist bekanntlich ein Wort mit fünf Buchstaben. Oh verdammt,nein, es hat ja sechs. Sechs ist ein Wort mit fünf Buchstaben, hören auch. Wir sollen, wenn es nach China geht, nichts hören aus dem anderen Land, das auch ein Wort mit fünf Buchstaben ist. Was in China vor sich geht, das ginge uns nichts an. Das zu sehen, darüber etwas zu sagen, das stünde uns nicht an.[br][br]Wenn man dieser chinesischen Logik folgt, stürben hierzulande immer noch Menschen, China wäre immer noch japanisch besetzt. Den Amerikaner sei dank, dass sie sich um solcherlei Einwände nicht scheren. Aber ob dies immer so sinnvoll ist und war, dieses bleibt im Zweifel.[br][br]Hier ist ein anderes Wort mit fünf Buchstaben: nicht.[br][br]Nicht hinzuhören, wenn man es schon hört; wenn man es, wie die Herren Olympioniken, schon vorher wusste - nicht zu sehen, was es zu sehen gibt, sondern es sogar bewusst auszublenden, nichts zu sagen, wenn man eine Stimme hat, die gehört wird in der Welt, und die Freiheit sie zu nutzen, das disqualifiziert die Idee, die sich in dem letzten Wort mit fünf Buchstaben widerspiegelt. [br]Sport.[br][br]Aber wie heißt es so schön: Sport ist Mord. [br][br]Na, dann kann die Olympiade ja kommen.[br][br][img]die3chinahasen.jpg[imgw]0[imgh]0[/img][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (230, '2008-04-18 11:05:16', 'de', 1, 'DO NOT KILL YOURSELF!', '"DO NOT KILL YOURSELF!" Ein Entwurf für ein Cut-Scenes-Spiel.', 'Die Cut-Scenes können nicht unterbrochen werden, dauern dafür aber auch nicht allzu lange - im Regelfall ungefähr 20 Sekunden.[br]Der Spieler hat zwischen jeder Cut-Scene 10 Sekunden Zeit, eine Entscheidung zu treffen.[br]Keine Entscheidung ist auch eine Entscheidung.[br]Die Option keine Entscheidung zu treffen, getroffen zu haben, löst den Selbstmord der Spielerfigur aus.[br]Dabei variiert die Selbstmordart nach dem erreichten Spielstand und dem Entscheidungspfad den man genommen hat.[br]Bei bestimmten Selbstmordarten kann der Spieler den Selbstmord noch verhindern, ändern oder verschlimmbessern.[br][br]Alternative Produktionsweise:[br]Die Cut-Scenes werden nicht durch eine Entscheidung unterbrochen/beendet, dauern dafür aber länger.[br]In den letzten x(5-20) Sekunden, wo absehbar, dass eine Entscheidung zu treffen ist, wird das Option-Panel eingeblendet. Vielleicht aber auch schon am Anfang oder mitten in der jeweiligen Cut-Scene. [br]Die Spielregeln bleiben gleich. Dadurch wirken die Cut-Scenes so, wie direkt aneinander geschnitten, obwohl optionalen Pfaden gefolgt wird.[br][br]Das Spielendekriterium Selbstmord kann durch andere Spielabrucharten, ergänzt und ersetzt werden, z.B. verlieb dich nicht, Spieltitel - "DO NOT FALL! (in love)".', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (229, '2008-04-10 13:10:58', 'de', 1, 'Das Häschen', 'Ein Gedicht in vielen Zeilen', 'Da steht es auf weiter, weiter Flur,[br]Weiß nicht, ob es kann verweilen,[br]hätte es doch nur eine Uhr,[br]in diesem Gedicht mit mit vielen Zeilen.[br][br]So klein, ganz allein, das Häschen.[br]Es lauscht mit seinen Öhrchen.[br]und schnuppert mit dem Näschen.[br]Sein größter Wunsch ist ein Möhrchen.[br][br]Ach hätte es nur eine Karotte fein,[br]und dazu auch noch eine Tasse Tee,[br]Wohl wie bekömmlich mag das sein,[br]Hier im grünen, grünen Klee.[br][br]Mach die Augen auf und schau,[br]soviel Grünzeug, du kannst es glauben,[br]Häschen nun sei doch schlau,[br]So tief hängen hier die Trauben.[br][br]Da im Neste bunt bemalt,[br]Findet Häschen jetzt ein Ei,[br]lacht so laut, dass es schallt,[br]es sind derer sogar zwei![br][br]Was mag wohl die Überraschung sein,[br]die steckt in der Eier bunten Schalen?[br]Es sind Konservendosen Möhrchen fein,[br]Nun muss das Häschen wohl bezahlen.[br][br]Das ist der Wirtschaft Streben,[br]so ist im Leben alles teuer,[br]denn weil wir an ihm kleben,[br]zu zahlen haben wir brav die Steuer.[br][br]', 2, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (231, '2008-04-22 11:44:46', 'de', 1, 'Wie, was, wann und wo', 'Blog schreiben und der Versuch der Regelmäßigkeit. Was nicht gelingt. Ein Lob auf die Faulheit und ein Ausblick.', 'Okay, ich gebe es zu ? ich bin gescheitert an meiner eigenen Maßlosigkeit. Dachte ich doch, ich könnte es schaffen, regelmäßig über Häschen zu schreiben, hübsche Zeichnungen abzuliefern, Webcomics zu zeichnen und noch das eine oder andere Spielchen zu designen, schreiben, programmieren, die Grafiken zu liefern und, und, und nun?[br][br]Nun stelle ich fest, gemach, gemach, lobe die Faulheit und mache Pläne. Setze sie um, aber veröffentliche sie nicht. Pläne sind nicht dazu da öffentlich zu werden. Pläne sind dazu da, den Druck zu erzeugen, den es braucht, um voranzukommen. Sind sie zu realistisch, machen sie keinen Druck. [br]Kurz gesagt: [br]Pläne korrigieren die Realität, damit die Realität die Pläne korrigiert. [br][br]So nun schauen wir nicht mehr zurück, sondern nur noch nach vorne.[br][br]Vorwärts, Häschen, schreibt Gedichte, auf nach vorne, wo immer das auch sei![br][br][img]http://rabbiators.com/rabbi_vorne.jpg[imgw]600[imgh]453[/img] [br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (232, '2008-08-16 17:38:53', 'de', 1, 'Ein kleines Spiel zur GCDC Leipzig', 'Just a little game for the GCDC Leipzig. Enjoy and have fun. ', '<APPLET codebase="applet" code="monking_vs_gijoe/MainApplet.class" width=350 height=200 archive="Monking_vs_GIJoe.jar"></APPLET>[br][br][br]This is a little tiny game. I have made it in 6 Hours. The idea, the code, the sound , the graphics, the animations and the bugs, if you find them.[br]Press SPACE to start the game. The monkey wants to free the dreaming princess. He has to, because GIJoe is throwing Barrels. He is the pure evil. Just climb the 	lianas and touch the princess. Do not get near by or in touch with the barrels or GIJoe. Try to reach your highscore. You have to hang for a long time as high as possible, but do not forget to free the princess.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (233, '2009-03-10 14:22:22', 'de', 1, 'Added mobile.second-age.com widget', 'Today I added the mobile.second-age.com widget/gadget super pre alpha to this webpage. You may test ...', 'You may test the login function and the firts puzzle. Simply click on the image and play the puzzle game. If you messed up the puzzle you can quit and start a new one.[br][br]Second-age is everything about the second-age, das Zweite Zeitalter. Just become friend with Hamster Doedels and I Rat. Listen to the messages of the sparrows.[br][br]More functions will follow as soon as possible.[br][br]On march 20th I fly to San Francisco. I visit the GDC - for those, who d''ont know, teh Game Developer Conference.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (234, '2009-04-09 06:34:00', 'de', 1, 'Was geschah am neunten April?', 'Was geschah am neunten April vor 50 Jahren? Eins ist sicher - Ostern kommt bald. Erwartet das was kommt ...', '...noch heute![br][br]Und was geschah vor 50 Jahren?[br]Die NASA präsentiert die Astronauten des Mercury-Programms, ihres ersten bemannten Raumfahrtprogramms und der US-amerikanische Architekt Frank Lloyd Wright, ein Meister der Organischen Architektur, stirbt.[br][br]Geburt eines Traum und Tod eines Traumwanderes,. So oft liegt beides so nah. [br][br]Achja, Ostern kommt...[br][br]Häschen?[br][br][img]http://rabbiators.com/rabbi_0.png[imgw]349[imgh]443[/img]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (235, '2009-04-09 08:27:57', 'de', 1, 'Das Häschen', 'Das Häschen. Ein Gedicht in vielen Zeilen. Teil 1', '[img]http://funkfishgames.com/spiele/images/bunny/bunny_strophe1.jpg[imgw]600[imgh]506[/img][br][br]Es steht auf weiter, weiter Flur.[br]Weiß nicht, ob es kann verweilen.[br]Ach, hätte es nur eine Uhr,[br]in diesem Gedicht mit vielen Zeilen.[br][br][img]http://funkfishgames.com/spiele/images/bunny/bunny_strophe2.jpg[imgw]600[imgh]447[/img][br][br]So klein, ganz allein, das Häschen.[br]Es lauscht mit seinen Öhrchen[br]und schnuppert mit den Näschen.[br]Sein größter Wunsch ist ein Möhrchen.[br][br]to be continued[br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (236, '2009-04-09 08:31:24', 'de', 1, 'Das Häschen Teil 2', 'Das Häschen. Ein Gedicht in vielen Zeilen. Heute ist Karfreitag. Nur ein Bild.', '[img]http://funkfishgames.com/spiele/images/bunny/bunny_strophe2.jpg[imgw]600[imgh]431[/img][br][br]Ach hätte es nur eine Karotte fein[br]und dazu auch noch eine Tasse Tee,[br]wohl wie bekömmlich mag das sein,[br]hier im grünen, grünen Klee.[br][br]To be continued[br][br][br]', 2, 1, '0000-00-00 00:00:00');
