INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (238, '2009-04-09 08:39:08', 'de', 1, 'Das Häschen. Ein Gedicht in vielen Zeilen. Teil 4.', 'Das Häschen. Ein Gedicht in vielen Zeilen. Teil 4. Und heute ist Sonntag. Frohe Ostern...', '[img]http://funkfishgames.com/spiele/images/bunny/bunny_strophe6.jpg[imgw]600[imgh]489[/img][br][br]Was mag wohl die Überraschung sein,[br]die steckt in der Eier bunten Schalen?[br]Es sind Konservendosen fein.[br]Nun muss das Häschen wohl bezahlen.[br][br][img]http://funkfishgames.com/spiele/images/bunny/bunny_strophe7.jpg[imgw]600[imgh]499[/img][br][br]Das ist der Wirtschaft Streben.[br]So ist im Leben alles teuer.[br]Denn weil wir an ihm kleben,[br]zu zahlen haben wir brav die Steuer.[br][br]Das wars.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (239, '2009-04-15 17:33:39', 'de', 1, 'Some after GDC09 thoughts about emotions in games', 'Some after GDC09 thoughts about emotions in games. The game design challenge: My First Time presented by Eric Zimmerman. Participants: Steve Meretzky,  Heather Kelley,  Sulka Haro,  Erin Robinson ', 'I was pretty shocked when Erin Robinson was telling me that bringing emotions into games is an easy thing.[br][br]I don''t think so. Especially if i look to the known emotions in games I do not see many different kinds of emotions. Fear, maybe hate but not love, anger, rage, violent emotions all the time and that goal emotion "Yeah I''m a HERO" - not subtile but boring.[br][br]We had learned so far that we might make the player care for his avatar, because he (and not she is in the focus) is the avatar. Do you remember the Tamagotchi? Yes, you do. Another game about care, but it is parental welfare. A game and a handheld console that provides the major theme of love.[br][br]We can use sounds and music for transporting emotional values,[br][br]so we can use the artwork. We can even use the story and the dialogs, but does this full fill our intention[br][br]of different emotions in different games. The usage of (one) emotion(s) as the basic game theme.[br][br]When ever you try to build emotions into games do you ever thought about the core game mechanics?[br][br]So what basic emotion delivers a FPS Ego shooter? I know that''s a rhetoric question - a Prince of Persia, Street Fighter, Halo 3, ... , Bejeweled, Click 3 away, Hidden Object Game, Sports game, what ever we made so far.[br][br]Still there is Tamagotchi. One game in a multiverse of many more. But the basic emotional driver is still care. A different kind of but still it is.[br][br]So what emotions we can deliver? Care, hero stuff and what more?[br][br]What is the basic emotion of a puzzle game?[br][br]Heather Kelley''s and Erin Robinson''s game proposal was a quite pure and poor casual games collection. Nothing that you would expect emotions being involved. The emotion had been driven through the graphical artwork. It looked like hand drawn plan of a 15year old teeny girl. Her dream catching battle plan for the first sex event.[br][br]Steve Meretzky achieved emotions through the story. He shared his experiences. The story is a tough driver! He delivered with the story even catharsis in the end. Something like love, friendship, understanding.[br][br]Sulka Haru finally made a social You share your emotions game. Is sharing providing aq different mechanic? Care versus share.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (240, '2009-07-29 18:21:19', 'de', 1, 'Will the web be googlefied?', 'Google Wave Developer Preview at Google I/O 2009', 'Return of the old origins of the web.[br]But still it is not xanadu.[br][br]<object width="560" height="340"><param name="movie" value="http://www.youtube.com/v/v_UyVmITiYQ&hl=de&fs=1&"></param><param name="allowFullScreen" value="true"></param><param name="allowscriptaccess" value="always"></param><embed src="http://www.youtube.com/v/v_UyVmITiYQ&hl=de&fs=1&" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="560" height="340"></embed></object>[br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (241, '2009-08-15 00:47:24', 'de', 1, 'A simple javascript game', 'Card Mahjong solitair in javascript.', 'This number one of those experimental 6hours games, that i''ve written in javascript.[br]The game does not store points.[br]The game start a blank page. Click on the game frame to view the title page, rules page and finally start the game.[br]You have to find similar cards. The similarity might be card value or color or both.[br]You can take cards only from the border.[br][br][include]games/iframe_mc.php[/include][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (242, '2009-08-15 01:17:41', 'de', 1, 'Experimental bejeweled like game', 'Another javascript game', 'I developed this game as an experiment when i was developing html-based games.[br][br]This game itself is a simple bejeweled clone in javascript, but it simulates a pure click-based html-game.[br]This game type is the mother of all click 3 away games.[br]This is not pretty exciting, if you play it, but a real time killer.[br][br][include]games/iframe_bj.php[/include][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (245, '2009-08-17 11:37:37', 'de', 1, 'Don Daglow - Designing for a new Audiences', 'session #2: Don Da glow is a 38years veteran in Game Industry - Founder of stormfront. Here are my notes...', '[b]Topics:[br][br]1.Insparation and Dreams[br]2.harsh realities[br]3.Solution checklist[/b][br][br][b]1.:[/b][br]make people feel a differen way. Your instaration?[br]Breaking traditional presantation. There is (no) gymnastics in shaekespear.[br][br]Don''t do it the same old ways.[br]You make it the older way combined with the newest way.[br]Do it the new way.[br][br]Techinic id not you dream.[br]When things seams to be undoable you may have to wait.[br][br]Time will change.[br][br]Have your dreams it''s importan.[br][b]2.:[/b][br]But what are the obstacles?[br][br]It''s a big business[br]deamnds growth and predictability[br]copies & sequels[br]biggest profits? From new, original games: >>> natural conflicts[br][br]Some times you need three tries or more to reach the break through.[br](Guitar Hero was their third music game before they h9t the market)[br]Time will change. Again.[br][br]decide fast[br][br]How do you get your Vista point?[br][b]3.:[/b][br]Checklist - the designers aproach:[br][br]Asume: There will be always change. You will be not disappointed.[br](Don''t asume wrong key assumption you''ll fail)[br]Do not stock to your assumption[br][br]Ask yourself: What would be fun?[br]Don''t ask for the machine. Do not become natural limiters into your process.[br][br]How can the players convince each others it''s "real"?[br]Sometimes up to us sometimes it is the player.[br][br]When is this single player and when is it online?[br]Games are more like a buquette of flowers a gift to the player.[br][br]Fill in the blanks but before this you have to ask yourself...[br][br]for whom is our game is intended?[br]I will not treat all gamers as hardcore gamers![br][br]interface...[br]How does the player feel unique, powerful and in cortol?[br]How do opponents ...?[br]How do the players feel part of the world?[br][br]How does the players feel - is this the only emotional values?[br][br]Games can change life. A least they can affect the real life.[br][br]Care for your game. Don''t waste the chance, don''t waste time.[br][br][br][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (244, '2009-08-15 01:48:16', 'de', 1, 'A puzzle adventure prototype', 'For today this is the third and last of those experimental javascript games. This is also written in less than 6 hours.', 'Although the german story is telling something else, this is only the protype written in javascript.[br]It''s a little more komplex than the other games.[br]I hope you enjoy anyway.[br][br]PuzzleAdventure ist ein echtes Puzzlespiel mit echten Adventureteilen.[br][br]Quest weder pro level gestellt, wie etwa "Gebe sieben Kartoffeln an Grafzahl."[br]Natürlich muss man dieses Quest beim Ork erfragen und um das zu erfragen muss man sich erst zum Ork bewegen.[br][br]Erst danach zählen die eingesammleten Kartoffeln, die man danach Gandolf geben kann.[br][br]Die Bewegung erfolgt, indem man zwei gleiche Felder nebeneinanderbringt. Die beiden Felder werden abgebaut und die denebenstehenden Felder rücken in diese Richtung ein. Von außen wird aufgefüllt. Dabei können Kaskaden entstehen. [br]Ein Beispiel:[br]Klick man ein Feld links von dem gleichen Feld und tauscht es mit dem Feld zwischen den beiden gleichen Feldern aus so bewegt man sich jetzt alles nach rechts. Tauscht man aber das Feld dazwischen mit dem linken Feld aus so bewegt sich alles nach Links. Man kann sich nach oben unten oder nach rechts bewegen. Die Richtung wird als Pfeil angezeigt.[br]Probieren geht über studieren.[br][br]Manche Figuren muss man etwas geben, andere haben Quests für den Spieler, wiederum andere haben nur Fragen, geben Antworten oder Hinweise.[br][br]Die Spielwelt ist in mehrere Räume aufgeteilt. [br][br][include]games/iframe_pa.php[/include][br][br][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (246, '2009-08-17 11:56:11', 'de', 1, 'GDCE session No1 session No3', 'session #1 Advanced Racing Game - AI in Pure, session #3 crytec technical blabla, i left', 'short note for session#1[br]sorry i didn''t made notes. Early monday morning.[br][br]Short assumtion:[br] Although they did not used scripting, they use writing to create the user expirience.[br]You user always has the feeling of a fair game because the game is balanced tt fit the skills of the user.[br][br]Nice (tecnical) demo, too. Sometime it''s cool to talk about technics, sometimes it''s a blabla showcase.[br]''The future of gaming grafics'' what a over ambitious, pretensious title![br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (247, '2009-08-17 20:52:21', 'de', 1, 'GDCE Session No4 Discussion with Don Daglow ', 'Discussion with Don Daglow: also starring Mary beth Haggerty from Games @ Autodesk. Talk about character and story. WARNING: these are notes while i was listening! Tons of typos.', 'Talk about character and story[br][br]don is excited about the outside gathering social of the players.[br]Interactions differs.[br][br]you can parcipated in the game as a role.[br]the predictability is lost. For classic writer this is terrible.[br][br]There are no player chars in NWN. Designer is a situation starter and world creator.[br]You may create also a shell for the player. This is a different way.[br][br]Story games:[br]don''t waste players time.[br][br]Pack and pull them in.[br][br]If you interact in social media,respect the time.[br][br]What make charakters beliable?[br]Care and emotional engagement.[br]Voice acting may distube this connetion.[br][br]Toying with world. Player is in charge of the control.[br]In Film all is about preformance of the actor.[br][br]Topic[br]emotion in stories.[br][br]Can a computer make you cry?[br]That is the holy gral we all after.[br][br]fullfilling emotion[br]Steve M.again Floyd:[br]all words[br]pure textadventures[br]little funny lines[br][br]Exiting quetions:[br]what is world we build games in?[br]Not: what kind of game world we build?[br][br]so many different divices to[br]connect with people (get your audience)[br]connections become emotions[br][br]Topic: creator original vison suspension of believe[br][br]vision can be rather an enemy than a friend[br]because it is exploring if it can be fun what you think that should be fun.[br][br]just let the original vision go. like parents has to let go their kids.[br][br]game making is art.[br]playing gtames can be art.[br]e.g. player writen stories.[br][br]Games are art, art is media. media is social. social is life.[br][br]online world is a ''reflection''of the real world.[br][br]car example online bad,bad cardriver closed room seperation[br]online bring outs the best and worst in people[br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (248, '2009-08-17 21:33:26', 'de', 1, 'Session No5 and Session No6', 'You may ask where are the notes?', 'Okay, session #5 should have been "Unity GUI in practice". The guys from unity are smart. They distribute a 3d platform for iphones and online. Easy to program and so on. But instead of listen to this session I bump into Jan Michealis from Daedalic. Strangly enough we had a conversati0on / discussion about episodic gaming in adventure, the problems, the pitfalls and the opportunities. There will come more.  I''ve to make some pictures and think about it. [br]In general the reason for the conversation was the discussion panel with don daglow.[br][br]Session #6 was the panel "Top Trends in Casual Games". 4 tough, cool, smart women and for some good reason i will not mention the name of the  participating man. There was some one?[br][br]The participants where Margaret Wallace (CEO Rebel Monkey), AllaKhramtsova (Intenium), Kate Pietrelli (TriplePoint). The  moderator was Arielle Lehrer. I''m still sorting out. [br]Arriele made a small introduction into the current trends: Bad falling numbers of still positive revenues, the bad fact of less funding in games (-64%). Hey marketing guys no : there is a simple reason NO Funding, No revenue!?[br]And the positive trends  a generally growing market and new opportunities: facebook (social gaming), iphone, onlinegames and distribution. She splitted the discussion into 5 situation for developer and the panel made comments on this statements.[br][br]Good session anyway. Esspacially because they where realy discussing with different points of views - none of those you could simply talk/wipe away.[br][br]Straight forward to the point.[br][br]My final resume: You should feel to make better and more inovated games anyway, but as Margaret said: There is no lag of invation and inspiration in the game business itself, but in the funding market in spite the current crisis.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (249, '2009-08-17 21:36:13', 'de', 1, 'GDCE Session No7 Kellee Santiago Flower:Design', 'Kellee Santiago Flower:Design', 'design process in general[br][br]break with the etablished emotion[br]to get a wider varity[br][br]goals of flower[br][br]genuie cross gender[br][br]create an emotional shelter[br][br]safe peace & harmony, a feel good game[br][br]several prototypes to sort out the weaknesses and find the strengths.[br][br][br]her after thoughts:[br][br]sometimes hard fun is your enemy[br][br]your defunition of fun in games is very limited[br][br]art and music crafted the specic emo0tion[br][br]rapid iteration[br][br]playtesting[br][br]pulling visual, mechanics(kiss), music as soon as possible[br][br]started with 6 people prototyping and finished with 9 people maximum.[br][br]I just have to admit these here are only notes. Keelee shown much more, talk fast and was leading us through the whole 7months design process of flowers. Thatgamecompany used flash, XNA, C and PS3code for the development. That was pretty much like looking over her shoulder seeing the work in progress but intensly condensed into some minutes.   [br][br]I have to mention the topic of playtesting. It was important for developing the game flowers.[br][br][br][br][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (250, '2009-08-17 21:48:17', 'de', 1, 'GDCE Monday Keynote No1', 'Remedy Max Payne To Alan Wake. Keynote with a lot of keys involved... Thanks to Matias Myllyrinne.', 'Nutshell of 3 key princples[br]focus, people and brand[br][br]key messument entertain most people the best possible way[br][br]entertainment company (I understand Comedy)[br][br]Topic: interlectual property[br][br]focus small in team size - not impact[br]culture of quality over quantity[br]no to big opertunities[br]focus[br][br]people [br]let the people focus on their strength[br]dont waste time[br]trust your people[br][br]Some introducing words, do not forget the branding - His advice – not selfpromotion.[br][br]7 key pillars of ip creation[br][br]1.[br]a strong lead char[br]chars a sticky[br]developrd for a longer period of time[br]2.[br]3rd person perspective[br]focus on the lead char[br]3.[br]Mainstream approachabitity[br]avoid niche or limited concepts[br]would our concept to a non gamer?[br]4.[br]Cinematic view[br]150% size instead of 100%[br]so is sound[br]it is about perception not about of what it is.[br]5.[br]Real world believability[br]premise and setting are familiar for a wide audience[br]6.[br]Story depth and atmosphere[br]story and mood are essencial[br]7.[br]action (gameplay - MY NOTE)[br][br]That''s basicly all but it was worth a keynote.[br]I just have to say the other KEYLESSNOTE from crytec was marketing blabala. Oops I already said it.[br][br][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (251, '2009-08-17 22:25:47', 'de', 1, 'GDC Europe and a flooder game ', 'This is a incredibile fast implementation of the flooder princip. It took half the way from my work to my home (25 minutes more or less)', 'This is a incredibile fast implementation of the flooder princip. It took half the way from my work to my home (25 minutes more or less). I wrote it in the Hamburg underground on saturday beginning at Hallerstraße and finished it completly at Farmsen station. What i want to say with that is, developing in javascript is rapid fast, no rabbit could run that faster. Indeed I reused a lot of code i''ver written before.[br][br]Reminds me to things Kellee Santiago said in her session and Don Daglow said in his session. Both statements are opposite and true. Game Design involves technics and programming skills(Kellee) My interpretation : Technic is your friend and Don sadi: Technic is your enemy. Don''t let it prevent you from doing your game.[br][br]Here is the game for my own pleasure: Have fun![br][br][include]games/iframe_fo.php[/include][br][br][br][br][br][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (252, '2009-08-18 10:56:23', 'de', 1, 'session Tue1 alternative finance', ' and new development business models. A classic business pane. I don''t if this was the right starter for the morning. Tons of coffee would be helpfull. Here are my GDCE notes:', 'completion bonds[br]a model from the cinematic production[br]a risk taker for publisher investors and developers[br]monitoring the production > enables the communication[br][br]external finance  vs  publisher deal[br]most financing is a mixed model[br][br]fonds act as a publisher. They give you a ditribution deal[br][br]control your ips and code[br][br]fonds deals you give your ip away as a garanty and get it back in the end of success[br][br]fonds wants royalty like yourself as a developer[br]a lot of ips are dormant[br]you could make a book comic song film themepark what ever[br][br]make a prototyp but it does not have to be computer game[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (253, '2009-08-18 10:59:09', 'de', 1, 'GDCE session tue2 social networking: lessons learned', 'hugh de loayza from zynga', 'what is social gaming / games?[br]basically it is games located at social platform[br][br]social games are espacialy designed to allow social interaction[br][br]facebook, myspace, bebo, xiaonei kaixin and smaller networks[br][br]what divers casual from social gaming?[br][br]the games are disgned to foster interaction between friends[br]i play, invite friend[br][br]multiplayer[br]. asynchronus and sync[br]distribution independent[br]advertising, micro transaction(item sell)[br][br]these are games not a destination[br]gaming is a component of the common life of a social player[br][br]communiy?[br][br]businessmodels vary[br][br]monitoring abuse and numbers[br]analytic business approach[br]- transaction monitored hourly[br]--installs[br]--invites[br]--notifications[br]--gifts[br]--etc[br]measure as much as possible measure all[br]focus on traffic more than on gameplay[br]where who when from? if possible why[br][br]building the game 20-25%[br]running the game 75-80%[br][br]deliver a constant stream of new game option patches play content[br][br]make it more casual than casual[br]KISS[br][br]build mechanics that spur vitality[br]gifting, competition, crew mechanics, notifications[br][br]Less game more social[br]use ubiquitous techs[br]- flash, php etc.[br][br]think reach[br]- open social vs FBML[br]- Loco? Maybe someday[br][br]build seeds to install your game.[br][br]big mistakes:[br][br]licances[br]people do not like it in social networks[br][br]linking to a destination site[br][br]converting existing games[br]can work, but it is not always the right thing. Better build bottom up to evaluate and build in the social interaction[br][br]overthinking everything[br][br]widgets don''t work[br]Why?[br][br]Attention to quality[br]innovation over imitation[br]. simulations[br]multiple mechcanics[br]- harvest[br]- gifting[br]- hiring friends[br][br]Localization[br]	because it is international[br]Crosspromo[br]	if you have other games or friends have games, promote your/their games[br][br]network effect[br][br]create games speciffically 4 social networks[br]think like an email marketer[br]pick your platform[br]your game is not an marketing tool[br]release early and often[br]measure and adapt accordingly[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (254, '2009-08-18 13:05:44', 'de', 1, 'GDCE session Tue3 panel designing women', 'Moderator Mageret Wallace (Rebel Monkey), Panel Kelle Santiago (thatgamecompany llc), Cynthia Woll (cul de sac studios), Sheri Garner Ray (schell games)since 1989,Author of the book Gender inclusive Game Design,Tracy Fullerton (usc interactive media)', '20 % of all console gamers are women[br]in some cases that are 70% average[br][br]the major question/problem is not women it''s diversity[br][br]diversity does not walks through the door. I have to go for it.[br][br]women like to design games that matters.[br][br]risk means more potential reward.[br]dev. is a risk but mucvh more options in design.[br]you want to reach a broad audience, your workforce has to reflect it.[br][br]girls are more inclusive thinking boys more exclusive for boys only[br][br]gender, skincolor, induvidual voices.[br][br]hire out of your compfort zone.[br][br]boobsslider wanted by the girls[br]we wanna our chars to be heros thats why girls want big boobs[br]idol icon![br][br]what we need are designers who look to life[br]hm, i think, wee need designers who have expirences in life, And those should be different.[br][br]CHALLANGE PART[br]show what we talk about[br][br]T.F.[br]games compress reality soldiers war chess[br]wargame?[br]runover rules here[br][br]focus on Simple hand holding mechanic[br][br]C.W.[br]Watching kids[br]there is structural difference[br][br]boy''s play clean[br]it''s easy to build a game of this[br][br]cource of convincing[br]no clear rules, inderect conflict[br]attribute the win state to an outside force[br]story-driven[br]triangle[br][br]romantic comedy[br]soap opera[br][br]opportunities[br]social networks etc.[br][br]K.S.[br][br]another wargame[br]what is an emotion of war that hadnot explored in the past?[br]FEAR[br]her approach: dont mess up[br]do not get detected.[br]full expirience contrast.[br]uppose versus distance[br][br]SGR[br][br]learning play[br]acquisition modes[br]risk vs imitative[br]explorrativ gs are experimental try and error[br]risktaking leaner[br]predominantly male[br][br]modeling imitative learner[br][br]they are projective learner[br]wanna know how it works before attempt it[br]typical women[br][br]sister stands behind him because she wants to know before play.[br]while Brother tries[br][br]why important?[br]both equally good[br][br]takes steps to make sure 4 both[br][br]Question[br]older women are always multitasking[br]how do they pay attention[br]challange[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (255, '2009-08-18 17:25:26', 'de', 1, 'GDCE keynote tuesday', 'writing interactive narrative for a mature content by Dave Cage(Quantum content)', 'Average gamers are[br]75% ARE 18+[br]40% are female[br][br]the 4 primal emotion  while you run away from a lion[br]anger[br]agressivity[br]fear[br]competition[br][br](Primitive emotions are anger, rage, pain, pleasure, comfort, thrill, fear, fright, and selfishness. found on google)[br][br]social emotions are[br]happiness[br]empathy [br]etc.[br][br]the problem[br]games have been made for kids and teens.[br][br]toys vs arts. I do not like this comparition[br][br]compare games vs movies[br][br]some games can compare[br]ico[br]flowers [br]rez[br]many many more[br][br]making mature content[br][br]decididions to make[br][br]primal emotions vs social emotions[br]toys vs art[br]kids vs adults[br]sandbox vs rollercoaster [br]achievment vs journey[br]tradition vs new paradigms[br][br][br]redefine experience as journey and not a challenge[br]get rid of pattern[br]dare to break rules and invent new paradigms[br]assume to be an art and not a toy[br][br][br]rule #1[br]out creativity at the heart of the game[br][br]dont make compromises Dont follow trends Follow your instinct[br][br]open game to all emotions[br] [br]put narrative at the heart of the expedrience[br][br]offer experiences that bear meaning[br][br]dare to evoke ew themes[br][br]a good story tells about characters mot about envoiroment[br][br]rule #2[br]find new answers[br][br]retink interfaces and make the contextual[br]think narrative emotion and interactivity at the same time[br][br]invent our own narrative grammar[br][br]keep non creative people out of the creative room.[br][br]accept that game designers became authors[br][br]train interactive writers[br][br]rule #3[br]forget about technology[br][br]its a tool not a goal[br][br]create believable vehicles for emotions[br][br]create one universal technology[br][br]rule #4[br]be proud of who we are[br][br]stop making stupid games[br][br]prove that we are an emergent culture[br][br]get censorship back to the normal standards[br][br]rule #5[br][br]be crative be ambitious be early be pationt[br]be innovative business models[br][br]ruleb #6 [br]have courage and patience[br][br]evangelize publichers[br]evangelize press[br][br][br]...[br][br]A real keynote. He is an evangelist of the narrative[br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (256, '2009-08-18 18:36:13', 'de', 1, 'GDCE last session tuesday: desining social games', 'desining social games by game veteran steve meretzky', 'desining social games[br][br]the are many platforms[br]like[br]facebook hi5 myspace bebo[br][br]there is a long history of playing with friends[br]since the first multiplayers platform 30 years ago[br]for 15 years we have the internet[br][br]professer obvious says socialgames are games[br][br]cooperative and / or competive games[br]user generated content[br][br]professer obvious says socialgames are games[br][br]easy to get started[br]reveal complexity gradually[br]short play sessions[br]donT punish the player[br][br]the business and the design of social games are mixed up[br][br]you cant requirre that players send invites in order to be able to play[br][br]2 goal of virality[br][br]get new playeer and get the player back[br][br][br]viral tools:[br][br]requests(invites)[br]wall posts[br]notifications[br][br]popular viral technics[br][br]beat my score[br]join my mob[br]lets exchange gifts[br]i need help/energy/etc[br]be my employee[br]you found a lost cow[br][br]monetization[br][br]dominant business is free-to-play[br][br]professors o says 0=n = o even for large vallues of n[br][br]the answer is item sale[br][br]paypal and so or complete offers(surveys)[br][br]money follows engagement of the player[br][br]Engagement[br][br]longer from games[br]game worlds where players can build a presence[br]engagement is half the battle[br][br]re-engagement[br][br]harvest fields[br]collect money[br]login rewards[br]my friend needs help[br]ake care of employees[br]take care of pets[br]someone beat your highscore[br][br]monetizing the engaged player[br]money to item - works best with real economic in the game[br]limited edition item time/amount[br]items for avatar personalzation[br]one free and buy  as many as you want[br]pay for advanced version and advanced rewards of the game[br][br]successfull themes[br][br]good mobsters, farms[br]real life[br]bad everything else[br]fantasy, sience fiction[br][br]the future[br][br]look at all avaiable informations in social games[br]who? what? where? when? which? friend, too? what games, too?[br][br]async is better than sync because it is easier[br][br]life time of a game? no game sowed a end of the life cycle. hats because no game is older than 2 yers.[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (257, '2009-08-25 01:19:36', 'de', 1, 'GDC Europe Wedneday My last session', 'Creating Visual Identity for games by Viktor Antonov. Just the notes, but there were many, many images. Sorry, you have to imagine them.', 'Creating Visual Identity for games[br][br]talk about preproduction[br][br]pitfalls[br][br]short time[br]its not taken very seriously[br][br]ask style 2d 3d comic realistic etc.[br][br]be fast, have no fear, be dramatic[br]you can use blach and white[br]simplyfy, be easy, get to the point direct[br][br]do it by hand[br]rough sketching[br][br]try as many possibilities as you can but be selfconfident[br]be essantial[br][br]styles creates identity[br]think about rules like light palette kontrast[br]even for different settings levels emotions[br]composition/cadrage[br][br]objective  vs subjective[br]be subjective because you want create your games identity[br][br]stylization=simplification[br][br]LEVEL OF INFORMATION/DETAIL[br]e careful and measure it[br]it can be easily to much[br][br]where is the detail ablied to and where not[br][br]FORM[br][br]curves vs edgy[br]flatness vs depth[br][br]identity comes from on part of styles, bring it up and bringing every else down[br]change proportion where you need to[br]make the belieable[br][br]COLOUR[br]reduce Colors[br]examplle[br](blue, red and orange, spring to)[br][br]style can come from a lot of different aspects[br][br]LIGHTNING[br][br]Architekture[br]patterns[br][br]rendering at least[br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (258, '2009-08-25 01:30:40', 'de', 1, 'GDC Europe My first 3 sessions', '''Choice'' by Peter Molyneux will follow.', 'I had a terrible headache on wednesday morning. That''s the reason why I''ve made no notes.[br]The sessions were tw panels both moderated by Bob Wallace. ''Successful iPhone Product Development Experiences'' and ''Why have a Publisheer for iPhone Products''.[br]Those were pretty contradictonary.[br][br]The third session was AION Game Design. It was held in Korean and translated into english. I took two more asprins. At the end of this lecture the headache disappeared.[br][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (259, '2009-08-25 09:14:38', 'de', 1, 'GDC Europe choice by peter molyneux', 'This is the last note for the GDC Europe. Peter Molyneux''s lecture felt like a keynote although it was none. It was a press presentation originally. Funny enough, worth to hear it.', '''choice'' peter molyneux[br][br]choise is one of the ultimate basic game design mechanics[br][br]why choices?[br][br]engage the player[br]emotional binding[br]give the feeling of control[br][br]the effect of choice[br][br]populous : choice is just a motive - no real choices[br]simple choices good and evil, black and white[br]b&w 35 choices 32 for evil. Most american choose the good part[br]cultures differrences between europe, usa, japan[br]unexpected outcome, cultural issues[br][br]fable[br]designer has to handle the significance of your choice[br]make it clear[br][br]Not cool:[br]outcome to unexpected[br]weave instead of split[br]don''t forget the gameplay[br]spend to much on little simple choices[br][br]choice can effect[br][br]simulation[br]roumor systems[br]regions[br][br]pitfalls[br]expect the unexpected[br]be bold with game mechanics, how to choice[br]question the foundation story[br]be bold with story & drama[br][br]touch mechanic - emotional presence', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (260, '2009-08-28 16:56:51', 'de', 1, 'I am a socialiser seeker', '... says International Hobo. It''s a little survey Chris Batesman established. So help him and the game industy and mayby yourself.', '[img]http://survey.ihobo.com/images/bh/SocialiserSeeker.png[/img][br][br]Try it yourself.[br][URi]http://survey.ihobo.com/BrainHex/[/URi]http://survey.ihobo.com/BrainHex/[UR/][br][br]Time passes by. Here is one of those game from 1893, when I started computer gaming, oops, it was 1983.[br]Anyway, i still love this game:[br][URi]http://en.wikipedia.org/wiki/M.U.L.E.[/URi]M.U.L.E.[UR/][br][br]At the end here is a post GDC Europe link:[br][br][URi]http://journal.wheel-of-games.com/en/2009/08/designing-women/[/URi]http://journal.wheel-of-games.com/en/2009/08/designing-women/[UR/][br][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (261, '2009-08-18 17:34:17', 'de', 1, 'GDC Europe Tuesday Dan Conner Telltale', 'This was a business talk, like they always do. I''m pretty interested in a developer talk, like the one, the music and sound department speech on last years GDC in San Francisco. I am interested in episodic storytelling gaming and a how to. Here are the notes:', 'constant release dates - always closing[br]voice recording and pick ups[br]keeping the process in sync[br]staying sensitive to the talent[br]unpredictable channel[br][br]guybrush vs. strongbad[br][br][br]great ongoing narrative[br]complex chars[br]epic subject[br]existing long form content[br]soap opera style[br][br]short from humor[br]thrives on absurdity[br]simple relationships[br]creative“s intent[br]episodes standalone[br][br]first you have to think like an publisher[br]approbate market budget[br]right licensing choices upfront[br]ask and answer[br]evaluate cost audience big how moneys flows and ...[br][br]you have to thing like an online business[br]metrics traffic conversion, click throughs[br]building an affility network[br]drm and store front e-commerce[br]care about your user customers[br]how does the game itself integrate with the online[br]experience?[br][br][br]integrate social facebook, youtube, twitter etc promote[br][br]very tight feed back loop[br]sometimes within hours[br]allow your employees to participate[br][br]risky but worth and cool[br][br]ways to keep users engaged and rewarded[br][br]do all beyond the game stuff[br][br]retail remains[br]see as a partnership[br]they still drive the people that you want you to see as your customers.[br][br]how do you keep u with the technical development[br][br]we keep the catalog always up today but backwards compatible.[br][br]it usaly takes 3 or 4 episodes to get changes in.[br][br]fixes/patches next episode[br][br]it''s key of the business that the engine is always stable.[br][br]start players start with episode 1 or with somewhere in between?[br]plyers start with episode one and it is the best selling.[br][br]invest .5 - 1.5 million for one episodic game (season)[br][br]prise point always has to be figured out. the situations and platforms are different and always changing.[br][br]whole season 85% 15% single episode for people who know the telltale brand.[br]60% 40% split for beginners[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (262, '2009-09-01 20:32:16', 'de', 1, 'Basic Game Idea Contest', 'Basic Game Idea Contest. You have 3 3DCubes/Boxes. Now make a Game.', 'Basic Game Idea Contest[br][br]You have 3 3DCubes/Boxes.[br][br] [img]images/3cubes_basic_game.jpg[imgw]400[imageTitle]3Cubes basic game[imgAlt]3Cubes basic game[imgh]300[/img][br][br]Each Cude has 6 Sides.[br]Each side has a fore- and a background represented by one sheet.[br]Each sheet can be transparent (it is transparent the side is transparent(1 sheet only)).[br]If the side is fully transparent it is an open box.[br][br]Background can be one of the boxes or a 2d(Panorama)Image.[br][br]You may use additional 2d Element for interface for example.[br][br]No other 3d Element, please. (if! you may use sheets bounded tight to the boxes.)[br][br]Create a gameplay - action, board or narrative or whatever you like. Feel free to mix genres and use emotions.[br]Some more suggestions. You may use the cubes as dices, but think about mutable dices.[br]The cubes can represent some characters, and their inner life, home ... You may make them invisible.[br][br]Best practice: Create emotions via the gameplay directly.', 2, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (263, '2009-09-01 20:56:41', 'de', 1, 'Second Age Game', 'The Second Age Social-Mobile-Twitter-Wiki-Story-Casual-Community-Game is back. You can puzzle messages and images. Use http://secage.com with your mobile ', 'Allthough under development, the game is driven by a basic main theme. The Second Age. If you can read german you can find some information on the webpage.[br][b] I''ve still a lot of work to do, because I''ve to reconstruct the old storiies.[/b][br]It is similar to twitter. Each user can contribute small text pieces with a length of a maximum of some letters through an input form. We call this text piece “message” by default.[br][br]The user in the role of the writer can assign a comma separated list of keywords to his message. The length of this list is 140 letters long at the most.[br][br]The creation date is assigned automatically to each message. [br][br]A user can find or sort a message by  [br]the last 5 entries to the message list. The default behavior of the homepage.[br]keyword. Shows the message list of messages, where this keyword is assigned to. [br]author. Shows the profile of that user author with all his contributions.[br]creation date. A list of messages sorted by hour, day, …, from date to date.[br][br]Some advanced features:[br]A user can also assign an image to a message and[br]create a follow up message to another message. This behavior is called trail.[br][br]The basic idea of this game is to proceed further into the story.[br][br]But…![br][br]There are some plugged in games.[br]A word puzzle, where you have to assemble the original message.[br]The image puzzle, that uses an assigned image split into 9, 16, 25 pieces, if it has a square format, or split into 12 or 20 pieces, if it is a rectangle.[br][br]\r\n[include]games/widget_2ndage.htm[/include][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (264, '2009-09-07 23:21:28', 'en', 1, 'Just an image', 'May I introduce to you: Charlie Max Angelmaker, Austin Texas, born in Chemnitz, East Germany.', '[img]http://funkfish.net/spiele/images/piggies/KalleMax1.png[imgw]570[imgh]540[/img]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (265, '2009-09-08 00:39:45', 'de', 1, 'Die drei kleine Schweinchen - die Nacherzählung', 'Die Nacherzählung des klassischen Märchens.', 'Die Nacht war kalt und stürmisch. Es regnete Hunde und Katzen, der Wind jaulte, den das Wetter war sau schlecht. Es war ein Frühlingssturm, als drei kleine Schweinchen von ihrer Mutter Sau aus dem Stall vertrieben wurden, nicht weil ihnen die Schweinepest drohte oder weil der Bauer sie schlachten wollte. Nein, die Mutter war einfach zu arm, ihnen die Schulausbildung, die Kleidung oder gar das Essen zu bezahlen, schließlich war sie eine umtriebige Sau und deswegen wieder schwanger. Die Mutter war sogar zu arm ihnen Namen zu geben. Wir nennen sie deswegen Strawy, Woody und Rolling Stoned.[br]Also fanden sich die drei kleinen Schweine auf der Straße wieder und zogen so gemeinsam durch die Lande.[br][br]Eines Abend spät im Sommer kamen sie an einem Feld vorbei und fanden sehr viel Stroh. Rasch bauten sie sich gemeinsam eine Strohhütte für das Nachtlager, den es wurde Nachts doch schon kühl. Am nächsten Morgen meinte das erste Schweinchen, Strawy mit Namen, "Ach, ich bin des Umher wandern müde. Lasst uns doch gemeinsam hier bleiben und die Hütte ausbauen." Doch die anderen beiden Schweinchen wollten weiter ziehen und so blieb das eine Schwein alleine zurück. Fortan machte es die Strohhütte winterfest und lies es sich ansonsten gut ergehen. Es wurde dick, fett und rund. Doch was es nicht wusste, längst hatte der böse Wolf* schon ihre Spur aufgenommen.[br][br]*So heißt es in der Literatur. Andererseits berichtete der Volksmund von einer Bande räudiger Köter oder zu mindestens von einem Wolfsrudel. Letzteres scheint am wahrscheinlichsten, was der weitere verlauf der Geschichte auch zeigen wird. Trotzdem habe ich mich für die Einzahl der literarischen Bearbeitung entschieden.[br][br]Gut eine Woche später, das Wetter war nicht mehr sehr beständig, kamen die beiden Wanderschweine Woody und Rolling Stoned an einem Holzlager an einem Waldesrand vorbei und zimmerten sich ein hübsches Holzhäuschen für die Nacht, die schon recht regnerisch war. Doch was sie beide nicht wussten, an jenem Abend kam der böse Wolf beim ihrem Bruder Strawy in der Strohhütte vorbei. Er roch nur kurz und wusste was zu tun war. Er nahm noch einen letzten Zug an der Zigarette und schnippte sie auf das Strohdach. Dann pustete er so kräftig er konnte , was aber auch nicht viel half. Das nasse Stroh wollte nicht zünden. Er war ein starker Raucher und hatte nicht genügend Lungenkapazität. So trat er röchelnd, prustend und hustend in die Hütte ein. Das kleine dicke Schweinchen war fast starr vor Schreck, doch dann nahm es seine Beine in die Hand und rannte von dannen. Und so zog der Wolf in die Hütte ein. Er entfachte ein Feuer, um sich zu wärmen. Das war aber keine gute Idee. Die Hütte brannte lichterloh, denn sie war, wie jedermann weiß, nur aus Stroh. So musste auch der Wolf fliehen.[br][br]Am nächsten Morgen meinte das eine Schwein von den beiden Schweinchen, ja es war Woody, "Ach, ich bin des umher wandern müde. Lass uns doch gemeinsam hier bleiben und die Holzhütte ausbauen zu einem richtigen Haus." Doch das andere Schwein von den beiden Schweinchen, Rolling Stoned, war ein richtiger Wandersmann und wollte weiter ziehen und so blieb das Schwein Woody alleine zurück. Fortan machte es die Holzhütte winterfest und lies es sich ansonsten gut ergehen. Es wurde nicht so dick, rund und fett, den Holzarbeit macht kräftig. Doch was es nicht wusste, längst hatte der böse Wolf schon seine Spur aufgenommen, denn er rannte dem anderen Schweinchen hinterher, welches aus der Strohhütte geflohen war. Das war nicht so unsportlich wie es aussah und lief und rannte so schnell es konnte und das war durchaus schneller, als ein böser rauchender Wolf es konnte.[br][br]Das Schwein, welches nun alleine umher wanderte, hatte nach wenigen Tagen auch keine Lust mehr auf das alleine umher wandern. Deswegen nahm es einen Job  auf einer Farm als Hühnerhirte an und der Bauer baute ihm ein festes Haus aus Stein. Da dachte es, "Ich habe es wahrlich gut getroffen!" Es war glücklich und zu Frieden.[br][br]Doch was es nicht wusste, an jenem Abend kam trafen die anderen beiden Geschwister sich wieder. So lud das Schwein aus der Holzhütte das umher irrende Schwein ein, doch was alle nicht wussten der Wolf war ihnen auf der Spur. Das Schwein aus der Strohhütte erzählte dem Schweinchen in der Holzhütte, was ihm widerfahren war. Das Schweinchen in der Holzhütte war entsetzt, doch dachte es sich, wie gut es es selber getroffen hätte. Aber es hatte seine Rechnung ohne den bösen Wolf gemacht. Der hatte längst die Holzhütte ausgemacht, eine Kanister Benzin gestohlen und schüttete es über das Dach. "Zwei gut gebratene Schweinchen für den Preis von einem, das ist ein wahres Geschäft." Er zündete sich noch eine letzte Zigarette vor dem Essen an, da stand er schon lichterloh in Flammen. So sprang er vom Dach, ran krachend durch die Tür und hüpfte wild schreiend, brennend wie eine Fackel durch die Hütte und entzündete alles.[br]Die Schweinchen aber nicht starr vor Schreck nahmen ihr Beine in die Hand und sprangen beherzt aus dem Fenster. Nun waren sie gemeinsam auf der Flucht.[br][br]Schnell war ihnen klar, das ihnen der Wolf wohl möglich auf den Fersen war.[br]Dem aber ging es gar nicht gut. Er leckte sich die Brandwunden und sah nun mehr aus nach einem geprügelten vom Schicksal gebeutelten Köter als nach einem bösen Wolf.[br]Die beiden Schweinchen waren gut in Form und so kamen sie schnell voran zu einem festen Haus aus Stein. Darin wohnte ihr Geschwister. Das war erfreut seien Geschwister wiederzusehen und erschüttert über ihre Geschichte. Also lud es seine Geschwister kurzer Hand und ohne lange zu überlegen ein, bei ihm zu verweilen.[br]Der Bauer jedoch war anfangs gar nicht erfreut. Das änderte sich aber als er einen räudigen Köter sah. Da kam ihn eine Idee. Besser als ein Hirtenschwein wäre ein Wachhund und eine Schweinezucht. So bekam der Wolf den Job und Schweine wussten nicht so Recht wie ihnen geschah.[br][br]Und die Moral von der Geschicht''?[br]Traue dem Wohltäter nicht?[br][br]Auch Wohltäter sind Täter?[br][br]Das Schicksal schlägt immer aus einer Ecke zu, aus der man es nicht erwartet?[br][br]Wer weiß das schon.[br][br]PS.:[br]Wenig später soll in dieser Gegend sich eine Geschichte zugetragen haben, die als "Die Farm der Tiere" bekannt werden sollte.[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (266, '2009-09-08 00:42:29', 'en', 1, 'The three little piggies retold', 'The classic fairy tale retold.', 'The night was cold and stormy. It was raining cats and dogs, the wind howled, the weather was beastly. It was a spring storm, when three little pigs  were driven out of the stable from their mother sow, not because they had the swine fever, or because the farmer wanted to kill them. No, the mother was simply too poor to pay the education, clothing or even the food for them. she was a shrewd sow and therefore pregnant again. Even the mother was too poor to give them names. That''s why we call them Strawy, Woody and Rolling Stoned.[br]So there were the three little pigs on the street again and pulled it together through the countryside.[br][br]One evening late in the summer, they passed on a field with very much straw. Quickly they built together a straw hut for the night, because nights became cold already. The very next morning, the first pig, which we call Strawy, said, "Oh, I''m tired of walking around. Let us stay here together and build the hut." But the other two pigs wanted to move on. They left the pig back alone. From then on the pig prepaired the straw hut for the winter. The rest of the time it spend everything on it''s personal well-fare. It was thick, fat and round. It didn''t know, that the big bad wolf* had already found their tracks.[br][br]*That fact is stated in the literature. On the other hand, the locals told of a gang of mangy mutt, or at least a pack of wolves. The last option seems most likely. That is what the further course of history shows too. Nevertheless, I have decided to use the singular form of literary editing.[br][br]Just over a week later, the weather was not very stable, the two pigs, Woody and Rolling Stoned, were walking past a lumberyard at a forest edge and built out a pretty little wooden house for the night, which was quite rainy. But they both didn''t know, that night the big bad wolf came along to their brother strawy in the straw hut. He sniffed briefly and knew what to do. He took one last breath on the cigarette and flicked it onto the straw roof. Then he blew so strong he could, but this did not help much. The wet straw did not ignite. He was a heavy smoker and did not have enough lung capacity. So he came rattling, snorting and coughing into the hut. The fat little piggy was almost paralyzed with fright, but then it took it''s own fate into his own hands and ran away. And so the wolf entered the hut. He kindled a fire to warm themselves. But this was not a good idea. The cabin was in flames, because it was, as everyone knows, only made of straw. The Wolf was forced to flee too.[br][br]The next morning one pig, it was Woody, of the two pigs meant "Oh, I''m tired of walking around. Let us stay here together and build the log cabin into a real house." But the other pigs from the two little piggies, Rolling Stoned was a real hiker and would go on. The pig Woody was left alone. From then on it made the log cabin winterized and spend the rest of his thim for his personal well-fare. It was not so thick, round and bold, wood-work is vigorous. But what it did not know, the big bad wolf had already taken its course, because he ran behind the other pig, which had escaped from the straw hut. That was not so unsporting as it looked and ran and ran as fast as it could and that was certainly faster than a bad fuming Wolf could do.[br][br]The pig, which now wandered alone, was too tired to walk alone after a few days. So it took a job at a chicken farm as a shepherd for the chickens and the farmer built him a strong house made of stone. Then the pig thought, "I''ve taken a pretty place!" It was happy and in peace.[br][br]But what it did not know was that night, the other two brothers met again. Thus, the pig from the wooden hut, Woody, invited his wandering brother, Strawy, but what they both did not know, the wolf was on their track. The pig in the straw hut told the pig in the wooden hut the story of his life since they had going different ways. The piggy in the wooden hut was shocked, but it thought, the fate was much more polite for him. But the pig made his bill without the big bad wolf. Already he had identified the wooden hut, a stolen petrol canister and poured the gasoline over the roof. "Two well-roasted pigs for the price of one, that''s real business." He lit a last cigarette, even before eating, since he was already blazing fire. So he jumped off the roof, ran crashing through the door and jumped wildly, screaming, burning like a torch through the hut and lit it all.[br]The pigs but not rigid with fright took their hand and legs into the game and disapeared through the window. Now they were together on the run.[br][br]Quickly they realized that the wolf followed them on their heels possibly.[br]The wolf, however, it did not go well. He licked his burns and he was now looking more like a whipped dog ill-fated than a real bad wolf.[br]The two pigs were in good shape and so they moved fast to a strong stone build house. There their sibling lived in. This was pleased to see them again and was shocked by the siblings story. So it invited his siblings out of hand and without hesitation to spend time with him.[br]The farmer, however, was initially not pleased at all. That changed however when he saw a mangy dog. Since it seemed to be an good idea. Better than a shepard pig would be a guard dog and a 	piggery. So the wolf got the job, and pigs did not get quite right what was happening to them.[br][br]And the moral of the story?[br]Do not live for the benefactors satisfactory?[br][br]Benefactors are also perpetrators?[br][br]Most the time the fate strikes back from a corner from which no one does not expect it?', 2, 1, '0000-00-00 00:00:00');
