INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (275, '2009-11-06 11:35:07', 'de', 1, 'Browser game forum 2009', 'part 1, Florian Bohn, Eike Klindworth, Coffee Break', 'ceo travian games[br]florian bohn[br]player suport and community management[br]pitfalls and challenges[br][br]each game, market and developer has different solutions and challenges[br][br]external factors[br]barriers of languages, cuture and custom[br]style of communication[br]native language of customers[br][br]different regulatory frameworks[br][br]time and calendrical differences:[br]time zones[br]different distribution models[br][br]Internal challenges:-consistent communications[br]marketing[br]product management[br]player support and community requries up to date informations[br]payment service providers[br]media partners[br][br]solutions[br][br]decentral support - different cultures[br]regulatory frameworks[br]: adjust reg for specific coutries[br]time differences central support 24/7 with shift operation[br]local support team[br][br]consistent mature cross-departmental communication[br]up2date[br]internal communications channels[br]knowledge management tools[br][br]increasing quality standards[br]decreasing response time[br][br]new technical challenges and requirements: chat video e.g[br][br]think about customer support when you start designing a MMO[br][br]-----------[br][br]Eike Klindworth-InnoGames[br]Balancing in Browsergames[br](german talk)[br][br]Challenges[br]protect new players from bi9g players[br]success has to be possible with late start as well[br]old players have to get advantages for their investments[br]old players should not grow quicker[br][br]solutions[br][br]Hard caps[br]beginners protection[br]hard cap[br]alternative leagues[br]soft caps[br]less rewards[br]protection through distance[br]attack deduction (moral[br][br]challenges[br] non-linear growth makes big players stronger (?)[br] players do not like linear growth[br] happens quickly[br][br]solutions[br] continuously impede growth(higher levels, each town gets more expensive)[br] squander away from capitol[br] new challenges for big players(alliance administration, complex fight systems)[br][br]challenges[br]the hardcore players get ahead faster[br]casual gamers lose interest[br][br]solutions[br]the main task are doable in few minutes on a daily basisi[br]inactive players get experince, resources boost[br]limited amount of action points[br]casual gamers achieve little successes quikly different ones from hardcore players[br][br]challenges[br]players are not online at the same time[br][br]solutions[br]night bonus for defenders[br]defenders can choose default settings in advance[br]no big advantage for activity during fights[br]give the defender a fight bonus[br][br]challenge[br]players can play more than one account[br]prohibited but hard to control[br]players support their own accounts[br]players interation is extremly important[br][br]solutions:[br]same starting conditions[br]limitations via distance[br]game play limitations caps[br]technical limitations[br]volunteers control multiaccounts[br][br]challenges[br]too high gameplay advantages make non-payers quit[br]too low gameplay advantages make players not even want to pay[br]players are more likely to quoit, because they join without costs[br][br]solutions[br]prefect first five minutes[br]sell advantages that reduce activity[br]the more advantages one buys the less it is worth it[br]do not sell the precious things(ranking points, cities etc.)[br][br]early prototype, trial & error', 2, 1, '0000-00-00 00:00:00');
