INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (271, '2009-09-22 22:47:36', 'de', 1, 'Die kleinen drei Schweinchen - Moderne Zeiten', 'Nicht ganz ein Märchen, aber immer noch das gute alte Motiv.', 'Es waren einmal drei kleine Schweinchen und sie waren alle Geschwister, zwei Brüder und eine Schwester, um genau zu sein. Sie lebten in einem fernen Land Namens Amerika, genauer gesagt, denn wir wollen doch genau sein, den Vereinigten Staaten von Amerika. Sie hießen Jorge, Luise und Borges, denn ihre Eltern hatten einen ausgefallen Geschmack, was die Namensgebung angeht.[br][br]Sie waren alle wohlerzogen und gut ausgebildet, als sie das Heim ihrer Eltern verließen. Ihre Eltern hatten sie stets liebevoll umsorgt.[br][br]Alle drei hatten Jobs in der Foodindustrie angenommen.[br][br]Das erste Schweinchen, Jorge, das war ein Farmer im mittleren Westen und baute Mais an, züchtete Hühner und Rinder.[br]Seine Farm war groß und er war Herr über viele Morgen Land, Hühner und Rinder. Soweit er der Herr war, denn um all dies zu erwerben und auszubauen, musste er nicht nur von früh bis spät hart arbeiten, sondern auch Schulden machen bei den Banken. Deswegen gehörte ihm eigentlich kein einziger Yard seiner Farm, die nächste Ernte und der Ertrag aus den Hühnerställen und der Rinderzucht war auch schon den Banken verpfändet. Er war mager und hager und doch am Ende das Tages glücklich und zufrieden. Er fand, er habe es im Leben gut getroffen. So lebte er von der Hand in den Mund.[br][br]Das nächste Schweinchen, Luise, war aber nicht so unternehmungslustig wie ihre beiden Brüder. Sie verkaufte die Endprodukte, die aus den Tieren und dem Korn hergestellt wurden, die viele Farmer und Bauern und ihr Bruder Jorge pflegten und hegten. Pappbrötchen, Chicken Nuggets und das Hack, welches nach dem Schlachten vom Rind noch übrig blieb. Deswegen hatte sie eine einfachen Job im Schnellrestaurant angenommen, geheiratet, Kinder und nannte ein kleines Einfamilienhaus mit einem hübschen Gärtchen, ganz so wie ihre Eltern es hatten, ihr Eigen. Man ahnt es schon, natürlich war das Häuschen nicht ihr Eigentum, noch nicht ganz, denn ihre Kinder aßen ihr die Haare vom Kopf und die Hypotheken für die Bank zahlten sie immer noch ab. Aber bald würden die Kinder das Haus verlassen und das Haus ihnen gehören. Anstrengend waren ihre Tage und auch voller Liebe. Meistens war sie glücklich oder zufrieden. Am Ende jeden Tages fand sie, sie habe es ganz gut getroffen im Leben. So lebte sie mehr recht als schlecht.*[br][br]*Dieser Teil der Geschichte ist tatsächlich schon für das Fernsehen real verfilmt worden und ich bin sicher viele kennen sie. Es ist die TV-Serie "Rosanne".  Namen und Ereignisse sind verändert worden, um real erzählte Schweine und existierende Personen zu schützen.[br][br]Das letzte Schweinchen jedoch, mit Namen Borges, hatte nie etwas richtiges gelernt. Er lebte von einem Tag auf den anderen und spekulierte mit anderer Leute Geld an der Foodbörse. Dadurch machte er eine Menge Geld. Er nannte einen Sportwagen, eine Villa mit Swimmingpool, ein dickes, fettes Bankkonto und diverse Firmenbeteiligungen sein eigen. Und soweit man den Banken glauben konnte, gehörte ihm dies alles auch und er war schuldenfrei. Er war geschieden, lebte in wilder Ehe, hatte viele Kinder, aber er zahlte keine Alimente. Natürlich, man kann es sich schon denken, fand er das er viel zu wenig verdiente, viel zu wenig hatte und alle anderen nur Schnorrer wären. Insbesondere seine Familie. Er war dick, fett, rund und faul wie die Sünde und am Ende des Tages wäre es besser für die Welt gewesen, er wäre an einem Herzinfarkt verstorben, denn natürlich war er auch noch Republikaner.[br][br]Als seine Mutter von einem Sportwagen angefahren wurde, da war er es, der diesen betrunken gefahren hatte. Selbstverständlich beging er Fahrerflucht und wurde nicht erwischt. Er lehnte es ab, sich an den Krankenhauskosten zu beteiligen. Sein Bruder Jorge aber verpfändete sein letztes Hemd, seine Schwester Luise führte ihrem alten Vater den Haushalt, während ihre Mutter im Krankenhaus lag. Er, Borges, spekulierte  darauf hin heftig auf fallende Preise bei Hühnern, Rinderhälften und Korn, wodurch die Preise fielen. Er wurde noch reicher, fetter und unausstehlicher und standesgemäß hatte er nun nicht nur einen neuen ausländische Sportwagen, sondern derer zwei, einen SUV und einen Rolls Royce.[br]Dem Bruder Jorge aber gönnte er nur Spott, als der Haus und Hof verlassen musste, weil ihm die Banken die Kreditlinien strichen.[br][br]Seine Schwester nahm ihren Bruder Jorge bei sich auf. Auch ihren alten Vater und ihre Mutter, die nicht genesen wollte, holte sie in ihr Haus. Sie wich nicht vom Bette ihrer kranken Mutter, wenn sie denn nicht im Schnellrestaurant arbeiten musste. Ihr Mann und ihr Bruder nahmen jeden Job an, den sie kriegen konnten. Den Sie drehten schon jetzt jeden Cent zweimal um. Doch all das half nichts.[br][br]Ihr Bruder spekulierte auf dem Häusermarkt. Er verlieh Geld an arme Schweine, von denen er schon wusste, dass sie sich einen Kredit auf keinen Fall leisten konnten. Dann verkaufte er ihnen ein Haus zum doppelten, dreifachen des Marktwertes. Dabei fühlte er sich auch noch als Wohltäter.[br]Von dem Geld, dass er mit derartig windigen Spekulationen verdiente, kaufte er sich eine Schnellrestaurantkette. Kurz darauf platzte die Spekulationsblase, aber Borges hatte ja schon seine Schäfchen ins trockene gebracht. Wegen der folgende Wirtschaftskrise entließ er die Hälfte der Mitarbeiter, darunter auch seine Schwester Luise. Der andere Hälfte bezahlte er nur die das halbe Gehalt für die doppelte Arbeit.[br]Die Bank  pfändete das Haus von Lusie, weil sie ihre Hypothek nicht mehr abbezahlen konnte, und versteigerte es. Sie und ihre Familie fand sich auf der Straße wieder. Sie mussten obdachlos in Parks und unter Brücken schlafen. Deswegen erkrankten auch sie an der Schweinegrippe.[br]Da bot Borges ihnen Hilfe an, doch hatte er nichts Besseres zu tun als seine Geschwister und seine Eltern für einen Spottpreise an den nächstbesten Schlachter zu verhökern. Er lebte noch lange und unzufrieden, und wenn er nicht gestorben ist, plant er mit Sicherheit die nächste Schweinerei.[br][br]Und die Moral von der Geschicht -[br]Mit einer öffentlichen Krankenversicherung passiert dir das nicht?[br][br]Der Irak hat Weapons of Mass Destruction?[br][br]Nicht jedes Schwein ist eine Schwein?', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (272, '2009-09-22 22:51:13', 'en', 1, 'The little three piggies - Modern Times', 'For sure not the good old fairy tale, but a new short story with a similar content. ', 'The little three piggies[br][br]There were once three little pigs and they were all siblings, two brothers and one sister, to be exact. They lived in a faraway land called America, more precisely, because we want to be precisely just yet, the United States of America. Their names were Jorge, Louise and Borges, because their parents had a strange taste when it comes to naming.[br][br]They were all well educated and well trained as they left their home, the house of her parents. Her parents had lovingly cared for them constantly.[br][br]All three had accepted jobs in the food industry.[br][br]The first pig, Jorge, was a farmer in the Midwest and built on corn, bred chickens and cattle.[br]His farm was large and he was lord of many acres of land, chickens and cattle. As far as he was the Lord. To develop and acquire these things, he had to work hard from morning till night. He also had to make debt with the banks. So he really did not own a single yard of his farm. The next harvest and the yield from the chicken coops and the cattle were already mortgaged to the banks. He was thin and gaunt, and yet at the end of the day, happy and satisfied. He found that he had made it good in life. So he lived from hand to mouth.[br][br]The next Pig, Louise, was not as enterprising as her two brothers. She sold the finished products made from the animals and the corn, which many farmers and peasants, like her brother Jorge, cultivated and fostered. Sticky baps, chicken nuggets and that ground beef, which remained after the slaughter of the cattle. It''s why she had taken a simple job in fast food, had married and had children. She called a small house with a pretty garden, just like their parents had, her own. You guessed it, of course, the house was not her property. Not quite, because her children were eating her hair from her head, bur she managed to pay off the mortgages for the bank always yet. But soon the children would leave the house and the house would belong to her. Her days were exhausting and full of love. Mostly she was happy or satisfied. At the end of each day, she found that she had taken it quite well in life. She was rather well than ill.*[br][br]* This part of the story was actually filmed in real terms even for television and I''m sure many of you know about. It is the TV series "Rosanne." Names and events have been changed to protect real live people, pigs and telling.[br][br]The last pig, however, called Borges, who had never learned anything real. He lived from one day to another and also invested other people''s money on the food market. Thus he made a lot of money. He called a sports car, a villa with swimming pool, a big, fat bank account and various corporate interests his own. And as far as one could believe the banks, it all belonged to him and he was also debt free. He was divorced, lived in sin, had many children, but he paid no child support. And of course, anyone can imagine already, he found that he earned too little, owned far too little and all the others were just scroungers. Especially his family. He was fat, fat, round and lazy as sin and at the end of the day, it would have been better for the world, he would have died of a prompt heart attack, because of course he was also a republican.[br][br]When his mother was hit by a sports car because it was he who had driven it drunken. Of course, he hit and run and was not caught by the police. He refused to participate in the hospital costs. His brother, Jorge, however, pledged his shirt off, his sister, Louise took her elderly father to her household while her mother was in hospital. He, Borges, speculated with an enormous amount of money to falling prices for chickens, sides of beef and grain, making the prices fell. He became even richer, fatter and more intolerable. Formal he owned now not only one new foreign sports car, he owned two of them, an SUV and a Rolls Royce.[br]He mocked his brother Jorge vehement, because Jorge had to leave house and farm. It was Borges who cut off the bank credit lines.[br][br]His sister got her brother Jorge into her house. She opened her house even for her old father and her mother, who did not recover. She did not leave the bedside of her sick mother, when she was not working in fast food. Her husband and her brother took any job they could get. Now they have been turned over every penny twice. But all this did not help.[br][br]Her brother speculated on the housing market. He lent money to poor pigs, of which he already knew that they could afford a loan under any circumstances. Then he sold them a house to double, triple the market value. He felt even as a benefactor.[br]Of the money that he earned with such a dubious speculation, he bought a fast-food business. Shortly thereafter, the bubble was bursting, but Borges had already brought his sheep into the dry ones. Because of the following economic crisis, he sacked half the staff, including his sister, Louise. The other half he paid only half the salary for the duplication of work.[br]The Bank distrained Louise''s house because she could no longer pay off her mortgages, and auctioned it. She and her family found themselves back on the road. They had homeless sleeping in parks and under bridges. That is why they became ill with the swine flu.[br]Borges kindly offered them help. But again he had nothing better to do than to peddle his siblings and his parents for a nominal price to the nearest butcher. He lived long and unhappy, and if he is not dead, he plans for sure the next mess.[br][br]And the moral of the story:[br]Go on a public health insurance for love and glory?[br][br]Iraq has Weapons of Mass Destruction?[br][br]Not every pig is a pig?[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (273, '2009-09-29 18:04:43', 'de', 1, 'Drei Schweinchen Brettspiel - ein Entwurf ', 'Das drei Schweinchen Brettspiel. Ein Rohentwurf der Spielregeln und des Spielbrettes.', '[img]images/pigs_brett_roh.jpg[imgw]500[imgh]500[/img][br][br][br]Ein Brettspiel für 3 Schweinchen und 2 - 6 Spieler die es werden wollen.[br][br]Start ist bei "Hotel Mama".[br]"Home Sweet Home" ist das Ziel.[br][br]Jeder Spieler erhält eine Spielfigur und einen Würfel.[br]Die schwarzen Spielsteine sind die Wölfe.[br][br]Ziel ist es von Hotel Mama nach Hause zu gelangen.[br]Wer als Erster ins Ziel gelangt gewinnt. Das Spiel ist aber erst, vorbei wenn alle Spieler im Ziel sind.[br][br] Augenzahl 2:[br]bedeutet der Spieler zieht zwei vor und baut hier dann ein Haus. Er kann es erst dann verlassen, wenn er eine 4 wirft und eine Wolfskarte zieht oder eine 6 würfelt.[br] Augenzahl 4:	[br]der Spieler muss eine Eventkarte ziehen. Es gibt Schweinchen-, Wolfs- und Schicksalskarten. Je nach Karte darf er 4 Felder weiter ziehen, oder auch nicht.[br] Augenzahl 6: 	[br]Der Spieler kann ein jedes Haus verlassen - Hotel Mama und seine Hütte an der Strecke. Ist er in keinem Haus, so darf er nochmal würfeln. Diese Strecke hat er zurück zu gehen. 6 Felder weit kann man nicht ziehen.[br][br]Spekulanten-Sonderregel: mit Geld spielen. Jeder Spieler erhält ein Darlehen von der Bank in Höhe von einigen Chips. Wann immer ein anderer Spieler auf ein Feld mit einem Häuschen eines anderen Spielers kommt, so zahlt er Miete von x Chips. Hierzu kann man Poker- oder Kartoffelchips nehmen.[br]Ist der Hausherr zu gegen zahlt er doppelt.[br]Sind andere Spieler anwesend, zahlt er pro Spieler x Chips mehr - schließlich hat man sich an der Wiedersehensfeier zu beteiligen.[br]Am Ende des Spiels ist das Darlehen zurückzuzahlen.[br][br]Eventkarten:[br]11 Schweinchenkarten müssen direkt in den Stapel zurück.[br]11 Wolfskarten können gesammelt werden.[br]11 Schicksalskarten.[br][br]Fürchte den Wolf : 1 bis 6Felder zurück und spezial "Back to Hotel Mama" Karte (Schweinchenkarten)[br]7 Karten[br][br]4 weiter Schweinchenkarten.[br]"Home Sweet Home"  baue hier ein Haus und setze eine Runde aus (zahle 5*x Chips an die Bank)[br][br]Bei den Schicksalskarten gibt es 4 Gewinnkarten. [br]Sie ändern die Gewinnbedingung.[br]Sie sind sofort vor dem jeweiligen Spieler aufzudecken und werden bei einer neuen Gewinnbedingung verdeckt. Wer alle 4 Karten gesammelt hat, hat sofort gewonnen. Die Karten können mit eingesammelt werden![br][br]"Slaughterhouse" - Wer als letztes ins Ziel gelangt hat gewonnen. Alle anderen			[br]erhalten 100*x Chips extra.[br]"Hot Dog" - wer die meisten Wölfe gesammelt hat, Wolfssteine und Wolfskarten, gewinnt.[br]Professor Schwein - Der Spieler mit den meisten Häusern gewinnt.[br]Bankrott - der Spieler mit dem meisten Geld oder wer als Erster ins Ziel gelangt			[br]gewinnt[br](Du bleibst stehen)[br][br]7 Humilationkarten Schicksal:[br]1. Sammele alle Wölfe ein inklusive der von den Spielern gefangenen.[br]2. Sammele alle von den Spielern gefangenen Wölfe ein.[br]3. Sammele alle Wölfe ein verteile sie vom Ziel aus neu inklusive Ziel (Abstand wird erwürfelt) die übrig gebliebenen Wölfe kommen zurück in den Wald[br]4. Reiße alle Hütten ab. ("Big bad Wolf" extra Wolfskarte)[br]5. Sammele alle Karten ein, inklusive Gewinnkarten, und mische sie unter den Stapel.[br]6. Sammele alle Karten ein und mische sie unter den Stapel. Exklusive Gewinnkarten![br]7. Du allein fängst das Spiel nochmal ganz von vorne an.[br]Du ziehst 4 Felder zurück.[br][br]Wolfskarten[br]"Capture the Wolf", 4 Karten der Spieler kann einen/zwei(1*) Wolf/Wölfe vom Spielfeld nehmen,	[br]aber dann muss er die Karte abgeben. Er kann die Karte auch im Vorbeiziehen spielen und so den Wolf einsammeln. (Ziehe außerdem 4 Felder weiter)[br]Platziere den Wolf 1 bis 6 Felder vor dem Spieler + ein spezial wo immer du einen Wolf platzieren willst - 7 Karten. (Du bleibst stehen)[br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (276, '2009-11-16 17:47:01', 'de', 1, 'Browser game forum 2009 part Two', 'I''m a little bit late, but finally I made it: here is part two of my notes from the BGF Frankfurt and a resume.', 'Dos and Donots from a Entrepreneurs View[br]Lukasz Gadowski,[br]Team Europe Ventures[br][br]                          Gameplay[br]                                            Virility[br]                          Distribution[br]Revenue-Share[br]                         Monetization[br][br]Consider the basic:[br]Don''t Forget: Teams win, not ideas[br](Though great ideas can attract great great teams and bad ideas can be expensive)[br][br]Why foreign money stinks:[br]waist time to acquire[br]you give up equity[br][br]When is money great:[br]on a great deal[br]when you can get it with value adds[br][br]--------------------------[br][br]Than I went to meet people in the Lobby.[br][br]The BFG is great to meet people, the lectures were mostly boring. Potentially the lecture on Saturday were better. I recommend lecture Patrick Streppel, CEO Gamigo Games AG. But it was impossible to make notes. He used charts and pictures -  very quick.[br][br]I also want to mention Julian Hühnermann from gratispay.de. We had a nice meeting on Friday. I''m sorry, I missed your lecture, but you know our car had have some battery problems. So that was the reason, why we left early on Saturday.[br][br]On Friday evening there was the EIGA Award ceremony.[br]A good presentation with good music and catering. EIGA means European Innovative Games Award.[br][br][br][br][br][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (277, '2009-11-24 17:56:25', 'en', 1, 'Serious Swineflu Report By...', '...Professor Doctor Ferdinand Schwartenbruch. ', 'May I introduce to you Professor Doctor Ferdinand Schwartenbruch.[br][br]He say''s, don''t Panic. The flu is better than getting a serious infection of [b]swine fever[/b].[br]So do not worry, be happy and thankful.[br][br][img]http://funkfish.net/spiele/images/piggies/pigvirus.jpg[imgw]585[imgh]627[/img][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (278, '2009-12-21 17:57:09', 'en', 1, 'Kopenhagen Unbehagen', 'Copenhagen changed from Hopenhagen to Flopenhagen', 'I just want you to remember this:[br][br][img]http://funkfish.net/spiele/images/saveYourEarth_585.png[imgw]585[imgh]835[/img][br][br]The translation of Unbehagen is discomfort or uneasiness.[br]Well, it will become pretty uncomfortable in the next years.[br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (279, '2009-12-23 22:15:01', 'de', 1, 'A little game as a gift for everyone', 'Merry Christmas everyone! "¡Viva Zapallo! ¿Pig a Zuma? Rolling heads! " Here is a little casual puzzle game just enjoy and have fun. Can you collect 150 heads? ', 'Well this is just a first test version. Wait for the first ten heads to roll in, than try to build pairs. You can switch the position between neighbors. Mark one head, than the other one.  [br][br]Avoid to loose heads at the end of the pipe. Otherwise you will loose your head.[br][br]Sacrifice and play "¡Viva Zapallo! Rolling heads!" [br][br]<applet code="MainApplet.class" width="350" height="200" codebase="applet" archive="PuzzleLiner.jar"><param name="nick" value="nick" /><param name="id" value="111" /></applet>[br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (280, '2010-02-26 11:03:41', 'de', 1, 'Do not drink Tea, drink Coffee.', 'In Honor to Joe Stack. Freedom fighter and public welfare and public health care backer. The Tea-Party-Fraction is wrong. Here you can read Joe''s last words. ', 'If you’re reading this, you’re no doubt asking yourself, “Why did this[br]have to happen?”  The simple truth is that it is complicated and has[br]been coming for a long time.  The writing process, started many months[br]ago, was intended to be therapy in the face of the looming realization[br]that there isn’t enough therapy in the world that can fix what is really[br]broken.  Needless to say, this rant could fill volumes with example[br]after example if I would let it.  I find the process of writing it[br]frustrating, tedious, and probably pointless… especially given my gross[br]inability to gracefully articulate my thoughts in light of the storm[br]raging in my head.  Exactly what is therapeutic about that I’m not sure,[br]but desperate times call for desperate measures.[br][br]We are all taught as children that without laws there would be no[br]society, only anarchy.  Sadly, starting at early ages we in this country[br]have been brainwashed to believe that, in return for our dedication and[br]service, our government stands for justice for all.  We are further[br]brainwashed to believe that there is freedom in this place, and that we[br]should be ready to lay our lives down for the noble principals[br]represented by its founding fathers.  Remember? One of these was “no[br]taxation without representation”.  I have spent the total years of my[br]adulthood unlearning that crap from only a few years of my childhood. [br]These days anyone who really stands up for that principal is promptly[br]labeled a “crackpot”, traitor and worse.[br][br]While very few working people would say they haven’t had their fair[br]share of taxes (as can I), in my lifetime I can say with a great degree[br]of certainty that there has never been a politician cast a vote on any[br]matter with the likes of me or my interests in mind.  Nor, for that[br]matter, are they the least bit interested in me or anything I have to say.[br][br]Why is it that a handful of thugs and plunderers can commit unthinkable[br]atrocities (and in the case of the GM executives, for scores of years)[br]and when it’s time for their gravy train to crash under the weight of[br]their gluttony and overwhelming stupidity, the force of the full federal[br]government has no difficulty coming to their aid within days if not[br]hours?  Yet at the same time, the joke we call the American medical[br]system, including the drug and insurance companies, are murdering tens[br]of thousands of people a year and stealing from the corpses and victims[br]they cripple, and this country’s leaders don’t see this as important as[br]bailing out a few of their vile, rich cronies.  Yet, the political[br]“representatives” (thieves, liars, and self-serving scumbags is far more[br]accurate) have endless time to sit around for year after year and debate[br]the state of the “terrible health care problem”.  It’s clear they see no[br]crisis as long as the dead people don’t get in the way of their[br]corporate profits rolling in.[br][br]And justice? You’ve got to be kidding![br][br]How can any rational individual explain that white elephant conundrum in[br]the middle of our tax system and, indeed, our entire legal system?  Here[br]we have a system that is, by far, too complicated for the brightest of[br]the master scholars to understand.  Yet, it mercilessly “holds[br]accountable” its victims, claiming that they’re responsible for fully[br]complying with laws not even the experts understand.  The law “requires”[br]a signature on the bottom of a tax filing; yet no one can say truthfully[br]that they understand what they are signing; if that’s not “duress” than[br]what is.  If this is not the measure of a totalitarian regime, nothing is.[br][br]How did I get here? [br][br]My introduction to the real American nightmare starts back in the early[br]‘80s.  Unfortunately after more than 16 years of school, somewhere along[br]the line I picked up the absurd, pompous notion that I could read and[br]understand plain English.  Some friends introduced me to a group of[br]people who were having ‘tax code’ readings and discussions.  In[br]particular, zeroed in on a section relating to the wonderful[br]“exemptions” that make institutions like the vulgar, corrupt Catholic[br]Church so incredibly wealthy.  We carefully studied the law (with the[br]help of some of the “best”, high-paid, experienced tax lawyers in the[br]business), and then began to do exactly what the “big boys” were doing[br](except that we weren’t steeling from our congregation or lying to the[br]government about our massive profits in the name of God).  We took a[br]great deal of care to make it all visible, following all of the rules,[br]exactly the way the law said it was to be done.[br][br]The intent of this exercise and our efforts was to bring about a[br]much-needed re-evaluation of the laws that allow the monsters of[br]organized religion to make such a mockery of people who earn an honest[br]living.  However, this is where I learned that there are two[br]“interpretations” for every law; one for the very rich, and one for the[br]rest of us… Oh, and the monsters are the very ones making and enforcing[br]the laws; the inquisition is still alive and well today in this country.[br][br]That little lesson in patriotism cost me $40,000+, 10 years of my life,[br]and set my retirement plans back to 0.  It made me realize for the first[br]time that I live in a country with an ideology that is based on a total[br]and complete lie.  It also made me realize, not only how naive I had[br]been, but also the incredible stupidity of the American public; that[br]they buy, hook, line, and sinker, the crap about their “freedom”… and[br]that they continue to do so with eyes closed in the face of overwhelming[br]evidence and all that keeps happening in front of them.[br][br]Before even having to make a shaky recovery from the sting of the first[br]lesson on what justice really means in this country (around 1984 after[br]making my way through engineering school and still another five years of[br]“paying my dues”), I felt I finally had to take a chance of launching my[br]dream of becoming an independent engineer.[br][br]On the subjects of engineers and dreams of independence, I should[br]digress somewhat to say that I’m sure that I inherited the fascination[br]for creative problem solving from my father.  I realized this at a very[br]young age.[br][br]The significance of independence, however, came much later during my[br]early years of college; at the age of 18 or 19 when I was living on my[br]own as student in an apartment in Harrisburg, Pennsylvania.  My neighbor[br]was an elderly retired woman (80+ seemed ancient to me at that age) who[br]was the widowed wife of a retired steel worker.  Her husband had worked[br]all his life in the steel mills of central Pennsylvania with promises[br]from big business and the union that, for his 30 years of service, he[br]would have a pension and medical care to look forward to in his[br]retirement.  Instead he was one of the thousands who got nothing because[br]the incompetent mill management and corrupt union (not to mention the[br]government) raided their pension funds and stole their retirement.  All[br]she had was social security to live on.[br][br]In retrospect, the situation was laughable because here I was living on[br]peanut butter and bread (or Ritz crackers when I could afford to[br]splurge) for months at a time.  When I got to know this poor figure and[br]heard her story I felt worse for her plight than for my own (I, after[br]all, I thought I had everything to in front of me).  I was genuinely[br]appalled at one point, as we exchanged stories and commiserated with[br]each other over our situations, when she in her grandmotherly fashion[br]tried to convince me that I would be “healthier” eating cat food (like[br]her) rather than trying to get all my substance from peanut butter and[br]bread.  I couldn’t quite go there, but the impression was made.  I[br]decided that I didn’t trust big business to take care of me, and that I[br]would take responsibility for my own future and myself.[br][br]Return to the early ‘80s, and here I was off to a terrifying start as a[br]‘wet-behind-the-ears’ contract software engineer... and two years later,[br]thanks to the fine backroom, midnight effort by the sleazy executives of[br]Arthur Andersen (the very same folks who later brought us Enron and[br]other such calamities) and an equally sleazy New York Senator (Patrick[br]Moynihan), we saw the passage of 1986 tax reform act with its section 1706.[br][br]For you who are unfamiliar, here is the core text of the IRS Section[br]1706, defining the treatment of workers (such as contract engineers) for[br]tax purposes. Visit this link for a conference committee report[br][br](http://www.synergistech.com/1706.shtml#ConferenceCommitteeReport)[br]regarding the intended interpretation of Section 1706 and the relevant[br]parts of Section 530, as amended. For information on how these laws[br]affect technical services workers and their clients, read our discussion[br]here [br](http://www.synergistech.com/ic-taxlaw.shtml).[br][br]SEC. 1706. TREATMENT OF CERTAIN TECHNICAL PERSONNEL.[br][br](a) IN GENERAL - Section 530 of the Revenue Act of 1978 is amended by[br]adding at the end thereof the following new subsection:[br][br](d) EXCEPTION. - This section shall not apply in the case of an[br]individual who pursuant to an arrangement between the taxpayer and[br]another person, provides services for such other person as an engineer,[br]designer, drafter, computer programmer, systems analyst, or other[br]similarly skilled worker engaged in a similar line of work.[br][br](b) EFFECTIVE DATE. - The amendment made by this section shall apply to[br]remuneration paid and services rendered after December 31, 1986.[br][br]Note:[br][br]·      "another person" is the client in the traditional job-shop[br]relationship.[br][br]·      "taxpayer" is the recruiter, broker, agency, or job shop.[br][br]·      "individual", "employee", or "worker" is you.[br][br] [br][br]Admittedly, you need to read the treatment to understand what it is[br]saying but it’s not very complicated.  The bottom line is that they may[br]as well have put my name right in the text of section (d).  Moreover,[br]they could only have been more blunt if they would have came out and[br]directly declared me a criminal and non-citizen slave.  Twenty years[br]later, I still can’t believe my eyes.[br][br]During 1987, I spent close to $5000 of my ‘pocket change’, and at least[br]1000 hours of my time writing, printing, and mailing to any senator,[br]congressman, governor, or slug that might listen; none did, and they[br]universally treated me as if I was wasting their time.  I spent[br]countless hours on the L.A. freeways driving to meetings and any and all[br]of the disorganized professional groups who were attempting to mount a[br]campaign against this atrocity.  This, only to discover that our efforts[br]were being easily derailed by a few moles from the brokers who were just[br]beginning to enjoy the windfall from the new declaration of their[br]“freedom”.  Oh, and don’t forget, for all of the time I was spending on[br]this, I was loosing income that I couldn’t bill clients.[br][br]After months of struggling it had clearly gotten to be a futile[br]exercise.  The best we could get for all of our trouble is a[br]pronouncement from an IRS mouthpiece that they weren’t going to enforce[br]that provision (read harass engineers and scientists).  This immediately[br]proved to be a lie, and the mere existence of the regulation began to[br]have its impact on my bottom line; this, of course, was the intended effect.[br][br]Again, rewind my retirement plans back to 0 and shift them into idle. [br]If I had any sense, I clearly should have left abandoned engineering and[br]never looked back.[br][br]Instead I got busy working 100-hour workweeks.  Then came the L.A.[br]depression of the early 1990s.  Our leaders decided that they didn’t[br]need the all of those extra Air Force bases they had in Southern[br]California, so they were closed; just like that.  The result was[br]economic devastation in the region that rivaled the widely publicized[br]Texas S&L fiasco.  However, because the government caused it, no one[br]gave a shit about all of the young families who lost their homes or[br]street after street of boarded up houses abandoned to the wealthy loan[br]companies who received government funds to “shore up” their windfall. [br]Again, I lost my retirement.[br][br]Years later, after weathering a divorce and the constant struggle trying[br]to build some momentum with my business, I find myself once again[br]beginning to finally pick up some speed.  Then came the .COM bust and[br]the 911 nightmare.  Our leaders decided that all aircraft were grounded[br]for what seemed like an eternity; and long after that, ‘special’[br]facilities like San Francisco were on security alert for months.  This[br]made access to my customers prohibitively expensive.  Ironically, after[br]what they had done the Government came to the aid of the airlines with[br]billions of our tax dollars … as usual they left me to rot and die while[br]they bailed out their rich, incompetent cronies WITH MY MONEY!  After[br]these events, there went my business but not quite yet all of my[br]retirement and savings.[br][br]By this time, I’m thinking that it might be good for a change.  Bye to[br]California, I’ll try Austin for a while.  So I moved, only to find out[br]that this is a place with a highly inflated sense of self-importance and[br]where damn little real engineering work is done.  I’ve never experienced[br]such a hard time finding work.  The rates are 1/3 of what I was earning[br]before the crash, because pay rates here are fixed by the three or four[br]large companies in the area who are in collusion to drive down prices[br]and wages… and this happens because the justice department is all on the[br]take and doesn’t give a fuck about serving anyone or anything but[br]themselves and their rich buddies.[br][br]To survive, I was forced to cannibalize my savings and retirement, the[br]last of which was a small IRA.  This came in a year with mammoth[br]expenses and not a single dollar of income.  I filed no return that year[br]thinking that because I didn’t have any income there was no need.  The[br]sleazy government decided that they disagreed.  But they didn’t notify[br]me in time for me to launch a legal objection so when I attempted to get[br]a protest filed with the court I was told I was no longer entitled to[br]due process because the time to file ran out.  Bend over for another[br]$10,000 helping of justice.[br][br]So now we come to the present.  After my experience with the CPA world,[br]following the business crash I swore that I’d never enter another[br]accountant’s office again.  But here I am with a new marriage and a[br]boatload of undocumented income, not to mention an expensive new[br]business asset, a piano, which I had no idea how to handle.  After[br]considerable thought I decided that it would be irresponsible NOT to get[br]professional help; a very big mistake.[br][br]When we received the forms back I was very optimistic that they were in[br]order.  I had taken all of the years information to Bill Ross, and he[br]came back with results very similar to what I was expecting.  Except[br]that he had neglected to include the contents of Sheryl’s unreported[br]income; $12,700 worth of it. To make matters worse, Ross knew all along[br]this was missing and I didn’t have a clue until he pointed it out in the[br]middle of the audit.  By that time it had become brutally evident that[br]he was representing himself and not me.[br][br]This left me stuck in the middle of this disaster trying to defend[br]transactions that have no relationship to anything tax-related (at least[br]the tax-related transactions were poorly documented).  Things I never[br]knew anything about and things my wife had no clue would ever matter to[br]anyone.  The end result is… well, just look around.[br][br]I remember reading about the stock market crash before the “great”[br]depression and how there were wealthy bankers and businessmen jumping[br]out of windows when they realized they screwed up and lost everything. [br]Isn’t it ironic how far we’ve come in 60 years in this country that they[br]now know how to fix that little economic problem; they just steal from[br]the middle class (who doesn’t have any say in it, elections are a joke)[br]to cover their asses and it’s “business-as-usual”.  Now when the wealthy[br]fuck up, the poor get to die for the mistakes… isn’t that a clever, tidy[br]solution.[br][br]As government agencies go, the FAA is often justifiably referred to as a[br]tombstone agency, though they are hardly alone.  The recent presidential[br]puppet GW Bush and his cronies in their eight years certainly reinforced[br]for all of us that this criticism rings equally true for all of the[br]government.  Nothing changes unless there is a body count (unless it is[br]in the interest of the wealthy sows at the government trough).  In a[br]government full of hypocrites from top to bottom, life is as cheap as[br]their lies and their self-serving laws.[br][br]I know I’m hardly the first one to decide I have had all I can stand. [br]It has always been a myth that people have stopped dying for their[br]freedom in this country, and it isn’t limited to the blacks, and poor[br]immigrants.  I know there have been countless before me and there are[br]sure to be as many after.  But I also know that by not adding my body to[br]the count, I insure nothing will change.  I choose to not keep looking[br]over my shoulder at “big brother” while he strips my carcass, I choose[br]not to ignore what is going on all around me, I choose not to pretend[br]that business as usual won’t continue; I have just had enough.[br][br]I can only hope that the numbers quickly get too big to be white washed[br]and ignored that the American zombies wake up and revolt; it will take[br]nothing less.  I would only hope that by striking a nerve that[br]stimulates the inevitable double standard, knee-jerk government reaction[br]that results in more stupid draconian restrictions people wake up and[br]begin to see the pompous political thugs and their mindless minions for[br]what they are.  Sadly, though I spent my entire life trying to believe[br]it wasn’t so, but violence not only is the answer, it is the /only/[br]answer.  The cruel joke is that the really big chunks of shit at the top[br]have known this all along and have been laughing, at and using this[br]awareness against, fools like me all along.[br][br]I saw it written once that the definition of insanity is repeating the[br]same process over and over and expecting the outcome to suddenly be[br]different.  I am finally ready to stop this insanity.  Well, Mr. Big[br]Brother IRS man, let’s try something different; take my pound of flesh[br]and sleep well.[br][br] [br][br]*The communist creed: From each according to his ability, to each[br]according to his need.*[br][br]*The capitalist creed: From each according to his gullibility, to each[br]according to his greed.*[br][br] [br][br]Joe Stack (1956-2010)[br][br]02/18/2010[br][br]', 2, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (287, '2010-03-04 01:55:11', 'de', 1, 'More Wadenbeißer-Nipper Pictures', 'A handmade nipper sculpture. A real  life 3d study for more pictures...', '[img]images/waden/wadenfoto_01.jpg[imgw]585[imgh]400[/img][br][br][br][br][img]images/waden/wadenfoto_02.jpg[imgw]585[imgh]490[/img][br][br][br][br][img]images/waden/wadenfoto_03.jpg[imgw]585[imgh]450[/img][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (281, '2010-02-26 19:40:24', 'de', 1, 'Two Games in The Pipe', 'This is an announcement. Two Java game sketches will be released soon. One is a none graphical dungeon-room game. Two is a resource management game.', 'The GDC is ahead and I will be there[br]in San Francisco[br]soon[br][br][img]http://funkfishgames.com/spiele/images/SFC.jpg[imgw]585[imgh]300[/img][br][br]So this is a more or less good reason to announce two games.[br]This will be just none graphical "sketches" though you might be able to play the.[br][br]The number one is a stupid dungeon room game, where you have to find a chest, may conquer or interact with robot-players. Once you have found the chest you turn to find over and over again. But first you''ve to find an open door, and there is no key.[br][br]The second game is a sort of finally "boredom took me into the flow" resource management game. It is not finished so far, because it is really a sketch. But you may understand with a little bit of goodwill what I''m thinking about.[br][br]Here are some screenshots of the land-generator and the city-screen.[br][br][img]http://funkfishgames.com/spiele/images/city/land.jpg[imgw]255[imgh]200[/img]&nbsp;[img]http://funkfishgames.com/spiele/images/city/city.jpg[imgw]255[imgh]200[/img][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (282, '2010-02-27 12:13:30', 'de', 1, 'Wadenbeißer - a translation problem', 'The direct translation for Wadenbeißer seems to be ankle-biter. But that does not fit very well to me.', 'With having in mind what the Bavarian word Wadenbeißer means, I was watching out for a better translation of this word.[br][br]First of all this word is a hidden pun. The major meaning is a guy, who is after you. Once you''ve finished a thing, he bites you in the calf., because he knows everything better - don''t mind he doesn''t.[br]He is just a childish person.[br][br] He is a Giftzwerg (poison dwarf), a Nachtreter (back kicker).[br]Ankle-biter would do it so far.[br][br]With the pun in mind the translation becomes a question of figure.[br]Thee ankle is placed right top of the foot,. The calf is higher. It ends under the knee.[br]So we talk about something two feed high instead of 4inch low.[br]And there are more puns:[br]A Beißer is not only a biter it is also a nipper (Zange).[br]So is Wadenbeißer. It is a hugh nipper if you mean the tool.[br][br]The last meaning is a annoying child[br]Calf would fit that and so does nipper.[br]So I decided that the best possible translation of Wadenbeißer is not ankle-biter, it is nipper.[br][br]So here he is the [b]Nipper[/b] of the Nippers, the [i]Wadenbeißer[/i].[br][br][include]images/waden/wadenbeisser.php[/include]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (289, '2010-03-09 19:56:55', 'de', 1, 'GDC10 How Games change everything', 'GDC 2010  Session keynote How Games change everything Social games Speaker  Gareth Davis', 'Guitar music is playing while the two video screen showing big blue "facebook"[br][br]friends are really important to us.[br]This reflected in popular culture. (Star wars Luck choose friends instead of become a jedi master)[br][br]Your real identity online[br]real friends online?[br]Connect with all of your friends online big impact on social-[br][br]new people power(ed)  new web[br][br]1,78 billion on the internet[br][br]1000000 developer created 500000 facebook apps. last 3 years.[br] 200 Million people playing games[br][br]designed for mass appeal (cool slides)[br]Game as a service (Game in a cloud)[br]Virtual goods driving monetization - free to play[br]designed for social interaction designed around friends[br]social distribution[br][br]games has been social for 1000 of year[br][br]soccer is the most popular social game worldwide[br](but did they created a new social environment?)[br][br]kids play together[br]adults do (poker night)[br][br]video games are social to[br][br]social games of the past,present and the future[br][br]SOCIAL EMOTIONS[br][br]competition, cooperarion, self-expression[br][br][br]sharing is a (the most) popular social activity[br][br]Loop between online and real world[br][br]real world events effect in game world?![br][br]Real identity in games[br]long way to go still[br]a facebook can know a lot of us[br]enables customize for player[br]image a game where a game involves my real world relations (?shiver)[br][br]The language of social games[br]the iconic Facebook game is ahead of us[br][br]Facebook Platform[br]Games Dashboard[br]Facebook Credits a virtual currency[br]Social Ads allows the developer to find his audience[br]Facebook Connect[br]Web portals & games with Facebook Connect[br]Desktop games with Facebok Connect[br]so iPhone use FbC (the most popular)[br]Connect on the DSi, XBox, PS3 (Buzz QuizWorld)[br][br]Facebook is a multi-device platform[br][br]same game on any platform[br]or possible future taylored design with different aspects of the same game[br](mobile location based)[br][br]Next generation social games:[br][br]a new Masinstream mass-market audience[br]iconic Facebook game ahead of us[br]facebook powering next generation[br][br]Friends chage everything[br][br]big blue facebook[br][br]Qustions and Answers[br][br]focus on high quality stories on highpoints of the game[br][br]real id versus fantasy id - you can have both.[br][br]games dashboard will not replace the wall[br]dashboards are about discovery wall the share personal id and info[br][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (288, '2010-03-05 00:16:55', 'de', 1, 'game no.1 out off the pipe ', 'As I said the GDC 2010 in San Francisco is ahead. So here is the first of two games, which are in development. It is the dungeon-room game. This game is pretty early stage. So see this only as a sketch.', 'The basic rules of the game:[br]You find yourself in a dungeon with a lot of rooms and some other players.[br]Somewhere there is a treasure chest.[br]Try to find the chest.[br]Each room has some doors, let us say 4 for example.[br]There should be at least one open door.[br]But maybe all doors are closed.[br]Try to find the open door. You have as many chances as you need, but only the first three tries will give you points. (30, 20, 10) One less than doors in the room. In this example there are 4 doors in the room, so you have 3 tries.[br][br]If any player is leaving a room, open doors are closed and closed doors get opened, but only one or none per room. Status messages shows you when a player is leaving a room. So the basic setting of the doors has been changed.[br]If you see a player try to interact and  conquer the robot player. Click simultaneously on the robot player and the player. You will see a emotional reaction.[br]Points will not be shown. The game play is infinite right now.[br][br]<script type="text/javascript"> function showApplet() { var element = document.getElementById(''applet_box''); element.innerHTML = ''<applet codebase="games/dungeon" archive="RoomDungeon.jar, GameHost.shared.jar" code="MainApplet" width=150 height=150 style="width: 150px; height: 150px; margin: 0px; "><param name="image" value="games/dungeon/minititle.jpg" /></applet>''; } function hideApplet() { var element = document.getElementById(''applet_box''); element.innerHTML = ''''; } </script>\r\n<div>\r\n    <div id="applet_box" style="width: 150px; height: 150px; margin: 0px; margin-left: 0px; background-color: #999999; background-image: url(games/dungeon/minititle.jpg); outline: 0px; float: left; " onClick="showApplet();">\r\n    </div>\r\n    <div style="width: 435px; height: 150px; margin: 0px; margin-left: 15px;  float: left; ">\r\n        Added a start javascript.\r\n        Please click on the funkfish image to start the applet.\r\n        <br />\r\n        Have fun!\r\n    </div>\r\n</div>\r\n[br][br]For the future you will be able to make robots your friend. The robot players will interact with each other. You should make them happy. There will be good and bad behavior.[br]I''ve implemented only emotional reactions. Each player can be happy, neutral, sad.[br]For the future players will have relations with each other. Players might be your friend, enemy or just a guy in the room. This is a more complex state, because the relations describe a social network.[br]the next implementation of  the inside combat will be called ConversationCombat. You may hug other players, play "Who is afraid of yellow red and blue?", ... It is not a pure Combat game because it also allows a pre definite non linear conversation. The result of a combat or a conversation or combat will depend on the emotion state and the relation of both players.[br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (290, '2010-03-09 20:52:29', 'de', 1, 'GDC 2010 session 2 The state of social gaming industry overview and update', 'The state of social gaming industry overview and update Speaker: Justin Smith', 'the western market[br]2009: $490 million[br]2010: $835 million[br][br]growth on every continent[br][br]virtual goods in  Asia[br]2008: $5 billion[br]2009: $8 billion[br][br]The Big hree[br]Zynga, Playfish, playdom[br]the contenders[br]crowdstart, rockyou, slide[br][br]the international players[br]rekoo[br]elex[br]five minutes[br]wooga[br]6waves[br][br]The developer opportunity[br][br]Facebook first social network over the world[br]400 million users total today - 70% outside US[br]rapidly evolving platform - new rules very 6 months[br]facebook connect - bringing fb to every website and device[br]facebook credits - coming soon[br][br]Game Portals[br]What is the value of portals social graph vs. Facebook social graph?[br][br]Fb Connect[br][br]Now, the same social graph is on any website[br][br]same identity and viral channel access, less fb.com constraint[br][br]what parts of the Internet[br]never developed because the social graph[br][br]Rush of competitors[br][br]Money:[br][br]PayPal is still dominant[br][br]Mobile increasingly important[br][br]other alternative direct methods like prepaid[br][br][br]keep road map of content releases months ahead[br]virtual economy optimization is now a core competency', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (291, '2010-03-09 21:21:37', 'de', 1, 'GDC10 session 3 What Virtual Worlds can learn from social games', 'What Virtual Worlds can learn from social games. Speaker: Sulka Haro A little bit to fast to make proper notes...', 'anyway:[br][br]it is all about friends[br][br]paralell play [br][br]virtual world is hard to find your friends[br]virtual worlds are obsessed with real time[br][br]publishing news about your world makes it feel more alive and real[br][br]how easy you get into?[br][br]go where the users are[br]you can''t assumed that users will fix the computers[br][br]faster clients  more user more retention[br][br]no signup[br]facebook connect, twitter, google[br][br]automatic friend finding[br][br]placeness[br]you need to justify why your world game is a world[br][br]make friend finding easy[br]enable meaning full gameplay[br]more...', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (292, '2010-03-10 00:53:33', 'de', 1, 'GDC10 session 5 What social games can learn from virtual worlds', 'What social games can learn from virtual worlds Speaker: mike goslin The counter part of Sulka Haro', 'worked for disney themeparks[br]working for hangout [br][br]success = (ltv-coa) * scale  LTV=lifetimevalue COA cost of accission[br][br]virtual world funnel ends with paying players 1%[br][br]registered players 100% but paying players 0.1%[br][br]status items[br]subscriptions ( as people staying long enough so they can bundle up their costs for less money )[br][br]retention lowers coa[br]virality works better over time [br][br]importance of retentio0n is increasing[br][br]when facebook growth slows[br]competition increasing[br]building a brand takes time[br][br]virtual world retention[br][br]player investment in the world[br]deep content[br]fresh content[br]service[br]concurrency[br]community[br][br]investment in the world[br]world is a place it is not game[br][br]persistence feels like a place[br]creativity customize your avatar and room[br]achievement – levels, collections status[br]loot[br]cognitive dissonance i spend a lot of time here therefore i must love it[br]community - contextual friendships[br][br]deep content[br]big world[br]treadmill[br]story[br]immersion[br][br]immersion can require a plugin - you usaly loose 40% of the players.[br][br]social game funnel[br][br]Fresh content[br][br]monthly, weekly daily[br]anticipation of content can be stronger than the actual content[br]change for the sake of change[br]routines are comforting[br]topics of conversations[br][br]these kind of games are services![br][br]customer service[br]dialog between developer and player[br]don''t think of as a cost[br][br]concurrency[br][br]community events – hosted spontaneous, emergent[br]multiplayer games coop, competition[br]drama, conflict, reconciliation[br][br]hormones[br][br]game is an icebreaker[br]game encourages concurrency[br]concurrency[br]leads to community[br]community sustains retention[br][br]monetization increases LTV[br][br]Paying percentage[br]relative small 1-3%[br][br]virtual monetization[br]retail:[br]game cards[br]grandmas[br][br]virtual goods[br][br]functional items[br]status items – require investment, retention[br]subscriptions[br]layed on the top of the virtual goods business[br]good for cash flow[br]commitment from core players[br][br]hybrid games[br]coa and scale of social games combined with ltv of virtual worlds[br]=[br]hangout model[br][br]cheer get into the lead a game about cheerleaders buy, train and combine moves', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (293, '2010-03-10 01:12:25', 'de', 1, 'GDC10 session 4 Why Game Veterans flocking into social gaming', 'Why Game Veterans flocking into social gaming? Speakers: Brenda Brathwaite, Noah Falstein, Steve Meretzky, Brian Reynolds', 'I tried to follow  the conversation. So here it is more or less:[br][br]Steve since 28 years in games.[br]having casual game experience[br]wants to go back to smaller teams 4-5 in 4-5 weeks again.[br][br]Brenda boardgames first passion sticked into facebook games[br]small group develop a game in short time instead of marriages are going on babies born during game development[br][br]Brain a year was more enough to make a game he want to be the game designer and the lead programmer again. Production costs are frighten for AAA games. 10 million is called a medium budget.[br][br]Noah[br]pretty same kind of story. To big size teams to large budgets, but good experiences with collaborative work in smaller teams.[br][br]Lower costs frees you to take more risks in creativity.[br]You can try a lot of weird things.[br]This is the best time game developers ever had - the most variety of opportunities.[br][br]Steve:[br]never predicted farmville would be a big success.[br][br]Brain:[br]we reached the mass market which is bigger than ever thought.[br]But this kind of gamer does not see themselves as gamers.[br]Farmville is a kind of social interactivity.[br][br]Brenda:[br]Harvesting is a popular mechanic in german boardgames.[br]Discussion about games moved from violent games to would please squeeze my pet.[br][br]Noah:[br]Farmville the most aggressive move you can make is harvest a little faster.[br]This does not threading the social player. We have to give up the hardcore game mechanic to reach the mass market.[br][br]Brenda  made that point clear.[br][br]Brian. Game mechanics is not longer king. We have to build the social interactivity first.[br][br]Noah:[br]The only survive in the game industry if you like the change. So you''ve love[br]to learn over and over again. He has recalibrate his game design skills[br][br]Steve:[br]New challenges make game development exciting.[br][br]Brenda:[br]game design become a game for game designers.[br]Metrics made it a game.[br][br]Noah:[br]... are we in trouble?[br]Steve:[br]we got 100 Million people playing a game for 5 minutes a day.[br]Noah: so the next big thing is to make them play the whole day.[br]...[br]Brian: Does this number is still growing?[br]...[br]it''s a huge relief to game designer that a facebook game still does not depend on hardware.[br]Games will be more complicated in the future.[br][br]Brenda:[br]We again keep the level of complexity on growing.[br][br]Steve:[br]I completely disagree. It the simplicity that makes the game so accessibility.[br]I don''t want to see us to make the same mistake.[br]Keep this kind of games close to the bottom.[br][br]Brain agrees.[br][br]Brenda: You guys are underestimating. ()[br][br]Brain: One of the big challenges in social games is not to fire and forget.[br]You''ve to put more constantly new content inside. Games start small and grow up complexity.[br][br]Noah:[br]If you clone, you may now profit from this. Less risk because you''ve two three months to do a game.[br][br]We can do things like Bejeweled Blitz which is a copy and again different.[br]We can iterate and innovate.[br][br]Steve:[br]500000 apps are made on facebook. It seems somebody thought of everything we can make. We still keep on innovating.[br][br]Brain: Add inherit new parts, but keep the whole game simple. he thought:If you want to go deeper you can deeper ends mostly with to much complexity.[br]Farmville is made in 4-5 weeks.[br]Noah said a fb game is easily made at low cost in short time. How much does it cost to keep it running? Steve: 5 times more, does not depend on if it is a success.[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (294, '2010-03-10 18:18:20', 'de', 1, 'GDC10 TUEsession6and7', 'How to innovate in the land of clones Speaker: Nick Fortugno and PaperbackWriter: The emergence of interactive story in casual games', '[b]How to innovate in the land of clones Speaker: Nick Fortugno[/b][br][br]Where we started years ago:[br][br]some slides will come soon.[br][br]Advice for innovating[br][br]Point # 1 Start from known Parts[br][br]zuma = ricochet = luxor[br][br]Point # 2 look after other (game) media[br][br]plants vs zombies > restaurant city[br][br]Point #4[br]go big or go home[br]anything easy is easy to steal[br][br]and there is much more money outside than you can imagine[br][br]so think crazy, weird and unique[br][br]point # 5 don''t assume your audience is solved[br][br]if we are game devs we assume our heart is testing[br][br]playmatics.com[br][br][b][br]kenny shea dinkin:[br][br]paperback writer[/b][br]the surprising[br]how to save the world[br]do want to save the world?[br][br]focus on entertainment[br][br]reality is broken game designers have to fix it[br][br]make your work an impetus for inquiry[br][br]reemergence of the narrative Adventure game as a ...  of HOG[br][br]mass market themes are fantasy mystery crime and romance[br][br]the problem with stories in games: in short: the suck[br][br]freitags triangle is really male coded[br]don''t lean freitag if you can avoid it[br][br]good reasons to tell storys in games[br][br]a lots of money[br]story addiction[br][br]characters = IP[br]emotional engagement[br][br]compelling chars driven serialized = crack[br][br]immersive navigable story world[br]to expensive so they failed[br][br]HOGs[br][br]easy mechanics to build[br][br]narrative space[br]linear[br]inventory objects[br]mass market[br][br]Birth of the Hogventure[br]puzzle integrations are a paramount[br][br]remind player what she should doing[br]provide a lots of talks and hints.[br][br]what about social?[br][br]asynchronous multiplayer adventure games?[br][br]big pitfalls but value to solve them.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (295, '2010-03-10 21:32:39', 'de', 1, 'GDC10 wedSession2 Designing for kids and parents playing together', 'Designing for kids and parents playing together speaker: jesse shell ', 'ten tips play patterns for kid and parents[br][br]1 you have to decide to design for it![br]Take this seriously[br]its a problem that you have to solve[br][br]2 find themes both kids and parents care about[br]like pirates -[br]toontown : robots vs toons, gray vs color, work vs family (play)[br]last child in the woods[br]richard louv[br]connect game with the real world give kids and parents something to talk about[br][br] Nostalgia bridges the generation gap[br][br]3 understand what families wand - and provide it[br]families want to share experiences[br]families want to share accomplishments[br]parents want to feel they provided meaningful useful ex[br][br]kids want to feel more emotionally connected to their family[br]kids wont say that[br][br]4 parents want to teach and kids want to learn[br]kids want to understand the adults[br][br]create opportunities[br]kids are aspirational[br]situations where kids needs their parents[br][br]5 coop existing roles for quick immersion[br]implement natural familiar behavior[br][br]6 reverse roles to delight everyone[br]everyone wants a break from the freaking p/ch relationship[br][br]when a child surpass the skill of the parent[br]it is landmark moment[br][br] 7 consider gender issues[br][br]you have 12 points of view if it comes to gender[br][br] 8deciding to pay is a collaboration between kid and parents[br]drives parents involved into the gameplay[br]you got mail[br][br]parents hand over the mail to kids...[br][br] 9 safety is paramount[br][br]youth care issues are important[br]keep parents informed[br][br]10 design for the family as well as for the individuals[br][br]design to them connect which each other[br][br]The connection between p and kids is the strongest emotional force we have[br][br]slideshare/jesseshell', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (296, '2010-03-10 21:37:17', 'de', 1, 'GDC10 wedSession3 Lesson Learned building Moshi monsters to 15m users', 'Lesson Learned building Moshi monsters to 15m users Speaker: Micheal Acton Smith', 'making of Moshi Monsters[br][br]the story behind the graph [br]the blood, sweat and tears[br][br]a social game design is a completté new area[br]1  [br]  dont be afraid tofail and change your ways( of thinking)[br][br]stealth education[br][br]kids love virtual pets for your virtual pet[br][br]2 don''t blindly follow the market leader[br][br]making it free is a great decision[br][br]3 free to play changes everything = boom and up[br][br]it has to be visual[br][br]4 don''t raise venture capital during a global financial melt down[br][br]5 revenue solves a multitude of problems[br]we need cues to make valuable context decision[br][br]6 keep it social, stupid[br]safe social tool lots to show of but no personal information[br][br]7 don''t pour marketing cash into a leaky bucket[br]radio and print does not work[br]run TV adds[br][br]gender specific adds for boys and girls[br][br]8 show me the funny[br]users online have very very short attention span[br][br]9 attention to detail[br][br]10 think big', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (297, '2010-03-11 19:04:25', 'de', 1, 'GDC10 ThursSession1 4 Most important emotions for social games', '4 Most important emotions for social games Speaker: Nicole Lazzaro', 'what emotions customers / gamers share?[br][br]laughter fun for example[br][br]Amusement[br][br]Mango = Social Token (bouncing back and forward)[br]Mango is a inside social token[br][br]laugh with or at[br]-grouping[br][br]amici[br][br]feeling funny and or friendly[br]desire for ...,[br][br]social grooming[br][br]conversation starting[br][br]amidar[br]most about admiration[br]it becomes a gaming (bouncing Mango with her sister)[br][br]its about ranking[br]help succeed[br][br]Amiero[br]>>>> reciprocity[br][br][br]1[br]amusement laugher wow silly dancer starts bringing people together[br]ice you is better than kill you[br]fun changes the social interaction[br][br]friends as coworkers....using emotional binding for amusement[br][br]chat and jokes[br][br]amusement mechanics[br]language[br]chat and jokes[br]many more ...[br][br]2[br]cute characters change how it feels to play[br]caretaking emotions: tilt flips adventure in a1.5d environment[br]easy to start social grooming mechanics[br]pets animals....[br]wow orhan guest. the lost thing that needs some caring![br][br]amici /[br]make friends or die vs... make friends vs Buy[br]real friends = more emotion[br]create stronger social emotions[br]likes and interests[br][br]people pets and plants[br]real friends[br]pet like caretaking[br]more ....[br][br]make it easy to start friendly interaction[br][br]3[br]ranking mechs[br]epic amor = horse stable[br]award that you''re so smart[br]friends as important as tools[br]looking using your friends as tool[br][br]tilt the real world[br][br][br]compare[br]rank[br]check with friends[br]see what other do[br]more ...[br][br]amiero[br]social bonding[br][br]comes out of all the other 3 emotions[br][br]mechanics[br][br]healing in WOW[br]cultivating friendships[br]builds trust in the social bond[br]gift giving easy fun baked in there[br][br]asking for valentines dates / social risk[br]personal interest communication[br]themed materials[br][br]gifting[br]re[br]offer risk in the social bonding[br]more ...[br][br]The three main questions to solve:[br][br]how will your game go viral?[br]look up[br][br]how will you make money?[br]tilt factor[br]social features[br]gameplay[br]monetization[br][br]bound together[br][br]how you will connect friends?[br][br]slideshre/nicolelazzaro[br][br]facial expression 7 basic emotions', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (303, '2010-03-16 01:04:54', 'de', 1, 'GDC10SaturdaySession2 Comedy in Games ', 'Speakers: rhianna pratchett  tim schafer sean vanaman', 'why comedy is not a genre in games?[br][br]r: No as a genre but a useful important tool[br]t: there is no premise to make a comedy game. It does happen when ever this happen.[br]s: comedy is definitely a tool[br][br]s: there is no such strong funny premise in our games. It comes not from puzzle solving, more from the script the voices the answers and heavily from the arts.[br][br]comedy comes from timing the right pees.[br][br]Three awesome people - the Bloody Marries were damn bloody and i got some allergic reactions on pollens.[br]...[br][br]INTERMISSION[br]My 5pennys on this: Classic three (Theater) Genres are: Tragedy, Historical and Comedy. And in general that''s it for drama. You may replace Historical with Fiction and Non-Fiction and add the not a drama but dramatic Panem Et Circensis Action to genres and you get what you see in general in modern drama the modern mixed and stirred up big 5. [b]Tragedy, Fiction and Non-Fiction, Comedy and Action[/b].[br][br]There is no such thing as a puzzle or an jump-and-run genre. These are technical categories.[br]Just my 5pennys...[br][br]You better read this here instead:[br][URi]http://www.1up.com/do/blogEntry?bId=9023448&cmpid=0104[/URi]http://www.1up.com/do/blogEntry?bId=9023448&cmpid=0104[UR/][br]if you want to read what they said.[br][br]By the way later on  Ernest Adams was awesome again, which took him by surprise.  He wasn''t that convinced by his own talk, but the reaction of the audience shown him.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (304, '2010-05-20 00:31:23', 'de', 1, 'Announcing an Announcement', 'shortly I will make an announcement for FFaC. ', 'Here is the new logo f.or FFaC.[br]What will FFaC be? Wait and you will see. It is build for the new awesome device platform, that does not begin with "i" and you will not have to paddle.[br][br][br][img]http://funkfish.net/spiele/images/newpictures/funkfish_icon_gold.png[imgw]400[imgh]400[/img][br][br][br]Screenshots will come soon, alpha version will follow for free download.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (302, '2010-03-16 00:42:14', 'de', 1, 'GDC10SaturdaySession 1 A mysterious adventure in social games', 'GDC2010 Saturday session 1 A mysterious adventure in social games Speaker Daniel James', 'his blog:[br]thefloggingwillcontinue.com[br][br]people talk about ''social'' games[br]which is anoying[br]they are basically singleplayer games on social networks[br]with in mind that some of your friend might play this game too[br][br]why success? -> really viral[br][br]distractions[br]black in the box pressing the button[br]B.F.Skinner[br][br]analyzing acquisition funnel numbers is a key value of your online business[br][br]whirled story[br][br]a multiplayer gaming world[br][br]too complicated[br]spir out does not work[br]users do not click through[br][br]but...[br][br]on customer development[br]eric ries: startuplessonslearned.com[br][br]create hypothesis[br]verify as early as possible[br]...[br][br]concept brainstorming[br]concept testing[br]prototype development[br]test prototype for retuning players, funnel[br]rest on the slides[br][br]30-60% of retention returning people is really good[br][br]Lesson Facebook:[br][br]Cute Cute Cute[br]Social Object in the center[br]simplicity of accessibility and game design[br][br]key metrics:[br]funnel[br]...[br][br]special guest number 1[br]meteor games: david who?[br][br]island paradise[br][br]at launch farming with palm trees[br]new content and mechanics layered in later[br][br]in the start pretty farmville[br]now + fishing cooking ...[br][br]lost dog mechanic[br]#you need 10 friends to click on your post to find your dog[br]2-3% conversion[br]and the dog is cute cute cute[br]not working[br]find the recipe[br]0.8% conversion[br][br]you can use common retail sell tactics[br][br]give away credits >>> create friends/fans on facebook[br](inherit give away bug)[br]guest 2: zipzap[br]playcrafter.com[br][br]understand the platform understand the audience[br]more female gender inclusive on facebook >50% up to >75%[br]try quick /try often = learn a lot cut/kill projects soon if they do not succeed[br][br]else wise iterate[br][br]At the End: Daniel James was not wearing his pirate hat, but the Bloody Mari s were officially server and believe or not - damn good.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (301, '2010-03-15 00:34:44', 'de', 1, 'First post GDC10 Today is PI day', 'A good reason to meet the PI-rat³ again.', '[img]http://funkfishgames.com/spiele/images/pirateday_2.jpg[imgw]580[imgh]605[/img][br][br]I know it is lame and it is 2010... [br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (300, '2010-03-12 19:59:38', 'de', 1, 'GDC FridaySession1 What you need to known about casual games in 2010', 'What you need to known about casual games in 2010 Speakers: Juan Gril, Nick Fortugno', 'category intelligent puzzle trend[br][br]closure[br]fusion of theme and play[br][br]time fcuk[br]unique game mechanic[br]minimalist art that works[br][br]a mazing monk[br][br]i love traving[br][br]category visual narrative trend[br][br]machinarium[br][br]visual storytelling[br]simple game mechanics[br]art style[br][br]blackwell convergence[br][br]classic advent. humor[br][br]engaging story[br][br]enlightenus[br][br]alabaster[br][br]aubergine sky[br][br]beggar[br][br]every day in the same dream[br][br]flower[br][br]category: lets play together[br][br]restaurant city(playfish)[br][br]innovating mechanics step by step[br]new form of progress mechanics[br]clever use of friends and narrative[br]interesting combination of pet and sim[br][br]cafe world[br]focused on cooking[br][br]castle age[br][br]asynchronous fight mechanics![br][br]arcade evolved[br][br]bit.trip beat[br]music tells you to how to play the game[br]its not about you play the music[br]extremely well known and easy mechanics[br]achieves instrument-like play[br][br]splosion man[br][br]full of dynamics[br]perspective changes add drama[br]great innovation for the platform genre[br]elegant game design (you blow up to jump)[br][br]learn to fly[br][br]fig. 8[br][br]cyclemaniniacs[br][br]category manage it all[br][br]swords and soldiers[br]humor and great chars[br]real time strategy simplified[br]WII pointer[br][br]plants vs zombies[br]you know it and you should know why[br]elegant simplified tower mechanics[br]simple mechanics with lots of variations[br][br]category touch me baby (i phone)[br][br]spider[br]intuitive touch control[br]great goal structure[br]subtle but effective visual narrative[br][br]draw race[br]ghost racing mode[br]uses the speed of your finger while you draw the path[br]balance of speed and path[br]asynchronous play mechanics[br][br]flight control[br][br]smokescreeen[br]play mission 8[br]serious game', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (305, '2010-05-20 18:23:06', 'de', 1, 'First screenshots of the pre alpha build of FFaC', 'The first screenshots are available of the pre alpha FFaC build. And yes, it is for android. What else?', 'FFaC - funkfish and chips - is a small storytelling wizard, "game" environment and notes taker.[br]It allows you to develop, build and play your on storytelling slide show games on any Android mobile device since Level 3 (Android Version 1.5).[br][br]Right here are some screen shots and explanations. So you can see what you get.[br]Indeed it is a strip down easy version of the funkfish adventure development environment.[br][br][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_starter.png[imgw]240[imgh]400[/img][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_wizzard1.png[imgw]240[imgh]400[/img][br][br]The first image show the central starter application. The first row is for building and playing your slide story.  The second row shows the note apps. A simple text editor, a super simple drawing tool and a primitive camera.[br]On the right you see the general slide show wizard. Add, remove or edit your slides. Do not forget to set the title of the game. Now you may click your android''s menu button to save your game.[br][br][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_wizzard2.png[imgw]240[imgh]400[/img][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_wizzard3.png[imgw]240[imgh]400[/img][br][br]Left: A single slide. Import any image from your "funkfish/notes" folder on the sdcard. [br]Right: here you can add, edit and remove texts to a selection element. Shows the target choice for a text.[br][br][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_notes_editor.png[imgw]240[imgh]400[/img][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_notes_editor2.png[imgw]240[imgh]400[/img][br][br]Left: You can use the note editor in landscape (good for phones with keyboard)  and[br]Right: in portrait mode. You can sketch your story before you build it or manage todo lists...[br][br][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_notes_drawing.png[imgw]240[imgh]400[/img][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_notes_camera.png[imgw]240[imgh]400[/img][br][br]Left: with the drawing tool you can make simple black and white sketches. Use export to save them as jpeg files, save to make a working copy, that you can load again.[br]Right: the camera currently takes only one square picture per run.[br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (306, '2010-05-29 14:06:35', 'de', 1, 'My experiences with the Dalvik Java Virtual Machine on Android so far', 'I present the conclusion first.  This is an affair of love and hate.', 'If you expect something like the nowadays JME than you will be disappointed.[br]Dalvik is strange in many ways, sometimes for the good, sometimes for the evil side.[br][br]One of the greatest problems is Dalvik is a young system. The first Android mobile touched[br]2 years ago the market, the programming environment is round about one year older.[br]Guess what, so is the documentation. Google is making a good job on improving the documentation.[br]Still a tons of answers are missing, still people do not have enough stable experience with the system.[br]New features are appearing, old ones do work suddenly, but only on new devices.[br]There is a big gap between more of the half of all devices (66%) and the new once (33%).[br]For good sake more and more new devices reach the market.[br]But there is a lag of support for new versions on old mobiles. HTC and others are not doing their job.[br]It would be much better for Google to do this support, so everyone can update their mobile. And I''m sure users will do so.[br][br]The Activity model that is used for visualization of the application is nice.[br]Most time you configure in a simple to learn xml syntax what component is seen where.[br]You should not have any trouble to make you application suitable on any possible device resolution.[br]There are some tricks and still some strange because unexpected behavior. As I said there is a lag on the documentation. But over all it is a really nice full filling of the KISS paradigm.[br][br]The real problem with the activity model is, it avoids to port Java Apps to Android the easy way.[br]Instead of Graphics it uses the Canvas, Paint is not Paint it is a BrushWithPaint object.[br]Dalvik is not a subset of the Java JSE language. There is a gap of meaning. Although both share the basic classes, like JME and JSE do, Dalvik introduces different conventions of naming. So is the EventModel. It looks pretty like pre-Java-1.0. It is messy. OnDraw, OnClick, OnResult, but you''ll never know when, why and where it is granted and where not. Educated guesses do not lead to the expected results in 66 or even more Percents. It is not clear, if it is an event or not.[br]The is no concept of update and repaint, no real control over the UI-Thread, except the SurfaceView. A view (component) that allows you to create a Thread to call the onDraw method.[br][br]There are more stupid things like ActivityGroups can''t start Activities with a result as feedback. The LocalActivityManager does not have such a method.[br][br]By the way here is a tip. Always make sure that you organize your applications horizontal or vertical. I ain''t talking about the layout! Activities can start other Activities. I call this vertical. Be sure that a child activity has closed. A child activity should never start an activity of the same level or the parent level. This would be an diagonal reference an keep the parent alive. This is a mess.[br]You may use instead an ActivivtyGroup as a controller. So every child activity is on the same level. I call this horizontal. This also avoids the mess with still living activities. Your application can close immediately.[br][br]Resume: Androids dalvik VM is nice, but young. It is open and easy to learn. Everyone can have access to it.[br]The tools for development are good. The system has a fast iteration of development. Every three to 6 months there is an new Api Level with more improvements for the good.[br]You should not compare the Android system with the IPhone. That one is already ten years old - some components are even older. It is close and very restrictive. My advice to Google: be a little more restrictive, so every user has a chance to access the newest API Level. Many bugs on older systems would disappear.[br][br]As I said it is an ongoing story of love and hate.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (307, '2010-05-29 14:55:48', 'de', 1, 'More screenshots of the alpha build of FFaC ', 'More  screenshots are available of the alpha FFaC build. Still it is for android...', '...but it will also come for JSE - your normal PC, netbook - Linux or Windows computer.[br][br]I''ve decided to name this build already an alpha version.[br][br]Today I present the "game".  So you an see how images will look like and the selections.[br][br][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_game1.png[imgw]240[imgh]400[/img][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_game2.png[imgw]240[imgh]400[/img][br][br]Any text field is selectable and should have an event.[br][br][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_game3.png[imgw]240[imgh]400[/img][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_game4.png[imgw]240[imgh]400[/img][br][br][br][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images/newpictures/ffac_game5.png[imgw]240[imgh]400[/img][img]http://funkfish.net/spiele/images/t.gif[imgw]20[imgh]20[/img][img]http://funkfish.net/spiele/images//t.gif[imgw]240[imgh]400[/img][br][br]There is a new unfinished component call "overview". It will give you th opportunity to review and edit your slideshow with all slides and their connections. In the future this component will replace the main screen of the wizard. Right now you should not perform save or delete. Exit does not work - use the device''s back button instead.[br][br][URi]http://funkfish.net/downloads/SlideShowAndroid.apk[/URi]You may download the alpha build here[UR/][br][br]Possibly there will be changes in the data models, except the notes editor and the camera. So everything you build now, might be broken in the future.[br][br]If you want to install the alpha build download this build. Copy it on the sdcard of your device. Call settings on the desktop / frontscreen of your mobile. Select Applications. Make sure that you allow to install "Unknown sources". You see the green check mark.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (308, '2010-07-28 12:32:44', 'en', 1, 'Interactive_Storytelling', 'Some brief ideas', '[b]Interactive Stories[/b][br]A storytelling system of read (listen), act and react[br]A decission engine[br]Interactive Stories are "choose your own ending" stories started by an Author and continued by any member that wishes to participate.[br][br][b]How to write Interactive Stories?[/b][br][br][b]Blank text, including pictures or the influence of different media.[/b][br][br][b]The basic game mediacomponents: text, image, music, (3d), environment[/b][br]	Why not videos? The simple answer: because it is a mixed media already.[br]	Why is 3d in braces? Because 3d is a mixure of the blank imaging process and an environmental build system.[br]	story environment = story world|uniserse? Yes, but story environment != story world|uniserse  [br]	That''s because the environment is a storytelleng device in a concrete way. It does tell the story. A world is only a container.[br][br]	Environmental Storytelling: The problem of [br]	Ludwig Mies van der Rohe "Lake Shore Drive Apartments"[br]	and [br]	Randy''s Donuts is a landmark building in Inglewood, California[br]	The Donut Hole is a bakery and landmark in La Puente, California[br][br]	The being inside a story versus the outside story (landmarking | general markup strategy)[br][br][b]Input types for interactive media/story[/b][br][i]Selection, point''n''click, text parser[/i][br][br][b]"You tell a story" stories[/b][br]a (linear) multiplayer aproach of an interactive story[br]Which is pretty much like a wikisystem[br][br]Puzzle and Riddles!?[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (309, '2011-03-16 17:37:31', 'de', 1, 'slideshow framework structure', 'The structure of the slideshow framework, what will become the hogventure.com game-editor and game-viewer. ', '<pre style="font-family: monospace;">slideshow\r\n	-slides\r\n	x globalAmbientMusic\r\n	-player\r\n	-globalPreferences	\r\n	-utils:\r\n		--mediaManager\r\n		--dialogsUtil\r\nslide\r\n	-dialogs\r\n	-title\r\n	-backgroundImage\r\n	x ambientMusic\r\n	x objects\r\n	x plugin\r\n\r\ndialog\r\n	-texts\r\n	x iconImage\r\ntext\r\n	-target\r\n\r\ntarget -> leads to dialog or slide\r\n\r\nplayer\r\n	x figures\r\n	x points\r\n	x bag\r\n	x visitedSlides\r\n	x usedTargets\r\n\r\nobject\r\n	-image\r\n	-dimension w,h\r\n	-position x,y\r\n	x footPosition\r\n	x footDimension\r\n\r\nplugin\r\n	<code>\r\n\r\nutils:\r\n	dialogUtil\r\n		-dialogs\r\n	\r\n	mediaManager\r\n		-sounds\r\n		x globalSounds\r\n		-images\r\n		x globalImages\r\n		-iconImages\r\n		-animations\r\n		x gloabalAnimations\r\n\r\n	connection\r\n		for download, upload and chat\r\n\r\n	connectionProtokoll\r\n\r\n-is default\r\nx is optional\r\n\r\nthe basic interface design\r\n\r\n---/\\---|---------------------------------------|---/\\---\r\n|	|	title			points	|	|\r\n|  	|---------------------------------------| 	|\r\n| visi	|					|	|\r\n| ted	|					|	|\r\n< 	<					> bag	>\r\n| sli	|					|	|\r\n| des	|					|	|\r\n|	|-----------------Dialog----------------|	|\r\n|	|- :) ------------- .. -----------------|	|\r\n---\\/---|------------------text-----------------|---\\/---\r\n\r\nlayout of the interface design is optional\r\n</pre>', 2, 0, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (310, '2011-03-21 17:05:04', 'de', 1, 'seaching google for "theory if adventure"', 'The classic answer of google is "No, you are wrong". You are searching for ...', '[b]Adventure therapy[/b][br][br]Adventure therapy is the creation of opportunities to explore the unknown in a safe environment through adventure activities. Often adventure therapy is conducted in a group or family context, though increasingly adventure therapy is being used with individuals.[3][4] Adventure therapy approaches psychological treatment through experience and action within cooperative games, Trust activities, Problem Solving Initiatives, High adventure, outdoor pursuits, and wilderness expeditions. Some believe that in adventure therapy there must be a real or perceived psychological and or physical risk generating a level of challenge or perceived risk. Challenge can be viewed as significant in eliciting desired behavioral changes. Positive behavior changes, which are synonymous with psychological healing, can occur through isomorphic connections. An isomorphic connection is transferring learning from a specific experience to other life experiences. Isomorphic connections occur through the structure of framing and activity.[5][6][3] Framing is the creation of a metaphoric theme for a given activity or a series of activities that relates to a targeted treatment issue. Debriefing or processing the experience is a discussion during or after the activity that is related to the frontload, individual, and group treatment issues designed to facilitate isomorphic connections.[7][br][br]Adventure therapy encompasses varying techniques and environments to elicit change. These include cooperative games, problem solving initiatives, trust building activities,high adventure (rock climbing/rappelling, ropes courses, peak ascents); and wilderness expeditions (backpacking, canoeing, dog sledding, sailing, etc).[2][8] Wilderness therapy, adventure based therapy, and long term residential camping are the most common forms of adventure therapy.[2][br][br][i]funny first result[/i]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (311, '2011-08-15 15:48:06', 'de', 1, 'GDC Europe 2011 talk no.1', 'intentionally broken game design by douglas wilson notes ', 'games are designed to be ambigeous,self-awareness,broken incomplete.[br][br]but how do you enforce people to follow your intructions.[br]how to avoid cheats?[br]the answers are no - but the player do implement the rules - not the computer[br][br]bernard de koven "the well played game" book must buy[br][br]''broken games''[br]the games tells you all the shit and than it does not bother about it atall[br][br]it requries the player to sacrifies the game[br]deputizing the players[br][br]why do games like button even need computer techs atall?[br][br]1.multimadia[br]2.subverting expectations[br][br]precedents[br]art theory eg. fluxus, boards of canada[br]celebrating the imperfect[br][br]sort of augmented reality[br]disenchanting and un-augement the digital games[br][br]doing ridiculous sh*t with technology[br]human beings can enforce rules, too[br]you do not depend on the digital technology[br][br]Johann Sebastian Joust[br]move around with the music and the move controler[br]physical interaction[br][br]21st century should go realy wild[br]anything else is realy boaring[br][br][br][URi]http://igg.me/p/35678?a=202959&i=shlk[/URi]please donate to the hogventure card game[UR/][br]great rewards are waiting for you!', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (312, '2011-08-15 15:52:02', 'de', 1, 'GDC Europe 2011 talk no.2', 'an inside look at public funding for indie games by alexnder zacherl & yacine salmi notes', 'why public funding[br] money most obvious[br]reduces start-up risk[br]keep your IP[br] public funds don''t want your IP[br]They succeed if you succeed[br] they have to goal to look good. If you succeed the y do[br]Artistic freedom[br] they trust you to be the expert[br]Less legal trouble[br][br]these are the upsides here the downsides[br][br]you lose some independence[br] - foreigm influence[br]time & effort[br] it takes time to get the funding (papers) milesstones tracking[br]your game matters[br] the ggame and the fund must fit -[br] look for the right matching fund[br]dumb money[br] you can not exspect development, marketing support[br]some strings attached[br] some funds have to be payed backed[br] they are not free[br] you have to deliver something - prototypes etc.[br]not a business plan[br] it''s not a valid future perspective[br] don''t get adicted relying on pulic funds[br][br]on public funds[br] game and digital funds (like nordic game fund)[br]economic funds[br] start up fundings - they want you th have employies[br] go to your local chamber of comerce[br]art funds[br] you promote yourself as aserious artist[br]research funds[br] targeted at technology[br][br]finacial spectrum[br] conditional loans[br] you pay back if you are successfull[br] tax reliefs sometimes - most times big studios[br][br]the list: bit.ly/publicfunds[br][br][URi]http://igg.me/p/35678?a=202959&i=shlk[/URi]please donate to the hogventure card game[UR/][br]great rewards are waiting for you![br][br][br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (313, '2011-08-15 16:17:15', 'de', 1, 'GDC Europe 2011 talk no.5', 'developing new audience by kellee santiago if you miss talk 3,4 and 6 a brief description will follow later', 'if you want to make something different[br]something new[br][br]history of that game company.[br]founded 2006[br]game as an emotional medium[br]look beyond feature innovation[br]love & take care of your car instead another racing game.[br]discover it''s actually pretty hard.[br][br]avoid the traps and sharks dicover europe if you come from usa[br]how to bring taht new experiences to market?[br][br]unattainable crush[br]disstress hope dispear[br]music, image, any reference matrial[br][br]story arc[br]arrange emotions[br]does not neccessarilly mean literally story arc[br]visual story[br][br]together we can move the mountain[br]changed to[br]we all walk the path. Each journey is different[br][br]minimize total time through the loop[br][br]ideas -build -code- measure-.. -..-[br][br]test your vocabulary[br][br]don''t be afraid to do things different[br]but think about your process(es)[br][br]q&a[br]how do you comunicate with.. if you do not have market data #[br][br]some prototype of the emotional experience[br]its cool to see that thing in action[br][br]before you have a prottype[br]articulate the process and tools that you use to develop that[br]experience[br][br]more question ... that I was not able to capture[br][br][URi]http://igg.me/p/35678?a=202959&i=shlk[/URi]please donate to the hogventure card game[UR/][br]Help to make it real. Great rewards are waiting for you!', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (314, '2011-08-16 01:00:08', 'de', 1, 'GDC Europe 2011 talk no.3 4 6 and 8', 'Some talks are not so easy to follow - so I listen and do not try to make notes. ', 'Waht I mean when I say game by Brandon Boyer[br]an inspirational talk about indie game development[br][br]10 Social design tips ... by Oskar Clark / Papaya mobile[br]mobile games and social is a good combination[br][br]Make your game motion controlled by Amir Hoffnung / Prime Sense[br]an introduction into the open NI Sdk and platform[br][br]Beyond fun: Perspective for indie games[br]moderated by Michael Samyn / Tale of Tales[br]Heather Kelley and others - a panel discussion[br]4 short 5 minutes statements and awesome people[br][br][URi]http://igg.me/p/35678?a=202959&i=shlk[/URi]please donate to the hogventure card game[UR/][br]Help to make it real. Great rewards are waiting for you!', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (317, '2011-08-17 01:29:25', 'de', 1, 'GDC Europe 2011 talk no.1 tuesday', 'Get in touch ... Oded Sharon carbomite games | adventure mob', 'early in the morning indeed. They should have a wake up coffee[br]service here.[br][br]zbang based on an isreali comic book[br][br]ios[br]huge user base with a strong game purchase mentality[br][br]unity is a great cross platform development tool[br][br]star shioing[br]travel between planets and trade to get rich[br][br]the challange make a full game in one month[br][br]avaiable asets[br]1 programmer 1 artist 1 musician[br][br]cross platform design[br]use only touch[br]different features per platforms: mouse vs accelerometer, ads, [br]in-app purchases[br][br]pizza morgana[br][br]left(choose) right(change action) click and mouseover(info [br]highlight) support different interations#[br]touch = click[br]coin interface = right[br][br]unity tips:[br]check out mobile compatible features[br]dont use them if they dont exists[br]low poly 40k in total[br]minimize draw calls[br]use relevant addons like EZGui and SM2[br][br]consider tech limitations of mobile early[br]you have to make sacrifices[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (318, '2011-08-17 01:31:27', 'de', 1, 'GDC Europe 2011 talk no.2 tuesday', 'Bringing licensed Content to the IPad platform by James Lamorticelli / Telltale Games', 'the ipad is the fasted growing gaming platform in the market [br]currently[br]123 countries[br]$9.5billion[br][br]for those who dont know telltale? You don#t know telltale![br]110 vetrans of the games business[br]award-winning[br][br]what is episodic[br][br]aeason of episodes[br] broad market focus[br] popular licenses[br] rich digital treatment across all platforms[br] connected technology - onoing relationship with customers[br] ipad pricing strategy[br][br]ubiquitous content across platforms[br]achieving consistent across platforms[br][br]use a lcense tha is in peoples minds - it''s crates a great buzz[br]partners provide marketing support, because they are interested  [br]in the licenses value[br]Use aniversary events if you have the chance[br][br]lesson learned[br]ipad is a great oppertunity to maximize your reach[br]episodic is a great way to continually engage your customers[br]and more[br][br]Q&A[br]cross platform distrubition?[br]Apple does not enables this - no real control for developers[br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (316, '2011-08-16 01:11:00', 'de', 1, 'GDC Europe 2011 talk no.7', 'The best at least making MMO games more storylike by Ernest W. Adams', 'qualities of a wellformed story[br]story must be coherent[br]players consistancy is enforced by available[br][br]experience preservers credibility wiht in the world[br]players derives entertainment form[br]few or no random or repetitive events[br][br]the lord of the rins online played[br]it has a famous story[br][br]thinks the game works very well generally[br][br]but[br]respawn the problem will be always be there[br]NPC wants erverybody help - everybody runs through zhe same quest[br]the universe is in trouble but the touble will actually never happen[br]same person in different places because you are espected to walk the storyline and never come back but you do. Bad location[br]managment![br]being in the boys scouts is not storylike.[br][br][br][br]The players actions do not contribute to the plot.[br]Personal groth is expressed in numbers.[br][br]expansions[br]usally include massive world changes.[br]occur suddenly overnight[br]changes are not the result of in-game player acctivities[br][br]examples for the good:[br]second-life[br]minecraft[br]a tale of the dessert 5[br][br]"a tale of the dessert" is more a social experiment than it is on[br]a story[br][br]recommendations[br][br]use more modern settings reduces the impact of bad role-playing[br]create a big world with a large story[br]it should also narurally generate many small stories[br]the player must be under pressure not the world but have powers[br]make changes permanent[br]dont use the heros journey story structure[br]the story must end or be a soap opera[br]give every player unique quests to do[br]use permanent death or no death at aall[br]death has to be meaningfull[br]the setting should justify the population size[br][br]his game idea[br]the blitz online[br]a visual presantation with many words[br]spirit of the blitz[br]everybody has to be hero somehow because he wants to survive[br]the basic idea is a virtual social community - network[br]tea is the only buff[br]...[br][br]after all a great awesome talk.[br][br][URi]http://igg.me/p/35678?a=202959&i=shlk[/URi]please donate to the hogventure card game[UR/][br]Help to make it real. Great rewards are waiting for you!', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (319, '2011-08-17 02:07:47', 'de', 1, 'GDC Europe 2011 talk no.3 and 4 tuesday', 'Integrating Augmented Reality  by Dirk Groten/Layer and Truth in Game Design by Jonathan Blow', 'Problem: all notes are lost by an accident called immediate loss off battery power. Constant polling the Wlan connection overheated the computer so the computer made an instant safety shut down. I''m very sorry.[br][br]Integrating Augmented Reality  was a technical talk about the solutions available for GEO-AR and Visual-AR.[br]Mentioned some sdks like that one from qualcomm and their solution (layer). [br][br]Jonathan Blow''s brief desciption: z'' = z ² + c as far as I remember. The rest is a very long tail.[br]Today I had a lot of great talks to a lot of people in the lounge  like Brian Sullivan, thos guys from nevigo who are doing a similar tool to that one that had been called the funkfish adventure engine for a while or two - actually for year - and that you can download at [URi]http://hogventure.com [/URi]hogventure.com [UR/].[br][br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (320, '2011-08-17 12:52:22', 'de', 1, 'GDC Europe 2011 talk no.1 wednesday', '3 Grand Eras Of Game Development by Richard Garriot', 'Solo Player, Massively Mutiplayer, Social/Mobile[br][br]A historical Trip not only to the past but also to the future? of games[br]at least 10 years ahead[br][br]origin, destinatiion games, portalarium[br][br]story lines with social relevance[br]iconic imagery[br]simple silhouettes build memorable images[br]cultural evidence (far beyond the game you create)[br][br]simplifying the truth in a complex world[br][br]creating world reactive and proactive world foes dont just wait at final level[br][br]second era:[br][br]playing with other people is more powerful than solo play[br]mmo market inherently limited[br][br]third grand era[br]mobile & social games[br][br]casual players evolving fast[br]dont underestimate how fast players and games are evolving[br][br]era shift = industry upheaval[br][br]to much information[br][br]respect the social graph[br]players care about their own friends[br][br]the future?[br][br]free to play viral dis is here to stay[br]all ages and both genders are now gamers[br]developers and consumers are now global[br]us/eu distribution ..[br][br]www,facebook.com/ManOnAMission (January 2012)[br][br]And please not forget to fund [URi]http://www.indiegogo.com/The-hog-adventure-card-game?i=imgl[/URi]http://www.indiegogo.com/The-hog-adventure-card-game?i=imgl[UR/] to get your copy of the game!', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (321, '2011-08-17 19:29:54', 'de', 1, 'GDC Europe 2011 talk no.2 wednesday', 'Gardens and Time Art and Iteration by Eric Todd', 'Getting from a good idea to something really good.[br][br]If you fail its not because your team mates don''t understand you[br]its because you don''t understand yourself - there are pitfalls flaws...[br][br]Its your personal iceberg for your personal titanic[br][br]project swordfish[br][br]solve great hidden object puzzles to reveal an epic background story and improve your house[br]house and garden[br][br]press go or map and you can travel around the world[br]to a certain place and hog scene[br]your are a Indianer Jones[br][br]alterate[br][br]you''re a time traveler[br]solve hogs throughout time[br]integrating collection game[br]deep social play (but later?)[br][br]museum instead of garden[br]having an avatar[br]smart search list more hints[br][br]but two Icebergs (of many)[br][br]shift from map to list[br]shift from garden to museum[br][br]what if I''m wrong?[br]why isn''t this working?[br]the intelligency of cultural analysis -> Book must read[br][br]define your space(s)[br][br]what do my customers think?[br][br]whats the problem we''re trying to solve?[br]have we nailed it?[br][br]   schedule[br]  /   |    [br]art design technology[br][br]art >schedule[br]art  team[br]art  technology[br]art  design[br][br]whats the simplest thing that could work?[br][br]Vision[br]can you play the game in your head?[br]THIS IS incredible Necessary![br]IT''s a Necessary lie[br]may its not a lie but unreliable[br][br]whats matters?[br]implementations[br]solutions[br]problems (there a far more than you have time to solve)[br]? so whats down here (Questions)[br][br]iteration in the design process is a tool[br][br]whats the right question?[br]what if I''m wrong?[br]have we nailed it?[br]why isn''t this working?[br]what do my customers think?[br]what''s the simplest thing that could work?[br]what''s the problem we''re trying to solve?[br]', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (322, '2011-11-18 16:30:33', 'en', 1, 'What''s missing for anorexic aardvark?', 'What''s missing for anorexic aardvark?  Date: 2011-11-16  .  ', 'Right now build in features are:[br][br]slideshow overview[br]with add/create slide[br]edit slide[br]delete slide[br]load and save slideshow in local storage[br]drawing the title image and direct export prompt to save the image to your file system[br]advertisement for the paypal campaign[br]login with google friend connect[br][br]slides can[br]add/create selections (named dialogs)[br]edit and remove dialogs[br]add/create texts to a dialog[br]edit a text[br]remove a text[br]set a target for the text (slides, but not the current one, dialogs and objects)[br]drawing the background image for the slide with direct export prompt[br]incomplete analyze of the slide[br]set titles (internal name) of the slideshow, slides, dialogs, objects[br][br]prepared and present in the data model, but not available for usage, are[br]player, bag, meta-data, notes,...[br]not prepared are the online functions todo list, initial author and co-users[br]several preferences like selecting a default font and font-size[br][br]testing / playing the game is prepared but it takes some time to make this feature available.[br][br]So here is the plan for anorexic aardvark, the first alpha release of the HOGventure editor for storytelling games:[br]finish the object mode, including drawing an image for the object.[br]import from and export to the user file system of all data.[br]finish the slide analyse.[br]finally enable the test button? Or do I build in a help button, which might include a playable help game instead?[br][br][br]I hope I get it done before Christmas time.[br]Meanwhile enjoy the truly nightly builds aka previews and do not forget to promote the project ( [URi]http://hogventure.com/slideshow/slideshow.html[/URi]http://hogventure.com/slideshow/slideshow.html [UR/]) or donate ( [URi]http://hogventure.com/paypalCampaign.html[/URi]http://hogventure.com/paypalCampaign.html[UR/] ) at least. ', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (323, '2011-11-18 16:34:01', 'en', 1, 'The features of the image editor', 'The features of the image editor  Date: 2011-11-17  .  ...and my plans for its future.', 'The features of the internal image editor of [URi]http://hogventure.com/slideshow/slideshow.html[/URi]http://hogventure.com/slideshow/slideshow.html[UR/][br][br]Right now you can draw with the image editor title- and background-images. Pretty soon images for objects will be enabled. These object-images don’t have the common size of 16 to 9[br]with a percentage of 100% each width and height. Object-images do have the relative dimension of the object itself. For small objects the image canvas will look larger than the origin. Don’t forget objects have relative positions and dimensions. You should always be able to resize  the editor application.[br][br]You can use the paint, fill and the sketch mode. I like the sketch mode most. [br]The paint mode produces a cumulative heavy monochrome line. The fill mode is a free shape mode, while the sketch mode is cumulative, too, but is really soft - an assembled multi-line that looks like a soft pencil. if you do not draw to fast.[br][br]You may miss a preview for what you are drawing in the fill mode. Layers are maybe helpful.[br]You may want an undo / redo option, like me, too. [br][br]The image editor uses an action model in the back so this will all happen in the future for sure. But don’t aspect this to soon. This will take place for the build of a final version. Before this the will be the first alpha “Anorexic Aardvark”, a second alpha named “All American (Boston Tea - no party)”, …, the first beta with the first live usage for team options (maybe ‘google+’ instead of ‘friend connect’, chat, todo-lists, ...),...[br][br]You will be able to use things like audio and environmental design, player characters, bag(s), visited slides, hidden objects and more, before I can build in, test and activate advanced features, that you and me do wish.', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (324, '2011-11-18 16:39:36', 'en', 1, 'What does meta-data mean?', 'What does meta-data mean?  Date: 2011-11-18  . ', 'I’ve build into the data-model of the slideshow the option to write meta-data for the slideshow, slides, objects and even the selections aka dialogs. What does meta-data means?[br]The slideshow has a button “notes” that will give you the opportunity to add some descriptive text to the slideshow.[br][br]Maybe you describe [br]your idea why you started to build your game, [br]communicate some guidelines, how to write,[br]or how the music should sound like, how to draw, [br]when and where to use plugins etc.  [br][br]Meta-data is part of the documentation and should help you to finish the project of your game.[br]Use this tool to write a small comprehensive outline of your story, characterize the slide - is this a stage, a room, an interruption? What is the atmosphere of the dialog? Should this object move, be animated or does this have it’s own history, it’s meta-story?[br][br]Things never will be communicated to the player, but enriches the story and the game play indirectly, because you and your teammates knows about these facts. Sometimes meta-data helps to find the missing link and leads to a new scenery, is shaping the game play, effects changes and cutoffs.    [br][br]For futures releases ‘“notes”-buttons will appear in the preferences box, that will appear after clicking the “preferences”-button.[br][br]The data-model can be reviewed “pretty soon” - sooner or later. I started using [URi]http://www.naturaldocs.org/[/URi]“Natural Docs”[UR/] for the documentation of the javascript code and will use googles [URi]http://code.google.com/intl/en-US/closure/compiler/[/URi]closure-compiler[UR/] for the compression of the javascript files. That will save loading time. The newest version of the [URi]http://hogventure.com/slideshow/slideshow.html[/URi]HOGventure Storytelling Games Editor[UR/] is “B0.27.111117.95”. The zero stands for the milestones step reached . It is still the preview of “Anorexic Aardvark”. The 1 will appear for the stable version.  [br][br]On Saturday, November the 19th, I will be in Offenbach am Main attempting the [URi]http://www.bgf2011.com[/URi]BGF2011[UR/] (Browser games Forum). Hope I see you there!', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (325, '2012-03-04 13:56:40', 'de', 1, 'GDC 2012 San Francisco', 'After visiting 3 GDCs last year, I''m glad that I made it to this year main event. I the plane to London I met two people from Bigpoint - Sven Liebich and Cazey Kuczik, the head of mobile gaming. Nice to meet you. ', 'San Francisco is a little bit wrecked this year - more than last year. The economic crisis - I just mention say Euro Crisis - shows it''s effects. No more book stores, the top of the Westfield looks strangely empty...[br][br]Well, better times will come - you''ve just to hold on America.[br][br]Visited the Yerba Buena Gardens early this morning, took a walk to the ferry point and back to the union square.[br]I''ve to write and talk about the artwork in front of the Jewish museum. I will try to blog about the GDC again. You may know, I''ll posting my notes.  So expect more to come.[br] ', 2, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (326, '2012-06-04 08:32:37', 'en', 1, 'HOGventure: an HTML5 story games editor', 'The first milestone is reached. "Anorexic Aardvark" is ready. I''m proud to anouce, that the development of the next alpha "All American" No Boston, No Tea, No Party will start soon - now.', 'I''ve started a new founding via paypal for [br]"The HOGventure Storytelling Games Editor". [br]These are the assumptions for the editor development:[br]  &#9679; write once,[br]  &#9679; write together,[br]  &#9679; write everywhere![br][br]Actualy you paint images, record sounds, vocal, music,[br]design levels and program plugins, too.[br][br]Run everywhere (with Google Chrome)[br]Publish all over the world and beyond at[br][br]  &#9679; hogventures.com[br]  &#9679; your website[br]  &#9679; google plus[br]  &#9679; as an android app[br]  &#9679; or a downloadable client (flash?)[br]  &#9679; even facebook might be possible.[br][br]You can watch the [URi]https://docs.google.com/present/embed?id=dgf2hxpw_0fknk77pj[/URi]latest presentation[UR/] and[br]test the HTML5 based tool. [br][br][URi]http://hogventure.com/anorexicaardvark/slideshow.html[/URi]Stable: anorexic aardvark.[UR/][br][br][URi]http://ow.ly/bfGhs[/URi]Nightly build: You may try the latest build B1.57.120531.202.[UR/][br][br][br][URi]http://hogventure.com/paypalCampaign.html[/URi]You may ask yourself, why you should donate? [UR/]', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (327, '2012-06-04 10:32:40', 'en', 1, 'Java Adventure Framework downloads', 'downloads - java applications for the adventure framework all alpha or beta versions! ', '[br][URi]http://hogventure.com/download/slider-v1.zip[/URi]earliest slideshow framework[UR/][br][br][URi]http://hogventure.com/download/SimpleSlideshow-v2.zip[/URi]second iteration simple slideshow[UR/][br][br][URi]http://hogventure.com/download/StorySlideEditor-v3.zip[/URi]latest version storyslider[UR/]', 11, 1, '0000-00-00 00:00:00');
