INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (329, '2012-06-04 15:49:53', 'en', 1, 'about the html based adventure framework.  ', 'The HOGventure HTML adventure editor', 'The first alpha of the HOGventure online adventure editor tool.[br]Currently the editor implements local storage, dialog editing, adding objects and drawing a simple background.[br]There is still missing a lot like save images, create different slides, remove and edit objects, plugins, online-storage, publishing etc.[br][br]The current stable version is B1.34.111208.117 new:[br]please welcome anorexic aardvark![br][URi]http://hogventure.com/anorexicaardvark/slideshow.html[/URi][img]http://hogventure.com/images/anorexicAardvark.png[imgw]530[imgh][/img][UR/][br]stable alpha[br]first milstone reached[br]advanced but not final data model introducing bag in game test[br]split development between alpha stable and nightly build[br]&#9829; YOU should USE google CHROME indeed[br]Stable: anorexic aardvark.[br][br][URi]http://ow.ly/bfGhs[/URi]Nightly build: You may try the latest build B1.57.120531.202.[UR/][br][br][br][URi]https://docs.google.com/present/embed?id=dgf2hxpw_0fknk77pj[/URi]This is a small presentation how the tool should look like.[UR/]', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (330, '2012-06-04 16:29:51', 'en', 1, 'Information about me and contact data.  ', 'About me and contact info:', '[br][br][br][img]http://hogventure.com/images/adress.jpg[imgw][imgh][/img][br][br][br]', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (331, '2012-06-06 09:00:24', 'en', 1, 'New layout for the hogventure homepage', 'As you see the hogventurepage has a new layout. Now it addopted the look and feel of the gameplayer for the adventure games. For that reason the right navigation bar is empty for future features.', 'Still you might ask yourself, what is [URi]http://ow.ly/bfGhs[/URi]that hogventure thingy[UR/]?[br][br]A well flavoured mixture between [URi]http://playfic.com[/URi]http://playfic.com/[UR/] and [URi]http://renpy.org[/URi]http://renpy.org[UR/] . It is also a cooperative and collaborative online editor using [URi]http://firebase.com[/URi]http://firebase.com[UR/] to transmit the datas you create with your crowd and clowd coworkers almost immediately. [URi]http://dropbox.com[/URi]http://dropbox.com[UR/] can be used to version, save and share those datas, if you have installed it. [br][br]Here you can test the lastest version of the tool: [URi]http://ow.ly/bfGhs[/URi]B1.57.120531.202[br][br][img]http://hogventure.com/beastyBoars3color512.png[imgw][imgh][/img][UR/].[br][br]Please do not forget that crowd thingy called funding and drop your support here: [URi]http://hogventure.com/paypalCampaign.html[/URi]http://hogventure.com/paypalCampaign.html[UR/]', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (332, '2012-06-07 09:27:52', 'en', 1, 'Some more basics about the Hogventure Editor', 'Hogventure is a simple editor for any kind of storytelling games such as hidden object games, adventure games or other dialog based ones. It runs on any modern browser because it is written in HTML5 and javascript.', 'The goal of this editor application is to enable you to create a storytelling game. You can cooperate with your friends online on the same project even if you and your friends are not in the same location, but in the same space - the Internet.[br][br]The data is stored in JSON files, which you can import to other technologies like standalone programs written in C/C++, Java or Flash. A html/javascript-based player is provided with the editor. This player can be embedded into your own web page.[br][br]Here is a simple picture of how the player structure looks like:[br][br][img]http://hogventure.com/images/editorPlayerLayout.jpg[imgw]600[imgh]338[/img][br][br]The basic raw model is a simple adventure-game, a game based on text portions. You may use these portions as descriptions of characters and situations, dialogs or use texts as selections. The game that you will create can be a branching one. In the next step you may add background-images, sounds and music or objects.[br][br]If you want to analyze your game to avoid death ends or other mistakes, use the test tool, that is build in player, and the overviews.[br]To extend the possibilities of the gaming engine you can use HTML for texts or you may program your own plug ins in javascript.[br][br][br]', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (333, '2012-07-13 09:14:25', 'en', 1, 'Join the help', 'If you build an application, one of the basic problems will getting the start up  right. You should always imagine, what a untrained user is willing to do first.', 'If you build an application, one of the basic problems will getting the start up [br]right. You should always imagine, what a untrained user is willing to do first.[br]Maybe he won''t login, although this seems to be necessary for an online [br]application. Here is the simple solution, make it possible to work offline, [br]too.*[br][br]*a simple solution that is not so simple by the way.[br][br]The problem of the right ''start up'' process is caused by your evil knowledge [br]about what a user should be able to do with this application. So you know how to [br]organize the application, input of title here, preferences, metadata, chat, [br]teammates, overview, gloabal anlyzation, test environment, painting tool for [br]backgrounds, objects, animations - an endless list for somebody who is new.[br][br]You should give him help. That is why you integrated the help button. Seriously[br]writing the help is part of the documentation. Never forget, you must start the [br]documentation process before you start the coding process. The first lines of [br]you code should be documentation commentary. Don''t care about the licence or [br]other stupid questions. You see, this is another start up problem, isn''t it?[br][br]Don''t be shy to rewrite your code and reuse it over and over again. Reuse the [br]doumentation and fix it over and over. Try to explain what to do first and why. [br]This will answer most of the questions a user may have. [br]And for your own sacrifice/saints, this will help you to detect bugs and [br]misstakes and provide the better code.**[br][br]**Over 70% of code should be comentary documentation. Over 80% of a project like [br]a game is documentation. In anyway this includes the production of music, art, [br]graphic assets, code, communiction, the plan. A good plan helps you to build a [br]good business.[br][br]Instead of starting with two buttons like ''login'' and ''offline'', your [br]application should start with a sentence like: [br]<div style="border: 1px #999 solid; margin: 10px; box-shadow: 3px 3px 3px #999; \r\npadding: 8px; width: 80%; text-align: center;">\r\n<br />Hello user! <br /><br />Choose to <br /><span>''Login''</span><br /> or <br /><a href="http://hogventure.com/beastlyBoars/index.html"><span>''create an offline project''</span></a><br />\r\nto start building a new game.<br /><br /></div>[br]A nice welcome message gives trust and makes the user feel comfortable.[br][br]So don''t be shy join the help and create a path for the new beginners.', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (334, '2012-11-15 10:42:57', 'en', 1, 'A call for bug hunting!', 'A new version of the hogventure html5 javascript game and prototype editor. ', 'The beastly boars versions merger is coming, [URi]merger/index.html[/URi]soon[UR/], if it is not [URi]http://hogventure.com/merger/[/URi]here[UR/].[br][br]I''d done a lot of experiments during the last 6 months on the hogventure editor.[br]After I''d decided to use the ''firebase.com'' technology to synchronize data of [br]the same project with multiple users in different places, I''ve build a little [br]test application for metadata and chat only.[br]Other prior apps had have multiple services'' login with facebook (broken), [br]twitter and google(broken, but updated), drawing tools with colors(abandoned, [br]for better work-file-images), local storage on the browser internal sandbox [br]system, indexedDB, websql(deprecated and not any more supported) and the [br]browsers'' local-storage. The apps have drawn nice lines in the analytic [br]overviews. The first version had have a specific input paradigm.[br][br]But name it, the user-interface was to complicated to support the user''s [br]workflow.[br][br]Now I show you a blank page first with prompts. Those ask you what to do and [br]lead you through the different work spaces, that you might explore, while you [br]create a HTML5/javascript game. Your game. That is what the editor is for. It [br]will still come with an build in game-interpreter - ''the player'' - for test [br]purposes. [br][br]So here are the incomplete currently supported features-list:[br][br]&bull; Start with the ''Slideshow'' - game - overview.[br]&bull; Create a ''Slide'', room, scene or whatever you would like to call it.[br]&bull; Add Selections to the Slide, these are single decisions, dialog, [br]&nbsp;&nbsp;&nbsp;etc. The Slide does have collection of Selections.[br]&bull; Add Objects to the Slide.[br]&bull; Add an image as the title-imgae to the Slideshow, background-image [br]&nbsp;&nbsp;&nbsp;to the Slide, image to an Object.[br]&bull; Create ''Metadatas'' for the purpose of documentation and (pre-)development.[br]&bull; Add images to a Metadata-Note.[br]&bull; Link to any kind on Slideshow-elements and Metadata-Notes. [br]&bull; Chat via firebase (incomplete implementation)[br]&bull; Ex- and import of all project data to your local harddrive (incomplete implementation)[br]&bull; Login with twitter[br]&bull; Overviews for Slideshow, Slide and Metadatas[br][br]Missing features as far as I can recapture them:[br][br]&#9675; add a Plugin to the Slideshow, a Plugin-Editor to the Project[br]&#9675; associating a plugin with a slide[br]&#9675; import an external image(png, jpg) for the Slideshow, Slide, Object, Selection, ...[br]&#9675; multiple, conditional targets for Objects, Selections, ... (&#191;plugins?)[br]&#9675; syncing all data![br]&#9675; invite friends with twitter[br]&#9675; animations, sounds and videos[br]&#9675; Object movement by path(&#191;I do not know if I will build this in, [br]&nbsp;&nbsp;&nbsp;because you could use plugins instead?)[br]&#9675; a larger, resizing, scrollable panel for overviews[br]&#9675; connecting lines and arrows in overviews[br]&#9675; complete ex- and import[br]&#9675; complete chat via firebase[br][br]There are bugs. [br]Please help me to find them.[br]I strongly recommend to use the last version of the google chrome browser, [br]please.[br]And still don''t forget to mention, what version you use - chome stable, dev or [br]canary. Many thanks in advanced for all your great help and support. [br]', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (335, '2013-01-15 16:40:26', 'en', 1, 'If you can change it, change it!', 'I never planed to reduce stuff, but now I did it.', ' I did not reduced the stuff of people that work on the editor, because that''s me. I reduced the stuff I''m working on. I recently changed the datamodel of the slideshow with slides, dialogs, objects, plugins,  and text plus the second path of notes to a super simple datamodel of memos. I love the kiss paradigm. Keep it simple, stupid![br]If you can change it, change - no conflict![br][br]So a brand new version of the hogventure-game-editor is online. It needs some serious bug testing.[br]I need your help, for the debugging. [br]Here is the new version of the editor called memo-board:[br][br][URi]https://hogventure.com/memo[/URi]Hogventure Game Editor Memoboard[UR/][br][br]You may want to work offline first, before you want to login.[br]If you work offline you can create two types of memos(notes) simple text and javascript plugins.[br]i''ve also build in a very basic raw memo board tester - a sort of mini game engine.[br]Before you save the project board, you should set the preferences of your board. Right now you enter the title.[br]Once you have saved, you should reload the webpage and than load your project. That is the first test case.[br][br]Feel free to register yourself and login now. Try to save the project online, reload the webpage, please, and load the project online. Now try to make several changes and save them online again. Reload or close the browser and reopen the webpage again. You should be able to load the project without a login and see the board without any changes - after the login loading online must make the changes visible. Those are step two, three and four for the testing.[br][br]Please use only the latest version of the chrome browser (24?) or the  latest version of the firefox (18+) to avoid unforeseen events.[br][br]The next steps will be introducing titles for each single memo, a short one. Also I like to build in an invite procedure. With that feature you might try working in a team of friends. Next step before this must be checking the lock of the memo - can you edit the memo?[br][br]Happy testing. [br][br]', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (336, '2013-01-17 18:02:06', 'en', 1, 'I memorize, you can set the title', 'I''ve uploaded a little update for the memo-board. You can set and edit the titles of the memos now.', 'Unluckily the title of the memo is not shown on the board and not in the game. [br]It will be done in one of the net updates. [br]I''ve fixed also some hidden bugs and glitches in the implementation. [br]The project title will be stored in the textmanager, too.[br][br]You can test the memo-board here:[br][URi]https://hogventure.com/memo[/URi]Hogventure-Game-Editor[UR/][br][br][URi]http://hogventure.com/If_you_can_change_it_change_it.html[/URi]You can read more about the memo-board tool and how you can use it.[UR/][br][br]If you have a better name for the tool, please send me an email with your suggestion(s). [br]Thanks and have fun.', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (337, '2013-01-23 16:22:42', 'en', 1, 'Licence changes for the Memo Broad Editor', 'It''s done - the title is visible and so the TEST licence.', 'Oh, and I almost forgotten, you can invite your friends to cooperate on your board and project now![br]All you have to know is your friend''s email address and maybe a good story, why you invite herhim.[br] [br]Here is the test licences, so you don''t get shocked:[br][br][b]Test Agreement ''Hogventure-Game-Editor''[/b][br][br][i]The test version of ''Hogventure-Game-Editor'' is inevitable to contain bugs, which may have a detrimental effect on the browser stability.[br]Make sure you are aware of the risks and willing to accept them in order to help us improve ''Hogventure-Game-Editor''.[br][br]No personal data will be collected or revealed without your consent. I will only use Google Analytics to collect error reports and some other common data. The estimated duration of this test test is 3-6 months. After the test, your account information and relevent data in the system might be all cleaned up, or not. [br][br]If you use this software furthermore, you accept the agreement.[br]Thanks for your kind help.[/i][br][br]Some things are still missing:[br][br]Password request is still leading to nowhere. Please do not forget you password.[br]Maybe bugs in plugin/game-test. Do not use or overwrite window or document in your script![br]A help file and better documentation.[br][br][URi]http://hogventure.com/memo/index.html[/URi]But feel free to test and invite your friends, too.[UR/][br][br][img]https://hogventure.com/image/bugHunter.png[imgw]520[imgh]390[imageTitle]bug hunters are invited[imgAlt]bug hunters are invited[/img][br] ', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (338, '2013-01-24 16:31:23', 'en', 1, 'IGDA Chapter Hambug Meetup and a little update', 'The IGDA Chapter Hamburg quarterly meeting is at the IBM building, Beim Strohhause 17, U Berliner Tor. The date is the 07.02.2013, 7pm (19o''clock). Do not be late and tell your friends.', 'I also made some bug fixes today for the game editor [URi]https://hogventure.com/memo/[/URi][b]memo board[/b][UR/]. [br]I use SSL now, so your data and ideas are safer now. Please use https://hogventure.com/memo to access the tool.[br][br]The HTML5 tool should work on android devices (tablets) with android 4.0.x and better in following browsers: chrome mobile beta and firefox 18.x.[br][br]Happy testing [br][br]<iframe width="425" height="350" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="https://maps.google.de/maps?f=q&amp;source=s_q&amp;hl=de&amp;geocode=&amp;q=IBM+hamburg&amp;sll=51.175806,10.454119&amp;sspn=10.421074,30.717773&amp;t=h&amp;ie=UTF8&amp;hq=IBM&amp;hnear=Hamburg&amp;ll=53.553297,10.021464&amp;spn=0.002409,0.007499&amp;z=14&amp;iwloc=A&amp;cid=15467072177305540621&amp;output=embed"></iframe><br /><small><a href="https://maps.google.de/maps?f=q&amp;source=embed&amp;hl=de&amp;geocode=&amp;q=IBM+hamburg&amp;sll=51.175806,10.454119&amp;sspn=10.421074,30.717773&amp;t=h&amp;ie=UTF8&amp;hq=IBM&amp;hnear=Hamburg&amp;ll=53.553297,10.021464&amp;spn=0.002409,0.007499&amp;z=14&amp;iwloc=A&amp;cid=15467072177305540621" style="color:#0000FF;text-align:left">Gr&ouml;&szlig;ere Kartenansicht</a></small>', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (339, '2013-01-25 16:42:16', 'en', 1, 'Updates, bug fixes and missing features', 'The adventurous journey developing a cooperative online game editor continues.', 'I fixed the bug that appeared after the registration. The ''login'' form pointed to the registration after being registered. Now it shows the ''login'' button. So once you registered yourself, just log in.[br]I''ve broken this, when I implemented SSL. Sorry.[br][br]The request ''new password '' (forgot password) is still incomplete. It will come during this weekend or next week. [br]Probably more important you can not delete links from memos. [br]I hope I can do that soon. Also I want to record an video of what you can do right now.[br]This version of the tool shows already the media manager capabilities. You can (not) upload images - png and jpeg - and audios - mp3 and ogg. This is an incomplete feature, [b]DANGER[/b]! Please do not use any data larger than 1MB. Saving offline ([b]local save[/b]) may fall, but you should do use this function before you save online.TIP: you have to do this always, if you finish a session.[br][br]Happy testing with the [URi]https://hogventure.com/memo/[/URi]Game Editor for Writers and Game Designers[UR/].[br][br]  ', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (340, '2013-01-29 17:59:15', 'en', 1, 'You get what I''ve promised', '...but can you see it? No, sorry ,it is in the code. I''m proud to introduce to you : ''types''.', 'Types make inner structure much better. A normal memo can have the type ''text'', ''audio'' or ''image''.[br]A memo of the type ''plugin'' is interpreted as a javascript. So now you can program, write, compose and use your drawings.[br][br]Here is a the source for a simple plugin:[br]\r\n<pre>\r\n/* plugin that shows all memos */\r\nconsole.log(''this plugin -> ''+uid);\r\n//the width of the memos retangles is also their height\r\nvar w = screenwidth / 10;\r\n//now we gather all memos of the game\r\nvar memos = game.getAllMemos();\r\nconsole.log(''memos length = ''+memos.length);\r\n//set the context''s color styles \r\ncontext.fillStyle = ''#ff6'';\r\ncontext.strokeStyle = ''#ff6'';\r\nfor (var i = 0; i < memos.length; i++) {\r\n//now we draw all memos\r\ncontext.strokeRect(10 + (i%5)*(w+10),10 + (i%4)*(w+10),w, w);\r\ncontext.fillText(memos.uid, 10 + (i%5)*(w+10),30 + (i%4)*(w+10));\r\n}\r\ncontext.stroke();\r\ncontext.fill();\r\nupdate = true;\r\n</pre>\r\n[br]By the way the board has a new background image.[br][br][img]http://hogventure.com/image/290113board.jpg[imgw]560[imgh][/img]', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (341, '2013-02-06 10:26:26', 'en', 1, 'Just on one word or two or more ...', 'Hallo game writers, artist, musicians, designers and programmers.  Here are some simple questions: (marketing blaphasel (drivel))', 'Can you use your draft manager online, cooperative in a team, [br]in different places, on different machines like your apple iPad, macbook[br]or an android tablet, windows or linux pc with zero installment, [br]for free?[br][br][br][b]Can you add specific needs to your project and validete it in the prototype [br]phase?[/b][br]The answer should be ''no'' as long you do not use hogventure.com''s[br]memoboard. Wait before you get to enthusiastic - this tool is not final unlike [br]common draft managers like ''articy:draft''. It is still in the test phase and it [br]will stay under permanent development.[br][br]Right now I look for a better name. So please send me your your[br]proposals via email. Don''t forget to test and use the[br]''memoboard'' tool.[br][br][b]How to use memoboard?[/b][br][br]It is a one touch only application. [br]If you don''t know, what to do click or touch. [br]Follow the buttons. But the best impression should deliver a little movie.(is coming soon)[br][br][img]http://hogventure.com/image/notes.jpg[imgw]560[imgh][/img][br][br][b]Now what can memoboard do for you for free?[/b][br][br]Memoboard is a prototype design solution.[br]All your data stays in one place. [br]It does effectively ensure that everyone works on current data.[br]Everywhere and any time. It has an on and offline mode, too.[br]You can reference all file types like audios, images, texts, etc. [br]to ensure, every type of information is in online.[br][br]The design data is game data.[br]For smaller teams and HTML5 developers this can be the final production source.[br][br]Documentation is essential - especially, if your project does not fail.[br]Memoboard enables you to found a solid code, design and meta-documentation base, [br]on which you can build, trust and rely your future success.[br]It improves  the communication between design, production and business starting [br]as early as possible in the project and far beyond. So failure is no more a must [br]and success is your story.[br]Easily switch between different program solutions while you can work on the same [br]data source. Stay flexible by defining structures based on your individual needs [br]for every project. Build iterations and cycles of ''try and error'' to solve your [br]problems.[br][br]With consistent information the tool structures your data, reduces the time and [br]the cost to unfold your creative potential over years. No useless searches, no [br]more missing data.[br][br]Insert more marketing speech here for your personal convictions[br]	or[br]simply start to write, test, rewrite, code and test again. [br]Help me to make the next version of memoboard become a better version.', 11, 1, '0000-00-00 00:00:00');
INSERT INTO `tab_doc_document` (`id_document`, `datum`, `language`, `id_user`, `title`, `summary`, `document_text`, `id_document_type`, `active`, `activation_date`) VALUES (342, '2013-02-07 16:28:06', 'en', 1, 'Code cooking and upcoming steps', 'Firebase.com was my tool of choice during the early development. It is a really  cool online service and it make complicated stuff easy to develop. But now  firebase announced it''s pricing plans for the after beta period. Much to  expensive to rely on this furthermore.', 'I have to stabilize the source for the hogventure memoboard tool.[br]So I made the decision that I will rebuild this communication part based on [br]firebase with a nodejs server. I also have to update the current old fashioned [br]version of my server to a better one, so I can run a stable version of nodejs.[br][br]This will cost a 2500$ something a year, but the service will remain still free.[br]If you still ask yourself what a draft manager is good for, you should read this[br]article http://www.crissxross.net/cwnm/labresearch.html . Draft managers solve a [br]lot of if not all problems mentioned in the article. You also can create things [br]like this http://dio.com and far beyond, like interactive 3d spheres or puzzle [br]games or ...[br][br]The memoboard still contains a lot of glitches like ''not giving the right [br]feedback when you load/save online'' or ''missing current invitations after the [br]login'' and many more for sure. That''s why I need your feedback. [br][br]Browsers that you should use Chrome latest and Firefox latest [br]Browsers that you should avoid: any older version of IE (9 and smaller),[br]older Firefoxes ( &lt;18 ), ...[br]You can use memoboard on your Android tablets with a Chrome beta and the Firefox [br]beta, too.', 11, 1, '0000-00-00 00:00:00');
